INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(1, 'APLIKASI MEDIA PEMBELAJARAN MATEMATIKA TINGKAT SMU BERBASIS ANDROID', 2019, 'SAINS DAN TEKNOLOGI', 3, 'Matematika adalah ilmu yang mempelajari tentang perhitungan,\r\npengurangan, pembagian, dan perkalian. Berkembang dari hal tersebut,\r\nmatematika menjadi mata pelajaran yang mempunyai banyak rumus, simbol, dan\r\nlain-lain pada jenjang yang tinggi seperti SMU sehingga sukar dipahami oleh para\r\npelajar baik itu dalam pemahaman materi ataupun pemahaman dalam\r\nmengerjakan soal-soal.\r\nTujuan dari penelitian ini adalah untuk memudahkan pelajar dalam\r\nmemahami materi ataupun dalam mengerjakan soal-soal dengan merancang dan\r\nmembangun sebuah aplikasi Media Pembelajaran Matematika tingkat SMU\r\nBerbasis Android sebagai media pembelajaran bagi para siswa baik terpandu\r\nmaupun tidak terpandu.\r\nHasil dari penelitian ini berupa aplikasi yang dapat menampilkan materi\r\nmatematika, latihan soal-soal, serta video penjelasan dalam mengerjakan suatu\r\nsoal yang berlandaskan Kurikulum 2013 revisi 2017 dari Kementerian Pendidikan\r\ndan Kebudayaan.\r\nKata Kunci: Matematika, Media Pembelajaran, Mobile, Android. '),
(2, 'MEDIA APLIKASI E-MARKETPLACE JASA DESAIN GRAFIS BERBASIS ANDROID', 2019, 'SAINS DAN TEKNOLOGI', 3, 'Matematika adalah ilmu yang mempelajari tentang perhitungan,\r\npengurangan, pembagian, dan perkalian. Berkembang dari hal tersebut,\r\nmatematika menjadi mata pelajaran yang mempunyai banyak rumus, simbol, dan\r\nlain-lain pada jenjang yang tinggi seperti SMU sehingga sukar dipahami oleh para\r\npelajar baik itu dalam pemahaman materi ataupun pemahaman dalam\r\nmengerjakan soal-soal.\r\nTujuan dari penelitian ini adalah untuk memudahkan pelajar dalam\r\nmemahami materi ataupun dalam mengerjakan soal-soal dengan merancang dan\r\nmembangun sebuah aplikasi Media Pembelajaran Matematika tingkat SMU\r\nBerbasis Android sebagai media pembelajaran bagi para siswa baik terpandu\r\nmaupun tidak terpandu.\r\nHasil dari penelitian ini berupa aplikasi yang dapat menampilkan materi\r\nmatematika, latihan soal-soal, serta video penjelasan dalam mengerjakan suatu\r\nsoal yang berlandaskan Kurikulum 2013 revisi 2017 dari Kementerian Pendidikan\r\ndan Kebudayaan.\r\nKata Kunci: Matematika, Media Pembelajaran, Mobile, Android.'),
(3, 'Perancangan Alat Pendeteksi Hewan Pengganggu Tanaman Kebun Menggunakan Sensor Gerak PIR (Passive Infra Red) Berbasis Mikrokontroler', 2019, 'SAINS DAN TEKNOLOGI', 2, 'Indonesia merupakan negara yang sebagian besar wilayah pertanian dan\r\nsebagian besar masyarakat juga bergerak di bidang pertanian sehingga indonesia\r\ntermasuk salah satu penghasil kacang, jagung dan padi. Dan kekayaan yang di\r\nmiliki oleh masyarakat indonesia lahan pertania, perkebunan yang sangat luas dan\r\nsubur. Pada umumnya pengusir hewan penggu pemakan kacang tanah di area\r\nperkebunan proses masih manual yang mengguanakan tarik-tarik tali yang di\r\npasangi kaleng bekas dan pembuatan orang-orangan. Dari perencanaan sistem\r\npengusir hewan pengganggu tanaman (babi hutan) berbasis mikrokontroler dan\r\nmenggunakan sensor PIR sebagai pembaca data dan modul mp3 yang mengirim\r\nsuara gonggong anjing ke speaker.\r\nJenis penelitian yang di gunakan adalah penelitian kualitatif dengan\r\nkonsep eksprimental. Pengujian yang dilakukan adalah pengujian blackbox.\r\nYangg berfokus pada persyaratan fungsionaal perangkat lunak Hasil dari\r\npenelitian ini adalah sebuah sistem pada tuggas akhir ini, pengusir babi hutan\r\npemakan kacang tanah terdeteksi oleh sensor pir maka akan di proses ke\r\nmikrokontroler terdapat juga suara gonggongg anjing yang berfungsi untuk\r\nmengusir babi hutan yang masuk di area perkebunan . dari hasil pengujian sistem\r\nsecara keseluruhan di dapatkan hasil jarak sensor pir dengan jarak maksimun 10\r\nmeter dan mengeluarkan suara gonggong anjing, sehingga hasil dari pemanfaatan\r\nalat tersebut dapat mengusir babi hutan yang masuk di area perkebunan atau\r\npersawahan.\r\nKata Kunci : Hewan Pengganggu , Sensor Gerak PIR, Suara Gongggong Anjing.'),
(4, 'SISTEM HAFALAN AL-QURAN SANTRI ONLINE PONDOK PESANTREN TAHFIZH BUTON BERBASIS WEB', 2019, 'SAINS DAN TEKNOLOGI', 1, 'Pada masa sekarang telah tumbuh subur lembaga-lembaga pendidikan\r\nIslam yang memberikan kesempatan kepada putra-putri di daerahnya mendalami\r\nnilai-nilai agama guna membentuk kepribadian muslim yang beriman dan\r\nbertakwa kepada Allah Swt., berakhlak mulia, bermanfaat bagi kemajuan\r\npembangunan bangsa dan negara. Pondok Tahfizh Buton adalah salah satu\r\nLembaga yang bergerak dalam bidang Tahfizh Al-Qur’an. Penyetoran Hafalan\r\ndan murojaah Al-Qur’an masih dilakukan dengan metode penyetoran langsung\r\nmendatangi pondok pesantren, metode ini memiliki kendala untuk para santri\r\npondok yang dalam kondisi tertentu berada diluar daerah sehingga tidak dapat\r\nmelakukan penyetoran hafalan dan murojaah Al-Qur’an secara langsung. Oleh\r\nkarena itu diharapkan aplikasi dapat memungkinkan seluruh santri dimanapun\r\nberada untuk tetap termotivasi melakukan penyetoran hafalan baru dan murojaah\r\nAl-Qur’an meskipun berada diluar daerah pondok Tahfizh Buton.\r\nJenis penelitian yang digunakan adalah metode penelitan deskriptif\r\nkualitatif, jenis penelitian deskriptif yang digunakan adalah Design and Creation,\r\nsedangkan metode pengumpulan data yang digunakan adalah menggunakan\r\nmetode pengumpulan data wawancara, dokumentasi, studi literatur dan observasi.\r\nMetode perancangan yang digunakan adalah Waterfall dan Teknik pengujian\r\nmenggunakan blackbox.\r\nHasil dari penelitian ini adalah sebuah aplikasi website sistem hafalan Al-\r\nQur’an. Kesimpulan dari penelitian ini yaitu memudahkan pihak pesantren tahfizh\r\nButon dalam mengelola data hafalan dan murojaah Al-Qur’an bagi para musyrif\r\ndan santri online Pondok Tahfizh Buton.\r\nKata Kunci : Al-Qur’an, Tahfizh, Hafalan, Murojaah, Website, Online'),
(5, 'RANCANG BANGUN INTERPRETER BAHASA ISYARAT INDONESIA MENGGUNAKAN LEAP MOTION DAN ALGORITMA NAIVE BAYES DENGAN BAHASA PEMROGRAMAN PYTHON', 2019, 'SAINS DAN TEKNOLOGI', 4, 'Komunikasi adalah suatu proses di mana seseorang atau beberapa orang,\r\nkelompok, organisasi, dan masyarakat menciptakan, dan menggunakan informasi agar\r\nterhubung dengan lingkungan dan orang lain. Dewasa ini, tuna rungu atau orang yang\r\nbermasalah dengan pendengarannya memiliki keterbatasan komunikasi terhadap\r\nsesamanya, keluarga, kerabat, dan orang-orang di sekitarnya, sehingga memengaruhi\r\nhubungan interpersonalnya. Berkaitan dengan kesenjangan tersebut alat komunikasi\r\nakternatif sangat dibutuhkan sebagai perantara komunikasi oleh tuna rungu. Untuk\r\nmengatasi kesenjangan tersebut, maka dibuatlah penerjemah komunikasi berupa Leap\r\nMotion Control, yakni dengan menggunakan Algoritma Naive Bayes, menerjemahkan\r\nbahasa isyarat tuna rungu dalam bentuk kata atau tulisan.\r\nPenelitian ini menggunakan jenis penelitian kualitatif berbasis saintifik dengan\r\nmetode eksperimental yang digunakan untuk memahami fenomena-fenomena sosial\r\nsebelum melakukan perancangan.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah\r\npenelitian deskriptif kualitatif dengan metode eksperimental yang bertujuan untuk\r\nmemahami fenomena – fenomena sosial sebelum melakukan perancangan. Adapun\r\ntahapan tahapan dalam sistem ini adalah menggambarkan flowchart dan blok digram\r\nuntuk gambaran atau alur kerja sistem yang akan dibuat dan diuji menggunakan\r\nmetode pengujian perangkat lunak, meliputi pengujian unit, pengujian integrasi, dan\r\npengujian sistem secara menyeluruh.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah alat penerjemah gerakan\r\ntuna rungu kedalam Bahasa Indonesia dengan memanfaatkan sensor leap motion\r\nsebagai penangkap vektor koordinat suatu gerakan tangan. Dari hasil pengujian yang\r\ndilakukan oleh peneliti alat ini berfungsi dengan baik dan mampu mengatasi\r\npermasalahan yang selama ini dialami.\r\nKata Kunci : Komunikasi, Leap Motion, Algoritma Naïve Bayes'),
(6, 'RANCANG BANGUN SISTEM PENDETEKSI PENCURIAN TERNAK SAPI BERBASIS MIKROKONTROLER \r\n', 2019, 'SAINS DAN TEKNOLOGI', 2, 'Bidang peternakan terutama berternak sapi merupakan salah satu bidang\r\nyang digeluti oleh sebagian masyarakat Indonesia dalam memperoleh\r\npenghidupan. Akan tetapi, seiring dengan perkembangan zaman dan\r\nperkembangan teknologi yang semakin pesat, tingkat pencurian ternak semakin\r\nmeningkat pula. Untuk menanggulangi hal tersebut, para pemilik ternak harus\r\nmenambah pengeluaran untuk membayar sejumlah petugas penjaga kandang.\r\nTujuan penelitian ini adalah untuk merancang suatu alat yang berfungsi untuk\r\nmendeteksi pencurian ternak sapi berbasis mikrokontroler. Aplikasi Sistem\r\nPendeteksi Pencurian Ternak Sapi ini adalah suatu alat yang dirancang dengan\r\ntujuan untuk mengetahui jika terjadi suatu kejahatan atau pencurian beserta lokasi\r\nkejadiannya. Proses penetuan titik lokasi kejadian menggunakan GPS Shield\r\nsedangkan dalam proses pengiriman SMS yang berisi link Google Maps\r\ndigunakan GPRS/GSM Shield dan dapat juga menerima SMS dari pengguna\r\nuntuk meminta lokasi sekarang. Ultrasonic Sensor sebagai pemicu sistem\r\nmengirim SMS lokasi keberadaan ternak. Mikrokontroller yang digunakan adalah\r\nArduino Uno sebagai kontrol utama sistem.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Penelitian ini\r\nmenggunakan metode pengumpulan data observasi, studi literatur, dan\r\nwawancara. Teknik pengujian yang digunakan adalah Black Box.\r\nHasil dari rancangan alat ini untuk mengetahui dan melacak posisi\r\nkeberadaan ternak sapi ketika keluar kandang atau terjadi pencurian pada ternak\r\ntersebut sehingga pemilik bisa mengambil langkah cepat untuk mengetahui posisi\r\nlokasi ternak mereka.\r\nKata kunci: Ternak, GPS Shield, GPRS Shield, Ultrasonic Sensor, Arduino\r\nUNO.'),
(7, 'RANCANG BANGUN SISTEM MONITORING LEMBAGA KEMAHASISWAAN PADA FAKULTAS SAINS DAN TEKNOLOGI UIN ALAUDDIN MAKASSAR BERBASIS WEB', 2019, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatarbelakangi monitoring kegiatan lembaga kemahasiswaan masih bersifat manual sehingga senat mahasiswa selaku lembaga pengontrol atau pengawas lembaga kemahasiswaan masih sangat kesulitan untuk mengontrol kegiatatan setiap himpunan yang ada difakultas, selain itu belum adanya jadwal kegiatan setiap lembaga sehingga sering kali terjadi kegiatan lembaga kemahasiswaan yg bersamaan.diketahui penyampaian hasil rapat senat yang dilakukan oleh senat mahasiswa tentang aturan yang ada disetiap lembaga keamahasiswaan penyampaiannya masih secara lisan dan ditempel dipapan pengumuman sehingga informasi yang didapat kurang up-to-date, kurang akurat, kurang komunikatif dan juga dapat hilang atau sobek.\r\nJenis penelitian yang digunakan pada penelitian ini adalah jenis penelitan kualitatif, dengan metode penelitian deskriftif. Pengembangan aplikasi ini menggunakan metode waterfall melalui tahapan-tahapan seperti analisa kebutuhan, desain sistem, penulisan kode program, pengujian program dan penerapan program. Adapun teknik metode pengujian yang digunakan pada penelitian ini adalah menggunakan metode pengujian Black Box. Hasil pengujian menunjukkan aplikasi mengerjakan seluruh loop yang sesuai dengan batasannya dan validasi data yang akan dimasukkan sesuai yang diharapkan. Berdasarkan hal tersebut dapat diambil kesimpulan bahwa tujuan penelitian sudah tercapai.\r\nDari penelitian ini menghasilkan perancangan dan aplikasi monitoring kegiatan lembaga kemahasiswaan. Penelitian ini menyimpulkan sistem yang dibangun dapat melihat program kerja lembaga, proses berjalannya kegiatan serta kegiatan yang telah terlaksana.\r\nKata kunci : Monitoring, lembaga kemahasiswaan, senat mahasiswa.'),
(8, 'RANCANG BANGUN APLIKASI INFORMASI KEGIATAN BIRO HAJI', 2019, 'SAINS DAN TEKNOLOGI', 3, 'Umat Islam menunaikan ibadah haji dan umroh merupakan ibadah yang wajib bagi yang\r\nmampu. Perjalanan ibadah haji dan umroh merupakan perjalanan suci yang memerlukan\r\nkesiapan fisik dan mental. Untuk persiapan keberangkatan, calon jamaah haji telah diberi\r\nbimbingan tentang bagaimana cara melaksanakan ibadah yang baik dan benar salama\r\nmelakukan perjalanan ibadah haji dan umroh. Saat ini pelayanan biro haji dan umroh masih\r\nmenggunakan sms dan telepon atau bahkan mendatangi kantor biro haji dan umroh yang\r\nmasih kurang efektif. Penelitian ini bertujuan untuk merancang sebuah aplikasi biro haji dan\r\numroh berbasis android yang memberikan kemudahan bagi klien dalam melakukan proses\r\npendaftaran ataupun memperoleh informasi dari biro haji dan umroh secara efektif dan\r\nefisien. Dimana Aplikasi biro haji dan umroh ini akan dibuat untuk media promosi bagi\r\npihak biro haji dan umroh sebagai media untuk memudahkan klien mengakses aplikasi biro\r\nhaji dan umroh berbasis android yang bisa diakses pada smartphone.\r\nDalam Penelitian ini menggunakan metode penelitian deskriptif kualitatif, jenis\r\npenelitian deskriptif yang digunakan adalah Design and Creation yang merupakan jenis\r\npenelitian untuk mengembangkan produk dibidang teknologi dan informasi. Sedangkan\r\nmetode pengumpulan data yang digunakan adalah metode observasi, wawancara dan\r\ndokumentasi. Analisis yang dilakukan adalah analisis system dan analisis aplikasi. Aplikasi\r\nini memiliki Hak Akses untuk Admin untuk melakukan pengolahan data pada Web. Untuk\r\nstudi kasus dilakukan pada Biro Haji dan Umroh PT. As-Salam Rahman Al Mughni.\r\nAplikasi ini diuji menggunakan uji unit, sistem dan integrasi yaitu pengujian unit,\r\nintegrasi dan sistem. Pengujian unit adalah sebuah metode pengujian perangkat lunak.\r\nPengujian integrasi merupakan tahap dalam pengujian perangkat lunak dimana modul\r\nperangkat lunak individu digabungkan dan diuji sebagai sebuah kelompok. Pengujian sistem\r\nmerupakan proses untuk menampilkan sistem dan menemukan kesalahan pada sistem,\r\nsebelum sistem tersebut diberikan kepada pengguna. Kesimpulannya bahwa Aplikasi Biro\r\nHaji dan Umroh Berbasis Android. Diharapkan dapat membantu promosi dan pemberian\r\ninformasi agar lebih mudah dan efisien.\r\nKata Kunci : Biro Haji dan Umroh, Android'),
(9, 'Rancang Bangun Sistem Portal Pesantren Di Indonesia', 2018, 'SAINS DAN TEKNOLOGI', 1, ' Data Kementerian Agama pada tahun 2016 mencatat jumlah santri pondok\r\npesantren di 33 provinsi di seluruh Indonesia mencapai 3,65 juta orang yang\r\ntersebar di 25.938 pondok pesantren. Artinya pesantren dan santri merupakan\r\nelemen penting dalam kehidupan bernegara dan aset bagi kemajuan bangsa.\r\nPesantren dapat dikatakan sebagai tempat terbaik dalam menimbah ilmu agama\r\nkhususnya orang muslim. Seiring pesatnya perkembangan teknologi informasi\r\nsekarang ini, semestinya data pesantren di indonesia sudah dapat diakses dengan\r\nmudah untuk mendapatkan informasi detail setiap pesantren, dengan demikian\r\nmasyarakat dapat membandingkan spesifikasi antar pesantren. Tujuan penelitian ini\r\nadalah membuat suatu portal pondok pesantren di indonesia untuk memudahkan\r\nmasyarakat dalam mencari informasi detail suatu pesantren dalam satu halaman\r\nwebsite.\r\nMetode penelitian yang digunakan adalah penelitian kualitatif. Penelitian\r\nini menggunakan pendekatan penelitian saintifik yaitu pendekatan berdasarkan\r\nilmu pengetahuan dan teknologi. Dengan menggunakan metode pengujian Black\r\nBox dalam pengujian sistem.\r\nHasil penelitian ini adalah sebuah sistem portal pesantren di indonesia\r\nberbasis web dengan 4 kategori pencarian. Kesimpulan dari penelitian ini yaitu\r\ndapat merancang sebuah sistem portal pesantren di indonesia berbasis web.\r\nKata kunci : Sistem Portal, Pesantren, Website, Masyarakat.'),
(10, 'PENGEMBANGAN APLIKASI PENJADWALAN SEMINAR DAN UJIAN SKRIPSI BERBASIS WEB DAN PEMBANGUNANA SISTEM PENGINGAT JADWAL SEMINAR DAN UJIAN SKRIPSI BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, ' Dalam proses penyelesaian studi / tugas akhir / skripsi terdapat beberapa seminar dan ujian skripsi di Jurusan Teknik Informatika dan Sistem Informasi Universitas Islam Negeri Alauddin Makassar yaitu seminar proposal / draft, seminar hasil, ujian komprehensif, dan ujian munaqasyah. Seluruh hal yang berkaitan dengan penjadwalan seminar dan ujian skripsi di Jurusan Teknik Informatika dan Sistem Informasi Universitas Islam Negeri Alauddin Makassar dikelolah secara manual. Mulai dari pengajuan permohonan seminar hingga diberikannya jadwal. Oleh karena itu, melalui pengembangan aplikasi penjadwalan seminar dan ujian skripsi ini akan lebih terstruktur dan berkesinambungan dengan ditampilkan pada website.\r\nDalam proses pengembangan ini, pembuatan web menggunakan beberapa software seperti Sublime Text 3 sebagai wadah untuk membuat source code HTML, CSS, PHP, dan Javascript. Perbedaan dari penelitian sebelumnya terletak pada Framework, dan beberapa tambahan fitur lainnya. Penelitian sebelumnya tidak menggunakan Framework sedangkan dalam penelitian ini menggunakan Framework Laravel. Tambahan fitur lainya seperti diagram tema skripsi terpopuler, perpustakaan judul, dan aplikasi pengingat jadwal. Untuk pembuatan aplikasi pengingat jadwal menggunakan software Android Studio. Untuk database menggunakan PostgreSQL. Penelitian ini menggunakan metode penelitian kualitatif dengan strategi design and creation, serta pengujian yang dilakukan adalah pengujian unit, integrasi dan sistem.\r\nHasil dari penelitian ini adalah sebuah aplikasi penjadwalan seminar dan ujian skripsi berbasis web dan aplikasi pengingat jadwal seminar dan ujian skripsi berbasis mobile, aplikasi ini dibuat untuk membantu proses penjadwalan seminar dan ujian skripsi serta penyampaian informasi jadwal seminar dan ujian skripsi kepada dosen penguji dan dosen pembimbing dan mengingatkan kepada dosen pembimbing dan dosen penguji akan adanya jadwal seminar dan ujian skripsi di Jurusan Teknik Informatika dan Sistem Informasi UIN Alauddin.\r\nKata Kunci: Penjadwalan, Seminar dan Ujian Skripsi, Mobile, Website'),
(11, 'APLIKASI ISLAMIC PARENTING PANDUAN ORANG TUA MENDIDIK DAN MENGAWASI PERKEMBANGAN AGAMA ISLAM ANAK', 2018, 'SAINS DAN TEKNOLOGI', 3, ' Salah satu tanggung jawab yang paling banyak diabaikan oleh orang tua muslim adalah tanggung jawab memahamkan dan mengajarkan agama Islam pada anaknya. Sekalipun pada masa sekolah agam Islam diajarkan pada setiap jenjang pendidikan namun keterbatasan kualitas dan kuantitas pendidikan yang diterima sangat terbatas. Sementara pendidikan agama Islam pada anak idealnya dimulai pada masa kandungan, dan hukum menuntut ilmu agama adalah wajib bagi setiap individu muslim. Pembuatan aplikasi Islamic Parenting ini diharapkan dapat membantu orang tua untuk mendidik dan memberikan pemahaman kepada anaknya tentang pendidikan agama Islam dasar, amalan-amalan wajib dan rutin, pembentukan karakter, akal, jiwa dan fisik.\r\nAplikasi dibangun dengan menggunakan Android Studio dengan Bahasa pemrograman Java dan database SQLite. Antar muka aplikasi menggunakan konsep Material Design. Penelitian ini menggunakan metode penelitian kualitatif dengan strategi design and creation, serta pengujian yang dilakukan adalah pengujian blackbox.\r\n. Hasil dari penelitian ini berupa aplikasi panduan pendidikan agama Islam dasar bagi anak yang dapat dijalankan pada perangkat android versi Lollipop â€“ Oreo versi 8.1. Dengan menggunakan aplikasi ini orang tua dapat mengetahui materi-materi dasar yang seharusnya diajarkan sejak dini kepada anaknya. Selain itu, metode yang ditonjolkan pada aplikasi adalah keteladanan, sehingga orang tua akan menjadi karakter yang selalu menjadi panutan bagi anak.\r\nKata Kunci: Islamic Parenting, Pendidikan Anak, Android, Java'),
(12, 'MANAJEMEN PENGELOLAHAN SAMPAH BERBASIS ANDROID (STUDI KASUS : LPM KELURAHAN PACCINONGANG)', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Kabupaten Gowa sebagai salah satu kabupaten besar di Indonesia merupakankan bupaten yang padat akan penduduk. Tidak sedikit permasalahan sosial yang muncul, tidak terkecuali masalah kebersihan. Tiap hari, masyarakat menghasilkan sampah, baik itu sampah dari masing-masing rumah, jalan, ataupun rumah makan, baik berupa sampah organik maupun non organik. Di kabupaten Gowa, aktivitas masyarakat berkembang pesat sehingga limbah sampah pun semakin banyak setiap harinya.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian kualitatif dengan metode field research. Selain itu, pembuatan sistem yang akan dibangun menggunakan metode perancangan waterfall. Aplikasi ini berjalan pada smartphone berbasis Android dan dirancang menggunakan bahasa pemrograman Java dan MySQL. Pembangunan aplikasi ini menggunakan software Android Studio dan JetBrains PhpStrom. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram, class diagram, activity diagram, dan sequence diagram, dan diuji menggunakan metode pengujian blackbox.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah sistem pengelolaan sampah berbasis Android melalui partisipasi masyarakat di Kelurahan Paccinongang yang diberi nama aplikasi Daur Ulang. Aplikasi ini telah diuji cobakan kepada masyarakat di Kelurahan Paccinongang secara langsung dan aplikasi ini direkomendasikan untuk digunakan dalam membantu pengelolaan sampah yang lebih baik dan lebih maksimal.\r\nKata Kunci: Kebersihan, Pengelolaan Sampah, Android, Java, MySQL'),
(13, 'SISTEM PENDUKUNG KEPUTUSAN DALAM PEMILIHAN PROGRAM STUDI DI PERGURUAN TINGGI UNTUK SISWA MADRASAH DAN PESANTREN BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Keputusan adalah aktifitas yang diambil sebagai dasar suatu permasalahan. Mengambil keputusan akan sangat berpengaruh pada kehidupan ke depannya sesuai dengan keputusan yang dipilih. Begitu pula dengan siswa tingkat menengah atas pada madrasah dan pesantren yang ingin melanjutkan pendidikannya ke jenjang yang lebih tinggi. Banyaknya pertimbangan bagi siswa madrasah dan pesantren seperti bidang studi yang dikuasai, minat siswa, cita-cita, nilai akademik, lingkungan pergaulan dan harapan orang tua ditambah dengan latar belakang pendidikan mereka yang juga mempelajari ilmu agama yang lebih banyak sehingga membuat mereka bingung dalam memilih program studi untuk melanjutkan pendidikannya. Terkait dengan permasalahan di atas, dibutuhkan teknologi untuk memudahkan siswa madrasah dan pesantren dalam memilih program studi di perguruan tinggi. Tujuan dari penelitian ini adalah memberi kemudahan kepada siswa madrasah dan pesantren dalam memilih program studi di perguruan tinggi sesuai dengan nilai, bakat dan minatnya.\r\nJenis penelitian yang digunakan pada penelitian ini adalah penelitian kualitatif. Metode pengumpulan data yang digunakan pada penelitian ini berupa observasi dan studi literatur. Metode pengembangan sistem yang digunakan adalah waterfall dan teknik pengujian sistem yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah berupa sebuah sistem pendukung keputusan dalam pemilihan program studi di perguruan tinggi untuk siswa madrasah dan pesantren berbasis android. Kesimpulan dari penelitian ini bahwa sistem ini mudah digunakan untuk siswa sehingga siswa dapat dengan mudah memilih program studi untuk melanjutkan pendidikannya ke jenjang yang lebih tinggi.\r\nKata Kunci: Pendukung Keputusan, Program Studi, Perguruan Tinggi, Madrasah, Pesantren, Android'),
(14, 'Sistem Antrian Kendaraan Pada Pelabuhan Penyeberangan Pamatata Dengan Metode RFID', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Masalah antrian kendaraan adalah salah satu permasalahan kompleks yang banyak ditemui di kota-kota besar, dimana pelayanan yang di sediakan kurang efektif untuk melayani pengendara seperti halnya di pelabuhan. Penelitian ini bertujuan untuk merancang sistem antrian untuk mengurangi tingginya antrian kendaraan dengan menggunakan RFID sebagai tiket antrian kendaraan, Load Cell sebagai penimbang berat kendaraan dan Arduino sebagai kontrol utama pada alat.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah alat antrian dengan menggunakan 2 sensor RFID sebagai pembaca kartu antrian untuk mengetahui jenis kendaraan yang ingin memasuki pelabuhan dan 2 sensor load cell sebagai pendeteksi berat kendaraan yang ingin masuk di pelabuhan.\r\nKata kunci : Sistem Antrian Kendaraan, RFID sensor, Load Cell sensor, Arduino Uno.'),
(15, 'SISTEM MONITORING PENCAPAIAN TARGET PENJUALAN PADA SEMUA TOKO XSPORT MAKASSAR BERBASIS WEB', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Pengembangan perangkat lunak atau aplikasi sistem monitoring dapat\r\nmemberikan efektifitas dan efesiensi data terutama dalam peningkatan monitoring\r\ntarget pencapaian pada bagian penjualan. Untuk menghindari atau mengantisipasi\r\nadanya duplikat data atau tertukarnya data omset penjualan pada toko Xsport\r\nMakassar, serta dapat memberikan kemudahan staf operasinal toko Xsport Makassar\r\ndalam pengambilan keputusan penentuan target pencapaian selanjutnya. Maka dalam\r\npenelitian ini dibangunlah sebuah sistem monitoring pencapaian target penjualan\r\npada semua toko Xsport Makassar berbasis web.\r\nMetode yang digunakan dalam penelitian ini adalah penelitian kualitatif\r\ndengan menggunakan pendekatan penelitian saintifik yaitu pendekatan berdasarkan\r\nilmu pengetahuan dan teknologi, serta menggunakan metode pengujian Black Box\r\ndalam pengujian sistem.\r\nHasil penelitian yang dihasilkan adalah sebuah sistem monitoring pencapaian\r\ntarget pada semua toko Xsport Makassar berbasis web. Adapun yang dihasilkan dapat\r\nmemberikan kemudahan staf operasional dalam proses melakukan monitoring\r\npencapaian target penjualan pada semua toko Xsport Makassar.\r\nKata kunci: Monitoring, pencapaian target, toko Xsport Makassar.'),
(16, 'RANCANG BANGUN APLIKASI DIAGNOSIS PENYAKIT HEWAN PELIHARAAN BERBASIS ANDROID MENGGUNAKAN METODE CERTAINTY FACTOR BERDASARKAN METODE DIAGNOSIS ANAMNESIS', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Kesejahteraan hewan (Animal Welfare) merupakan suatu usaha untuk memberikan kondisi lingkungan yang sesuai bagi satwa sehingga berdampak ada peningkatan sistem psikologi dan fisiologi satwa. Masalah kesejahteraan hewan merupakan hal penting karena sejak dahulu kala hubungan antara manusia dan hewan sejatinya tidak dapat dipisahkan Tujuan dari penelitian ini adalah merancang dan membuat aplikasi berbasis android untuk mendeteksi dan menangani penyakit pada hewan peliharaan serta memberikan pemahaman dan informasi kepada pemilik hewan tentang jenis, penyebab dan penanganan penyakit pada hewan peliharaan berbasis Android sehingga dapat mencegah kemungkinan penularan dan perkembangan penyakit tersebut sehingga dapa menjadi semakin parah dan membahayakan hewan dan pemiliknya.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan yaitu jenis penelitian kualitatif dimana strategi yang digunakan adalah Design and Creation. Dipilihnya jenis penelitian ini oleh penulis dikarenakan konsep dari Design and Creation sangat tepat untuk mengelola penelitian ini. Disamping melakukan penelitian tentang judul ini, penulis juga mengembangkan produk berdasarkan penelitian yang dilakukan.\r\nBerdasarkan hasil pengujian yang telah dilakukan pada setiap proses, disimpulkan bahwa proses secara fungsional sistem telah dapat menghasilkan output yang diharapkan sebagaimana tujuan dari penelitian ini\r\nKata Kunci: Animal Welfare, Android, Design and Creation.'),
(17, 'RANCANG BANGUN SISTEM PENGOLAAN DATA KEUANGAN PERUSAHAAN CV. RAHMAT JAYA BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatar belakangi oleh perusahaan Cv. Rahmat Jaya yang mengalami kesulitan saat penginputan data keuangan. Akibatnya perusahaan tersebut mengalami kendala pada laporan keuangan perusahaan tiap bulannya. Rumusan masalah di penelitian ini adalah bagaimana merancang sistem penginputan data keuangan berbasis Android pada perusahaan Cv. Rahmat Jaya. Tujuan untuk mengaplikasikan sistem penginputan data keuangan berbasis Android sehingga akan membantu perusahaan Cv. Rahmat Jaya dalam mengatur cashflow (Perputaran) keuangan perusahaan.\r\nDalam Penelitian ini menggunakan metode penelitian kualitatif Design and Creation dimana akan membahas komponen-komponen sistem data, dan membahas aplikasi yang berjalan pada perangkat mobile dengan sistem penginputan data keuangan berbasis Android. Sedangkan metode pengumpulan data yang digunakan adalah metode wawancara dan Studi Literatur. Analisis kebutuhan pembangunan sistem antara lain kebutuhan antarmuka yang familiar dan mudah digunakan bagi pengguna, kebutuhan data yang terdiri dari data pemasukan, dan data pengeluaran. Perancangan dalam membangun sistem ini terbagi atas use case diagram, class diagram, sequence diagram, flowchart, dan perancangan antarmuka.\r\nAplikasi ini berjalan pada perangkat mobile dengan sistem operasi Android dan dirancang menggunakan bahasa pemrograman Java dan DBMS MySQL. Pembangunan aplikasi ini menggunakan software Eclipse dan SQLite Browser, dengan menggunakan pengujian blackbox. Penelitian ini menghasilkan sistem pengolaan data keuangan perusahaan yang dapat digunakan untuk membantu pengguna dalam menyelesaikan laporan data keuangan perusahaan Cv. Rahmat Jaya.\r\nKata Kunci : Keuangan, Java, MySql, Android'),
(18, 'SISTEM LAYANAN TOUR GUIDE PADA MUSEUM LAGALIGO MENGGUNAKAN TEKNOLOGI QR BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Museum hingga saat ini belum memperlihatkan orientasi memberikan manfaat kepada para pemangku kepentingan lintas sektor dan disiplin misalnya pemerintah, swasta dan masyarakat atau komunitas termasuk para pengunjung yang bergerak antara lain di bidang pendidikan, kebudayaan, pariwisata, ekonomi, pemasaran, dan bahkan dalam pengelolaannya belum menyesuaikan dengan kemajuan ilmu pengetahuan dan teknologi yang berkembang.\r\nTujuan dari penelitian ini adalah untuk memudahkan pengunjung Museum khususnya di Museum Lagaligo yang berada di Kota Makassar dalam mendapatkan informasi yang dinginkan dalam hal ini yaitu penjelasan tentang benda-benda bersejarah yang di pamerkan tanpa harus menunggu seorang Tour Guide untuk menjelaskannya.\r\nAdapun jenis penelitian yang digunakan pada penelitian ini adalah penelitan eksperimental. Penelitian eksperimental merupakan penelitian yang bertujuan untuk mengidentifikasi hubungan sebab akibat dari satu atau lebih variabel terikat dengan melakukan manipulasi variabel bebas pada suatu keadaan yang terkendali. Hasil dari penelitian ini berupa aplikasi yang dapat memberikan pengunjung museum Lagaligo berupa informasi yang mereka ingin ketahui seputar benda-benda yang terpajang dalam museum melalui smartphone android mereka.\r\nKata Kunci: Tour Guide, Museum, Mobile, Android.'),
(19, 'TRANSAKSI BANK SAMPAH EVERY WHERE BANKING BERBASIS ANDROID DAN WEB (Study Kasus Bank Sampah Pelita Harapan)', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Sebagian besar proses administrasi dan transaksi menggunakan media\r\nkomputer, namun berdasarkan data tahun 2016 nasabah Bank Sampah Pelita\r\nHarapan telah mencapai kurang lebih 420 nasabah namun proses administrasi\r\ndilakukan secara manual sehingga menyulitkan para karyawan dalam melakukan\r\nproses transfer saldo, penghitungan saldo setiap harinya, dan perhitungan statistika\r\nsaldo jadi tidak efektif. Tujuan dilakukannya penelitian ini agar karyawan dan\r\nnasabah lebih terbantu dalam proses layanannya.\r\nMetodologi pengembangan yang digunakan dalam pengembangan adalah\r\nWaterfall, study literature yang mendukung teori penyelesaian masalah serta Data\r\nFlow Diagram (DFD) untuk perancangan perangkat lunaknya disertai juga\r\nmengujian perangkat lunaknya.\r\nAkan merancang sebuah aplikasi untuk penanganan Pelayanan Bank\r\nSampah Pelita Harapan berbasis web sehingga karyawan dan nasabah Bank\r\nSampah dapat lebih mudah melakukan proses pelayanan di Bank Sampah secara\r\nefektif dan efisien.\r\nKata Kunci : Bank Sampah Pelita Harapan, Karyawan, Nasabah, Transaksi'),
(20, 'RANCANG BANGUN APLIKASI PENCARIAN LOKASI DAN INFORMASI ATM DENGAN MENGGUNAKAN LOCATION BASED SERVICE BERBASIS ANDROID DI PROVINSI SULAWESI SELATAN', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Berkembangnya populasi masyarakat di provinsi Sulawesi Selatan berbanding lurus dengan tersebarnya fasilitas ATM di berbagai sudut daerah di provinsi Sulawesi Selatan, mulai dari ATM Mandiri, BCA, BNI, BRI, BTN, serta ATM dari bank lainnya. Namun karena banyaknya jumlah fasilitas ATM yang ada di provinsi Sulawesi Selatan serta lokasinya yang tersebar di segala penjuru daerah, membuat sebagian masyarakat, mungkin dalam keadaan terdesak, mengalami kesulitan dalam menemukan posisi atau letak ATM terdekat yang disediakan oleh bank. Karena itulah dirancang dan dibangun sebuah Aplikasi Pencarian Lokasi dan Informasi ATM dengan menggunakan Location Based Service Berbasis Android yang mempermudah pengguna dalam mencari lokasi ATM terdekat serta informasi seputar ATM seperti nominal/pecahan uang, jumlah mesin ATM dan tipe/jenis ATM.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Metode perancangan menggunakan waterfall dan teknik pengujian yang digunakan adalah Black Box dan White Box. Hasil dari penelitian ini menunjukkan bahwa aplikasi ini dapat digunakan sebagai media pencarian lokasi dan informasi ATM yang berada di provinsi Sulawesi Selatan.\r\nKata Kunci: ATM, Location Based Service, Android, Sulawesi Selatan'),
(21, 'RANCANG BANGUN APLIKASI PEMBELAJARAN BAHASA JEPANG DAN BUDAYANYA BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Indonesia merupakan Negara kedua yang paling banyak mempelajari Bahasa Jepang. Banyak lembaga formal maupun non formal yang mengajarkannya. Akan tetapi dalam mempelajarinya tidaklah mudah karena bahasa Jepang mempunyai aksaranya tersendiri. Terkait dari latarbelakang permasalahan di atas, dibutuhkan teknologi yang dapat membantu pemelajar, Android termaksud salah satu teknologi yang paling tepat karena banyaknya pengguna sistem operasi Android. Tujuan dari penelitian ini adalah membuat sebuah aplikasi pembelajaran Bahasa Jepang dan Budayanya berbasis Android.\r\nJenis penelitian yang digunakan pada penelitian ini adalah penelitian eksperimental dan Design and Creation. Metode pengumpulan data yang digunakan pada penelitian ini berupa observasi, wawancara, dan studi literatur. Metode pengembangan sistem yang digunakan adalah waterfall dan teknik pengujian sistem yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah berupa sebuah aplikasi Pembelajaran Bahasa Jepang dan Budayanya berbasis Android. Sebuah aplikasi yang dapat digunakan sebagai sarana pembelajaran yang mempermudah pemelajar dalam mempelajari bahasa Jepang.\r\nKata Kunci: Pembelajaran, Bahasa Jepang, Budaya Jepang, Android'),
(22, 'RANCANG BANGUN SISTEM PAKAR BERBASIS MOBILE UNTUK MENDIAGNOSA PENYAKIT TROPIS', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Kesehatan merupakan salah satu faktor penting untuk melakukan aktivitas sehari-hari. Namun, sebagian masyarakat tidak peduli terhadap kesehatan tubuhnya sehingga pada akhirnya banyak penyakit yang terlambat didiagnosis menyebabkan kondisi pada tahap yang serius. Seperti tifus, filariasis, chikungunya, tuberculosis, demam berdarah, cacingan, hepatitis dan malaria. Dimana semua penyakit tersebut dikelompokan kedalam penyakit tropis. Pada umumnya, jika masyarakat terkena gejala penyakit tersebut maka akan pergi ke rumah sakit atau puskesmas terdekat untuk melakukan pemeriksaan. Namun masih banyak masyarakat yang tidak ingin atau tidak bisa ke dokter karena beberapa hal, seperti biaya yang mahal dan rasa takut. Oleh sebab itu, perlu dibuatkan aplikasi sistem pakar untuk mendiagnosa penyakit tropis bagi masyarakat sebagai sarana dalam mengatasi masalah tersebut.\r\nDalam melakukan penelitian ini, digunakan jenis penelitian kualitatif dengan metode design and creation. Kemudian melakukan metode wawancara dengan dokter dalam pengumpulan data. Selain itu, metode perancangan System Development Life Cycle (SDLC) digunakan untuk pembuatan sistem. Aplikasi ini berjalan pada perangkat mobile dengan sistem operasi android. Dirancang menggunakan bahasa pemrograman Java dan diuji menggunakan metode pengujian blackbox.\r\nDengan adanya penelitian ini maka dihasilkan sebuah sistem pakar untuk mendiagnosa penyakit tropis, dimana sistem ini mengadopsi pengetahuan dokter ke dalam sistem. Sistem pakar ini akan menghasilkan keluaran/output yang berupa hasil diagnosa dan cara penanganan jenis penyakit tropis tersebut.\r\nKata Kunci: Penyakit Tropis, Aplikasi, Expert System, Android.'),
(23, 'RANCANG BANGUN ALAT PEMELIHARAAN SANITASI TEMPAT MINUM TERNAK BERBASIS MIKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Perbaikan tingkat pendapatan telah mengubah pola konsumsi masyarakat\r\ndari karbohidrat ke protein hewani, khususnya hasil ternak seperti daging, susu\r\ndan telur sebagai sumber protein berkualitas tinggi. Untuk meningkatkan hasil\r\nproduksi dan menjaga kesehatan ternak, air minum ternak menjadi hal yang paling\r\npenting dimana air merupakan salah satu komponen yang penting dalam\r\npeternakan.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variable-variabel control (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variable.\r\nHasil penelitian ini adalah sebuah alat pemeliharaan sanitasi tempat\r\nminum ternak dengan menggunakan beberapa komponen untuk melakukan proses\r\npembersihan dan pengisian air pada tempat minum ternak.\r\nKata Kunci: Sensor Ultrasonic, Sanitasi Air Minum Ternak, Arduino Mega'),
(24, 'APLIKASI MANAJEMEN PENGELOLAAN DEPARTEMEN ADMIN DI PT. SERASI AUTORAYA TRAC-ASTRA RENTAL CAR CABANG MANADO BERBASIS WEB', 2018, 'SAINS DAN TEKNOLOGI', 1, 'TRAC – Astra Rent A Car merupakan salah satu perusahaan besar dalam\r\nbidang penyewaan mobil terus berupaya dalam meningkatkan kualitas\r\nperusahaannya. Salah satunya meningkatkan dari segi manajemen pengelolaannya\r\ndimulai dari departemen admin, di dalam departemen admin terbagi lagi menjadi 3\r\nbagian yaitu General Affair, Cashier dan Administration Officer. Di dalam General\r\nAffair sendiri terdapat masalah dalam hal permintaan dan pengadaan ATK dan juga\r\ndalam hal lingkungan perusahaan, Di dalam Cashier sendiri terdapat masalah dalam\r\nhal mengingatkan pemasukan nota dari hasil peminjaman uang muka. Didalam\r\nAdministration Officer pembuatan dan pelacakan data tanda terima kontrak serta\r\npenyimpanan data hasilnya. Terkait dengan permasalahan tersebut dibutuhkan\r\nteknologi untuk memberikan kemudahan dan efisiensi dalam bekerja bagi seluruh\r\nkaryawan Trac terkhusus kepada karyawan yang berada di departemen admin.\r\nTujuan dari penelitian ini untuk memanage pengelolaan departemen admin agar\r\nmemberi kemudahan dan mengefiensian pekerjaan karyawan di departemen admin.\r\nJenis penelitian yang digunakan pada penelitian ini adalah penelitian\r\nkualitatif. Metode pengumpulan data yang digunakan pada penelitian ini berupa\r\nobservasi dan wawancara. Metode pengembangan sistem yang digunakan adalah\r\nwaterfall dan teknik pengujian sistem yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah berupa sebuah aplikasi manajemen pengelolaan\r\ndepartemen admin di Trac-Astra Rent A Car cabang Manado berbasis web.\r\nKesimpulan dari penelitian ini bahwa sistem ini dapat memudahkan karyawan\r\ndepartemen admin dalam pengajuan purchase request, complain, request,\r\npembuatan tanda terima kontrak serta reminder peminjaman uang muka.\r\nKata Kunci: Bisnis, Manajemen Pengelolaan, Trac-Astra Rent A Car,\r\nDepartemen Admin, Website'),
(25, 'APLIKASI REKAM TAHAPAN PEMBINAAN NARAPIDANA LAPAS KELAS I MAKASSAR', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Pada masa sekarang ini, pengolahan data dan informasi membutuhkan kecepatan dan keakuratan. Berdasarkan pada ilmu yang penulis tekuni, untuk mendapatkannya haruslah didukung dengan suatu teknologi informasi yang tepat dan berdaya guna serta relevan untuk penerapannya. Kantor Lembaga Pemasyarakatan yang biasa disingkat LAPAS ini turut pula merasakan dampak dari kemajuan teknologi.\r\nDalam hal ini yaitu dalam proses tahapan pembinaan narapidana, dimana dalam proses tahapan ini, membutuhkan ketelitian dalam melakukan penghitungan remisi pada setiap narapidana, maka dari itu dibutuhkan suatu aplikasi yang dapat mendukung proses tahapan pembinaan tersebut agar lebih meningkatkan mutu dari lembaga pemasyarakatan itu sendiri. Dalam penelitian ini, penulis menarik kesimpulan bahwa perlunya dilakukan pembaharuan yang lebih efisien dan efektif dalam melakukan proses tahapan pembinaan.\r\nKata Kunci : Aplikasi, Rekam Tahapan Pembinaan Narapidana'),
(26, 'APLIKASI VIRTUAL REALITY MEDIA AJAR BANGUN RUANG (TRIGONOMETRI) BERBASIS ANDROID (STUDI KASUS : SMP PGRI BAJENG BARAT)', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Pada dunia pendidikan, semakin berkurangnya minat belajar siswa dikarenakan perkembangan teknologi hiburan yang semakin menyuguhkan hal-hal menarik dan interaktif seperti film kartun maupun animasi tiga dimensi (3D), sedangkan media pembelajaran yang saat ini digunakan masih didominasi oleh buku yang berisikan tulisan dan gambar. Pada pelajaran Matematika kelas IX tentang materi bangun ruang yang penyampaiannya masih menggunakan papan tulis serta gambar yang ada dibuku yang terkesan kurang menarik. Sehingga dibutuhkan suatu aplikasi sebagai media pembelajaran untuk meningkatkan minat siswa dalam mempelajari materi bangun ruang. Tujuan dalam penelitian ini adalah merancang dan membangun aplikasi sebagai media pembelajaran bangun ruang dengan memanfaatkan teknologi Virtual Reality berbasis Android yang nantinya menarik minat belajar siswa.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi literatur. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan, memberikan informasi visual yang lebih baik, menyenangkan sehingga siswa tidak merasa bosan serta membantu meningkatkan pemahaman siswa.\r\nKata Kunci: Pendidikan, Bangun Ruang, Metode Desentinasi, Virtual Reality.'),
(27, 'ANIMASI LAPISAN STRUKTUR BUMI PADA BUKU GEOGRAFI DENGAN MENERAPKAN TEKNOLOGI AUGMENTED REALITY', 2018, 'SAINS DAN TEKNOLOGI', 4, 'Asrul Try Hasbullah, 2012. Animasi Lapisan Struktur Bumi Pada Buku Geografi\r\nDengan Menerapkan Teknologi Augmented Reality. Manfaat teknologi pada saat\r\nini sudah sangat mempengaruhi kehidupan manusia, dengan diciptakannya\r\nmesin atau alat canggih yang dipergunakan manusia demi tercapainya\r\nkebutuhan manusia. Sejalan dengan perkembangan tersebut, muncullah\r\nteknologi realitas tertambah atau biasa disebut dengan Augmented Reality (AR).\r\nAugmented Reality adalah suatu lingkungan yang memasukkan objek virtual 3D\r\nkedalam lingkungan nyata.\r\nPenelitian ini bertujuan untuk menerapkan teknologi Augmented Reality\r\npada Buku Geografi yang didalamnya membahas lapisan struktur bumi, yang\r\nmenyajikan desain interaktif tiga dimensi model lapisan struktur bumi dimana\r\ndapat memberikan kontribusi yang positif pada perkembangan kecerdasan siswa\r\ndalam memahami materi yang didalamnya yang membahas lapisan struktur\r\nbumi.\r\nMetode yang digunakan untuk menguji pencapaian tujuan penelitian\r\nadalah dengan mensisipkan marker pada halaman buku geografi SMA kelas X\r\nyang akan menampilkan desain interaktif 3D model lapisan struktur bumi\r\ndidepan webcam dan ditampilkan dalam monitor komputer.\r\nHasil dari penelitian ini adalah menyajikan desain interaktif tiga\r\ndimensi dimana obyek lapisan struktur bumi dipetakan dari 2D ke 3D yang\r\ndilengkapi dengan animasi.\r\nSetelah melakukan tahapan, uji coba dan implementasi pengujian maka\r\ndapat disimpulkan bahwa: 1) Marker yang telah dibuat dan dicetak dapat\r\ndikenali pada kamera/webcam. 2) Aplikasi augmented reality dapat\r\nmenampilkan Lapisan Struktur Bumi. 3) Software library Artoolkit yang\r\ndigunakan dapat berfungsi dengan baik dan dapat membaca format *.wrl dengan\r\nbaik. 4) Tekstur model 3D objek lapisan struktur bumi dapat dibaca dan\r\nditampilkan pada webcam. 5) Model 3D objek lapisan struktur bumi dapat\r\nmuncul pada monitor diatas marker yang telah disisipi pada brosur. 6) Penerapan\r\naplikasi Augmented Reality berhasil pada marker. 7) Ukuran marker sangat\r\nberpengaruh pada nilai jarak minimum dan maksimum antara kamera dan\r\nmarker. Pola marker dapat mempengaruhi hasil virtual. Marker dengan pola\r\nsederhana dan kompleks dapat menampilkan objek yang tetap. Sedangkan untuk\r\nmarker dengan pola simetris, objek yang ditampilkan berubah posisinya.\r\nKata kunci: Augmented Reality, Buku Geografi, Artoolkit, Lapisan Strukur\r\nBumi.'),
(28, 'RANCANG BANGUN SISTEM PEMBERIAN PAKAN TERNAK (SAPI) DAN PENGADUKANNYA SECARA OTOMATIS BERBASIS MIKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Bagi peternak yang memiliki sejumlah besar sapi, dapat menjadi tugas yang sulit untuk menjaga mereka memberi makan sepanjang waktu.Apalagi jika peternak tersebut juga berprofesi sebagai petani. Umumnya para peternak memberikan pakan di wadah berbentuk kotak menggunakan tangan dan harus berjalan sepanjang kandang yang mana kandang sapi yang diternakkan sangatlah jauh dari pemukiman. Kegiatan seperti itu bagi peternak sapi akan menyita waktu dan tenaga. Alat ini akan membuat peternak menggunakan waktunya sebaik mungkin.Pemberian pakan sapi dapat dipermudah dengan penggunaan alat mekanik yang dikontrol oleh peralatan eletronik. Sistem ini merupakan alat kontrol yang mampu memberikan pakan sapi secara otomatis sesuai jadwal. Pengendali utama sistem ini menggunakan mikrokontroler yang di program dan di delay sebagai penyesuaian waktu pemberian pakan sapi.\r\nMetode yang digunakan adalah Prototyping yang memiliki keunggulan pengembang dapat bekerja lebih baik dalam menentukan kebutuhan setiap pelanggannya dan lebih menghemat waktu dalam pengembangan sistem.\r\nHasil dari penelitian ini telah mencapai target dengan nilai keakuratan alat dalam pemberian pakan setiap harinya mencapai 90,86% sedangkan standar pemberian pakan untuk mencapai berat badan ideal sapi adalah 80% keatas.\r\nKata Kunci:, Pakan, Ternak, Mikrokontroller, Motor Servo, Motor DC'),
(29, 'RANCANG BANGUN SMARTHOME MENGGUNAKAN CHAT BOT TELEGRAM BERBASIS ARDUINO', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Permasalahan kontrol rumah jarak jauh adalah permasalahan yang biasa dirasakan oleh\r\nmanusia. Dimana orang-orang yang memiliki aktivitas setiap hari susah dalam\r\nmengontrol rumah. Penelitian ini bertujuan mengendalikan rumah dengan jarak jauh\r\nyang dapat mengakses atau mengendalikan perangkat rumah dari jarak jauh\r\nmenggunakan aplikasi telegram. Data yang diterima dan dikirim lewat user akan\r\nmasuk ke sistem yang telah terintegrasi dengan perangkat Arduino dan wemos d1\r\nmini sebagai pusat kendali dari seluruh sistem yang ada, sehingga memungkinkan\r\nuser mengendalikan ataupun mengawas rumah dari jarak jauh dengan mudah dan\r\ntanpa mengeluarkan banyak biaya.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nSistem ini dirancang menggunakan mikrokontroler arduino uno. Terdapat tiga\r\npoin penting yang menjadi fokus dalam penelitian ini yaitu yang pertama\r\nmengendalikan lampu jarak jauh, yang kedua memantau kondisi sebuah ruangan\r\nmenggunakan wemos d1 mini dan yang ketiga yaitu memantau kondisi buka tutup\r\npintu. Untuk komunikasi antara mikrokontroler ke Android melalui aplikasi\r\ntelegram.\r\nKata kunci : Smarthome, Arduino, Wemos D1 Mini, Smartphone Android');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(30, 'RANCANG BANGUN SISTEM PENDINGIN RUANGAN MENGGUNAKAN MODUL TERMOELEKTRIK PILTIER TEC-12706 BERBASIS MIKROKONTROLER ARDUINO UNO', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Penelitian ini dilatar belakangi oleh Pemanfaatan teknologi mencakup segala aspek kehidupan manusia. Dalam penggunaan teknologi, manusia menyadari akan bahaya yang ditimbulkan dari penggunaan bahan kimia didalamnya misalnya, penggunaan freon pada pendingin ruangan yang dapat membahayakan. Untuk itu digunakanlah fenomena termoelektrik sebagai bahan pengganti freon. Pada penelitian ini modul termoelektrik dimanfaatkan untuk membuat sistem pendingin ruangan. Zat kimia tersebut memiliki dampak buruk terhadap lingkungan yang dapat merusak lapisan ozon. Modul termoelektrik peltier mampu menghasilkan suhu dingin.\r\nMetode penilitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan melakukan eksperimen terhadap variabel-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil dari penelitian ini adalah sebuah alat pendingin ruangan dengan sistem sensor suhu LM35 yang menghasilkan persentase keberhasilan 95% karena tingkat akurasi pembacaan dari sensor suhu LM35 sangat akurat dapat mengukur suhu dalam ruangan kemudian suhu ditampilkan ke LCD, sehingga mempermudah bagi pengguna untuk aktifitas seperti pada umumnya.\r\nKata Kunci: Piltier TEC1-12706, Sensor suhu LM35, Arduino uno, LCD.\r\n'),
(31, 'SISTEM PEMINJAMAN DAN KEAMANAN PADA PERPUSTAKAAN MENGGUNAKAN RFID', 2018, 'SAINS DAN TEKNOLOGI', 2, 'disebabkan salah satunya oleh sistem layanan perpustakaan yang digunakan. Umumnya perpustakaan menyediakan layanan dengan sistem terbuka. Pada sistem tersebut, pengguna dapat secara langsung memilih bahan pustaka yang diinginkan pada rak tempat jajaran koleksi diletakkan. Hal ini dapat mendorong seseorang untuk melakukan tindak kejahatan penyalahgunaan koleksi perpustakaan. Sistem keamanan untuk mengelola koleksi buku harusnya memiliki keunggulan teknologi yang mampu membaca suatu objek data dengan ukuran tertentu tanpa melalui kontak langsung (contacless) dan tidak harus sejajar dengan objek yang dibaca. Dengan teknologi sensor RFID, objek dapat terdeteksi tanpa melakukan kontak langsung dengan sensor reader RFID dan walaupun dalam kondisi tidak sejajar dengan objek yang dibaca. Mikrokontroller arduino sebagai kontrol untuk menyalakan fungsi sensor RFID dan penggerak dari servo.'),
(32, 'PERANCANGAN SISTEM DETEKSI DAN PANTAUAN LOKASI KEBAKARAN HUTAN BERDASARKAN PENGARUH FAKTOR-FAKTOR IKLIM', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Kebakaran hutan dan lahan merupakan permasalahan yang semakin sering\r\nterjadi di Indonesia yang menimbulkan berbagai dampak buruk terhadap fungsifungsi\r\nhutan. Penyampaian informasi tentang tingkat rawan kebakaran hutan ke\r\nmasyarakat masih menggunakan cara manual. Kecanggihan teknologi pada saat ini\r\ndapat kita manfaatkan untuk menyampaikan informasi tingkat rawan kebakaran\r\nhutan dengan menggunakan sensor DHT11, ANEMOMETER, RAINDROPS\r\nMODULE, dan Arduino Mega 2560 sebagai alat sistem informasi.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabel kontrol (input) untuk menganalisis output.\r\nHasil penelitian ini adalah sebuah alat pendeteksi tingkat rawan kebakaran\r\nhutan berdasarkan pengaruh faktor-faktor iklim menggunakan sensor DHT11,\r\nANEMOMETER, dan RAINDROPS MODULE yang masing-masing menggunakan\r\n2 sensor dan mengirim data ke LCD dan PC. Berdasarkan dari hasil pembacaan\r\nsensor maka diperoleh nilai Suhu = 280C, Kecepatan Angin = 4.3 km/j, Kelembaban\r\nUdara = 16%, dan Curah Hujan = 107 mm. yang menunjukkan bahwa tingkat rawan\r\nkebakaran rendah.\r\nKata kunci : Kebakaran Hutan, Pendeteksi Tingkat Rawan Kebakaran\r\nHutan, Penelitian Kuantitatif, DHT11, ANEMOMETER,\r\nRAINDROOPS MODULE, dan Arduino Mega 2560'),
(33, 'Rancang Bangun Sistem Panen Buah Kelapa Muda', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Indonesia merupakan produsen kelapa terbesar ke-3 dunia, namun sepertiga\r\ntanaman kelapa di Indonesia dalam kondisi tua dan tidak produktif akibat dari\r\nketerbatasan sumber daya manusia pada saat musim panen. Penelitian ini bertujuan\r\nuntuk merancang alat panen buah kelapa muda. Robot panen ini menggunakan\r\nArduino Nano sebagai sistem kendali utama robot, menggunakan motor wiper sebagai\r\nmotor penggerak roda dan remot kontrol sebagai sistem pengontrolan. Dengan\r\nmenggunakan robot panen yang dirancang untuk menggantikan kerja manusia pada\r\nsaat proses panen buah kelapa muda, dapat membuat kerja menjadi lebih produktif\r\ndan cepat saat proses panen kelapa muda.\r\nMetode penelitian yang di gunakan adalah penelitian kualitatif. Penelitian\r\nkualitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variable - variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Penelitian ini menggunakan metode\r\npengumpulan data wawancara dan observasi. Metode perancangan yang digunakan\r\nadalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah sebuah robot panen buah kelapa muda yang\r\ndigunakan untuk membantu petani kelapa dalam proses panen buah kelapa muda\r\ndengan menggunakan remot kontrol sebagai alat utama dari sistem pengontrolan,\r\nperintah-perintah yang dapat dikeluarkan seperti mengontrol pergerakan roda dan\r\nalat pemotong. Kesimpulan dari penelitian ini yaitu sebagai alat bantu untuk petani\r\nkelapa serta memberikan kemudahan dalam proses perawatan serta pengelolaan\r\nperkebunan khususnya kebun kelapa.\r\nKata kunci: Panen Buah Kelapa Muda, Remot Kontrol, Prototype, Arduino Nano.'),
(34, 'MEDIA PEMBELAJARAN PENGEMBANGAN NILAI AGAMA DAN MORAL PADA PAUD BERBASIS DESKTOP', 2018, 'SAINS DAN TEKNOLOGI', 4, 'Penyampaian materi yang monoton yang digunakan oleh guru dalam\r\nmengajar akan membuat anak akan merasa bosan untuk belajar. Terkhusus dalam\r\npembelajaran pengembangan nilai agama dan moral seperti contoh saat proses\r\nbelajar berlangsung hanya sebagian anak yang ikut belajar karena perhatian anakanak\r\ntidak fokus, suka mengganggu temannya yang lain, dan masih banyak anak\r\nyang belum dapat menghafal doa sehari- hari yang sudah diajarkan oleh gurunya.\r\nBerdasarkan latar belakang tersebut, peneliti membuat media pembelajaran nilai\r\nagama dan moral berbasis desktop, yang memberikan kemudahan bagi guru\r\npendidikan anak usia dini (PAUD) dalam proses pembelajarannya agar dapat\r\nberjalan dengan efektif.\r\nJenis peneltian yang digunakan adalah metode penelitian deskriptif\r\nkualitatif, jenis penelitian deskriptif yang digunakan adalah Design and Creation\r\nSedangkan metode pengumpulan data yang digunakan adalah menggunakan\r\nmetode pengumpulan data wawancara, dokumentasi, studi literatur dan observasi.\r\nMetode perancangan yang digunakan adalah Waterfall dan Teknik pengujian\r\nmenggunakan blackbox.\r\nHasil dari pengujian aplikasi ini menyimpulkan bahwa fungsi yang diharapkan\r\nsemuanya berhasil dan diterima sesuai dengan keinginan. Kesimpulannya bahwa\r\nmedia pembelajaran ini berbasis Desktop diharapkan dapat membantu proses\r\npembelajaran agar lebih mudah dan menarik minat anak untuk belajar.\r\nKata Kunci : Pembelajaran, PAUD, Desktop.'),
(35, 'Penerapan Logika Fuzzy Pada Sistem Pendukung Keputusan Bantuan Siswa Miskin (BSM) di SDN 106 Pinceng Pute', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatarbelakangi dengan adanya kebijakan Pemerintah dalam meningkatkan mutu Pendidikan dengan meliputi pelaksanaan wajib belajar untuk anak usia 6-21 Tahun yang saat ini tengah diupayakan Kementerian Pendidikan dan Kebudayaan (Kemendikbud). Dengan adanya upaya Pemerintah dalam memberikan akses Pendidikan kepada Kelompok masyarakat yang selama ini kurang dapat menjangkau layanan pendidikan maka dibuatlah suatu program bantuan beasiswa miskin yang diharapkan dapat menjangkau segenap lapisan masyarakat kurang mampu. Di SD Negeri 106 Pinceng Pute terkadang ditemukan adanya pemberian bantuan yang tidak tepat sasaran. Dikarenakan dalam proses pemberiannya masih berdasarkan atas dasar pengamatan terhadap kondisi calon penerima bantuan. Baik itu pengamatan secara langsung maupun hanya berdasarkan masukan - masukan dari pihak yang dipercaya. Rumusan masalah dari penelitian ini adalah Bagaimana merancang aplikasi sistem pendukung keputusan dalam pemberian bantuan beasiswa miskin di SD Negeri 106 Pinceng Pute. Adapun tujuan dari penelitian ini diharapkan dapat menghasilkan rancangan sistem aplikasi yang dapat membantu dalam proses pengambilan keputusan pemberian bantuan beasiswa miskin.\r\nPenelitian ini menggunakan jenis penelitian kuantitatif dengan konsep perhitungan persentase, rata-rata, ehi kuadrat, dan juga perhitungan statistik lainnya, sedangkan metode pengumpulan data yang digunakan yaitu wawancara yang dilakukan melalui tatap muka dan tanya jawab langsung antara pengumpul data dengan narasumber / sumber data. Analisis yang dilakukan mencakup analisis sistem dan analisis aplikasi..\r\nDari penelitian ini menghasilkan perancangan dan aplikasi pendukung keputusan dalam pemberian bantuan beasiswa miskin. Penelitian ini menyimpulkan aplikasi yang dibangun dapat memberikan kemudahan dan membantu pihak sekolah khususnya SD Negeri 106 Pinceng Pute dalam proses pemberian bantuan beasiswa miskin.\r\nKata Kunci: Logika Fuzzy, Mamdani, Sistem Pendukung Keputusan, Beasiswa.'),
(36, 'RANCANG BANGUN APLIKASI SISTEM PAKAR DIAGNOSA PENYAKIT INFEKSI SALURAN PERNAPASAN AKUT (ISPA) DENGAN METODE FORWARD CHAINING', 2018, 'SAINS DAN TEKNOLOGI', 1, 'aktivitas sehari-hari, karena siapa saja dapat mengalami gangguan kesehatan. Salah satu penyakit yang banyak diderita oleh masyarakat yaitu penyakit infeksi saluran pernapasan akut (ISPA). ISPA adalah infeksi yang mengganggu proses pernapasan seseorang. Infeksi ini umumnya disebabkan oleh virus yang menyerang hidung, trakea, atau bahkan paru-paru.\r\nUntuk mendiagnosis penyakit ISPA biasanya hanya dapat dilakukan oleh seorang dokter ahli penyakit dalam. Namun dengan berkembangnya teknologi memungkinkan seorang awam juga dapat melakukan diagnosa awal dengan bantuan sistem pakar. Sistem pakar adalah sebuah program komputer yang meniru proses pemikiran dan pengetahuan pakar dalam menyelesaikan suatu masalah tertentu.\r\nTujuan dari dibuatnya Sistem Pakar Diagnosa Penyakit Infeksi Saluran Pernapasan Akut (ISPA) adalah untuk merancang dan membuat sistem pakar yang mampu mendiagnosa penyakit ISPA pada seseorang serta memberikan pengetahuan dan informasi tentang ISPA.\r\nMetode yang digunakan dalam penelitian ini adalah metode Forward chaining untuk menentukan jenis–jenis penyakit yang diderita oleh pasien. Input yang dibutuhkan adalah gejala–gejala yang dialami oleh pasien. Basis pengetahuan dibangun dengan menggunakan kaidah produksi (IF – THEN). Output dari hasil diagnosa penyakit ini merupakan penyakit yang diderita. Tahapan pengembangan sistem pakar yang digunakan adalah penilaian, koleksi pengetahuan, perancangan, test, dokumentasi dan pemeliharaan. Dalam perancangan Sistem Pakar ini, penulis mengunakan beberapa alat bantu yang di gunakan yaitu Flowchart, sistem ini dikembangkan dengan pemrograman Netbeans, notepad++, dan Dreamweafer.\r\nDari hasil penelitian dihasilkan sebuah sistem pakar. diagnosa penyakit Infeksi Saluran Pernapasan Akut (ISPA) yang dapat memberikan kemudahan kepada masyarakat untuk mendapatkan informasi tentang gejala-gejala dan Penyakit Infeksi Saluran Pernapasan Akut (ISPA) yang diderita berdasarkan pengetahuan pakar.\r\nBerdasarkan hasil pengujian, dapat disimpulkan bahwa program sistem pakar ini berjalan dengan baai dan layak untuk digunakan oleh user.\r\nKata Kunci : Sistem Pakar, ISPA, Forward Chaining'),
(37, 'SISTEM PAKAR KESESUAIAN PASAL UU KUHP DENGAN KASUS PERDATA YANG DIAJUKAN PADA PENGADILAN KASUS PERDATA YANG DIAJUKAN PADA PENGADILAN AGAMA TAKALAR ', 2018, 'SAINS DAN TEKNOLOGI', 4, 'Indonesia merupakan salah satu negara hukum di dunia. Berbagai lembaga\r\nyang bergerak dibidang hukum pun sekarang banyak di dirikan di negara Indoneia.\r\nDalam hal ini pemerintah Indonesia sekarang sedang ingin menegakkan hukum yang\r\nseadil-adilnya. Salah satu hukum yang saat ini dapat kita ketahui yaitu hukum perdata\r\nyang merupakan aturan-aturan hukum yang mengatur tingkah laku setiap orang\r\nterhadap orang lain yang berkaitan dengan hak dan kewajiban yang timbul dalam\r\npergaulan masyarakat maupun pergaulan keluarga contohnya, hukum perkawinan,\r\nhubungan anatar suaimi dan istri,hubungan antara wali dan anak, harta benda,\r\nperceraian.\r\nNamun dengan adanya perkembangan teknolgi memungkinkan proses\r\npengajuan masalah atau kasus-kasus yang diajukan sesuai dengan pasal dan ayatnya\r\ndapat dilakukan dengan mudah. Salah satu sistem pakar yang membantu hakim\r\nmelakukan proses kesesuaian pasal yakni sistem pakar yang khusus dalam\r\nmenyesuaiakan pasal-pasal.\r\nSistem pakar kesesuaian pasal merupakan sistem pakar yang menyesuaikan\r\npasal ke dalam sistem dan menggunakan metode forward chaining sebagai metode\r\npenelusurannya, dimana sistem melakukan penelusuran yang diawali dari fakta-fakta\r\nyang diberikan user kemudian dicari rule yang sesuai dengan pasal-pasal yang ada.\r\nSetelah itu diadakan hipotesis untuk memperoleh kesimpulan. Sistem pakar ini\r\nnantinya akan menghasilkan keluaran/outputyang berupa hasil diagnosa dan cara\r\npenanganan jenis pasal-pasal tersebut.\r\nKata Kunci :Aplikasi, Sistem Pakar,Pasal, Forward Chaining'),
(38, 'APLIKASI VIRTUAL GUIDE PADA PENANGKARAN SATWA LANGKA DI BONTOMARANNU EDUCATION PARK BERBASIS MOBILE', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Penangkaran atau yang disebut dengan konservasi adalah objek pembiakan\r\nsatwa dan flora di luar habitat (tempat aslinya) dengan campur tangan (budidaya)\r\nmanusia. Penangkaran merupakan usaha/kegiatan untuk memperbanyak melalui\r\npengembangbiakan dan pembesaran tumbuhan atau hewan dengan tetap\r\nmempertahankan kemurnian aslinya.\r\nSalah satu penangkaran yang ada di Sulawesi selatan tepatnya terletak di\r\nkabupaten gowa yakni Bontomarannu Education Park. Di penangkaran tersebut\r\nberbagai macam satwa yang dilindungi seperti anoa, rusa, kasuari dll. Untuk\r\nmemudahkan wisatawan dalam melakukan kunjungan maka di buatlah aplikasi\r\nVirtual Guide untuk memudahkan wisatawan untuk menglilingi penangkaran\r\ntersebut.\r\nMetode penelitian pada penelitian ini adalah penelitian Deskriptif dimana\r\nstrategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan\r\nmetode pengumpulan data observasi dan studi literatur. Metode perancangan yang\r\ndi gunakan adalah Black Box. Berdasarkan masalah yang ada di rancang sebuah\r\naplikasi Virtual Guide pada penangkaran satwa di Bontomarannu Education park\r\nberbasis Mobile.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah\r\ndigunakan, memberikan informasi yang lebih baik.\r\nKata Kunci: Konservasi Satwa, Virtual Guide, Mobile, Android.'),
(39, 'RANCANG BANGUN SISTEM PENILAIAN KINERJA ANGGOTA POLRI PADA KEPOLISIAN RESORT BARRU BERBASIS WEB', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Penilaian kinerja (performance appraisal), juga disebut tinjauan kinerja, evaluasi kinerja, atau penilaian pegawai kepolisian, adalah upaya menilai prestasi dengan tujuan meningkatkan produktivitas Instansi. Sistem Manajemen Kinerja yang selanjutnya disingkat SMK adalah sistem yang digunakan untuk mengidentifikasi dan mengukur kinerja pegawai negeri pada Polri agar selaras dengan visi dan misi organisasi. Minimnya akses dalam melakukan penilain kinerja anggota polri dan pengumpulan data yang ada diresort Barru.\r\nPenelitian ini bertujuan untuk merancang sebuah website untuk Sistem Penilaian Kineja Anggota Polri Sektor Barru sebagai media untuk memudahkan anggota Polri dalam pengisisan penialain terhadap anggota maupun atasan yang ada di Kabupaten Barru dengan mengakses secara online.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi design and creation sedang metode pengumpulan data yang digunakan yaitu observasi. Adapun metode perancangannya menggunakan Data Flow diagram (DFD). Analisis yang dilakukan mencakup analisis masalah, analisis sistem dan analisis kebutuhan. Sistem ini mencakup beberapa konten yaitu data penilaian, hasil penilaian, dan data rekapitulasi penilaian yang ada di Satuan Kerja Polres Barru. Hasil dari pengujian sistem ini diharapkan dapat membantu Kepolisian dalam Sistem Kinerja dan dapat lebih Efektif dalam melakuakan Penialain setiap rekan maupun pejabat penilai.\r\nKata Kunci : Polres Barru, Polri, Informasi, Website.'),
(40, 'SISTEM PAKAR PENDETEKSI DINI GANGGUAN EMOSIONAL DAN PERILAKU PADA ANAK BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Penilaian kinerja (performance appraisal), juga disebut tinjauan kinerja, evaluasi kinerja, atau penilaian pegawai kepolisian, adalah upaya menilai prestasi dengan tujuan meningkatkan produktivitas Instansi. Sistem Manajemen Kinerja yang selanjutnya disingkat SMK adalah sistem yang digunakan untuk mengidentifikasi dan mengukur kinerja pegawai negeri pada Polri agar selaras dengan visi dan misi organisasi. Minimnya akses dalam melakukan penilain kinerja anggota polri dan pengumpulan data yang ada diresort Barru.\r\nPenelitian ini bertujuan untuk merancang sebuah website untuk Sistem Penilaian Kineja Anggota Polri Sektor Barru sebagai media untuk memudahkan anggota Polri dalam pengisisan penialain terhadap anggota maupun atasan yang ada di Kabupaten Barru dengan mengakses secara online.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi design and creation sedang metode pengumpulan data yang digunakan yaitu observasi. Adapun metode perancangannya menggunakan Data Flow diagram (DFD). Analisis yang dilakukan mencakup analisis masalah, analisis sistem dan analisis kebutuhan. Sistem ini mencakup beberapa konten yaitu data penilaian, hasil penilaian, dan data rekapitulasi penilaian yang ada di Satuan Kerja Polres Barru. Hasil dari pengujian sistem ini diharapkan dapat membantu Kepolisian dalam Sistem Kinerja dan dapat lebih Efektif dalam melakuakan Penialain setiap rekan maupun pejabat penilai.\r\nKata Kunci : Polres Barru, Polri, Informasi, Website.'),
(41, 'RANCANG BANGUN ALAT PENGUKUR BERAT BADAN DAN TINGGI BADAN BALITA DENGAN METODE ANTROPOMETRI BERBASIS ARDUINO UNO', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Penelitian ini bertujuan untuk merancang alat pengukur berat badan dan\r\ntinggi badan balita denganmetode indeks antropometri berbasis arduino uno.\r\nRancangan alat ukur adalah suatu kegiatan untuk memudahkan orang tua\r\nmengetahui kondisi badan. Sehingga dapat mencegah terjadinya\r\npenyakit yang di alami pada balita tersebut. Dengan menggunakan alat\r\npengukur yang merupakan salah satu piranti mekanik yang mampu melakukan\r\npekerjaan manusia secara otomatis dengan hasil yang cepat. Proses pendeteksi\r\npada kesehatan balita dengan menggunakan sensor ultrasonik yang berfungsi\r\nuntuk mengetahui tinggi atau panjang badan balita dan sensor load cell untuk\r\nmengetahui berat badan balita, Kemudian LCD (Liquid Crystal Display) yang\r\nmenampilkan hasil dari sensor ultrasonik dan sensor load cell dan arduino uno\r\nsebagai komponen utama untuk menghasilkan data ideal, kurang ideal, dan\r\nobesitas pada balita.\r\nMetode penelitian yang digunakan adalah penelitian pengembangan atau\r\nResearch and Development (R&D). Penelitian ini dilakukan dengan beberapa\r\nlangkah, yakni: identifikasi potensi dan masalah, pengumpulan informasi, desain\r\nproduk, pembuatan produk, validasi ahli, revisi produk, uji coba, produksi akhir.\r\nHasil penelitian ini adalah sebuah alat pengukur berat badan dan tinggi\r\nbadan balita dengan metode indeks antropometri berbasis arduino uno dengan 2\r\nsensor ultrasonik sebagai penghitung tinggi dan panjang, dan 1 sensor load cell\r\nsebagai penghitung berat badan pada balita yang nantinya akan di tampilkan pada\r\nlayar LCD.\r\nKata kunci : Berat badan dan tinggi badan, Antropometri, Arduino uno.'),
(42, 'RANCANG BANGUN SISTEM PENGENDALI SUHU KELEMBABAN DAN CAHAYA PADA RUMAH WALET BERBASIS MIKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Burung walet merupakan ternak unggas yang dibudidayakan dengan sarang sebagai produksi utama. Terdapat beberapa jenis burung walet salah satunya adalah Collocalia fuciphaga, spesies ini merupakan walet yang mampu menghasilkan sarang berwarna putih. Penggunaan sarang burung walet untuk berbagai keperluan menjadikan peternak memiliki peluang usaha yang cukup baik. Produksi sarang burung walet dipengaruhi oleh kondisi lingkungannya. Kondisi ini terdiri dari suhu, kelembaban dan cahaya pada tempat tinggal burung walet.\r\nKemajuan ilmu pengetahuan dan teknologi, pada prinsipnya dapat diterapkan untuk mengatasi masalah tersebut, yaitu dengan membuat alat pengendali suhu, kelembaban dan cahaya yang bekerja secara elektronik. Suhu dan kelembaban pada rumah walet dapat dideteksi dengan menggunakan sensor DHT11, sedangkan cahaya yang ada di dalam ruangan dapat dideteksi dengan sensor LDR, yang kemudian diproses oleh mikrokontroler Arduino Uno R3 dan ditampilkan dalam bentuk output berupa penyemprotan air dari spray dan tirai yang dapat terbuka dan tertutup pada jendela.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan konsep eksperimental, sedangkan metode pengumpulan data yang digunakan yaitu mengamati langsung kepada objek penelitian rumah burung walet di desa bontobangun, kelurahan palampang, kecamatan rilau ale, kabupaten bulukumba dan pengujian yang dilakukan adalah pengujian blackbox yang berfokus pada persyaratan fungsional perangkat lunak Adapun metode perancangan yaitu prototype.\r\nHasil dari penelitian ini adalah sebuah sistem yang dapat mengendalikan konsidi suhu, kelembaban dan cahaya pada rumah walet. Hasil dari pengujian rancangan alat ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan keinginan.\r\nKata Kunci : Burung walet, Sensor DHT11, Sensor LDR, Arduino Uno R3'),
(43, 'Rancang Bangun Sistem Pencegah Kemacetan Pada Jalur Maros- Bone Menggunakan Mikrokontroler', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Penelitian ini dilatar belakangi oleh kemacetan, situasi atau keadaan\r\ntersendatnya atau bahkan terhentinya lalu lintas yang disebabkan oleh banyaknya\r\njumlah kendaraan melebihi kapasitas jalan. Terutama yang tidak mempunyai\r\ntransportasi publik yang baik atau memadai ataupun tidak seimbangnya kebutuhan\r\njalan dengan kepadatan penduduk. Kemacetan bukan hanya terjadi dikota besar\r\nnamun kemacetan juga banyak di jumpai didaerah, termasuk pada jalur penghubung\r\nantar kabupaten Maros dan kabupaten Bone di provinsi Sulawesi Selatan. Yang\r\ndimana pada jalur tersebut, banyak kendaraan besar yang melintas sedangkan jalur\r\nyang dilalui sempit dan berkelok kelok sehingga seringkali terjadi kemacetan.\r\nMengacu dari hal tersebut dibutuhkan suatu alat yang dapat memberikan informasi\r\nkepada para pengguna jalan sehingga dapat mengetahui kondisi kendaraan yang\r\nsedang melaju di sisi lain. Tujuan dari penelitian ini adalah merancang alat yang\r\ndapat digunakan untuk mendeteksi ukuran kendaraan yang melintas di jalur poros\r\nMaros-Bone. Alat ini menggunakan sensor ping untuk mendeteksi ukuran kendaraan\r\napakah tergolong kendaraan yang berukuran besar atau kendaraan yang berukuran\r\nkecil lalu di tampilkan melalui LCD dan penanda oleh LED.\r\nHasil dari penelitian ini adalah sistem dapat mengenali ukuran kendaraan yang\r\nlewat, sehingga mempermudah bagi pengguna untuk menghindari kemacetan\r\nkhususnya dan resiko kecelakaan pada umumnya.\r\nKata Kunci: Mikrokontroller, jalur poros Maros-Bone, ukuran kendaraan, sensor\r\nping, LCD, LED.'),
(44, 'RANCANG BANGUN SMARTHOME MENGGUNAKAN CHAT BOT TELEGRAM BERBASIS ARDUINO', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Permasalahan kontrol rumah jarak jauh adalah permasalahan yang biasa dirasakan oleh\r\nmanusia. Dimana orang-orang yang memiliki aktivitas setiap hari susah dalam\r\nmengontrol rumah. Penelitian ini bertujuan mengendalikan rumah dengan jarak jauh\r\nyang dapat mengakses atau mengendalikan perangkat rumah dari jarak jauh\r\nmenggunakan aplikasi telegram. Data yang diterima dan dikirim lewat user akan\r\nmasuk ke sistem yang telah terintegrasi dengan perangkat Arduino dan wemos d1\r\nmini sebagai pusat kendali dari seluruh sistem yang ada, sehingga memungkinkan\r\nuser mengendalikan ataupun mengawas rumah dari jarak jauh dengan mudah dan\r\ntanpa mengeluarkan banyak biaya.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nSistem ini dirancang menggunakan mikrokontroler arduino uno. Terdapat tiga\r\npoin penting yang menjadi fokus dalam penelitian ini yaitu yang pertama\r\nmengendalikan lampu jarak jauh, yang kedua memantau kondisi sebuah ruangan\r\nmenggunakan wemos d1 mini dan yang ketiga yaitu memantau kondisi buka tutup\r\npintu. Untuk komunikasi antara mikrokontroler ke Android melalui aplikasi\r\ntelegram.\r\nKata kunci : Smarthome, Arduino, Wemos D1 Mini, Smartphone Android'),
(45, 'RANCANG BANGUN SISTEM PENGEREMAN OTOMATIS DAN BLIND SPOT WARNING PADA SEPEDA MOTOR BERBASIS ARDUINO UNO', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Teknologi alat transportasi hari ke hari semakin meningkat, namun resiko mengalami kecelakaan tetap ada dan tidak bisa dihindari. Khususnya sepeda motor yang memiliki angka kecelakan terbesar. Indonesia sendiri merupakan negara dengan pengguna sepeda motor yang sangat tinggi, hal ini juga yang membuat Indonesia menempati peringkat ke lima dunia sebagai negara dengan tingkat kecelakaan lalu lintas tertinggi. Adapun tujuan dari penelitian ini adalah merancang sistem pengereman otomatis dan blindspot warning pada sepeda motor untuk membantu mengurangi risiko kecelakaan dan mempermudah pengendara sepeda motor menerapkan budaya berkendara yang baik dan aman.\r\nJenis penelitian yang digunakan adalah jenis penelitian kualitatif dengan metode eksperimental. Hasil dari penelitian ini adalah alat yang diintegrasikan pada helm sebagai peringatan blind spot dan sepeda motor untuk menjalankan sistem pengereman otomatis. Kesimpulan dari penelitian ini adalah dari hasil pengujian yang didapatkan, sensor dapat mendeteksi jarak hingga 300 cm, pada sisi kanan dan kiri sepeda motor, output berupa buzzer saat sensor mendeteksi objek. Pada bagian depan, sensor juga dapat mendeteksi jarak hingga 300 cm dengan output berupa system pengereman otomatis yang ditarik oleh Motor DC.\r\nKata kunci: Sepeda Motor, Pengereman, Blindspot.'),
(46, 'Rancang Bangun Alat Pengering dan Pengupas Kulit Kacang Hijau berbasis Mikrokontroler', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Di Indonesia, kacang hijau adalah sejenis tanaman budidaya dan palawija yang dikenal luas di daerah tropika. Tumbuhan yang termasuk suku polong-polongan (Fabaceae) ini memiliki banyak manfaat dalam kehidupan sehari-hari sebagai sumber bahan pangan berprotein nabati tinggi. Namun proses pengolahan kacang hijau pasca panen membutuhkan waktu yang cukup lama dikarenakan petani masih mengandalkan sinar matahari dalam proses pengeringan kacang hijau yang memakan waktu 2-3 hari.\r\nPenelitian ini bertujuan untuk merancang dan membangun alat pengering dan pengupas kulit kacang hijau berbasis mikrokontroler sebagai solusi bagi para petani kacang hijau dalam mengolah kacang hijau pasca panen sehingga memudahkan dalam menghasilkan biji kacang hijau dengan waktu yang relatif singkat.\r\nAlat ini dibangun menggunakan Arduino Uno sebagai sistem kendali alat, motor DC sebagai penggerak tabung dan juga dilengkapi sensor kapasitif yang berfungsi mendeteksi kelembaban kacang hijau. Jenis penelitian yang digunakan adalah penelitian kualitatif dengan konsep eksperimental. Pengujian yang dilakukan adalah pengujian blackbox. Hasil dari penelitian ini adalah sebuah prototype alat yang berfungsi untuk menghasilkan biji kacang hijau melalui proses pengeringan dan pengupasan secara otomasi.\r\nKata kunci: Kacang Hijau, Arduino Uno, Motor DC, Sensor Kapasitif, Blackbox, Prototype, Otomasi.'),
(47, 'RANCANG BANGUN SISTEM PENGERING VANILI BERBASIS MIKROKONTROLER (Studi Kasus Petani Vanili di Kabupaten Enrekang, Sulawesi Selatan)', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Indonesia merupakan salah satu negara pengekspor vanili terbesar di dunia, namun ironisnya Indonesia masih belum mampu memenuhi kebutuhan pasar internasional. Salah satu alasannya adalah tak lain karena vanili yang dihasilkan para petani Indonesia masih bersifat konvensional sehingga kurang maksimal kualitasnya untuk di ekspor. Adapun tujuan dari penelitian ini adalah merancang dan membangun sistem pengering vanili dengan menggunakan arduino sehingga memudahkan dan mempercepat proses pengeringan vanili untuk menghasilkan vanili yang berkualitas baik sesuai standar ISO dan Standard Nasional.\r\nJenis penelitian yang digunakan adalah jenis penelitian kualitatif dengan metode eksperimental. Hasil dari penelitian ini adalah alat pengering vanili. Kesimpulan dari penelitian ini adalah dari beberapa sampel yang telah diuji maka didapatkan kadar air pada vanili sebesar 20-35 %. yang telah sesuai dengan standar International Standard Organisation (ISO) dan Dewan Standardisasi Nasional.\r\nKata kunci: Agraris, Vanili, Pengering.'),
(48, 'RANCANG BANGUN ALAT PENGHITUNGAN BENIH IKAN NILA MENGGUNAKAN PHOTODIODE DAN INFRARED LED BERBASIS ARDUINO UNO', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Seiring dengan meningkatnya jumlah penduduk dunia, dan juga kebutuhan\r\nakan bahan pangan yang bergizi lebih baik, permintaan ikan terus meningkat dari\r\ntahun ke tahun. Permintaan ikan yang meningkat tentunya memiliki makna positif\r\nbagi pengembangan perikanan, terlebih bagi negara kepulauan seperti Indonesia\r\nyang memiliki potensial perairan yang cukup luas dan memiliki potensi untuk\r\npengembangan perikanan .\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan konsep\r\nsaintifik, sedangkan metode pengumpulan data yang digunakan yaitu observasi dan\r\nwawancara pada pengusaha pembenihan ikan nila CV. Sahabat Ikan Makassar dan\r\nmetode pengujian yang dilakukan adalah pengujian Blackbox yang berfokus pada\r\nfungsi khusus pada alat yang dirancang.adapun metode perancangan yaitu\r\nPrototype.\r\nHasil dari penelitian ini adalah sebuah alat yang dapat membantu pengusaha\r\npembenihan ikan nila dalam menghitung pesanan benih ikan mereka. Hasil dari\r\npengujian alat ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil\r\nsesuai dengan keinginan.\r\nKata Kunci : Benih, Ikan Nila, Pengusaha Pembenihan Ikan, Photodiode, Infrared\r\nLED, Arduino Uno.'),
(49, 'RANCANG BANGUN ROBOT PENANAM BENIH JAGUNG OTOMATIS BERBASIS M IKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Indonesia adalah negara agraris yang memiliki potensi alam dibidang\r\npertanian. Ada juga mereka para petani yang menanam jagung di kebun. Dewasa\r\nini, sebagian besar petani jagung masih menanam benih dengan menggunakan\r\nmetode konvesional yang membutuhkan banyak tenaga dan operator (manusia).\r\nPenelitian ini bertujuan untuk merancang sebuah robot penanam otomatis.\r\ndimana petani tidak perlu lagi menggunakan tenaga manusia untuk penanaman\r\nbenihnya. Proses ini dilakukan secara otomatis dan lebih mudah digunakan oleh\r\npetani, Dengan mikrokontroller Arduino Uno sebagai sebagai kompoenen utama.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah robot penanam benih jagung otomatis\r\ndengan 6 sensor photodioda sebagai pembaca garis sekaligus jalur pada lahan\r\ntanam, dan Motor Servo sebagai pengontrol gerak pada lengan penanam robot.\r\nKata kunci : Robot Penanam Otomatis, Sensor Photodioda, Arduino Uno,\r\nMotor Servo, Petani Jagung.'),
(50, 'RANCANG BANGUN ALAT PEMISAH SEDIMEN DAN SAMPAH BERBASIS MIKROKONTROLLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Sistem pengangkutan sedimen dan sampah pada kanal yang ada saat ini mempunyai kelemahan dari sisi kontrol maupun perilaku. Pengangkutan sedimen dan sampah pada kanal harus menggunakan alat berat yang membutuhkan tenaga dan waktu yang begitu banyak, sehingga terkadang kondisi sedimen dan sampah pada kanal terabaikan. Tujuan dari penulisan ini adalah merancang suatu model prototype alat pengangkut sedimen dan sampah pada kanal yang dirancang untuk mempermudah pengangkutan sedimen dan sampah pada kanal serta mengefisienkan waktu. Sistem ini dibangun menggunakan beberapa komponen seperti Motor DC, Switch, Power Supply dan Mikrokontroller Arduino Uno 328 sebagai kontrol utama sistem.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Penelitian ini menggunakan metode pengumpulan data observasi, studi literatur, dan wawancara. Teknik pengujian yang digunakan adalah Black Box.\r\nHasil penelitian ini berupa sebuah alat prototype yang dapat mengangkut sedimen dan sampah pada kanal yang akan sangat membantu dalam mengefisienkan waktu menangani masalah sampah dalam proses pengangkutannya pada kanal.\r\nKata kunci : Mikrokontroller, Ardiuno Uno 328, Sensor Proximity, Pengangkut Sedimen dan Sampah Pada Kanal.'),
(51, 'Rancang Bangun Sistem Parkir Valet Otomatis Menggunakan Robot Line Follower', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Masalah perparkiran adalah salah satu permasalahan kompleks yang banyak ditemui di kota-kota besar, dimana jumlah kendaraan tidak sesuai dengan lahan parkir yang disediakan termasuk di kantor maupun di tempat-tempat umum lainnya. Penelitian ini bertujuan untuk merancang sistem parkir valet otomatis dengan bantuan robot line follower. Sistem parkir valet adalah suatu kegiatan untuk memarkirkan kendaraan yang dibantu oleh petugas, sehingga tidak perlu lagi pemilik kendaraan untuk mencari tempat parkir karena sudah dilakukan oleh petugas parkir. Dengan menggunakan robot parkir yang merupakan salah satu mobile robot yang dirancang untuk dapat memarkirkan kendaran dengan cepat pada suatu arena yang telah ditentukan. Proses pendeteksian adanya kendaraan yang terparkir menggunakan infrared sensor dan dibuatkan alat sistem untuk menampilkan kondisi parkir. mikrokontroller Atmega32 sebagai kontrol gerak robot, Arduino Uno sebagai kontrol pengangkat kendaraan dan Arduino Mega 2560 sebagai alat sistem informasi robot.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah robot parkir dengan 10 sensor photodioda sebagai pengikut garis yang digunakan untuk memarkirkan kendaraan pada lokasi-lokasi parkir yang masih kosong dan dibuatkan alat sistem informasi agar dapat mengetahui kondisi tempat parkir dengan pembacaan sensor inframerah yang dapat mengetahui adanya kendaraan yang parkir atau tidak sehingga dapat diketahui lokasi parkiran yang masih kosong.\r\nKata kunci : Parkir Valet, Robot Parkir, Infrared Sensor, Arduino Uno, Arduino Mega 2560, Atmega32.'),
(52, 'PERANCANGAN ALAT PERAGA PENGENALAN HURUF BRAILLE BERBASIS MIKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Memiliki kondisi fisik yang cacat bukanlah hal yang diinginkan oleh\r\nsetiap individu karena harus menjalani hidup dengan keterbatasan fisik,\r\nsehingga dapat menghambat sebagian aktivitas yang harus dilakukan\r\nlayaknya individu dalam kondisi normal, salah satunya adalah tunanetra.\r\nTunanetra tetap berhak memperoleh haknya sebagai manusia, termasuk hak\r\natas medapatkan ilmu dengan belajar membaca.\r\nSistem perancangan alat peraga huruf Braille ini adalah salah satu\r\nalat bantu pembelajaran yang dibuat untuk tunanetra yang dapat digunakan\r\nsebagai salah satu alternatif media pembelajaran yang dimiliki oleh\r\ntunanetra. Proses pembelajaran dilakukan dengan mengenalkan huruf dan\r\nangka Braille menggunakan button, mp3 shield untuk membaca file mp3\r\ndari dan solenoid disesuaikan dengan pola huruf Braille yang telah\r\ndisisipkan dalam program. Mikrokontroler yang digunakan adalah\r\nmikrokontroler Arduino Mega sebagai kontrol utama sistem.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan\r\nadalah penelitian deskriptif kualitatif dengan metode eksperimental yang\r\nbertujuan untuk memahami fenomena – fenomena sosial sebelum\r\nmelakukan perancangan. Adapun tahapan tahapan dalam sistem ini adalah\r\nmenggambarkan flowchart dan blok digram untuk gambaran atau alur kerja\r\nsistem yang akan dibuat dan diuji menggunakan metode pengujian\r\nblackbox.\r\nHasil penelitian ini adalah alat yang dapat membantu tunanetra\r\nuntuk mengenal pola angka dan huruf Braille berbasis mikrokontroler.\r\nKata Kunci : Alat Peraga, Huruf Braille, Mp3 Shield,\r\nSolenoid, dan Arduino Mega 256'),
(53, 'RANCANG BANGUN ALAT PENDETEKSI GOLONGAN DARAH SERTA PENGUKUR KANDUNGAN GULA DARAH, KOLESTEROL, DAN ASAM URAT BERBASIS ARDUINO', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Proses Pengujian dan pengamatan reaksi aglutinasi/non-aglutinasi dari sel\r\ndarah merah yang telah diberi antisera/ serum untuk menentukan golongan darah\r\ndan rhesus seseorang selama ini masih dilakukan oleh orang yang berpengalaman\r\ndengan mengandalkan kemampuan mata secara langsung. Sementara itu, mata\r\nsangat dipengaruhi oleh faktor kejenuhan atau kelelahan. Sehingga cara ini kurang\r\nmenguntungkan untuk pengujian sampel darah dalam jumlah yang banyak.\r\nPada penelitian ini dirancang sebuah alat yang dapat membaca golongan\r\ndarah manusia secara elektronik untuk memudahkan pengujian sampel darah\r\ndalam jumlah yang banyak. Pengujian golongan darah manusia pada alat ini\r\nmenggunakan Sistem ABO.\r\nAlat yang dirancang terdiri dari dua pasang sensor cahaya, yang dibangun\r\ndari komponen LDR, dan sistem pengontrol dari arduino. Alat tersebut akan\r\nmendeteksi terjadinya reaksi aglutinasi/ non-aglutinasi dari sampel darah yang\r\ndiuji dengan antisera melalui sensor. Alat yang dirancang juga dapat mendeteksi\r\ngula darah, kolestrol dan asam urat dengan menggunakan tambahan sensor PPG\r\ndimana darah yang dimasukkan akan di bandingkan dengan detak jantung\r\nSelanjutnya data dari sensor akan dikondisikan dan diolah langsung oleh arduino\r\ndan hasilnya ditampilkan pada LCD 4x20. Tingkat keberhasilan 88%.\r\nKata kunci : Golongan Darah, Gula Darah, Kolestrol, Asam Urat, Arduino\r\nMega 2560, PPG, LDR.'),
(54, 'RANCANG BANGUN ALAT BANTU BACA TUNANETRA BERBASIS RASPBERRY PI', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Alat bantu baca tunanetra ini adalah salah satu alat yang dibuat untuk\r\npenyandang tunanetra sebagai salah satu alternative minimnya media baca\r\ntunanetra khususnya buku cetak braille. Untuk memperoleh informasi dan\r\nmenambah keilmuan seorang penyandang Tunanetra tidak lagi bergantung pada\r\nbuku cetak braille. Dengan alat ini penyandang Tunanetra dapat membaca buku\r\nkonvensional yang dibaca manusia normal pada umumnya.\r\nDalam penelitian ini, jenis penelitian yang digunakan adalah penelitian\r\nkualitatif. Penelitian kualitatif yang dilakukan dengan metode eksperimental. Untuk\r\nmetode pengumpulan data dilakukan dengan observasi, wawancara dan studi\r\nliteratur. Adapun tahapan-tahapan dalam perencanaan sistem ini dilakukan dengan\r\nmenggambarkan flowchart dan blok diagram. Teknik pengujian dalam penelitian\r\nini menggunakan teknik pengujian Blackbox.\r\nAlat ini berhasil dibangun dengan Raspberry Pi sebagai mikrokontroller,\r\ndengan trigger dari Push Button sebuah Raspberry Pi Camera akan melakukan\r\ngraphical capture dan menghasilkan sebuah file gambar yang secara otomatis akan\r\ndiolah dengan proses Optical Character Recognition (OCR) dan dikonversi\r\nmenjadi ucapan/speech dengan proses Text to Speech (TTS). Hasil dari rentetan\r\nproses ini menghasilkan sebuah file mp3 untuk diperdengarkan kepada penyandang\r\ntunanetra melalui pengeras suara/speaker sehingga penyandang tunanetra dapat\r\nmembaca secara tidak langsung dari tulisan cetak dari sebuah kertas/halaman buku.\r\nKata Kunci : Rancang Bangun, Media Baca Tunanetra, Raspberry Pi, Raspberry\r\nPi Camera, Push Button, Optical Character Recognition (OCR), Text To Speech\r\n(TTS) dan Speaker'),
(55, 'SISTEM PENGAMANAN ATM BERBASIS MIKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Kasus pembobolan ATM saat ini semakin sering terjadi. Pembobolan bahkan terjadi tanpa kenal waktu, dahulu biasanya hanya terjadi saat malam hari, namun kini beberapa kasus pembobolan justru terjadi disiang hari. Meski pada prinsipnya pembobolan ATM ada banyak metode dan modusnya, dari yang paling sederhana dengan metode pembongkaran mesin dan yang paling canggih seperti skimming dan jackpotting. Dengan Berkembangnya modus – modus pembobolan yang terjadi, maka sangat diperlukan pula terjadinya perkembangan pada sisi pengamanan mesin ATM itu sendiri, untuk mengatasi hal tersebut maka dibuatlah sistem pengamanan memanfaatkan sms sebagai report alert ke kantor kepolisian untuk lebih mengefisienkan proses peringkusan pelaku.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian deskriptif kualitatif dengan metode eksperimental yang bertujuan untuk memahami fenomena – fenomena sosial sebelum melakukan perancangan. Adapun tahapan tahapan dalam sistem ini adalah menggambarkan flowchart dan blok digram untuk gambaran atau alur kerja sistem yang akan dibuat dan diuji menggunakan metode pengujian blackbox.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah alat Sistem pengamanan ATM dengan memanfaatkan sms kiriman dari sim900 sebagai report alert dan juga selenoid door lock sebagai pengunci otomatis berbasis arduino uno sebagai input/output data yang akan di proses. Dari hasil pengujian yang dilakukan oleh peneliti alat ini berfungsi dengan baik dan mampu mengatasi permasalahan yang selama ini dialami.\r\nKata Kunci : Pengamanan, Mesin ATM, Mikrokontroler Arduino, Sim900'),
(56, 'RANCANG BANGUN SISTEM PENGAMAN TANAMAN PALAWIJA DARI HAMA BABI HUTAN BERBASIS MIKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Petani palawija sering kali mengalami gagal panen akibat hama babi hutan yang sering kali merusak tanaman di perkebunan, oleh karena itu agar dapat meningkatkan hasil panen maka diperlukan solusi yang mampu membantu petani dalam menangani masalah ini, seperti perancangan alat yang berfungsi sebagai pengaman tanaman palawija yang mampu bekerja secara otomatis dalam melakukan proses pengamanan.\r\nMetode yang digunakan dalam penelitian ini adalah prototyping, yaitu memiliki keunggulan yang pengebangan yang mampu bekerja lebih baik dalam menentukan kebutuhan pengguna dan lebih efisien dalam pengembangan sistem.\r\nHasil dari penelitian ini yaitu terciptanya prototype sistem pengaman tanaman palawija dari hama babi hutan berbasis mikrokontroler\r\nKata kunci : Pengaman, Hama,Tanaman, Mikrokontroler, RTC.'),
(57, 'APLIKASI PEMERIKSAAN PARU-PARU DENGAN METODE AUSKULTASI BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Salah satu cara yang digunakan dokter untuk mendiagnosa paru-paru adalah\r\ndengan mendengar suara paru dengan menggunakan stetoskop. Teknik ini dikenal\r\ndengan teknik auskultasi. Suara paru yang dihasilkan pada beberapa kasus penyakit\r\nparu menunjukkan adanya pola tertentu yang bisa dikenali.\r\nTujuan penelitian ini adalah merancang suatu alat untuk mendengar suara\r\nparu-paru dengan menggunakan stetoskop akustik yang di modifikasi dengan\r\nmenempatkan sebuah mikropon kondenser di dalam pipa berongga stetoskop\r\nakustik untuk mengkonversi bunyi yang ditangkap oleh chestpiece menjadi sinyal\r\nlistrik. Dalam melakukan penelitian ini, jenis penelitian yang digunakan adalah\r\npenelitian kualitatif dengan metode eksperimental\r\nhasil penelitian penelitian ini berupa aplikasi pemeriksa paru-paru dengan\r\nmetode auskultasi berbasis android yang akan menghasilkan tampilan grafik dari\r\nsuara paru-paru yang telah direkam berserta informasi berupa durasi dan frekuensi\r\nyang akan memudahkan pengguna dalam melakukan pemeriksaan paru\r\nKata kunci : Stetoskop, Auskultasi, Suara paru-paru, Android'),
(58, 'APLIKASI VIRTUAL TOUR BERBASIS WEB SEBAGAI MEDIA PENGENALAN WILAYAH KAWASAN ADAT AMMATOA, KAJANG, DESA AMMA TOA, KECAMATAN KAJANG, KABUPATEN BULUKUMBA', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Kawasan adat Ammatoa adalah salah satu tempat wisata budaya yang ada di kecamatan Kajang, kabupaten Bulukumba. Ada banyak hal yang dapat dipelajari di kawasan adat Ammatoa, namun karena semakin banyaknya pengaruh budaya asing dan belum adanya website official untuk mengeksplor objek-objek budayanya membuat para pengunjung kurang tertarik untuk mengunjungi wisata budaya kawasan adat Ammatoa ini. Ada juga masyarakat yang memiliki minat dan ketertarikan akan kawasan adat Ammatoa, tetapi karena banyak tersebar mitos yang membuat kawasan adat Ammatoa seakan-akan suatu daerah yang menyeramkan saat dikunjungi, sehingga masyarakar luar menjadi ragu bahkan takut untuk berkunjung. Hal ini disebabkan karena kurangnya informasi yang lebih akurat mengenai kawasan adat Ammatoa, sehingga masyarakat luar menjadi keliru dalam menilai masyarakat adat Ammatoa. Untuk itu dibutuhkan beberapa solusi untuk menangani semua masalah tersebut, yaitu berupa teknologi yang memungkinkan seseorang untuk bisa merasakan dan memvisualisasikan informasi lebih detail dalam bentuk panorama 360. Tujuan dalam penelitian ini adalah untuk merancang Sistem Virtual Tour Pengenalan Budaya Kawasan Adat Ammatoa di Desa Tana Toa, Kecamatan Kajang, Kabupaten Bulukumba yang nantinya memudahkan pengunjung mengetahui objek–objek apa saja yang ada di kawasan adat Ammatoa.\r\n\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi literatur. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\n\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan kapan dan dimana saja karena diaplikasikan dalam bentuk web, memberikan informasi visual yang lebih baik daripada layanan sejenis, menyenangkan sehingga calon pengunjung tidak merasa bosan serta membantu meningkatkan pemahaman calon pengunjung. Akan tetapi performasi masih banyak kekurangan, dimana ketika dijalankan performa aplikasi masih belum stabil dan gambar panorama 360 yang belum jernih atau belum High Definition karena banyak faktor yang mempengaruhi.\r\n\r\nKata Kunci: Kawasan adat Ammatoa, Web, Virtual Tour.\r\n'),
(59, 'RANCANG BANGUN SISTEM PELAYANAN ADMINISTRASI JURUSAN TEKNIK INFORMATIKA UIN ALAUDDIN MAKASSAR', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatar belakangi oleh kendala-kendala yang terjadi di jurusan Teknik Informatika tentang berkas-berkas persuratan yang tidak teratur. Selama proses penginputan beberapa kendala yang paling sering dihadapi adalah para staff atau dosen sering sekali melupakan penomoran persuratan yang sudah diinput yang menyebabkan sistem administrasi tidak terkoordinir dengan baik sesuai dengan perencanaan sebelumnya.\r\nTindak lanjut tentang persuratan dan laporan yang tidak terkoordinir dengan baik, serta penginputan persuratan yang telah dilakukan operator jurusan Teknik Informatika masih mengalami kesulitan dalam pengaturan pengolahan laporan tidak sesuai dengan estimasi waktu yang diinginkan.Tujuan dari penelitian ini adalah untukmempermudah untuk pencarian berkas data-data mahasiswa serta mempermudah melakukan pembuatan persuratan baik dalam bentuk manual ataupun digital.Sehingga dapat menjadi media dalam menyampaikan informasi agar lebih mudah, cepat, dan efisien.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi design and creation sedangkan metode pengumpulan data yang digunakan yaitu observasi, wawancara, dan studi literatur.Analisis yang dilakukan mencakup analisis sistem dan analisis aplikasi. Aplikasi ini mencakup tiga konten yaitu info persuratan, format pengisian persuratan masuk dan keluar dan data penelitian pada jurusan Teknik Informatika. Sistem ini diuji menggunakan black box.Hasil dari pengujian sistem ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan keinginan. Kesimpulannya bahwa sistem administrasi digital iniadalah sebagai media untuk memberi kemudahan dalam proses pembuatan persuratan lebih mudah, lebih cepat, dan tepat.\r\nKata Kunci : Web, Administrasi Digital.');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(60, 'RANCANG BANGUN SMART BOX BRAILE SEBAGAI ALAT BANTU PENGINGAT BAGI PENYANDANG TUNANETRA', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Indera adalah kumpulan dari reseptor yang membentuk organ atau alat khusus yang terdapat pada tubuh manusia., salah satu yang terpenting adalah indera penglihatan. Apabila seseorang mengalami gangguan pada indera penglihatan, maka aktifitasnya akan jadi sangat terbatas karena informasi yang diperoleh akan berkurang dibandingkan yang berpenglihatan normal. Salah satu cara mendapat informasi adalah menggunakan indera pendengaran. namun media yang mendukung keterbatasan ini masih sangat terbatas. meskipun demikian, mereka tetap berhak memperoleh haknya sebagai manusia termasuk hak atas informasi dan beraktifitas.\r\nTujuan penelitian ini adalah untuk merancang sebuah alat dengan fungsi jam berupa angka Braile dengan fitur alarm sehingga dapat menyelesaikan masalah minimnya media informasi waktu bagi penyandang tunanetra. Dalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian kualitatif dengan metode eksperimental, karena melakukan pengembangan sebuah alat dan melakukan penelitian berupa eksperimen terhadap objek penelitian penulis. Hasil dari penelitian ini berupa alat bantu yang dapat mengingatkan waktu kepada penyandang tunanetra atau disebut Smart Box Braile.\r\nBerdasarkan uraian diatas, betapa pentingnya memperoleh informasi melalui indera penglihatan merupakan suatu hal yang urgen dalam kehidupan sehari-hari. untuk itu, dibuatlah sebuah media yang dapat membantu penyandang tunanetra untuk memperoleh informasi. Dalam hal ini, waktu.\r\nKata kunci : Tunanetra, Smart Box, Braile'),
(61, 'SISTEM PENGELOLAAN MANAJEMEN MASJID NURUL IMAN AL-KHAER DI KECAMATAN BONTOMARANNU KAB GOWA', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Masjid adalah pusat kegiatan ibadah bagi ummat islam. Selain sebagai tempat sholat 5 waktu masjid juga di berdayakan sebagai tempat kegiatan hari-hari besar islam, tempat pengelolaan zakat maupun tempat kajian dan diskusi keagamaan. Dimana kegiatan tersebut membutukan manajemen yang baik agar dapat menghasilkan informasi maupun data-data yang akurat untuk bisa di sampaikan pada masyarakat. Namun saat ini belum ada sistem pengelolaan masjid yang bisa mengatur seluruh kegiatan tersebut dengan baik, khususnya data keuangan yang masih berbentuk laporan manual begitupun data penerimaan zakat dan jadwal pembawaan ceramah yang sering kali berbenturan antara dua khatib dalam satu masjid karena kurangnya koordinasi.\r\nTujuan dari peneltian ini adalah membantu pengelolaan masjid dalam mengatur laporan keuangan,Informasi zakat maupun penjadwalan khatib dengan menggunakan sistem pengelolaan secara efektif dan efisien.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan menggunakan pendekatan seitifik, sedangkan metode pengumpulan data yang di gunakan yaitu observasi,wawancara dan studi literature, metode perancangan software yang digunakan pada penelitian ini adalah waterfall, sedangkan pengjian yang digunakan adalah Blackbox.\r\nHasil dari pengujian aplikasi menyimpulkan bahwa aplikasi ini bermanfaat dan membantu pengelolah masjid dalam mengelolah keuangan,zakat dan jadwal khatib. Sistem pengeolaan ini masih jauh dari kesempurnaan. Apabila ada yang berniat untuk mengembangkan sistem ini maka di sarankan untuk menambah sistem notifikasi pada android dan penambahan fitur-fitur pada aplikasi website nya.\r\nKata Kunci: Website,Sistem Pengelolaan Masjid.'),
(62, 'RANCANG BANGUN SISTEM PENGERINGAN RUMPUT LAUT BERBASIS ARDUINO UNO DI KABUPATEN TAKALAR', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Indonesia memiliki perairan laut yang cukup luas dengan garis pantai sepanjang 81.290 kilometer merupakan pantai terpanjang kedua di dunia. Negara kepulauan yang memiliki potensi pengembangan rumput laut ini seyogyanya menjadi produsen utama komoditas rumput laut di pasar dunia. Areal strategis yang dapat digunakan untuk budidaya rumput laut di seluruh Indonesia meliputi wilayah seluas kurang lebih 1.380.931 hektar. Proses Pengeringan rumput laut masih sangat sederhana dengan bantuan sinar matahari jika cuaca tidak bersahabat proses pengeringan memakan waktu selama 6 hari.Rancang bangun system pengeringan rumput laut berbasis arduino uno adalah solusi yang dirancang yang bertujuan untuk memudahkan dan mempersingkat waktu pengeringan rumput laut khususnya di Kabupaten Takalar Sulawesi Selatan. Alat pengering rumput laut menggunakan sensor DHT11 bertujuan memantau suhu serta kelembaban dalam alat pengering rumput laut.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Penelitian ini menggunakan metode pengumpulan data observasi, studi literatur, dan wawancara. Teknik pengujian yang digunakan adalah Unit, Integrasi, dan sistem.\r\nHasil penelitian ini adalah sebuah prototype oven pengering rumput laut yang membantu petani dalam mengeringkan hasil budidaya rumput lautnya dalam kondisi apapun dengan hasil kekeringan yang sama jika di keringkan dibawah sinar matahari langsung\r\nKata kunci : Rancang Bangun, Sistem,Pengeringan, Rumput Laut, Arduino uno'),
(63, 'RANCANG BANGUN 3D PHOTOREALISTIC DOKUMENTASI ARKEOLOGI MENGGUNAKAN VISUALISASI 360 DEGREE PANORAMIC BERBASIS WEB', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Indonesia memiliki kekayaan kultural berupa peninggalan arkeologi yang menyimpan warisan budaya masa lalu. Tinggalan arkeologi merupakan unsur penting dalam merekonstruksi kebudayaan masa lalu sehingga perlu dilakukan upaya-upaya yang tepat untuk melestarikan cerita sejarah yang dimiliki, salah satunya dengan mendokumentasikan warisan budaya sebagai wujud konservasi arkeologi. Sehingga diperlukan perekaman data yang baik dan lengkap berupa atribut spasial atau 3D (tiga dimensi) untuk perekaman sebuah artefak, ekofak, monumen ataupun relief dinding. Untuk itu dibutuhkan sistem yang dapat mendokumentasikan objek arkeologi pemodelan 3D (tiga dimensi), sebagai bentuk pelestarian warisan budaya serta menjadi media informasi dan pembelajaran interaktif tentang arkeologi menggunakan pendekatan fotografi panorama untuk visualisasi yang interaktif membuka sebuah ruang pemanfaatan Virtual Panoramic dalam pelestarian situs bersejarah.\r\nPenelitian ini menggunakan metode penelitian kualitatif Design and Creation dan pengujian yang dilakukan adalah pengujian blackbox yang berfokus pada persyaratan fungsioanal perangkat lunak. Hasil dari penelitian ini adalah sebuah Aplikasi 3D Dokumentasi Arkeologi menggunakan Visualisasi 360 Degree Panoramic Berbasis Web. Adapun kelebihan sistem ini yaitu memudahkan masyarakat dalam mengakses informasi dan menjadi media interaktif dalam pengenalan objek bersejarah. Sehingga pengguna dapat merasakan pengalaman eksplorasi dan mengapresiasi suatu objek arkeologi secara detail dari segala sisi.\r\nKata Kunci : Arkeologi, 3D (Tiga Dimensi), Virtual Panoramic, Web.'),
(64, 'RANCANG BANGUN WATER RESISTANT UNTUK PERKEBUNAN KARET BERBASIS MIKROKONTROLER', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Budidaya tanaman karet merupakan salah satu mata pencaharian yang paling diminati oleh masyarakat Indonesia, salah satunya yaitu budidaya tanaman karet. Di dalam budidaya tanaman karet masih banyak kendala yang dihadapi para petani karet, salah satunya yaitu faktor cuaca. Untuk mendukung dalam budidaya tanaman karet, maka dirancang sebuah alat water resistant untuk perkebunan karet berbasis mikrokontroler.\r\nAlat ini dirancang untuk dapat melakukan proses buka tutup penampang getah karet secara otomatis untuk menghindari tercampurnya getah karet dengan air hujan secara berlebihan dan dapat dikontrol secara manual menggunakan pushbutton. Penggunaan sensor rintik hujan berfungsi untuk membaca terjadi hujan atau tidak terjadi hujan di area budidaya tanaman karet. Untuk menutup penampang getah karet digunakan pergerakan motor servo dengan kondisi putaran searah jarum jam mendekati penampang getah karet.\r\nMetode penelitian yang digunakan adalah penelitian eksperimen. Penelitian eksperimen yang dilakukan adalah metode penelitian eksperimental. Dengan melakukan eksperimen terhadap variable-variabel control (input) untuk menganalisis output yang dihasilkan. Ouput yang dihasilkan akan dibandingkan dengan ouput tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah alat yang mampu mencegah masuknya air kedalam penampang getah karet secara berlebihan menggunakan pembacaan cuaca apakah terjadi hujan atau tidak terjadi hujan, serta keseluruhan proses pada alat water resistant untuk perkebunan karet.\r\nKata Kunci : Water Resistant, Perkebunan Karet.'),
(65, 'PENGEMBANGAN MEDIA PEMBELAJARAN SCRUM INTERAKTIF BERBASIS APLIKASI ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Seiring dengan Perkembangan ilmu pengetahuan dan teknologi Developer (pengembang produk) maka dituntut serba cepat untuk memenuhi kebutuhan pelaku bisnis yang berubah-ubah tiap waktu, sehingga muncullah metode scrum. Scrum menjadi sebuah kerangka kerja untuk mengembangkan dan mengelola produk kompleks yang mana orang-orang dapat menyelesaikan permasalahan walaupun kompleks dan konsep yang selalu berubah-ubah, di mana pada saat bersamaan menghasilkan produk dengan nilai setinggi mungkin secara kreatif dan produktif.Tujuan dilakukannya penelitian ini adalah untuk memberi pemahaman awal kepada mahasiswa mengenai scrum\r\nPada penelitian ini penulis menggunakan metode deskriptif kualitatif, dimana data yang diperoleh lebih banyak bersifat uraian dari hasil observasi yang telah dilakukan kemudian data tersebut akan dianalisis secara kualitatif serta diuraikan dalam bentuk deskriptif.Sedangkan metode pengumpulan data yang digunakan adalah wawancara, Obeservasi dan study pustaka. Metode perancangan aplikasi yang digunakan pada penelitian ini adalah metodewaterfalldan use case.Sedangkan teknik pengujian yang digunakan oleh penulis adalah pengujian Black Box.\r\nHasil dari penelitian berupa aplikasi Android untuksystem media pembelajaran yang interaktif. Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini berjalan sesuai dengan tujuan yang diharapkan. Dengan tingkat keakuratan diatas 98% dalam system pembelajaran aplikasi android yang interaktif.\r\nKata Kunci: Aplikasi Android, scrum,media pembelajaran Scrum'),
(66, 'RANCANG BANGUN APLIKASI PENGELOLAAN HIDUP SEHAT BERBASIS ANDROID', 2018, 'SAINS DAN TEKNOLOGI', 3, 'Pola hidup sehat adalah gaya hidup yang lebih fokus pada kesehatan, baik\r\nitu dalam perilaku, makanan dan sebagainya yang mengarah pada hidup lebih sehat\r\nbaik jasmani maupun rohani. Manfaat dari menerapkan pola hidup sehat di\r\nantaranya adalah membuat pikiran lebih positif, membuat tubuh lebih semangat\r\ndalam bekerja, mencegah berbagai macam penyakit dan masih banyak lagi manfaat\r\nyang dapat diperoleh dari menjaga pola hidup sehat secara benar.\r\nNamun masyarakat di Indonesia masih jauh dari penerapan pola hidup\r\nsehat, ini berdasarkan berbagai survei yang ada. Kondisi tubuh masyarakat di\r\nIndonesia juga sangat beragam, sehingga pola hidup sehat setiap masyarakatpun\r\nberbeda sesuai dengan riwayatnya. Patokan dalam penerapan pola hidup sehat\r\nutamanya dalam urusan makanan dan olahraga adalah sesuai dengan kadar\r\nkolesterol, asam urat dan gula darah dalam tubuh. Tujuan dari penelitian ini adalah\r\nuntuk merancang suatu aplikasi pengelolaan hidup sehat untuk perangkat mobile\r\nkhususnya smartphone yang berbasis Android.\r\nMetode penelitian yang digunakan adalah penelitian deskriptif kualitatif\r\nyang bertujuan untuk memahami fenomena-fenomena sosial. Penelitian ini\r\nmenggunakan metode pengumpulan data observasi, studi pustaka, kuesioner dan\r\nwawancara. Metode perancangan yang digunakan adalah waterfall dan teknik\r\npengujian yang digunakan adalah Black Box. Pada aplikasi ini pengguna harus\r\nmemasukkan riwayatnya seperti kadar kolesterol, asam urat dan gula darah untuk\r\nmendapatkan hasil pola hidup sehat yang sesuai dengan pengguna yaitu jenis\r\nmakanan yang sebaiknya dikonsumsi dan sebaiknya dihindari, sekaligus jenis\r\nolahraga yang sesuai dengan pengguna. Berdasarkan hasil uji coba terbukti aplikasi\r\npengelolaan hidup sehat dapat memberikan informasi dan kemudahan pada\r\nbeberapa orang dalam mengatur pola hidup sehat.\r\nKata kunci : pola hidup sehat, kolesterol, asam urat, gula darah, android'),
(67, 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN VARIETAS BAWANG MERAH PADA LAHAN BERBATU (LITOSOL) MENGGUNAKAN METODE SAW (SIMPLE ADDITIVE WEIGHTING) DI KAB. ENREKANG', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Pertanian merupakan salah satu sumber mata pencaharian terbesar di Indonesia, yaitu\r\nkegiatan pemanfaatan sumber daya hayati terkhususnya dalam pembudidayaan tanaman untuk\r\nmenghasilkan bahan pangan, obat-obatan dll. Salah satu tanaman yang sering dimanfaatkan\r\ndalam bidang pertanian yaitu tanaman bawang merah. Kabupaten Enrekang merupakan salah\r\nsatu kabupaten yang dikembangkan sebagai sentra produksi terbesar bawang merah. Tetapi\r\nmasih banyak petani yang memiliki lahan yang tidak produktif seperti lahan berbatu sehingga\r\nmasih menjadi kendala dalam memproduksi bawang merah yang berkualitas. Hal ini menjadi\r\nsuatu hambatan bagi petani yang memiliki lahan berbatu untuk memilih variteas bawang merah\r\nyang cocok untuk di tanam di lahan tersebut disebabkan kurang dan terbatasanya pengetahuan\r\npetani sehingga perlu adanya media bantu berupa sistem pendukung keputusan yang dapat\r\nmembantu memilih varietas yang baik untuk lahan berbatu.\r\nPenelitian ini membangun sebuah perangkat lunak sistem pendukung keputusan\r\nberbasis web mengenai penentuan varietas bawang merah yang cocok untuk di tanam di lahan\r\nberbatu dengan metode simple additive weighting . Sebuah metode yang akan mencari solusi\r\nkesimpulan berdasarkan penjumalahan terbobot dari suatu rating kinerja setiap atribut. Jenis\r\npenelitian yang digunakan pada penelitian ini metode penelitian korelasi. Metode\r\npengumpulan data yang digunakan berupa observasi,waawancara dan dokumentasi. Metode\r\npengembangan sistem yang diguanakan adalah waterfall dan teknik pengujian sistem yang\r\ndiguankan adalah Black Box.\r\nPenelitian yang dilakukan menghasilkan perangkat lunak sistem yang berguna sebagai\r\nmedia konsultasi mengenai penetuan varietas bawang merah yang cocok dan baik di tanam di\r\nlahan berbatu pertanian. Informasi yang dihasilkan berbasi pada kriteria lahan yang ada dengan\r\nkriteria lahan bawang merah, sehingga keputusan yang dibuat oleh sistem untuk jenis varietas\r\nbawang mengacu pada kriteria lahan tersebut. Hasil uji coba menunjukkan bahwa aplikasi\r\nlayak dan dapat digunakan.\r\nKata Kunci: DSS, Metode SAW, Bawang merah, Litosol'),
(68, 'RANCANG BANGUN SISTEM PENGELOLAAN DATA KELURAHAN TOMBOLO BERBASIS WEB', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Sistem Informai pendataan penduduk di desa ataupun di kelurahan sampai saat ini masih banyak yang menggunakan sistem manual dimana data-data serta berkas-berkas penduduk masih banyak yang berbentuk fisik yang mana harusnya sistem ini dapat dibuat menjadi lebih sederhana sehingga berkas-berkas penduduk yang tidak terlalu penting dapat diminimalisir sehingga tidak terjadi pertumpukan berkas pada kantor kelurahan ataupun kantor desa.\r\nPada penelitian ini dirancang sebuah sistem yang dapat menyimpan data-data penduduk beserta berkas-berkas penting lainnya seperti, Akte, KTP, surat kelahiran, surat kematian, surat pindah dan surat pendatang, sistem ini bertujuan agar memudahkan staff kantor desa ataupun kelurahan lebih mudah menyimpan data-data penduduk tanpa harus takut kehilangan, Website ini dapat dikelola oleh user dengan login menggunkan nomor kartu keluarga dan password yang telah disediakan oleh admin kelurahan.\r\nSistem informasi ini dirancang dengan menggunakan metode waterfall, framework codeigniter, xampp dimana phpMyAdmin sebagai operator database, MySQL sebagai database, dan Wamp sebagai server offlinenya serta sublime sebagai pembuatan code program sistem informasi ini. Sistem informasi ini dirancang dengan alur dan desain atarmuka yang sederhana sehingga staff yang menjadi operator lebih mudah menggunakan sistem informasi ini, dan hasil akhir dari sistem informasi ini sebagai pengelolah data kelurahan Tombolo, Kecamatan Somba Opu, Kabupaten Gowa.\r\nKata kunci : Sistem Informasi, Pendataan, Kependudukan, Xampp, Wamp, phpMyAdmin, MySQL dan sublime.'),
(69, 'SISTEM PENGELOLAAN INFORMASI DAN PELAPORAN PEMBIAYAAN TANAH KAVLING DAN PERUMAHAN PADA PT MAMMINASATA SYARIAH PROPERTINDO', 2018, 'SAINS DAN TEKNOLOGI', 1, 'PT. Mamminasata Syariah Propertindo merupakan perusahaan yang bergerak dalam bidang real estate. Dalam menjalankan proses bisnisnya PT Mamminasata Syariah Propertindo melakukan pengecekan jatuh tempo properti yang di beli secara kredit masih secara manual. Setiap buyer di cek tanggal pembelian propertinya setiap hari. Apabila jumlah buyer masih sedikit tentu tidak merepotkan bagi perusahaan. Untuk itu tujuan dari penelitian ini adalah untuk membuat sistem yang secara otomatis pengecek tanggal pembelian properti kemudian informasi angsurannya dikirm secara otomatis ke buyer.\r\nPada penelitian ini menggunakan jenis penelitian kualitatif, sedangkan metode pengumpulan data menggunakan observasi, wawancara dan studi literatur, serta dalam pembangunan perangkat lunak penulis menggunakan Sublime Editor dan dalam teknik pengujian perangkat lunak menggunakan teknik black box dalam teknik pengembangan sistem yang digunakan oleh penulis adalah metode waterfall, alat bantu model proses Data Flow Diagram (DFD), model data konseptual dengan entity relationship diagram (ERD) dan diagram alir flowmap. Dengan adanya sistem ini, diharapkan perusahaan dapat peningkatkan pelayanannya terhadap konsumen.\r\nKata Kunci: Sistem, Data Flow Diagram, flowmap, real estate.'),
(70, 'Rancang Bangun Sistem Pemeliharaan Ternak Ayam Broiler', 2018, 'SAINS DAN TEKNOLOGI', 2, 'Ayam broiler merupakan binatang berdarah panas (homeotermic) yang harus mempertahankan suhu tubuh normal dan sangat rentan terhadap lingkungan sekitar jika tidak dijaga kehangatannya, maka ayam akan stres dan mengalami gangguan pertumbuhan yang berdampak pada penurunan konsumsi pakan yang berakibat pada penurunan produktivitas. Penelitian ini bertujuan untuk merancang dan membangun sistem pemeliharaan ternak ayam broiler pada kandang tertutup berbasis mikrokontroler, sebagai solusi bagi para peternak ayam broiler sehingga memudahkan para peternak dalam mengelola ternaknya. Pemilihan jenis kandang tertutup tentunya akan mengurangi dampak penyebaran penyakit dikarenakan kandang tidak terhubung secara langsung dengan lingkungan luar, selain itu suhu dalam kandang akan lebih mudah diatur.\r\nJenis penelitian yang digunakan adalah penelitian kualitatif dengan konsep eksperimental. Pengujian yang dilakukan adalah pengujian blackbox. Hasil dari penelitian ini adalah sebuah prototype alat yang berfungsi untuk menjaga kestabilan kandang pada suhu 31oC–35oC dengan kelembaban 50%–70%, mengatur ketersediaan pakan dalam wadah dan mengatur penerangan kandang secara otomasi.\r\nKata kunci: Ternak Ayam Broiler, Mikrokontroler, Prototype, Suhu, Kelembaban, Pakan, Penerangan, dan Otomasi.'),
(71, 'RANCANG BANGUN SISTEM MONITORING DAN PENJADWALAN TURNAMEN SEPAKBOLA BERBASIS WEB', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Hasil dari pengujian aplikasi ini menyimpulakan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan yang diinginkan. Kesimpulan bahwa aplikasi monitoring dan penjadwalan turnamen sepak bola adalah sebagai media dalam mempermudah bagi setiap penggemar sepak bola mendapatkan informasi tentang tim favorit tanpa harus meninggalkan kesibukan sehari-hari'),
(72, 'MULTIMEDIA INTERAKTIF SIMULASI UJIAN KOMPREHENSIF ONLINE BERBASIS WEB (STUDI KASUS DI JURUSAN TEKNIK INFORMATIKA UIN ALAUDDIN MAKASSAR', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Ujian Komprehensif adalah ujian yang dilaksanakan untuk mengukur tingkat penguasaan mahasiswa dalam bidang keislaman dan spesialisasi keilmuan program studi serta menilai kemampuan mahasiswa dalam berpikir secara interdisipliner sebagai syarat untuk mengikuti ujian skripsi/tesis. Dengan sistem ujian yang dilakukan secara manual membuat dosen biasanya harus menambah jam kerja untuk membuat dan menilai soal ujian para mahasiswa secara manual,karena itu dengan kemajuan teknologi informasi yang semakin pesat maka dibutuhkan sebuah sistem ujian online sebagai solusi untuk mengoptimalkan sistem ujian manual.\r\nTujuan penelitian ini adalah untuk merancang suatu sistem simulasi ujian komprehensif online yang berbasis Web dengan melakukan studi kasus di jurusan Teknik Informatika UIN Alauddin Makassar\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode dimana penelitian riset yang bersifat deskriptif dan cenderung menggunakan analisis proses dan makna lebih di tonjolkan dalam penelitian kualitatif dengan prosedur yang menghasilkan data deskriptif berupa kata-kata tertulis atau lisan dari orang dan perilaku yang diamati kemudian diarahkan pada suatu latar individu secara utuh.\r\nDari hasil penelitian ini menghasilkan aplikasi multimedia interaktif simulasi ujian komprehensif online berbasis web dengan tampilan responsif, sehingga dapat diakses oleh penguna dimanapun berada selama masih terhubung dengan internet. Berdasarkan kesimpulan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan, memberikan pelayanan ujian komprehensif lebih optimal dari sebelumnya, dan bisa mengefisienkan waktu bagi penggunanya.\r\nKata kunci : Sistem Simulasi Ujian Komprehensif Online, Multimedia Interaktif, Web'),
(73, 'IMPLEMENTASI PROGRESSIVE WEB APP SEBAGAI SOLUSI UNTUK MENINGKATKAN KINERJA APLIKASI BERBASIS WEBSITE (STUDI KASUS DALAM APLIKASI PENGINGAT JADWAL TAKLIM)', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Penyebaran informasi taklim di Kota Makassar sangat beragam, mulai dari\r\nkonvensional yakni dari mulut ke mulut dan penempelan pamflet di masjid-masjid\r\nsampai cara modern seperti menggunakan aplikasi pesan instan dan media sosial.\r\nGrup taklim tidak bisa mengakomodir banyaknya peserta dan media sosial tidak\r\nefektif dalam menyimpan informasi taklim yang akan didatangi karena pengguna\r\ndiharuskan untuk tetap terhubung ke internet untuk membuka informasi taklim\r\nyang telah tersimpan. Pada skripsi ini, penulis mencoba membangun dan\r\nmengimplementasikan teknologi Progressive Web App ke dalam website agar\r\npenggunaan website bisa lebih efektif dan efisien sehingga penyebaran taklim bisa\r\nlebih maksimal.\r\nJenis penelitian yang digunakan adalah metode penelitian deskriptif\r\nkualitatif, jenis penelitian deskriptif yang digunakan adalah Design and Creation\r\nSedangkan metode pengumpulan data yang digunakan adalah menggunakan\r\nmetode pengumpulan data wawancara, dokumentasi, studi literatur dan observasi.\r\nMetode perancangan yang digunakan adalah Waterfall dan Teknik pengujian\r\nmenggunakan blackbox.\r\nHasil dari pengujian aplikasi ini menyimpulkan bahwa fungsi yang diharapkan\r\nsemuanya berhasil\r\nKata Kunci : Taklim, PWA, Website.'),
(74, 'RANCANG BANGUN SISTEM POINT OF SALE SEBAGAI PLATFORM Usaha Busana Muslim Online Berbasis\r\nWebsite', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Busana muslimah merupakan busana yang dikenakan wanita beragama\r\nislam dengan tujuan menutup aurat dalam berbagai aktivitas (Gusriady 2016).\r\nBusana muslimah pun kian berkembang tidak hanya dipakai pada saat momen\r\nhari raya atau pengajian, tetapi juga telah menjadi busana sehari-hari. Keadaan ini\r\nternyata ditangkap oleh produsen busana muslim untuk terus melakukan inovasi,\r\nbaik dari bahan maupun modelnya. Produsen busana muslimahpun mengalami\r\nbeberapa kendala diantaranya pendataan stok barang yang tidak efektif dan efisien.\r\nKarena masalah tersebut, peneliti bertujuan untuk merancang sebuah sistem\r\ntransaksi elektronik Point of Sale sebagai platform usaha busana muslim online\r\nberbasis website.\r\nJenis penelitian yang digunakan dalam penelitian ini adalah metode\r\nkualitatif. Metode kualitatif adalah metode penelitian tentang riset yang bersifat\r\ndeskriptif dan cenderung menggunakan analisis. proses dan makna (perspektif\r\nsubjek) lebih ditonjolkan dalam kualitatif. Sedangkan metode pengumpulan data\r\nyang digunakan adalah wawancara dan studi literature. Metode perencanaan\r\naplikasi yang digunakan adalah waterfall. Sedangkan teknik pengujian yang\r\ndigunakan oleh penulis adalah pengujian Black Box.\r\nHasil dari penelitian berupa aplikasi Website untuk penyampain informasi\r\nkepada pelanggan tentang busana muslim, serta membantu penjual dalam\r\nmengakumulasi pendataan barang. Berdasarkan hasil pengujian dapat disimpulkan\r\nbahwa sistem ini berjalan sesuai dengan tujuan yang diharapkan. Dengan tingkat\r\nkeakuratan diatas 98% dalam pembagian bantuan serta penyampaian informasi\r\nyang teransparan dan relevan.\r\nKata Kunci: Website, Busana Muslim, Point Of Sale.'),
(75, 'SISTEM TRANSPARANSI DATA PENYALURAN KELOMPOK TANI BERBASIS WEB PADA DINAS PERTANIAN KABUPATEN BULUKUMBA', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Hasil Penelitaian ini berupa aplikasi website untuk pengelolaan bantuan kelompok tani yang memberikan informasi secara transparan. Berdsarakan hasil pengujian dapat disimpulkan bahwa sistem ini berjalan sesuai dengan tujuan yang diharapkan. Dengan Tingkat Keakuratan diatas 98% dalam pembangian bantuan serta penyampaian informasi yang transparan dan relevan.'),
(76, 'PERANCANGAN MODEL DIGITAL SIGNAGE BERBASIS IOT SEBAGAI PAPAN INFORMASI DIGITAL TERINTEGRASI WEBSITE', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Digital Signage adalah sebuah bentuk penyampaian informasi melalui media display elektronik (dinamis). Selama ini informasi akademik maupun pengumuman lainnya masih ditampilkan secara konvensional. Adanya layar LCD juga tidak diterapkan secara optimal sehingga terkesan mubassir. Olehnya itu dengan adanya Digital Signage, diharapkan informasi-informasi akademik maupun pengumuman lainnya dapat ditampilkan secara digital, akurat, cepat, dan lebih menarik..\r\nDalam Penelitian ini menggunakan metode penelitian deskriptif kualitatif, jenis penelitian deskriptif yang digunakan adalah Design and Creation yang merupakan jenis penelitian untuk mengembangkan produk dibidang teknologi dan informasi. Sedangkan metode pengumpulan data yang digunakan adalah metode studi pustaka. Analisis yang dilakukan adalah analisis system dan analisis aplikasi. Aplikasi Ini memiliki Hak Akses bagi Admin untuk melakukan pengolahan data pada halaman dashboard website. Untuk studi kasus dilakukan di Jurusan Teknik Informatika UIN Alauddin Makassar.\r\nDigital Signage ini diuji menggunakan pengujian tiap blok yaitu menguji setiap fungsi dari perangkat keras yang digunakan dan menguji perangkat lunak dari segi spesifikasi fungsional. Pengujian yang dimaksudkan apakah fungsi-fungsi masukan dan keluaran dari perangkat sesuai dengan spesifikasi yang dibutuhkan. Hasil dari pengujian Digital Signage ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil dan diterima sesuai dengan keinginan. Kesimpulannya bahwa Digital Signage Berbasis Website diharapkan dapat membantu pihak jurusan dalam menyampaikan informasi lebih mudah dan cepat kepada para mahasiswa, begitupun sebaliknya mahasiswa dapat menerima informasi dengan lebih jelas, menarik, dan terarah.\r\nKata Kunci : Digital Signage, IoT, Website'),
(77, 'RANCANG BANGUN SISTEM INFORMASI AKUNTANSI DI PERUSAHAAN KONTRAKTOR PT. KURNIA CIPTA KARYA INDONESIA BERBASIS WEB ', 2018, 'SAINS DAN TEKNOLOGI', 1, 'PT. Kurnia Cipta Karya Indonesia merupakan perusahaan yang bergerak di\r\nbidang kontruksi. Perusahaan ini mengerjakan proyek kontraktor, developer, dan\r\nperdagangan dengan cakupan sulawesi selatan. Sebagai perusahaan besar dengan\r\njumlah pekerja yang tidak sedikit, PT. Kurnia Cipta Karya Indonesia belum mampu\r\nmengelola berbagai permasalahan yang meliputi proyek pelaksanaan proyek,\r\npenyewaan alat, pembayaran progress proyek, inventori, penggajian, dan akuntansi.\r\nSaat ini, proses yang terdapat pada PT. Kurnia Cipta Karya Indonesia belum\r\nterintegrasi dengan baik sehingga proses-proses yang terdapat di PT. Kurnia Cipta\r\nKarya Indonesia menjadi tidak efektif dan efisien. Kesalahan-kesalahan yang terjadi\r\ndalam pengambilan keputusan sering terjadi dan dapat berakibat fatal bagi\r\nperusahaan.\r\nPermasalahan tersebut dapat di atasi dengan membuat sebuah sistem proses\r\npelaksanaan proyek, penyewaan alat, pembayaran progress proyek, inventori,\r\npenggajian, dan akuntansi. Dengan adanya sistem ini proses-proses tersebut dapat\r\ndilakukan dengan terintegrasi. Selain itu, dapat dengan mudah melakukan\r\npengambilan keputusan bagi manajemen perusahaan.\r\nKata Kunci: Kontraktor, Proyek, Penggajian, Inventory, Akuntansi, Website'),
(78, 'PERANCANGAN SISTEM SIRKULASI BUS PADA HALTE BRT DI KOTA MAKASSAR', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Penggunaan kendaraan pribadi semakin marak di Indonesia. Mulai dari orang dewasa bahkan anak-anak sekalipun. Hal ini menjadi salah satu faktor utama penyebab kemacetan di berbagai ruas-ruas jalan, khususnya pada daerah perkotaan. Untuk mengatasi permasalahan tersebut, pemerintah telah mengeluarkan berbagai macam kebijakan mulai dari perluasan jalan, penggunaan jalur searah, metode ganjil genap sampai dengan penyediaan BRT (Bus Rapid Transit). Penggunaan BRT juga sudah berlaku di kota Makassar. BRT dilengkapi dengan tempat pemberhentian khusus yang disebut halte. Penggunaan halte dimaksudkan agar bus dapat berhenti dengan aman dan tanpa mengganggu arus lalu lintas. Namun pada penerapannya, pengendara lainlah yang mengganggu jalur pemberhentian bus tersebut, sehingga sterilisasi halte bus inilah yang menjadi tujuan penelitian ini. Metode perancangan yang digunakan dalam penelitian ini adalah metode prototyping yang kemudian diuji dengan metode pengujian per blok/ setiap rangkaian, pengujian kondisi (state), dan pengujian secara keseluruhan. Dengan demikian akan diperoleh data yang kemudian akan dilakukan perbandingan dengan data yang diperoleh berdasarkan simulasi. Hasil dari ini adalah sebuah alat sterilisasi jalur pemberhentian bus dengan menggunakan pemicu berupa RFID yang kemudian diteruskan ke komponen yang terpasang pada halte. Kata kunci : Sterilisasi Jalur Halte BRT, BRT Mamminasata Makassar, Sistem Sirkulasi Halte BRT, Sensor RFID, Arduino Uno.'),
(79, 'RANCANG BANGUN SISTEM MARKETING PROPERTY MENGGUNAKAN VISUALISASI PANORAMA 360 BERBASIS WEB (STUDI KASUS PADA PERUMAHAN DATO RESIDENCE)', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Perumahan adalah salah satu kebutuhan yang sangat penting bagi masyarakat saat\r\nini, berbagai cara pemasaran perumahan pun dilakukan seperti pembuatan brosur\r\nyaitu cetakan kertas yang berisi informasi mengenai produk seperti gambar, ukuran\r\nharga dan lain lain. Namun sejauh ini promosi melalui media brosur hanya\r\nmenampilkan gambar atau konsep dalam bentuk 2D yang dibagikan kepada calon\r\npembeli, kemudian pembeli harus datang langsung ke lokasi perumahan menemui\r\npetugas/marketing untuk kemudian melihat bentuk rumah maupun lokasi rumah\r\nsecara detail. Untuk dapat mempermudah pembeli/konsumen dalam melihat lokasi\r\nrumah dan type rumah secara detail tanpa harus datang langsung kelokasi\r\nperumahan. Aplikasi visualisasi panorama 360, yang mana memudahkan calon\r\npembeli untuk mengerti/mengetahui detail lokasi perumahan dan type rumah tanpa\r\nharus mendatangi langsung kelokasi peruhan. Cukup dengan menggunakan\r\nvisualiasi panorama 360 calon pembeli/konsumen sudah dapat melihat lokasi rumah\r\ndan type rumah secara 360 derajat. Visualisasi Panorama 360 diterapkan pada\r\nplatform web yang responsif, sehingga dapat diakses oleh pengguna dimanapun\r\nberada selama masih terhubung dengan internet\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana\r\nstrategis yang digunakan adalah Design and Creation dengan sumber data penelitian\r\nadalah beberapa jurnal, skripsi, tesis dan literature lain serta sumber-sumber data\r\nonline atau internet Penelitian ini menggunakan metode pengumpulan data\r\nobservasi dan studi literatur. Metode perancangan yang digunakan adalah waterfall\r\ndan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah\r\ndigunakan, memberikan informasi visual yang lebih baik daripada layanan sejenis,\r\nmenyenangkan sehingga calon pembeli/konsumen tidak merasa kesulitan untuk\r\nmembuka melihat lokasi perumahan dan type rumah menggunakan aplikasi\r\nVisualisasi panorama 360.\r\nKata Kunci: Sistem Marketing property, visualisasi panorama 360, Web'),
(80, 'RANCANG BANGUN ALAT PENGAMAN RUMAH MENGGUNAKAN SENSOR PIR (PASSIVE INFRA RED) BERBASIS SMS GATEWAY', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Latar belakang penelitian ini adalah keamanan rumah sangatlah penting mengingat saat ini tindang kriminalitas sangat meresahkan masyarakat , salah satunya adalah kasus pencurian yang biasa terjadi pada rumah-rumah penduduk. Hal ini mungkin dapat disebabkan antara lain karena faktor enokomi yang menyebabkan orang terkadang mengambil jalan pintas untuk memenuhi kebutuhan hidupnya yaitu dengan cara mencuri. Maka peneliti merancang sebuah alat dimana alat ini dibuat untuk memudahkan kita dalam mengontrol keamanan rumah apabilah ditinggalkan dalam keadaan kosong, media yang digunakan adalh Handphone, dengan memanfaatkan fasilitas SMS. Tujuan dari penelitian adalah merancang sebuah alat pengaman rumah menggunakan sensor PIR berbasis SMS Gateway. Alat ini terdiri dari sebuah sensor yaitu sensor pir sebagai pendeteksi gerak gerik manusia yang ada disekitarnya, dan bazzer akan berbunyi setiap ada pergerakan yang di tangkap oleh sensor pir, sebuah GPRS Shield yang didalamnya terdapat sim card yang berfungsi untuk mengirim sms.\r\nJenis penelitiang yang digunakan adalah penelitian kualitatif dengan metode experimental yaitu dengan cara melakukan uji cona (trial and error) untuk rancangan mekanik maupun elektronik komponen harware dan berusaha untuk menjelaskan, mengendalikan fenomena seteliti mungkin. Dan menggunakan metode pengumpulan data yaitu, Library Research, Field Researc, Observasi, Interview.\r\nDari penelitian ini menghasilkan Alat Pengaman Rumah Menggunakan Sensor PIR Berbasis SMS Gateway yang diharapkan dapat di aplikasikan oleh masyarakat agar dapat memberi rasa aman, dan nyaman saat meninggalkan rumah dalam keadaan kosong.\r\nKata Kunci : Handpohone, Mikrokontroler, PIR, SMS'),
(81, 'SISTEM PEMASARAN PERUMAHAN DINAMIS BERBASIS WEB', 2018, 'SAINS DAN TEKNOLOGI', 1, 'Di Indonesia, perkembangan industri jasa khususnya jasa pemasaran\r\nproperty mengalami kemajuan yang pesat. Persaingan bisnis di dunia pemasaran\r\nyang ketat menuntut perusahaan selalu meningkatkan daya saingnya. Salah\r\nsatunya bauran pemasaran dan kualitas jasa yang sangat penting bagi pelanggan\r\nuntuk dapat menggunakan jasa yang ditawarkan oleh perusahaan sesuai dengan\r\nkebutuhan masing-masing yang dapat memenuhi harapan pelanggan. Tujuan\r\nPenelitian ini dilakukan untuk mengetahui bagaimana pengaruh bauran pemasaran\r\ndan kualitas jasa terhadap kepuasan pelanggan terhadap pemesanan rumah sesuai\r\ndengan yang dibutuhkan.\r\nJenis peneltian yang digunakan adalah penelitian kualitatif yaitu\r\nmemahami kondisi yang sedang terjadi. Sedangkan metode pengumpulan data\r\nyang digunakan adalah wawancara, Obeservasi dan study pustaka. Metode\r\nperancangan aplikasi yang digunakan pada penelitian ini adalah metode waterfall\r\ndan Data Flow Diagram (DFD).Sedangkan teknik pengujian yang digunakan oleh\r\npenulis adalah pengujian Black Box.\r\nHasil dari penelitian berupa aplikasi Website untuk pemasaran dan\r\npemesanan perumahan yang memberikan informasi secara transparan.\r\nBerdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini berjalan sesuai\r\ndengan tujuan yang diharapkan. Dengan tingkat keakuratan diatas 95% dalam\r\npemesanan serta penyampaian informasi yang relevan.\r\nKata Kunci: Website, Pemasaran Perumahan Dinamis'),
(82, 'APLIKASI PELAYANAN PENDAFTARAN DAN SISTEM NOTIFIKASI PADA KLINIK PRAKTEK BERSAMA', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh banyaknya pasien yang butuh pelayanan\r\nterhadap suatu klinik kesehatan yang menyebabkan terjadinya proses antrian yang\r\npanjang untuk mendapatkan pelayanan kesehatan. Dalam proses antrian, pasien\r\ndiharuskan untuk datang langsung ke klinik agar bisa mendapatkan nomor antri. Hal\r\nini menjadi salah satu pemicu tidak efisiennya waktu yang digunakan untuk berobat.\r\nTerlebih lagi jadwal dokter praktek yang tidak menentu dan tidak tepat waktu seperti\r\nyang telah dijadwalkan sebelumnya. Tujuan penelitian ini adalah merancang dan\r\nmembuat suatu sistem yang mampu melakukan pendaftaran pada suatu klinik\r\nkesehatan oleh pasien secara online tanpa harus mengalami antrian panjang di klinik\r\ntersebut, sekaligus bisa memberikan notifikasi mengenai jadwal praktek dokter pada\r\npasien tersebut. Dengan begitu, seorang pasien bisa mendapatkan nomor antri dengan\r\nmudah dan pemberitahuan apabila terdapat perubahan jadwal dokter praktek yang\r\ndituju.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi design\r\nand creation. Metode pengumpulan data yang digunakan yaitu studi pustaka. Metode\r\nperancangan aplikasi yang digunakan adalah metode waterfall. Hasil dari penelitian\r\nini yaitu aplikasi yang dapat digunakan untuk melakukan pendaftaran pada suatu\r\nklinik untuk mendapatkan nomor antri dan juga akan mendapatkan pemberitahuan\r\nmengenai perubahan-perubahan jadwal dokter d klinik tersebut.\r\nKata Kunci: Android, Klinik, Notifikasi, Java, MySQL.'),
(83, 'RANCANG BANGUN SISTEM PAKAR PENDIAGNOSA INFERTILITAS PADA PRIA DAN WANITA BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Pernikahan adalah ikatan lahir batin antara seorang pria dengan seorang wanita sebagai suami istri dengan tujuan membentuk keluarga (rumah tangga) yang bahagia dan kekal berdasarkan Ketuhanan Yang Maha Esa. Tujuan pernikahan bukan hanya untuk membangun keluarga yang sakinah mawaddah wa rahmah. Selain itu tentunya adalah untuk memperoleh keturunan. Semua orang memiliki kecenderungan dan perasaan bahagia dengan anak. Bahkan Nabi menuntutkan agar menikahi perempuan yang penuh kasih sayang serta bisa melahirkan banyak keturunan.\r\nInfertilitas atau yang disebut juga dengan kemandulan atau tidak subur adalah ketidakmampuan pasangan suami istri mendapatkan keturunan atau kehamilan setelah satu tahun berhubungan seksual tanpa perlindungan apapun di waktu-waktu subur. Kemandulan ini bisa terjadi pada wanita maupun pria, bahkan biasa terjadi pada keduanya. Karena kurangnya sumber pengetahuan tentang infertilitas dan kurangnya dokter ahli kandungan khususnya yang ada di pedesaan, sehingga banyak pria dan wanita tidak akan tahu tentang penyakit yang bisa jadi akan terjadi pada dirinya. Salah satu cara untuk mendeteksi sejak dini penyakit infertilitas (kemandulan) tersebut di atas adalah dengan memanfaatkan teknologi canggih dan modern seperti yang diketahui dewasa ini, yaitu telah berkembangnya bidang study Artificial Intelegence (AI) yang mempelajari serta mampu meniru kecerdasan buatan adalah sistem pakar (Expert System ). Dimana sistem pakar ini akan dibuat untuk memberikan informasi bagi para pria dan wanita di Indonesia dalam mencegah infertilitas dengan menjaga kesehatan dan menjaga pola makan sejak dini berbasis android yang bisa diakses pada smartphone.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi literatur. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box. Hasil diagnosanya menggunakan metode certainty factor (CF). Certainty factor merupakan cara dari penggabungan kepercayaan dan ketidakpercayaan dalam bilangan yang tunggal. Dalam certainty theory, data-data kualitatif direpresentasikan sebagai derajat keyakinan (degree of belief).\r\nBerdasarkan hasil uji coba menunjukkan bahwa aplikasi ini mudah digunakan oleh user, memberikan informasi mengenai gejala-gejala apa saja yang dapat\r\nxiv\r\nmenyebabkan infertilitas pada pria dan wanita dan memberikan hasil diagnosa berdasarkan indikasi yang diinput oleh user serta memberikan saran pengobatan kepada user berdasarkan hasil diagnosanya.\r\nKata Kunci: Infertilitas, Artificial Intelegence, Expert System, Android, Certainty Factor.'),
(84, 'RANCANG BANGUN APLIKASI 3D (TIGA DIMENSI ) RUMAH ADAT SE-INDONESIA BERBASIS MOBILE', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Informasi mengenai rumah adat di Indonesia sangat penting untuk kita ketahui karena menjadi salah satu jati diri bangsa Indonesia dan rumah adat di Indonesia sangat banyak jenisnya. Namun pada perkembangan zaman penyediaan informasi mengenai rumah adat di Indonesia masih sangat minim yaitu hanya berbatas pada buku dan website saja, sehingga untuk memperoleh informasi mengenai rumah adat yang lebih lengkap dan menarik terkadang masih harus mencari banyak buku dan mengunjungi lebih dari satu website yang dimana masih berbentuk 2D (dua dimensi). Pada skripsi ini, penulis mencoba membangun dan mengembangkan sebuah aplikasi 3D(tiga dimensi) rumah adat berbasis mobile untuk memberikan bentuk asli dari rumah adat menggunakan media 3D(tiga dimensi).\r\nTujuan dari penelitian adalah untuk menghasilkan aplikasi yang lebih interaktif dan memberikan informasi yang lebih real dari 2D (dua dimensi).Jenis penelitian yang digunakan adalah penelitian kualitatif dengan sumber data penelitian adalah beberapa jurnal, skripsi, tesis dan literature lain serta sumber-sumber data online atau internet. Hasil dari penelitian ini yaitu aplikasi 3D (tiga dimensi) rumah adat yang memberikan bentuk asli dari 34 provinsi rumah adat yang ada di Indonesia.Pada aplikasi, 3D rumah adat dapat di rotasi sesuai dengan keinginan serta penjelasan yang disediakan dalam bentuk suara dan juga terdapat fitur capture jika ingin menyimpan dalam bentuk file image.Kesimpulan dari penelitian ini yaitu Penyajian informasi rumah adat menggunakan media 3D (Tiga dimensi) lebih memudahkan user untuk mengetahuai bentuk asli dari rumah adat yang ingin mereka ketahui dan juga lebih menarik dan interaktif, serta penjelasan rumah adat dalam bentunk suara lebih memudahkan user.\r\nKata kunci :Rumah Adat Indonesia, Tiga Dimensi (3D), Android.'),
(85, 'SISTEM PEMANDU WISATA BERBASIS AUGMENTED REALITY MARKERLESS MEMANFAATKAN GPS BASED TRACKING DENGAN PLATFORM ANDROID (Studi Kasus : Lokasi Wisata di Kota Makassar)', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Bagi setiap turis yang baru mengenal wilayah kota Makassar dirasa sangat menyulitkan untuk mendapatkan informasi mengenai lokasi-lokasi wisata yang dapat dikunjungi. Bertanya kepada penduduk lokal dan adanya pemandu turis dapat menjadi solusi bagi turis untuk mendapatkan informasi mengenai lokasi wisata yang dituju, tetapi solusi tersebut belum tentu diperoleh turis saat mereka berkunjung ke kota Makassar. Adapun solusi lain yang ditawarkan yaitu dengan diterapkannya teknologi augmented reality pada aplikasi mobile, sehingga informasi mengenai lokasi wisata dapat terpenuhi dengan baik. Teknologi augmented reality yang diterapkan tidak menggunakan marker, melainkan menggunakan konsep markerless dengan teknik GPS based tracking. Teknologi handphone khususnya smartphone yang sudah berkembang pesat saat ini, mempermudah implementasi augmented reality dikarenakan setiap smartphone yang ada sekarang sudah diintegrasikan dengan GPS, yang kemudian GPS tersebut digunakan sebagai pengembangan metode augmented reality dalam memberikan navigasi terhadap lokasi sekitar.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah design and creations. Sistem ini berjalan pada perangkat mobile berbasis Android. Dirancang dengan bahasa pemrograman java. Dalam pemodelan sistem ini menggunakan UML dan diuji dengan metode pengujian blackbox.\r\nHasil dari penelitian ini menunjukkan bahwa sistem ini mudah digunakan oleh pengguna, data lokasi yang ditampilkan mudah diperoleh dan memudahkan pengguna dalam menentukan lokasi yang ingin dituju melalui augmented reality. Dengan demikian sistem ini dapat menjadi alternatif lain bagi para turis untuk memperoleh informasi.\r\nKata Kunci : GPS, Augmented Reality, Markerless, Lokasi Wisata, Android.'),
(86, 'APLIKASI PEMBELAJARAN SHALAT WAJIB DAN SUNNAH SECARA DIGITAL BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Kesibukan dunia di zaman modern ini semakin lama semakin membuat seseorang terkhusus ummat Islam diberbagai kalangan belum mengerti tentang apa yang harus di lakukan dalam melakukan kewajiban shalat. Shalat merupakan rukun Islam kedua setelah syahadat dimana hukumnya adalah wajib bagi ummat muslim. Permasalahan yang dihadapi cukup kompleks apabila orang – orang yang ingin melaksanakan shalat sesuai dengan syari’at Islam ini tidak memiliki pengetahuan yang cukup atau pengalaman dalam melaksanakan shalat. Berdasarkan hal ini maka perlu dibuat aplikasi untuk smartphone yang dapat membantu seseorang dalam pemeblajaran shalat dan mempelajari ilmu tentang shalat kapan saja dan dimana saja. Adapun tujuan dari penelitian ini adalah membuat aplikasi pembelajaran shalat wajib dan sunnah yang dapat berjalan dengan baik di sistem operasi Android untuk membantu masyarakat dalam melaksanakan shalat sesuai syariat islam.\r\nPenelitian ini menggunakan metode penelitian Eksperimen sedang metode pengumpulan data yang digunakan yaitu saintifik. Adapun metode perancangannya menggunakan metode Prototype. Aplikasi ini mencakup beberapa konten yaitu materi tentang shalat, bacaan shalat, tata cara shalat, manfaat gerakan shalat, tata cara wudhu. Hasil dari pengujian aplikasi ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan keinginan. Kesimpulannya bahwa aplikasi “Pembelajaran Shalat” ini dapat membantu dalam melaksanakan shalat dan dapat berjalan dengan baik di smartphone bersistem operasi Android.\r\nKata Kunci: Pembelajaran Shalat, Materi, Android'),
(87, 'APLIKASI KUIS BUDAYA TRADISIONAL DI INDONESIA BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi dengan beberapa realita yang terjadi saat ini diantaranya\r\nadalah Indonesia yang merupakan negara kepulauan, di tiap-tiap daerah memiliki ciri\r\nkhas budaya masing-masing sehingga budaya yang ada menjadi beraneka ragam. Ilmu\r\npengetahuan dan teknologi perkembangannya sangat pesat sehingga masyarakat harus\r\nmenerima tren perkembangan yang terkini/mutakhir. Minimnya pemahaman tentang\r\nbudaya asli Indonesia dikalangan anak-anak maupun remaja sejak dini, dikarenakan\r\nlebih tertarik dengan kebudayaan luar misalkan dalam musik (pop, rock, jazz, R&B)\r\nsehinga musik tradisional Indonesia terlupakan. Beberapa sinetron dan budaya barat\r\nyang bebas masuk ke Indonesia sehingga kesenian-kesenian tradisi mulai terkikis dan\r\ntidak dilirik/dihargai lagi hingga terlupakan. Pemerintah tidak menghakpatenkan\r\nseluruh budaya yang dimiliki oleh negara Indonesia sehingga sedikit demi sedikit\r\nnegara lain mengambil atau mengklaim budaya yang sepatutnya milik Indonesia itu\r\nsendiri. Dari latar belakang yg telah disebutkan maka penelitian ini bertujuan untuk\r\nmembuat sebuah aplikasi budaya tradisional yang berasal dari Indonesia dengan\r\nmetode kuis yang menarik, sehingga dapat dipergunakan oleh semua kalangan baik\r\npemerintah, pengusaha ataupun pelajar dan seluruh masyarakat di dalam upaya\r\nmeningkatkan pemahaman serta pengetahuan kita terhadap budaya sendiri.\r\nDalam penelitian ini, menggunakan jenis penelitian kualitatif Design and Creation\r\nserta pengujian yang dilakukan adalah pengujian blackbox. Hasil dari tugas akhir ini\r\nadalah sebuah sistem aplikasi mobile dengan sistem operasi Android yang\r\nperancangannya menggunakan beberapa software seperti notepad++ sebagai wadah\r\nuntuk menampung source code HTML, CSS, angularjs serta software Xampp selaku\r\nweb server lokal. Dari hasil uji coba dapat disimpulkan bahwa Aplikasi Kuis Budaya\r\nTradisional Indonesia dapat dipergunakan oleh para pengguna sebagai media alternatif\r\nuntuk mengetahui sejauh mana pengetahuan mengenai budaya untuk kategori tarian,\r\nlagu, rumah, pakaian, alat musik, dan senjata tradisi yang ada di Indonesia, kapanpun\r\ndan dimanapun melalui Aplikasi berbasis Android ini.\r\nKata Kunci: Indonesia, Budaya, Tradisi, Kuis, Android, Angularjs, HTML, CSS,\r\nIonic, Java Script, Notepad++, XAMPP, Apache Cordova');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(88, 'RANCANG BANGUN APLIKASI MONITORING PERKEMBANGAN STATUS GIZI DAN KESEHATAN BAYI DAN BALITA DENGAN MENGGUNAKAN METODE ANTROPOMETRI BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Dari Laporan Promise Renewed: 2015 Progress Report Indonesia termasuk dalam 10 besar kematian di bawah 5 tahun salah satu solusi untuk mengatsi masalah tersebut dengan memberikan ASI Ekslusif akan tetapi pemberian ASI Eksklusif bayi pada usia 0-6 bulan di Indonesia sendri masih kurang yaitu sebesar 54,3%. Kemudia presentase gizi buruk dan gizi kurang menurut BB/U di Indonesia 19,6% gizi kurang dan 5,7% gizi buruk. Berdasarkan latar belakang tersebut penelitian membuat suatu aplikasi, yang bertujuan untuk memonitor perkembangan status gizi serta dapat memberika saran sehingga dapat menguragi angka kematian bayi dan kurang gizi.\r\nPerancangan dalam membangun sistem ini terbagi atas use case diagram, class diagram, sequence diagram, activity diagram, Entity Relationship diagram, flowchart, struktur navigasi dan perancangan antarmuka. Jenis penelitian yang digunakan adalah Library Research dengan menggunakan Design and Creation. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah whitebox, blackbox dan kousioner. Penelitian ini menghasilkan aplikasi yang memonitor perkembangan status gizi secara digital mobile dengan mengunakan metode Antropometri selain itu dapat juga memberikan saran sesuai dengan perkembangan status gizi dan umur dari bayi dan balita.\r\nKata Kunci : Status Gizi, Metode Antropometri, Mobile.'),
(89, 'APLIKASI TATA CARA PENYELENGGARAAN JENAZAH BERDASARKAN SYARIAT ISLAM BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Setiap orang bernafas pasti akan meninggal, dan setiap muslim memiliki kewajiban terhadap saudaranya yang meninggal dunia yaitu memandikan, mengkafani, menshalatkan, dan menguburkannya. Penyelenggaraan jenazah merupakan sesuatu yang harus kita ketahui dimana hukumnya adalah fardhu kifayah. Permasalahan yang dihadapi cukup kompleks apabila orang – orang Islam tidak mengetahui tata cara penyelenggaraan jenazah atau tidak memiliki pengetahuan yang cukup dan pengalaman dalam mengurus jenazah. Berdasarkan hal ini maka perlu dibuat aplikasi untuk smartphone yang dapat membantu seseorang dalam pembelajaran tata cara penyelenggaraan jenazah kapan saja dan dimana saja. Adapun tujuan dari penelitian ini adalah diharapkan dapat membuat aplikasi yang dapat berjalan dengan baik pada sistem operasi Android untuk membantu dalam penyelenggaran jenazah.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi penelitian Design and Creation. sedang metode pengumpulan data yang digunakan yaitu library research dan field research. Adapun metode perancangannya menggunakan metode Prototype. Aplikasi ini mencakup beberapa konten yaitu materi,penyelenggaraan, dan materi bid’ah-bid’ah. Hasil dari pengujian aplikasi ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan keinginan. kesimpulannya bahwa aplikasi “Penyelenggaraan Jenazah” ini dapat membantu dalam penyelenggaraan jenazah dan dapat berjalan dengan baik di smartphone bersistem operasi Android.\r\nKata Kunci: Pembelajaran, Penyelenggaraan Jenazah, Materi, Android'),
(90, 'APLIKASI PEMBELAJARAN BAHASA ARAB BAGI MAHASISWA UIN ALAUDDIN MAKASSAR DENGAN MENGIKUTI KURIKULUM BAHASA ARAB PADA JURUSAN SASTRA ARAB BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Salah satu bahasa dunia yang digunakan untuk berkomunikasi adalah bahasa arab. Sangat dianjurkan untuk mempelajarinya terlebih kita sebagai seorang ummat muslim yang dimana pedoman kita mengikuti kitab suci Al-Qur’an sehingga aneh rasanya apabila kita tidak biasa menyebut bahkan membacanya juga memahami artinya. Alasan ummat muslim masih kurang memahami bahasa arab dikarenakan mereka jarang menemui pelajaran bahasa arab itu dikehidupan sehari-harinya, terkadang mereka hanya menemui pelajaran bahasa arab disekolah atau diperguruan tinggi, sehingga hanya sebagian orang yang tau, memahami dan mengaplikasikan bahasa arab dikehidupan mereka.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah design and creations dan metode waterfall. Sistem ini berjalan pada perangkat mobile berbasis Android. Pemodelannya menggunakan flowchart dan diuji dengan metode pengujian blackbox. Pengujian dimaksudkan untuk mengetahui apakah fungsi-fungsi, masukan, dan keluaran dari perangkat lunak sesuai dengan spesifikasi yang dibutuhkan.\r\nHasil dari sistem ini berupa aplikasi android yang bisa digunakan oleh seluruh mahasiswa UIN Alaudin Makassar terkhusus mahasiswa baru yang masuk ditahun pertama perkuliahan, agar mereka bisa mengenal materi bahasa arab diawal semester perkuliahan dan aplikasi Sastra Arab dapat berfungsi dengan baik, baik dari segi logika maupun fungsi sehingga dapat diimplementasikan berdasarkan tujuannya.\r\nKata Kunci : Bahasa Arab, Android, Blackbox'),
(91, 'RANCANG BANGUN APLIKASI GAME EDUKASI BAHASA BUGIS DAN BAHASA MAKASSAR BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Permainan tradisional adalah salah satu kebudayaan milik Indonesia yang harus dilestarikan, sebab permainan tradisional merupakan produk kebudayaan etnis Indonesia yang memiliki manfaat, kandungan dan makna filosofis. Saat ini, anak-anak sudah terfokus pada permainan modern dan sudah mulai melupakan permainan tradisional. Sehingga dibutuhkan suatu aplikasi sebagai media informasi yang memperkenalkan tentang permainan tradisional. Tujuan dalam penelitian ini adalah merancang aplikasi pengenalan dan simulasi permainan tradisional nusantara berbasis android. Aplikasi ini dibuat sebagai sarana untuk memudahkan pengguna dalam memperoleh informasi seputar permainan tradisional dan untuk menarik minat anak-anak untuk melestarikan dan menghidupkan kembali permainan tradisional.\r\nPendekatan atau metode yang digunakan pada penelitian ini adalah penelitian kualitatif dimana strategi yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi pustaka. yaitu dengan mencari referensi dari buku dan juga dari internet yang berhubungan dengan objek yang diteliti. Metode perancangan yang digunakan adalah waterfall, pemodelannya menggunakan UML dan teknik pengujian yang digunakan adalah Black Box. Berdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan dan fitur-fitur yang ada dalam aplikasi ini berupa deskripsi singkat, cara bermain, manfaat permainan, filosofi permainan dan simulasi permainan berfungsi dengan baik.\r\nKata Kunci : Aplikasi, Bahasa Bugis Makassar, Android,unity.'),
(92, 'RANCANG BANGUN APLIKASI GAME MATH RACE BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh rendahnya minat pelajar SMA dalam mempelajari matematika dan kurang efektifnya kemampuan siswa dalam mengerjakan soal matematika. Matematika adalah salah satu ilmu pendidikan yang utama karena matematika berperan dalam melengkap ilmu lainnya. Berdasarkan latar belakang tersebut peneliti membuat suatu aplikasi yang disebut Aplikasi Game Math Race berbasis Android.\r\nJenis penelitian yang digunakan adalah kualitatif dengan menggunakan Design and Creation. Pengambilan data dilakukan dengan cara observasi, wawancara dan studi literatur. Perancangan dalam membangun sistem ini terbagi atas use case diagram, sequence diagram, activity diagram, flowchart, dan perancangan antarmuka. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah white box, black box dan kuisioner. Penelitian ini menghasilkan aplikasi pembelajaran dalam menjawab soal-soal dengan cepat dan tepat.\r\nKata Kunci : Matematika, Game, Android'),
(93, 'RANCANG BANGUN APLIKASI REKRUTMEN KARYAWAN BERBASIS ANDROID ', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh kurang efektifnya masyarakat dalam pencarian informasi lowongan pekerjaan dan kurang efisiennya dalam setiap perusahaan untuk menyebarluaskan informasi lowongan kerjanya untuk melakukan suatu perekrutan karyawan. Berdasarkan latar belakang tersebut peneliti membuat suatu aplikasi yang disebut Aplikasi Rekrutmen Karyawan Berbasis Android, yang bertujuan untuk membantu masyarakat dalam mencari informasi lowongan kerja secara efektif melalui perangkat mobilenya.\r\nPerancangan dalam membangun sistem ini terbagi atas use case diagram, class diagram, sequence diagram, activity diagram, Entity Relationship diagram, flowchart, struktur navigasi dan perancangan antarmuka. Jenis penelitian yang digunakan adalah kualitatif dengan menggunakan Eksperimental. Penelitian ini menggunakan metode pengumpulan data observasi, studi literature, dan observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah whitebox, blackbox dan kuisioner. Berdasarkan hasi ujicoba menunjukkan bahwa aplikasi ini dapat membantu masyarakat dalam mencari informasi lowongan kerja secara efektif melalui perangkat mobilenya tanpa harus mendatangi terlebih dahulu kantor atau perusahaan yang ingin dilamar, selain itu melalui aplikasi ini masyarakat dapat dengan mudah menemukan lokasi perusahaan melalui bantuan fitur maps.'),
(94, 'APLIKASI PELAPORAN PELAYANAN PUBLIK BERBASIS ANDROID (Studi Kasus Ombudsman Makassar)', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Lembaga Ombudsman Kota Makassar saat ini masih mengandalkan penerimaan pelaporan dan monitoring yang dilakukan oleh masyarakat terhadap bentuk-bentuk pelayanan publik masih bersifat manual. Artinya masyarakat dalam hal ini harus datang secara langsung kepada lembaga ombudsman. Ini menunjukkan belum terciptanya palayanan publik yang efektif dan efisien dengan asas cepat, tepat dan biaya murah.Perancangan dalam membangun sistem ini adalah use case diagram, class diagram, sequence diagram dan flowchart. Tujuan dari penelitian ini adalah untuk merancang aplikasi pelaporan pelayanan publik yang melakukan malaminidtrasi berbasis android. Jenis penelitian yang digunakan adalah jenis penelitian kualitatif dengan metode Design and creation. Aplikasi ini berjalan di sistem operasi Android, dirancang dengan bahasa pemrograman Java. Penelitian ini menggunakan metode wawancara dan dokumentasi. Metode perancangan aplikasi yang digunakan adalah waterfall. Teknik pengujian sistem yang digunakan pada penelitian ini adalah black box testing.\r\nBerdasarkan hasil penelitian aplikasi ini dapat digunakan untuk membantu dan mempermudah bagi masyarakat untuk memberikan pelaporan terhadap pelanggaran-pelanggaran hukum dan ketidakpuasan pelayanan publik yang dilakukan oleh lembaga negara, baik oleh lembaga pemerintahan, termasuk Badan Usaha Milik Negara (BUMN), Badan Hukum Milik Negara (BHMN) dan Badan Usaha Milik Daerah (BUMD) sebagai pemberi pelayanan publik yang dalam melaksanakan tugas dan fungsinya sesuai dengan peraturan dan perundang-undangan yang berlaku kepada Ombudsman dengan cepat, efisien dan biaya murah.\r\nKata Kunci: Pelaporan, Pelayanan Publik, Ombudsman'),
(95, 'RANCANG BANGUN SISTEM PAKAR BERBASIS MOBILE UNTUK MENDIAGNOSA MASALAH KULIT DENGAN MENGGUNAKAN ALGORITMA GENERATE AND TEST', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Kulit manusia terdiri dari berbagai lapisan, baik itu lapisan yang terlindungi maupun lapisan yang sangat rentan terhadap serangan dari luar seperti dari lingkungan. Belakangan ini terdapat penemuan-penemuan yang berhubungan dengan penyakit kulit dimana terdapat banyak cara bakteri dan virus kulit menyerang manusia seperti dari keadaan lingkungan, iklim atau suhu bahkan dari kontak langsung dengan inang atau induk virus. Penyakit kulit yang diderita oleh masyarakat saat ini cepat sekali menyebar dikarenakan kurangnya informasi dan pengetahuan tentang penyakit kulit. Oleh karena itu peneliti membuat riset sistem pakar untuk mendiagnosa penyakit kulit dengan menggunakan metode fordward dan backward chaining berbasis web disertai cara pencegahan dan pengobatannya. Sistem ini dibuat agar para penderita penyakit kulit mengerti dan memahami jenis penyakit kulit apa yang diderita dan system ini memberikan beberapa solusi pencegahan sesuai dengan tingkatan penyakit yang ada sekarang ini. Metode yang digunakan adalah Metode waterfall. Aplikasi ini berjalan pada perangkat mobile dengan sistem operasi Android dan dirancang menggunakan bahasa pemrograman Java dan DBMS MySQL. Pembangunan aplikasi ini menggunakan software Android Studio dan SQLite Browser. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram, class diagram, activity diagram, dan sequence diagram dan diuji menggunakan metode pengujian blackbox. Hasil dari penelitian ini adalah berupa program aplikasi yang dapat membantu user mengetahui jenis penyakit kulit yang diderita serta mendapat informasi yang luas mengenai penyakit kulit serta mengetahui teknik pengobatan dan cara pencegahannya.\r\nKata Kunci: Sistem Pakar, Algoritma Generate and Test, Kulit, Android.'),
(96, 'SISTEM LAYANAN PERUBAHAN JADWAL TATAP MUKA / PERTEMUAN KULIAH DI JURUSAN TEKNIK INFORMATIKA DAN SISTEM INFORMASI BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh munculnya permasalahan pada proses\r\npemindahan ataupun penambahan jadwal tatap muka/pertemuan kuliah yang kurang\r\ndemokratif, informasi tidak tersebar merata yang mengakibatkan ada mahasiswa yang\r\ntidak masuk pada mata kuliah tersebut karena kurangnya informasi tentang\r\npemindahan jadwal tatap muka/pertemuan kuliah pada Jurusan Teknik Informatika dan\r\nSistem Informasi. Berdasarkan latar belakang tersebut peneliti membuat suatu aplikasi\r\nyang disebut Sistem Layanan Perubahan Jadwal Tatap Muka/Pertemuan Kuliah\r\nJurusan Teknik Informatika dan Sistem Informasi Berbasis Android, yang bertujuan\r\nuntuk membantu mahasiswa dan dosen dalam mengubah dan melihat pertemuan\r\nataupun perubahan jadwal mata kuliah.\r\nPerancangan dalam membangun sistem ini terbagi atas use case diagram, class\r\ndiagram, sequence diagram, activity diagram, entity relationship diagram, flowchart,\r\nstruktur navigasi dan perancangan antarmuka. Jenis penelitian yang digunakan adalah\r\nkualitatif dengan menggunakan Design and Creation. Penelitian ini menggunakan\r\nmetode pengumpulan data observasi dan kuisioner. Metode perancangan yang\r\ndigunakan adalah waterfall dan teknik pengujian yang digunakan adalah whitebox dan\r\nkousioner. Penelitian ini menghasilkan sistem layanan perubahan jadwal tatap\r\nmuka/pertemuan kuliah dalam bentuk digital mobile yang mampu membantu\r\nmahasiswa dan dosen dalam mengubah dan melihat pertemuan ataupun perubahan\r\njadwal mata kuliah. Selain itu kesimpulan dari penelitian ini yaitu mengetahui\r\ninformasi jadwal tatap muka/pertemuan kuliah dengan adanya pemberitahuan atau\r\nnotifikasi, hanya dengan login berdasarkan id dosen dan NIM (nomor induk\r\nmahasiswa) yang sudah dibuat.\r\nKata Kunci: Jadwal Mata Kuliah, Mahasiswa,Android.'),
(97, 'RANCANG BANGUN APLIKASI INTERAKTIF E-BOOK READER DENGAN INTERUPSI NOTIFIKASI DAN FITUR PENERJEMAH E-BOOK DARI BAHASA ASING BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Teknologi yang semakin hari terus berkembang membuat masyarakat ikut berlomba-lomba mengikuti trend. Seperti halnya pada perkembangan smartphone yang sudah bisa dijangkau mulai dari anak-anak, remaja, maupun orang tua. Smartphone kini menjadi panutan mereka. Semua informasi dan pemberitaan kini telah tersedia pada apliaksi. Tidak halnya pada aplikasi e-book reader yang sudah memiliki banyak versi pada pengembangannya. Akan tetapi, dengan banyaknya aplikasi e-book reader yang dapat di download gratis atau berbayar, masih belum menjadi prasarana untuk dapat menambah minat baca masyarakat yang sangat memprihatinkan. Sehingga dibutuhkan suatu aplikasi e-book reader yang dapat mengurangi perhatian masyarakat terhadap akun media sosialnya dan mulai membaca berbagai genre buku pada satu aplikasi yang nyata dan lebih memberikan kenyamanan dikarenakan dapat menginterupsi notifikasi akun media sosial supaya dapat terfokus pada bacaan mereka. Adapun tujuan dari penelitian ini diharapkan dapat menghasilkan sebuah aplikasi E-Book Reader yang lebih efisien, ekonomis dan memberikan kenyamanan tanpa gangguan kemunculan notifikasi akun media sosial serta dapat ketersediaan e-book translate dalam bahasa Asing ke bahasa Indonesia yang dapat berjalan pada smartphone berbasis Android.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data wawancara dan observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan, memberikan kemudahan bagi pengguna untuk membaca lebih mudah daripada buku konvensional, menyenangkan dan menenangkan sehingga masyarakat lebih terfokus pada bacaannya tanpa ada kemunculan notifikasi akun media sosial.\r\nKata Kunci : Membaca, E-book, E-book Reader, Notifikasi, Android'),
(98, 'APLIKASI CLASS REMINDER UNTUK UIN ALAUDDIN MAKASSAR BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh sering kalinya jadwal perkuliahan yang telah dirancang sebelumnya mengalami perubahan secara tiba-tiba baik oleh dosen pengampu mata kuliah, maupun dari mahasiswa yang mengikuti mata kuliah tersebut. Perubahan jadwal kuliah ini kadang kala tidak diketahui oleh keseluruhan mahasiswa yang mengikuti mata kuliah tersebut dan menyebabkan keterlambatan bahkan ketidakhadiran dalam perkuliahan oleh mahasiswa yang tidak mendapatkan perubahan jadwal tersebut. Tujuan dari penelitian ini yaitu merancang dan membuat aplikasi pengingat kelas (class remainder) berbasis android yang mampu mengingatkan mahasiswa tentang jadwal perkuliahan, jadwal mid test, jadwal final test, dan batas waktu pengumpulan tugas\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi design and creation. Metode pengumpulan data yang digunakan yaitu studi pustaka. Metode perancangan aplikasi yang digunakan adalah metode waterfall. Penelitian ini diuji dengan menggunakan metode whitebox dan blackbox. Hasil pengujian menunjukkan bahwa aplikasi telah benar, tidak memiliki kesalahan dari segi logika dan fungsi, dan secara fungsional dapat menghasilkan output yang diharapkan. Berdasarkan hal tersebut dapat disimpulkan tujuan penelitian ini sudah tercapai.\r\nKata Kunci: Android, Reminder, Pengingat, Jadwal Kuliah, Java, MySQL.'),
(99, 'Rancang Bangun Media Pembelajaran Pengenalan Budaya Indonesia Berbasis Android Menggunakan Phonegap ', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatar belakangi Sebagai warga negara Indonesia sudah sepantasnya mengetahui dan melestarikan Budaya Indonesia. Pengenalan mengenai Budaya Indonesia ini sudah harus dimulai ketika masih menginjak masa kanak–kanak, yaitu dimana masa belajar tentang kehidupan di sekitarnya, agar budaya Indonesia di masa yang akan datang tetap dijaga dan dilestarikan oleh generasi selanjutnya.\r\nRancang bangun media pembelajaran pengenalan budaya Indonesia. Aplikasi ini berisi media pembelajaran, pakaian adat, tarian adat, lagu adat daerah, rumah adat, alat music, serta senjata tradisional yang ada di Indonesia.\r\nAplikasi ini berjalan pada perangkat di smartphone berbasis android dan dirancang menggunakan Phonegap dengan bahasa pemrograman web seperti HTML,CSS dan Javascript blackbox. Hasil dari penelitian ini adalah rancang bangun media pembelajaran pengenalan budaya Indonesia, Aplikasi ini diperuntukan secara khusus kepada peserta didik.\r\nKata Kunci: Android, Phonegap, HTML, CSS, Javascript, Waterfall, BlackBox, XHAMP'),
(101, 'APLIKASI SPEECH RECOGNITION DAN TEXT TO SPEECH PADA MESSENGER BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh kebutuhan menyelaraskan aktivitas komunikasi, khususnya mengirim dan menerima SMS, dengan tingkat mobilitas masyarakat yang semakin tinggi. Kendati semakin canggih berkat kemajuan teknologi komunikasi, aktivitas berkirim SMS tersebut seringkali harus dilakukan di saat sedang melakukan aktivitas lain yang menyita banyak perhatian dan mengurangi mobilitas masyarakat. Bagaimana meningkatkan proses komunikasi yang efektif dan efisien, serta sesuai dengan tuntunan agama untuk mengimbangi mobilitas manusia dan perkembangan teknologi komunikasi menjadi tantangan tersendiri untuk dihadapi dan diselesaikan, sehingga peneliti bertujuan membangun aplikasi messenger yang mendukung speech recognition dan text to speech berbasis Android yang dapat membantu meningkatkan mobilitas pengguna smartphone. Berdasarkan latar belakang tersebut peneliti membuat aplikasi yang disebut Aplikasi Speech Recognition dan Text to Speech Berbasis Android, yang bertujuan meningkatkan mobilitas dalam berkomunikasi.\r\nPerancangan dalam membangun sistem ini terbagi atas UML, flowchart, dan perancangan antarmuka, jenis penelitian yang digunakan adalah penelitian lapangan kualitatif eksperimental. Pengumpulan data meliputi observasi, dan studi literatur. Perancangan meliputi waterfall dan pengujian terdiri atas whitebox, blackbox dan kuisioner. Hasil uji coba menunjukkan aplikasi ini membantu masyarakat dalam proses SMS yang lebih singkat, cepat, dan mudah, dengan memanfaatkan speech recognition dan text to speech. Kesimpulan yang ditarik berdasarkan hasil uji coba adalah tujuan penelitian telah berhasil dicapai.\r\nKata Kunci: Speech Recognition, Text to Speech, Komunikasi, Android.'),
(102, 'MEDIA PEMBELAJARAN MAKHRAJ HURUF HIJAIYYAH MENGGUNAKAN ANIMASI INTERAKTIF', 2017, 'SAINS DAN TEKNOLOGI', 4, 'Penggunaan teknologi multimedia sebagai salah satu media pembelajaran merupakan salah satu alternatif untuk pebelajaran yang lebih menarik serta mudah dipahami, begitu juga dalam proses belajar membaca Alquran dengan tajwid yang benar maka seorang Qary wajib memperhatikan cara melafalkan huruf hijaiiyah dengan benar sesui dengan makhraj bacaanya. Penilitan ini bertujuan untuk membantu menerapkan cara pelafalan huruf hijaiyyah dengan baik dan sesuai kaidah dengan menggunakan media pembelajaran Makhraj Huruf Hijaiyyah yang dapat membantu pembaca untuk terhindar dari kesalahan-kesalahan ucapan yang mengakibatkan perubahan makna dari kalimat yang diucapkan pada saat membaca Alquran.\r\nJenis penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah media pembelajaran makhraj huruf hijaiyyah dengan menampilkan pergerakan mulut serta lidah. Dengan demikian dapat disimpulkan kesimpulan bahwa Aplikasi Media Pembelajaran Makhraj Huruf Hijaiyyah Animasi Interaktif merupakan media pembelajaran yang dapat digunakan oleh umat Islam agar dapat mengetahui cara membedakan pengucapan huruf hijaiyyah sehingga terhindar dari kesalahan-kesalahan pada bacaan yang dapat mengakibatkan perubahan makna dari kalimat yang diucapkannya dan memberikan pemparan tentang perbedaan huruf dan bunyinya, yaitu dengan cara menampilkan animasi pergerakan mulut pada objek 3D serta suara pengucapannya dan penjelasan tentang huruf.\r\nKata Kunci: Media Pembelajaran, Makhraj Huruf Hijaiyyah, Alquran, dan Animasi'),
(103, 'RANCANG BANGUN APLIKASI SISTEM PAKAR DIAGNOSA PENYAKIT ANEMIA DENGAN METODE FORWARD CHAINING BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Kesehatan merupakan salah satu faktor penting untuk melakukan aktivitas sehari-hari. Namun, sebagian masyarakat tidak peduli terhadap kesehatan tubuhnya sehingga pada akhirnya banyak penyakit yang terlambat didiagnosis menyebabkan kondisi pada tahap yang serius. Salah satu penyakit yang dimaksud adalah anemia. Pada umumnya, jika masyarakat terkena gejala penyakit anemia maka akan pergi ke rumah sakit ataupun puskesmas terdekat untuk melakukan pemeriksaan. Namun disisi lain mereka harus mengorbankan waktu yang cukup banyak untuk hal tersebut. Untuk itu perlu dibuatkan aplikasi sistem pakar cek anemia bagi masayarakat sebagai sarana dalam mengatasi permasalahan tersebut.\r\nDalam melakukan penelitian ini, digunakan jenis penelitian kualitatif dengan metode eksperimental. Kemudian melakukan metode wawancara dengan dokter spesialis dalam pengumpulan data. Selain itu, metode perancangan waterfall juga digunakan untuk pembuatan sistem. Aplikasi ini berjalan pada perangkat mobile dengan sistem operasi Android. Dirancang menggunakan bahasa pemrograman Java. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram , activity diagram, dan sequence diagram dan diuji menggunakan metode pengujian blackbox.\r\nDengan adanya penelitian ini maka dihasilkan sebuah sistem pakar penyakit anemia, dimana sistem ini mengadopsi pengetahuan dokter spesialis ke dalam sistem. Sistem pakar ini akan menghasilkan keluaran/output yang berupa hasil diagnosa dan cara penanganan jenis penyakit anemia tersebut.\r\nKata Kunci : Aplikasi, Sistem Pakar, Anemia, Forward Chaining, Android'),
(104, 'RANCANG BANGUN SISTEM KONVERSI TEKS KE HURUF BRAILE UNTUK ALAT BANTU BACA BAGI TUNANETRA MENGGUNAKAN ARDUINO UNO', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Sistem Konversi Teks ke Huruf Braile ini adalah salah satu system konversi yang dibuat bagi penyandang tunanetra sebagai salah satu alternative minimnya media baca yang dialami oleh penyandang Tunanetra.\r\nProses konversi dilakukan dengan cara mengambil data file txt dari MicroSD Shield dan disesuaikan dengan pola huruf Braile dari array yang telah disisipkan dalam program. Alat yang dirancang ini memiliki tiga jenis fungsi navigasi diantaranya, tombol navigasi kembali yang berfungsi untuk mengembalikan hasil konversi satu kata berdasarkan indeks spasi terakhir, tombol navigasi play/pause yang berfungsi untuk menghentikan sementara proses visualisasi huruf Braile, serta tombol navigasi kecepatan yang berfungsi untuk mengatur delay visualisasi huruf Braile. Mikrokontroler yang digunakan adalah mikrokontroler Arduino UNO sebagai kontrol utama sistem.\r\nJenis penelitian yang digunakan adalah penelitian kualitatif. Penelitian kualitatif yang dilakukan adalah metode penelitian eksperimental dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah alat yang dapat mengonversi file txt dari microSD kedalam bentuk kombinasi huruf Braile dengan Solenoid.\r\nKata kunci : Sistem Konversi, Huruf Braile, Media Baca Tunanetra, MicroSD, Solenoid dan Arduino UNO.'),
(105, 'IMPLEMENTASI AUGMENTED REALITY BERBASIS CLOUD COMPUTING PADA BUKU PELAJARAN BIOLOGI SMU', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Menurut Dimjati dan Mudjiono(1994:56-60), keaktifan siswa dapat didorong oleh\r\nperan guru. Guru berupaya untuk memberi kesempatan siswa untuk aktif, baik\r\naktif mencari, memproses dan mengelola perolehan belajarnya. Maka salah satu\r\ncara untuk mewujudkan hal tersebut adalah dengan mengembangkan media\r\npembelajaran bagi siswa. Sedangkan salah satu pelajaran yang sangat\r\nmembutuhkan media pembelajaran yang interaktif adalah pelajaran Biologi. Hal\r\nini dikarenakan materi Biologi dipandang sebagai suatu yang sederhana, namun\r\njuga dapat dipandang sebagai sesuatu yang rumit dan kompleks. Namun hal itu\r\npada saat sekarang ini diatasi oleh para guru dengan cara memperlihatkan gambar\r\ndua dimensi pada para siswa yang tentunya masih membuat siswa menghayal.\r\nAtau harus menggunakan mikroskop dalam menjelaskan hal-hal yang bersifat\r\nmikroskopis. Atau menggunakan torso untuk menjelaskan organ-organ dalam\r\nmanusia. Sedangkan jika melihat dari segi ekonomis, sebuah torso harganya\r\nratusan ribu, bahkan untuk sebuah mikroskop perbuahnya dapat mencapai\r\npuluhan juta rupiah.\r\nAdapun jenis penelitian kualitatif lapangan yang digunakan dalam penelitian iini\r\nadalah Design and Creation. Penelitian menggunakan metode pengumpulan data\r\ndengan observasi, wawancara dan study literatur. Metode perancangan yang\r\ndigunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black\r\nBox. Berdasarkan hasil uji coba menunjukkan bahwa aplikasi ini mudah\r\ndigunakan, dapat membantu guru dalam menjelaskan materi yang berkaitan\r\ndengan Biologi dan siswa pun dapat mengamati mikroorganisme dengan cara\r\nyang berbeda dan meyenangkan.\r\nKata Kunci: Augmented Reality, Cloud Computing, Biologi, SMA, Android.'),
(106, 'RANCANG BANGUN APLIKASI VIRTUAL INTERIOR DESIGN EVENT ORGANIZER BERBASIS IOS', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Mendesain interior ruangan untuk sebuah dekorasi kegiatan bukanlah kegiatan yang mudah dan cepat, meskipun dilakukan oleh kelompok professional seperti Event Organizer. Hal tersebut dikarenakan, meskipun dirancang oleh banyak orang akan tetapi, efektifitas dan fleksibilitas EO terbatas pada keinginan setiap client, sehingga kinerja seseorang dalam mendesain interior menjadi cenderung lebih lama dan membutuhkan perincian biaya yang lebih matang agar property yang akan digunakan benar-benar sesuai.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian kualitatif strategis dengan metode design and creation. Selain itu, pembuatan sistem yang akan dibangun menggunakan metode perancangan waterfall. Aplikasi ini berjalan pada smartphone berbasis iOS dan dirancang menggunakan bahasa pemrograman Java. Pembangunan aplikasi ini menggunakan XCODE dan Unity dengan pemanfaatan Augmented Reality Vuforia SDK. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram, class diagram, activity diagram, dan sequence diagram, dan diuji menggunakan metode pengujian blackbox.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah aplikasi platform mobile berbasis iOS melalui Adzan Event Organizer yang diberi nama aplikasi Virtual Interior Design Event Organizer yang disingkat VIDEO. Aplikasi ini telah diuji cobakan kepada interior desainer secara langsung dan aplikasi ini direkomendasikan untuk digunakan dalam membantu orang-orang yang ingin mendekorasi ruangannya dengan lebih efisien dan fleksibel.\r\nKata Kunci: Desain Interior, Virtual Design, Event Organizer, iOS, Unity, Vuforia'),
(107, 'Rancang Bangun Sistem Pengenalan Bahasa Isyarat Untuk Tuna Wicara Menggunakan Sarung Tangan Berbasis Mikrokontroler', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Sistem pengenalan bahasa isyarat merupakan sistem yang mampu menerjemahkan gerakan isyarat yang digunakan oleh penyandang cacat anak tuna wicara sesuai dengan standar Sistem Isyarat Bahasa Indonesia (SIBI), sehingga memudahkan orang awam (normal) dalam memahami bahasa isyarat. Sistem ini dibangun menggunakan Arduino Mega 2560 sebagai pengolah data, Sensor Flex sebagai pembaca lekukan jari tangan dan Sensor Accelerometer-Gyroscope sebagai pembaca kemiringan telapak tangan, serta modul Bluetooth HC-05 sebagai perantara pengiriman data ke aplikasi smartphone android.\r\nJenis Penelitian yang digunakan adalah metode penelitian kuantitatif dan metode pengujian adalah blackbox yang berfokus pada persyaratan fungsional perangkat. Hasil dari penelitian adalah sebuah sistem pengenalan bahasa isyarat untuk tuna wicara menggunakan sarung tangan berbasis mikrokontroler.\r\nDari hasil uji coba, sistem tersebut mampu mengenali bahasa isyarat sebanyak 10 buah kata isyarat dan beberapa karakter huruf serta angka menurut Sistem Isyarat Bahasa Indonesia (SIBI) menggunakan gerakan satu tangan dengan 5 jari dalam bentuk teks pada aplikasi smartphone android.\r\nKata Kunci : Sistem, Bahasa Isyarat, SIBI, Sarung Tangan, Sensor Flex, Sensor Accelerometer-Gyroscope, Bluetooth HC-05, Smartphone Android, Arduino Mega 2560'),
(108, 'RANCANG BANGUN PERANGKAT DRUM ELEKTRIK BERBASIS MIKROKONTROLER DENGAN MEMANFAATKAN BAHAN PLASTIK ', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Penelitian ini dilatar belakangi oleh banyaknya musisi yang memiliki akan kebutuhan alat musik, salah satunya drum elektrik. Terbatasnya kemampuan dalam aspek keuangan untuk memiliki alat musik yang diinginkan menjadi faktor yang sangat banyak dijumpai. Terlepas dari itu dimasyarakat banyak dijumpai limbah-limbah rumah tangga bisa yang bisa didaur ulang, dengan itu penelitian ini bertujuan untuk dapat mengembangkan perangkat drum elektrik dengan menggunakan microcontroller dan bahan limbah daur ulang. Penelitian ini difokuskan pada software drum MIDI Addictive Drum dan penggunaan limbah daur ulang dalam pembutan alatnya.\r\nJenis penelitian yang digunakan adalah penelitian kualitatif dengan strategi penelitian design and creation, teknik pengumpulan data menggunakan observasi, studi literatur. Data-data yang diperoleh kemudian dicocokkan dengan buku atau majalah yang mengupas tentang teknologi audio dan data-data dari internet. Perangkat akan dirangkai menggunakan Arduino UNO, piezoelectric dan terintegrasi dengan aplikasi pada komputer, dalam perancangannya menggunakan bahasa pemrograman C/C++. Untuk pengujiann penelitian ini menggunakan pengujian black box. Hasil penelitian menunjukan keefektifan dalam penggunaan alat yang telah dibuat. Dari segi teknis, drum MIDI elektrik dari bahan limbah daur ulang telah memiliki bentuk yang sesuai seperti drum elektrik yang dijual dipasaran. Dalam proses pengoperasiannya drum elektrik hanya menggunakan komputer dan perangkat tambahan seperti virtual instrument drum, sehingga tidak perlu dengan micking, tunning sampai proses tracking.\r\nKata kunci : Drum, MIDI, Microcontroller, Limbah daur ulang (plastik).'),
(109, 'SISTEM MONITORING INFUS MENGGUNAKAN ARDUINO MEGA 2560', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Infus adalah salah satu piranti kesehatan yang dalam kondisi tertentu digunakan\r\nuntuk menggantikan cairan yang hilang dan menyeimbangkan elektrolit dalam\r\ntubuh. Tetapi pada pengaplikasiannya sehari-hari kerap terjadi masalah yang di\r\nsebabkan oleh kelalaian penjaga pasien serta kurangnya sumber daya perawat yang\r\nada di rumah sakit atau puskesmas dalam memantau infus yang terpasang di pasien.\r\nPadahal hal ini dapat mengakibatkan komplikasi lain jika tidak di atasi secara cepat.\r\nSistem Monitoring Infus menggunakan Arduino Mega 2560 adalah solusi yang\r\ndirancang yang bertujuan untuk memudahkan perawat dalam pemantauan kondisi\r\ninfus pasien. Untuk pemantauan kondisi tersumbatnya infus menggunakan sensor\r\ntetesan. Untuk pemantauan kondisi cairan infus akan habis menggunakan sensor\r\ncairan. Sedangkan kondisi terakhir yaitu naiknya darah ke selang infus pasien\r\nmenggunakan sensor darah.\r\nMetode penelitian yang digunakan adalah penelitian kualitatif eksperimental.\r\nPenelitian kualitatif yang dilakukan adalah metode penelitian eksperimental.\r\nPenelitian ini menggunakan metode pengumpulan data observasi, studi literatur,\r\ndan wawancara. Teknik pengujian yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah sebuah aplikasi desktop yang dapat memonitoring atau\r\nmelihat perkembangan proses infus pasien melalui ruangan perawat sehingga\r\nmembantu meringankan tugas perawat untuk melihat kondisi pasien pengguna\r\ninfus.\r\nKata kunci : Sistem Monitoring, Infus, Sensor Tetesan, Sensor Cairan, Sensor\r\nDarah dan Arduino Mega 2560.'),
(110, 'SOLAR TRACKING SYSTEM BERBASIS ARDUINO', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Infus adalah salah satu piranti kesehatan yang dalam kondisi tertentu digunakan\r\nuntuk menggantikan cairan yang hilang dan menyeimbangkan elektrolit dalam\r\ntubuh. Tetapi pada pengaplikasiannya sehari-hari kerap terjadi masalah yang di\r\nsebabkan oleh kelalaian penjaga pasien serta kurangnya sumber daya perawat yang\r\nada di rumah sakit atau puskesmas dalam memantau infus yang terpasang di pasien.\r\nPadahal hal ini dapat mengakibatkan komplikasi lain jika tidak di atasi secara cepat.\r\nSistem Monitoring Infus menggunakan Arduino Mega 2560 adalah solusi yang\r\ndirancang yang bertujuan untuk memudahkan perawat dalam pemantauan kondisi\r\ninfus pasien. Untuk pemantauan kondisi tersumbatnya infus menggunakan sensor\r\ntetesan. Untuk pemantauan kondisi cairan infus akan habis menggunakan sensor\r\ncairan. Sedangkan kondisi terakhir yaitu naiknya darah ke selang infus pasien\r\nmenggunakan sensor darah.\r\nMetode penelitian yang digunakan adalah penelitian kualitatif eksperimental.\r\nPenelitian kualitatif yang dilakukan adalah metode penelitian eksperimental.\r\nPenelitian ini menggunakan metode pengumpulan data observasi, studi literatur,\r\ndan wawancara. Teknik pengujian yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah sebuah aplikasi desktop yang dapat memonitoring atau\r\nmelihat perkembangan proses infus pasien melalui ruangan perawat sehingga\r\nmembantu meringankan tugas perawat untuk melihat kondisi pasien pengguna\r\ninfus.\r\nKata kunci : Sistem Monitoring, Infus, Sensor Tetesan, Sensor Cairan, Sensor\r\nDarah dan Arduino Mega 2560.'),
(111, 'Rancang Bangun Sistem Parkir Valet Otomatis Menggunakan Robot Line Follower', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Masalah perparkiran adalah salah satu permasalahan kompleks yang banyak\r\nditemui di kota-kota besar, dimana jumlah kendaraan tidak sesuai dengan lahan\r\nparkir yang disediakan termasuk di kantor maupun di tempat-tempat umum lainnya.\r\nPenelitian ini bertujuan untuk merancang sistem parkir valet otomatis dengan\r\nbantuan robot line follower. Sistem parkir valet adalah suatu kegiatan untuk\r\nmemarkirkan kendaraan yang dibantu oleh petugas, sehingga tidak perlu lagi\r\npemilik kendaraan untuk mencari tempat parkir karena sudah dilakukan oleh\r\npetugas parkir. Dengan menggunakan robot parkir yang merupakan salah satu\r\nmobile robot yang dirancang untuk dapat memarkirkan kendaran dengan cepat pada\r\nsuatu arena yang telah ditentukan. Proses pendeteksian adanya kendaraan yang\r\nterparkir menggunakan infrared sensor dan dibuatkan alat sistem untuk\r\nmenampilkan kondisi parkir. mikrokontroller Atmega32 sebagai kontrol gerak\r\nrobot, Arduino Uno sebagai kontrol pengangkat kendaraan dan Arduino Mega 2560\r\nsebagai alat sistem informasi robot.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah robot parkir dengan 10 sensor photodioda\r\nsebagai pengikut garis yang digunakan untuk memarkirkan kendaraan pada lokasilokasi\r\nparkir yang masih kosong dan dibuatkan alat sistem informasi agar dapat\r\nmengetahui kondisi tempat parkir dengan pembacaan sensor inframerah yang dapat\r\nmengetahui adanya kendaraan yang parkir atau tidak sehingga dapat diketahui\r\nlokasi parkiran yang masih kosong.\r\nKata kunci : Parkir Valet, Robot Parkir, Infrared Sensor, Arduino Uno, Arduino\r\nMega 2560, Atmega32.'),
(112, 'SISTEM PENGENDALI BEBAN ARUS LISTRIK BERBASIS ARDUINO', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Sistem pengendali beban listrik adalah alat yang dirancang untuk mengatur\r\ndan mengontrol pemakaian listrik. Proses pembacaan arus listrik menggunakan\r\nsensor arus ACS712 sedangkan dalam proses menahan beban arus listrik saat\r\npemakaian yang telah diatur melebihi pemakaian menggunakan relay. Lcd\r\ndigunakan untuk menampilkan pemakaian listrik dan keypad digunakan untuk\r\nmenginput, Mikrokontroler yang digunakan adalah Mikrokontroler Arduino Mega\r\nsebagai kontrol utama sistem.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah sistem pengendali beban arus listrik yang\r\ndapat mengatur dan mengontrol pemakaian listrik agar dapat meminimalisir\r\npemakaian listrik.\r\nDengan diadakannya penelitian ini, peneliti berharap dapat mengurangi\r\npermasalahan-permasalahan yang berhubungan dengan pembayaran, mengukur\r\nbagaimana cara memonitoring serta menghitung biaya listrik pada tempat tinggal.\r\nKata kunci : Sistem Pengendali Beban Arus Listrik, ACS712, Relay, Arduino\r\nMega.'),
(113, 'KEAMANAN KENDAARAN BERMOTOR RODA DUA MENGGUNAKAN NEAR FIELD COMMUNICATION (NFC) DAN MIKROKONTROLER ARDUINO', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Dalam sistem keamanan pada kendaraan bermotor pada masa kini, keamanannya kurang terjamin, itu bisa dibuktikan dengan adanya laporan kasus pencurian sepeda motor yang setiap tahunnya semakin meningkat. Maka dari itu penulis ingin menciptakan tambahan sistem keamanan pada kendaraan bermotor yang menggunakan sistem NFC, yang berguna untuk mengurangi terjadinya pencurian sepeda motor, dengan alat sistem keamanan ini akan di letakan di bagian kendaraan bermotor yang akan di tambahakan alat, dengan cara menggunakan NFC TAG, yang menggunakan prangkat arduino. Dengan sistem ini diharapkan bisa mengurangi terjadinya pencurian sepeda motor yang marak terjadi di masa kini, Dengan perancangan sistem pada alat tersebut akan tercipta sebuah alat yang dapat mengurangi terjadinya pencurian sepeda motor dan mengurangi kerugian materi pada pengguna kendaraan bermotor, dan keamanan lebih terjamin.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Penelitian ini\r\nxv\r\nmenggunakan metode pengumpulan data observasi, studi literatur, dan wawancara. Teknik pengujian yang digunakan adalah Black Box. Hasil penelitian ini adalah sebauh kendaraan bermotor yang telah dipasangi dengan system keamanan kendaraan dengan menggunakan teknologi NFC dan arduino. Kata kunci : NFC, NFC TAG, arduino, sepeda motor'),
(114, 'SISTEM PENGISIAN VOUCHER LISTRIK JARAK JAUH VIA SMS BERBASIS MIKROKONTROLLER', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Sistem KWH digital (prabayar) yang ada saat ini mempunyai kelemahan dari sisi kontrol maupun perilaku. Pengisian harus dilakukan pada meteran, sehingga bila penghuni tidak berada di rumah maka listrik akan padam sampai dengan penghuni rumah datang dan mengisi ulang. Sistem pengisian voucher listrik jarak jauh ini adalah sistem yang dirancang untuk mempermudah pengisian voucer listrik dimanapun dan kapanpun.Sistem ini dibangun menggunakan SIM 800 untuk menerima sms berupa kode voucer listrik. Servo dan stepper di gunakan untuk menekan angka digit voucher pada kwh meter digital. Mikrokontroller yang digunakan adalah Ardiuno Uno sebagai kontrol utama sistem.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Penelitian ini menggunakan metode pengumpulan data observasi, studi literatur, dan wawancara. Teknik pengujian yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah sebuah alat yang dapat mengisi voucher listrik jarak jauh menggunakan sms.\r\nKata kunci:KWH Digital,SMS, SIM800, Servo,Stepper, dan Ardiuno Uno'),
(115, 'ROBOT PEMADAM API DENGAN SISTEM DETEKSI DINI', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Robot pemadam api adalah salah satu mobile robot yang dirancang untuk\r\ndapat melakukan aksi pemadaman api lilin pada letak terjadi munculnya api dan\r\nmemadamkannya pada suatu arena yang telah ditentukan. Proses pencarian titik api\r\nmenggunakan flame sensor dan DHT11 sedangkan dalam proses pendeteksi\r\nkebakaran dibuatkan alat sistem untuk menampilkan lokasi kebakaran. Motor DC\r\ndigunakan sebagai motor penggerak roda dan kipas dengan driver L298N sebagai\r\nmotor penggerak. Mikrokontroller yang digunakan adalah mikrokontroller\r\nAtmega32 sebagai kontrol robot dan Arduino Mega 2560 sebagai alat sistem\r\ninformasi robot.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah robot pemadam api dengan 10 sensor\r\nphotodioda sebagai pengikut garis dan dibuatkan alat sistem informasi agar dapat\r\nmengetahui letak kebakaran.\r\nKata kunci : Robot Pemadam Api, DHT11, Flame, Arduino Mega 2560,\r\nAtmega32.'),
(116, 'RANCANG BANGUN SISTEM PENGERING GABAH DENGAN MENGGUNAKAN ARDUINO', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Indonesia merupakan negara agraris, namun ironisnya Indonesia masih mengimpor beras dari negara lain. Salah satu alasan dilakukannya impor beras adalah tak lain karena gabah yang dihasilkan para petani Indonesia kurang maksimal jumlahnya untuk dijadikan cadangan beras nasional. Adapun tujuan dari penelitian ini adalah merancang dan membangun sistem pengering gabah dengan menggunakan arduino sehingga memudahkan dan mempercepat proses pengeringan gabah untuk menghasilkan gabah yang berkualitas baik sesuai standar bulog.\r\nJenis penelitian yang digunakan adalah jenis penelitian kualitatif dengan metode eksperimental. Hasil dari penelitian ini adalah alat pengering gabah. Kesimpulan dari penelitian ini adalah dari beberapa sampel yang telah diuji maka didapatkan kadar air pada gabah sebesar 14 %. yang telah sesuai dengan standar BULOG.\r\nKata kunci: Agraris, Beras, Gabah, Pengering.'),
(117, 'SISTEM PENGIDENTIFIKASI WARNA BAGI PENDERITA BUTA WARNA BERBASIS MIKROKONTROLER', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Mata pada dasarnya memiliki kepekaan terhadap cahaya dan warna, jika kepekaan terhadap warna terganggu maka akan dialami kelainan buta warna. Buta warna adalah suatu kelainan yang disebabkan ketidakmampuan sel-sel kerucut mata untuk menangkap suatu spektrum warna tertentu. Kasus buta warna yang paling sering terjadi adalah buta warna parsial yang menyebabkan penderitanya kesulitan dalam mengenali warna merah, hijau, biru dan kuning. Tujuan dari penulisan skripsi ini selain sebagai syarat untuk mencapai gelar sarjana komputer pada jurusan teknik informatika, juga untuk merancang sebuah alat pengidentifikasi warna berbasis mikrokontroller arduino uno untuk membantu penderita buta warna parsial dalam mengenali warna yang tidak mampu mereka lihat.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Penelitian ini menggunakan metode pengumpulan data observasi, studi literatur, dan wawancara. Teknik pengujian yang digunakan adalah Black Box.\r\nHasil penelitian ini adalah sebanyak 80% penderita buta warna parsial menyetujui akan adanya sebuah alat yang dapat mendeteksi jenis warna sehingga dengan alat ini dapat membantu mereka dalam kehidupan sehari-hari\r\nKata kunci : Alat pendeteksi warna, buta warna, sensor TCS3200, LCD 2004, I2C LCD module, arduino uno.'),
(118, 'ANALISA PERANCANGAN SISTEM PENDETEKSI SUARA PADA KAMERA DSLR BERBASIS MIKROKONTROLER ARDUINO UNO', 2017, 'SAINS DAN TEKNOLOGI', 2, 'inggris Digital Single Lens Reflex (DSLR) camera adalah kamera yang menggunakan sistem jajaran lensa jalur tunggal untuk melewatkan berkas cahaya menuju ke dua tempat, yaitu Focal Plane dan Viewfinder, sehingga memungkinkan photographer untuk dapat melihat objek melalui kamera yang sama persis seperti hasil fotonya. Adapun tujuan dari penelitian ini adalah merancang dan membuat alat pendeteksi suara pada sebuah kamera berbasis mikrokontroler sehingga dapat memudahkan para photographer untuk pengambilan suatu gambar dengan menggunakan suara.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah alat Pendeteksi Suara Pada Kamera DSLR Berbasis Mikrokontroler Arduino UNO dengan melakukan dua kali tepukan yang dapat mendeteksi suara tepukan dengan jarak maksimal 10 meter.\r\nKata Kunci : Analisa, Perancangan Sistem, Pendeteksi Suara, Kamera DSLR, Arduino UNO');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(119, 'PENGENDALIAN SIRKULASI DAN PENGUKURAN PH AIR PADA TAMBAK UDANG BERBASIS ARDUINO', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Indonesia yang merupaka negara maritim yang terdiri dari ribuan pulau, sehingga\r\nkebanyakan warga Indonesia yang bekerja sebagai petani tambak. Kegiatan budidaya\r\ntambak udang yang terus menerus menyebabkan terjadinya degradasi lingkungan, yang\r\nditandai dengan menurunnya kualitas air dengan pencemaran limbah rumah tangga\r\nataupun nelayan yang merusak kualitas air sehingga banyak petambak udang yang\r\nmengalami gagal panen karena perubahan nilai atau kadar pH pada air tambak yang\r\nsangat bepengaruh pada budidaya udang, penelitian ini bertujuan untuk mengetahui\r\nnilai pH air serta mengontrol sirkulasi air pada tambak, sehingga dalam\r\nmembudidayakan udang dapat sesuai dengan kebutuhan kadar pH air pada tambak.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian\r\nkuantitatif dengan eksperimental. Alat ini dibuat dengan menggunakan bahasa\r\npemrograman C/C++ Arduino. Pemodelanya menggunakan flowchart dan diuji dengan\r\nmenggunakan white box dan black box. Hasil pengujian menunjukkan bahwa alat ini\r\ndapat berfungsi dengan baik, baik dari segi logika maupun dari segi fungsi sehingga\r\ndapat ditarik kesimpulan bahwa dalam perancangan alat ini dengan tujuan untuk\r\nmemberikan kemudahan kepada petani tambak udang tradisional dalam mengontrol\r\nkadar pH air yang ada pada tambak serta memudahkan dalam sistem sirkulasi tambak\r\nsudah tercapai.\r\nKata Kunci : Pengukuran pH air, Tambak Udang, Arduino UNO'),
(120, 'SISTEM PENGENDALIAN PENGGUNAAN AIR PDAM BERBASIS ARDUINO (Studi Kasus: Rumah Kos di Makassar)', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Air adalah salah satu dari sekian banyak sumber daya alam yang sangat di butuhkan bagi kehidupan mahluk hidup. Di perkotaan, pelayanan jasa air bersih umumnya diselenggarakan oleh PDAM (Perusahaan Daerah Air Minum) yang disalurkan ke rumah-rumah penduduk yang mengalir dari sungai kemudian di tampung terlebih dahulu di bak-bak penampungan (reservoir) kemudian di saring dan di distribusikan ke rumah-rumah penduduk, salah satunya rumah kos yang dimana biasanya pembayaran air setiap kamar di rumah kos, rata untuk semua kamar. Padahal seperti yang diketahui bahwa pemakaian air di setiap kamar per bulannya berbeda-beda, ada yang banyak maupun sebaliknya. Kemajuan ilmu pengetahuan dan teknologi, pada prinsipnya dapat diterapkan untuk mengatasi masalah tersebut, yaitu dengan membuat alat ukur volume air PDAM yang bekerja secara elektronik. Volume air ini dapat diukur dengan menggunakan sensor flow meter, yang kemudian diproses oleh mikrokontroler dan ditampilkan dalam bentuk aplikasi android, berupa volume dan biaya yang harus dibayar per kamar setiap bulannya.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan konsep eksperimental, sedangkan metode pengumpulan data yang digunakan yaitu mengamati langsung penggunaan air PDAM di rumah kos di Makassar dan pengujian yang dilakukan adalah pengujian blackbox yang berfokus pada persyaratan fungsional perangkat lunak. Analisis yang digunakan mencakup analisis sistem dan analisis aplikasi. Adapun metode perancangan yaitu prototype.\r\nHasil dari penelitian ini adalah sebuah sistem yang dapat memonitor jumlah pemakaian air dan pembayaran per kamar di rumah kos. Hasil dari pengujian aplikasi ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan keinginan.\r\nKata Kunci : Air, PDAM, Rumah kos, Sensor flow meter, Arduino Mega 2560, Android, Shield GPRS, Server Hosting.'),
(121, 'Rancang Bangun Sistem Pendeteksi Keaslian dan Nominal Uang Untuk Tunanetra Berbasis Mikrokontroler', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Uang merupakan alat yang digunakan untuk melakukan transaksi jual beli dan sudah digunakan oleh seluruh manusia di setiap penjuru dunia. Hal ini sudah pasti menjadikan uang menjadi barang pokok untuk setiap orang, bahkan bagi para penyandang disabilitas seperti halnya tunanetra. Keterbatasan tunanetra dalam hal melihatmerupakan masalah dalam hal komunikasi sehingga mereka hanya mengandalkan indra peraba dan pendengar. Kelemahan tunanetra dalam melihat dan mengidentifikasi uang dapat menyebabkan uang tertukar, salah ambil, atau bahkan tertipu pada saat jual beli. Mengacu dari hal tersebut maka perlu adanya alat bantu yang dapat memudahkan tunanetra untuk mengidentifikasi keaslian dan nilai nominal uang.Tujuan penelitian ini adalah merancang alat yang dapat digunakan untuk mendeteksi keaslian dan nilai nominal uang kertas. Alat ini menggunakan sensor warna TCS3200-DB untuk mendeteksi warna uang kertas, dan sensor ultraviolet untuk mendeteksi keaslian uang. Lalu oleh mikrokontroller diubah menjadi data RGB dan dikeluarkan dalam bentuk suara.Jenis penelitian yang digunakan adalah jenis penelitian kualitatif dengan metode eksperimental, dan menggunakan teknik pengujian Black Box. Hasil dari penelitian ini adalah sistem dapat mengenali keaslian dan nominal uang. Sehingga mempermudah bagi pengguna, terkhususnya tunanetra dalam melakukan transaksi jual beli agar tidak salah menukar uang.\r\nKata Kunci: Sensor warna, sensor ultraviolet, suara, tuna netra, uang kertas.'),
(122, 'RANCANG BANGUN APLIKASI ASBABUN NUZUL AL-QUR’AN BERBASIS MOBILE', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Al-Qur’an merupakan pedoman hidup bagi ummat Islam yang diwahyukan kepada Nabi Muhammad SAW secara berangsur-angsur. Ayat-ayat Al-Qur’an dapat dikategorikan menjadi dua kelompok menurut sebab turunnya, pertama, ayat turun dengan adanya sebab; kedua, ayat yang turun tanpa sebab atau peristiwa yang melatar belakanginya. Mengetahui asbabun nuzul akan mengantarkan kita pada pengetahuan tentang makna-makna dan maksud-maksud ayat Al-Qur’an serta mengetahui kejadian yang menyertai turunnya ayat\r\nTujuan dari penelitian ini adalah untuk memudahkan kaum muslimin mengkaji Al-Qur’an dengan merancang dan membangun sebuah Aplikasi Asbabun Nuzul sebagai media informasi dan media kajian ilmu keislaman tentang sebab turunnya ayat Al-Qur’an. Dalam melakukan penelitian ini, jenis penelitian yang digunakan adalah metode penelitian kualitatif. Karena penelitian ini menyangkut tentang riset yang bersifat deskriftif dan cenderung menggunakan analisis. Hasil dari penelitian ini berupa aplikasi yang dapat menampilkan surah, ayat beserta sebab turunnya yang dijalankan pada system operasi Android.\r\nBerdasarkan pernyataan diatas, betapa mempelajari Asbabun Nuzul merupakan suatu hal yang urgen dalam konteks penafsiran Al-Qur’an. Untuk itu, dibuatlah sebuah aplikasi berbasis Mobile yang dapat memudahkan umat muslim untuk mencari dan mengkaji ayat-ayat Al-Qur’an sesuai Asbabun Nuzulnya.\r\nKata kunci : Al-Qur’an, Asbabun Nuzul, Mobile, Android'),
(123, 'ANALISIS SENTIMEN PENGGUNA TWITTER TERHADAP OBJEK PARIWISATA DI INDONESIA MENGGUNAKAN ALGORITMA PENGOLAHAN DEEP NATURAL LANGUAGE DARI IBM INSIGHTS UNTUK TWITTER', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatarbelakangi untuk memanfaatkan teknologi sosial media dalam hal mengetahui respon dan pendapat masyarakat terhadap objek pariwisata di Indonesia, juga untuk memperluas pasar dan mengelola hubungan dengan konsumen membutuhkan informasi sebagai pendukung keputusan. Salah satu informasi yang dapat digunakan adalah informasi dari media sosial. Twitter adalah raksasa utama media sosial, dengan jutaan pengguna dan memberikan wawasan yang unik, data yang ada di dalam Twitter bisa membantu mengetahui sentimen pasar secara objektif. Adapun tujuan dari penelitian ini adalah untuk menghasilkan polaritas sentimen pengguna Twitter mengenai objek pariwisata di Indonesia dalam bentuk diagram pie.\r\nPada penelitian ini menggunakan metode penelitian kualitatif dengan metode pengumpulan data yaitu studi literatur. Bahasa pemrogaraman yang digunakan adalah bahasa pemrograma Python sebagai backend dan HTML sebagai frontend-nya serta pengujian aplikasi ini menggunakan metode Black box.\r\nHasil dari penelitian ini adalah sebuah sistem berbasis web yang dapat menampilkan polaritas dari tweet apakah bernilai positif, negatif, atau netral, yang dapat memberikan kemudahan dalam mengetahui pendapat pengguna Twitter mengenai kata kunci atau topik yang dimasukkan.\r\nKata Kunci: Analisis Sentimen, Deep Natural Language, Twitter, IBM Insights, Objek Pariwisata'),
(124, 'IMPLEMETASI LOGIKA FUZZY UNTUK SIMULASI TRANSPORTASI OTOMATIS DI KEBUN BINATANG MENGGUNAKAN ROBOT LINE FOLLOWER', 2017, 'SAINS DAN TEKNOLOGI', 2, 'Robot transportasi otomatis adalah salah satu mobile robot yang dirancang untuk dapat membawa pegunjung berkeliling mengitari area kebun binatang. Robot ini menggunakan Arduino Nano sebagai sistem kendali robot, menggunakan motor DC sebagai motor penggerak roda dan juga dilengkapi sensor jarak (ping) yang akan membaca jika ada halangan di depan robot, karena kebun binatangnya memiliki konsep untuk membebaskan para binatangnya berkeliaran, sehingga ketika seekor binatang berada di atas lintasan, robot ini dapat mengetahui dan segera berhenti agar tidak terjadi tabrakan.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan.\r\nHasil penelitian ini adalah sebuah robot transportasi otomatis dengan 8 sensor photodioda sebagai pengikut garis dengan mengimpelementasikan logika fuzzy sebagai sistem kendalinya.\r\nKata kunci : Robot Transportasi Otomatis, Ping, Arduino Nano.'),
(125, 'Analisis dan Implementasi Teknik Data Mining dengan Metode Association Rule Mining untuk Memprediksi Strategi Pemasaran Produk Unilever pada PT. Tiran Makassar', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatarbelakangi karena masih banyaknya ditemukan produk yang sudah\r\nkadaluarsa tetapi tetap diperjualbelikan. Hal ini dapat terjadi salah satunya karena\r\nkesalahan strategi pemasaran. Oleh karena itu, analisis dan penerapan teknologi data\r\nmining diharapkan dapat memberikan solusi sebuah informasi baru yang dapat\r\ndijadikan sebagai strategi pemasaran agar dapat meminimalisir kejadian seperti\r\ndiatas. Kemudian tujuan dari penelitian ini yakni menghasilkan sebuah aplikasi dari\r\nyang didalamnya terdapat informasi dari hasil analisis teknik data mining sehingga\r\nmemudahkan PT. Tiran Makassar mendapatkan strategi untuk pemasaran produk\r\nUnilever Indonesia.\r\nPerancangan dalam membangun sistem ini terbagi atas Data Flow Diagram,\r\nflowchart, dan perancangan antarmuka. Aplikasi ini berbasis dan dirancang aplikasi\r\nini menggunakan codeigniter Framework, yang menggunakan pengujian White Box\r\ndan Black Box. Hasil penelitian ini adalah sebuah aplikasi berbasis website yang\r\nmenerapkan rule data mining. Kesimpulan penelitian ini membantu penemuan\r\ninformasi baru yang dapat memudahkan PT. Tiran Makassar menemukan strategi\r\nyang tepat untuk melakukan pemasaran pada produk Unilever Indonesia.\r\nKata kunci: Produk, Data, Data mining, codeigniter Framework, MySql, Web, White\r\nBox, Black Box.'),
(126, 'PENERAPAN ALGORITMA GENETIKA DAN PERBANDINGANNYA DENGAN ALGORITMA GREEDY DALAM PENEYELESAIAN KNAPSACK PROBLEM', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Permasalahan optimasi adalah suatu permasalahan yang mempunyai banyak solusi dan harus bisa ditentukan solusi mana yang dikatakan optimal. Optimasi bermanfaat dalam bidang jasa pengangkutan barang seperti pengangkutan barang ke dalam peti kemas. Dalam usaha tersebut, diinginkan keuntungan yang maksimal untuk mengangkut barang yang ada dengan tidak melebihi batas kapasitas. Permasalahan semacam ini sering dianalogikan dengan permasalahan Knapsack. Solusi dari Knapsack Problem dalam pengangkutan barang ke dalam peti kemas, dapat dilakukan dengan menerapkan algoritma genetika dan algoritma greedy. Algoritma genetika dan greedy yang diterapkan ke dalam suatu aplikasi dapat digunakan untuk menyelesaikan permasalahan Knapsack pada pengangkutan barang dalam peti kemas dengan perolehan profit lebih besar. Tujuan dari penelitian ini adalah menerapkan algoritma genetika dan membandingkan dengan algoritma greedy dalam menyelesaikan knapsack problem.\r\nDalam melakukan penelitian ini, jenis penilitian yang digunakan adalah design and creation, metode perancangan yang digunakan adalah metode waterfall. Aplikasi ini berbasis web. Pemodelannya menggunakan flowchart dan diuji dengan metode pengujian whitebox. Hasil dari pengujian whitebox berdasarkan perhitungan yang dilakukan dengan rumus Cyclomatic Complexity pada flowgraph sudah sesuai dengan alur program yang dirancang. Kesimpulan dari penelitian ini adalah baik algoritma genetika dan algoritma greedy sama-sama dapat menyelesaikan knapsack problem. Akan tetapi algoritma genetika lebih optimal dalam kasus dengan jumlah banyak barang. Sedangkan algoritma greedy unggul dalam kompleksitas waktu pencarian solusi.\r\nKata Kunci : Optimasi, Knapsack Problem, Algoritma Genetika, Algoritma Greedy'),
(127, 'RANCANG BANGUN SISTEM INFORMASI GEOGRAFIS SEBARAN JENIS HASIL PERTANIAN DAN POTENSI PENGEMBANGAN KOMODITAS PERTANIAN KABUPATEN ENREKANG SULAWESI SELATAN', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Kabupaten Enrekang adalah salah satu wilayah di Sulawesi Selatan yang berpotensi dalam sektor pertanian. Ketersediaan sumber daya alam yang memadai memungkinkan pengembangan komoditas yang beragam. Namun hal ini belum didukung oleh informasi data yang akurat tentang kondisi sebaran jenis hasil pertanian, dimana data dan informasi merupakan instrument yang sangat penting dalam perencanaan pembangunan sistem pertanian. Penelitian ini bertujuan untuk memberikan kemudahan kepada masyarakat dalam mendapatkan informasi produksi hasil pertanian yang senantiasa diperbaharui.\r\nAdapun jenis penelitian yang digunakan adalah metode kualitatif, metode penelitian yang digunakan untuk meneliti pada kondisi obyek yang alamiah, dimana peneliti adalah sebagai instrument kunci, teknik pengumpulan data dilakukan secara gabungan, analisis data bersifat induktif, dan hasil penelitian kualitatif lebih menekankan makna dari pada generalisai. Sedangkan metode pengumpulan data yang digunakan adalah Observasi dan Wawancara. Metode perancangan software yang digunakan pada penelitian ini adalah waterfall. Sedangkan metode pengujian yang digunakan adalah Blackbox dan WhiteBox.\r\nHasil dari Penelitian ini adalah sebuah Sistem Informasi Geografis Sebaran Jenis Hasil Pertanian dan Potensi Pengembangan Komoditas Pertanian Kabupaten Enrekang Sulawesi Selatan, sehingga penyajian informasi akan lebih mudah disampaikan dan memberi solusi mengenai rotasi tanaman yang tepat untuk setiap desa.\r\nKata Kunci: Potensi Pengembangan, Sebaran Hasil Pertanian, Sistem Informasi.'),
(128, 'SISTEM PELAYANAN PENUMPANG BRT (BUS RAPID TRANSIT) YANG BEROPERASI DI KOTA MAKASSAR', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh munculnya permasalahan kurangnya kesadaran masyarakat kota Makassar untuk menumpangi angkutan umum karena beberapa faktor, diantaranya fasilitas dan informasi yang masih minim. Berdasarkan latar belakang tersebut peneliti membuat suatu aplikasi yang disebut Sistem Pelayanan Penumpang (BRT) Bus Rapid Transit yang beroperasi di Kota Makassar, yang bertujuan untuk membantu penumpang bus mengetahui waktu kedatangan bus pada suatu halte di kota Makassar.\r\nPenelitian ini di laksanakan dengan mengambil data berupa lokasi dan kecepatan dari bus yang akan dilakukan di koridor-koridor BRT yang ada di kota Makassar. Sistem ini melalui 2 tahap yaitu tahap deteksi lokasi dan kecepatan bus kemudian tahap estimasi waktu bus mencapai halte yang ada di kota Makassar sesuai permintaan dari penumpang bus. Pada tahap deteksi lokasi dan kecepatan akan menggunakan aplikasi android yang terinstal di smartphone dengan GPS sebagai sensonya. Pada tahap estimasi waktu kedatangan bus di hate menggunakan rata-rata jarak dibagi dengan rata-rata kecepatan yang dikirim dari bus.\r\nHasil penelitian menunjukan bahwa penggunaan bus sebagai sensor berjalan dapat memberikan data yang dinamis sehingga data yang terkirim ke client atau penumpang lebih valid karena kondisi lalu lintas di kota Makassar tidak menentu. Untuk menentukan estimasi waktu dari sebuah bus ke halte menggunakan rata-rata dari kecepatan lebih tepat dibanding dengan menggunakan kecepatan sesaat dari bus yang dibagi dengan jarak tempuh oleh bus. Hal ini dipengaruhi dengan adanya kondisi jalanan di kota Makassar yang sering macet dan kondisi tidak menentu lainnya.\r\nKata Kunci: sistem informasi monitoring, deteksi lokasi, kecepatan kendaraan, GPS.'),
(129, 'RANCANG BANGUN SISTEM PENDUKUNG KEPUTUSAN DISTRIBUSI TENAGA MEDIS PUSKESMAS DI SULAWESI SELATAN DENGAN MENGGUNAKAN METODE ANALYTICAL HIERARCHY PROCESS (STUDI KASUS KABUPATEN MAROS)', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Pembangunan kesehatan harus dipandang sebagai suatu investasi untuk mendukung peningkatan kualitas sumber daya manusia. Saat ini terjadi ketimpangan dalam penempatan sumber daya manusia kesehatan di Kabupaten Maros yang salah satunya disebabkan oleh informasi yang kurang akurat. Akibatnya, kondisi sehat yang komprehensif tidak akan tecapai apabila ketersediaan dan distribusi sumber daya manusia hanya berkutat pada daerah yang tergolong maju, mengabaikan kesehatan di daerah tertinggal, serta hanya menempatkan berdasarkan jumlah penduduk. Penelitian ini bertujuan untuk memudahkan pemerintah dalam mendistribusikan tenaga medis dengan melihat nilai bobot dari masing-masing puskesmas, agar puskesmas yang memiliki nilai bobot tertinggi menjadi prioritas pemerintah dalam penempatan tenaga medis.\r\nAdapun jenis penelitian yang digunakan adalah metode design and creation. Metode ini dilakukan dengan menggabungkan antara metode penelitian dan metode pengembangan sistem. Sedangkan metode pengumpulan data yang digunakan adalah Wawancara dan Studi Literatur. Metode perancangan software yang digunakan pada penelitian ini adalah waterfall. Sedangkan metode pengujian yang digunakan adalah Black Box dan White Box. Hasil dan Kesimpulan Penelitian ini adalah sebuah Sistem pendukung keputusan distribusi tenaga medis puskesmas di Sulawesi Selatan dengan menggunakan metode Analytical Hierarchy Process (AHP) yang mempermudah pemerintah dalam menentukan puskesmas prioritas penempatan tenaga medis dengan mengacu pada nilai bobot tertinggi masing-masing puskesmas di Kabupaten Maros..\r\nKata Kunci: Sistem Pendukung Keputusan, Analytical Hierarchy Process, Kabupaten Maros.'),
(130, 'Implementasi Kombinasi Algoritma Asimetris Rivest Shamir Adleman Dan Algoritma Simetris Advanced Encryption Standard Pada Aplikasi Pesan Singkat', 2017, 'SAINS DAN TEKNOLOGI', 3, 'mengamankan informasi yang bersifat rahasia (pribadi) saat proses pengirimannya dan tidak adanya proteksi terhadap isi pesan. Dari masalah ini, maka dibutuhkan sistem yang dapat memberikan pengamanan terhadap isi pesan rahasia pada aplikasi pesan singkat. Pada skripsi ini, penulis mencoba membangun dan mengembangkan sebuah aplikasi pesan singkat untuk mengamankan pesan menggunakan sistem hybrid cryptosystem. Tujuan dari penelitian ini adalah 1). Untuk mengetahui teknik dan algoritma yang dapat digunakan untuk mengamankan isi pesan pada aplikasi pesan singkat berbasis Android, 2). Untuk mengetahui langkah-langkah algoritma asimetri Rivest Shamir Adleman (RSA) dan algortima simetri Advanced Encryption Standard (AES) dalam mengamankan pesan, dan 3). Untuk mengetahui cara mengimplementasikan algoritma asimetri Rivest Shamir Adleman (RSA) dan algortima simetri Advanced Encryption Standard (AES) dalam mengamankan pesan pada aplikasi pesan singkat.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian kualitatif dengan perancangan sistemnya menggunakan Unified Modelling Language. Teknik pengujian yang digunakan pada penelitian ini adalah pengujian White Box. Hasil dari penelitian ini berupa aplikasi pesan yang mampu mengenkripsi pesan plaintext/asli menjadi pesan ciphertext. Kemudian mendeskripsi pesan ciphertext menjadi pesan plaintext/asli. Aplikasi ini menggunakan teknik kriptografi dengan menggabungkan dua algoritma yakni algoritma asimetri Rivest Shamir Adleman untuk melakukan enkripsi dan deskripsi terhadap kunci simetri/sesi dan algoritma simetri Advanced Encryption Standard untuk melakukan enkripsi dan deskripsi terhadap pesan plaintext dan kunci simetri/sesi. Kemudian kedua algoritma ini akan diimplementasikan pada aplikasi pesan singkat menggunakan bahasa Java dengan IDE eclipse.\r\nKata Kunci : hybrid cryptosystem, kunci simetri (sesi), pesan plaintext/asli, pesan ciphertext, AES dan RSA'),
(131, 'PERANCANGAN MEDIA TERAPI MENGGUNAKAN VIRTUAL REALITY DENGAN METODE DESENTISIASI UNTUK PENDERITA FOBIA TERHADAP HEWAN', 2017, 'SAINS DAN TEKNOLOGI', 4, 'Fobia merupakan ketakutan yang irasional, sejenis gangguan kecemasan, dimana penderitanya mengalami ketakutan tanpa henti terhadap sebuah situasi, benda, atau tempat tertentu. Fobia dapat menyerang orang-orang dari berbagai usia, jenis kelamin, dan status sosial ekonomi, dan jumlah wanita yang terserang fobia lebih banyak dibandingkan dengan laki-laki. Untuk mengatasi fobia dapat dilakukan dengan terapi desentisiasi yaitu terapi secara bertahap, dimana pasien dihadapkan objek yang tidak terlalu mirip dengan objek asli, sampai mirip ataupun dengan jarak yang jauh sampai jarak dekat dengan objek tersebut. Berdasarkan masalah yang ada, dirancang sebuah aplikasi Perancangan Media Terapi menggunakan Virtual Reality dengan Metode Desentisiasi untuk Penderita Fobia terhadap Hewan yang nantinya memungkinkan pengguna bisa berinteraksi terhadap objek nyata yang disimulasikan menggunakan komputer.\r\nMetode penelitian yang digunakan adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi literatur. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi media terapi ini lebih efektif karena penderita fobia terhadap hewan seolah - olah melihat hewan yang nyata di lingkungan yang nyata, sehingga pada saat proses terapi tahap lanjut tidak mengalami ketakutan berlebih.\r\nKata Kunci : Fobia, Hewan, Metode Desentisiasi, Virtual Reality'),
(132, 'APLIKASI PEMODELAN 3D VIRTUAL REALITY MASJIDIL HARAM BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Di setiap penyelenggaraan haji, selalu diwarnai kisah pilu dan menjadi\r\npermasalahan hangat bagi sejumlah calon jamaah haji yang berangkat ke tanah\r\nsuci. Hal ini disebabkan karena banyak jamaah haji yang kebingungan dengan\r\nletak atau posisi dari objek – objek yang ada di Masjdili Haram. Hal ini\r\ndisebabkan karena Masjidil Haram memiliki luas kurang lebih 656.000 m2 yang\r\nterdiri dari tiga lantai, membuat beberapa jamaah haji sering tersesat apabila ingin\r\nmengunjungi beberapa objek yang ada disana. Untuk itu dibutuhkan beberapa\r\nsolusi untuk menangani semua masalah tersebut, yaitu berupa teknologi yang\r\nmemungkinkan seseorang untuk bisa merasakan kemegahan dari Masjidil Haram.\r\nTujuan dalam penelitian ini adalah untuk merancang Aplikasi Pemodelan 3D\r\nVirtual Reality Masjidil Haram yang nantinya memudahkan pengunjung\r\nmengetahui objek – objek apa saja yang tersedia di Masjidil Haram.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis\r\nyang digunakan adalah Design and Creation. Penelitian ini menggunakan metode\r\npengumpulan data observasi dan studi literatur. Metode perancangan yang\r\ndigunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black\r\nBox.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan,\r\nmemberikan informasi visual yang lebih baik daripada layanan sejenis,\r\nmenyenangkan sehingga calon jamaah haji tidak merasa bosan serta membantu\r\nmeningkatkan pemahaman calon jamaah haji.\r\nKata Kunci: Ibadah Haji, Masjidil Haram, Android, Virtual Reality.'),
(133, 'PEMANFAATAN TEKNOLOGI VIRTUAL REALITY SEBAGAI MEDIA PEMBELAJARAN INTERAKTIF UNTUK SISTEM TATA SURYA BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Pada dunia pendidikan, semakin berkurangnya minat belajar siswa dikarenakan perkembangan teknologi hiburan yang semakin menyuguhkan hal-hal menarik dan interaktif seperti film kartun maupun animasi tiga dimensi (3D), sedangkan media pembelajaran yang saat ini digunakan masih didominasi oleh buku yang berisikan tulisan dan gambar. Pada pelajaran IPA kelas VI tentang materi sistem tata surya yang penyampaiannya masih menggunakan papan tulis serta gambar yang ada dibuku yang terkesan kurang menarik. Sehingga dibutuhkan suatu aplikasi sebagai media pembelajaran untuk meningkatkan minat siswa dalam mempelajari sistem tata surya. Tujuan dalam penelitian ini adalah merancang dan membangun aplikasi sebagai media pembelajaran interaktif sistem tata surya dengan memanfaatkan teknologi Virtual Reality berbasis Android yang nantinya menarik minat belajar siswa.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi literatur. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan, memberikan informasi visual yang lebih baik, menyenangkan sehingga siswa tidak merasa bosan serta membantu meningkatkan pemahaman siswa.\r\nKata Kunci: Pendidikan, Sistem Tata Surya, Android, Virtual Reality.'),
(134, 'APLIKASI PEMODELAN 3D VIRTUAL REALITY ANATOMI KERANGKA MANUSIA BERBASIS ANDROID', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Pada pembelajaran ilmu pengetahuan alam (IPA) dan Biologi di sekolah perlu\r\nmendapat perhatian yang serius terutama dari pendidik, karena pembelajaran\r\ntersebut merupakan konsep dasar untuk mengetahui segala sesuatu tentang alam,\r\nbukan hanya tentang hewan dan tumbuhan, tetapi pada pelajaran ini diajarkan juga\r\nuntuk mengenal struktur tubuh dari manusia. Pengenalan struktur tubuh manusia\r\npada peserta didik tidak di lakukan dalam satu jenjang pendidikan saja, tetapi di\r\nlakukan secara bertahap pengenalan mulai dari Sekolah Dasar dalam pelajaran IPA\r\nkemudian kembali diajarkan pada jenjang Sekolah Menengah Pertama dalam mata\r\npelajaran Biologi dan pada jenjang pendidikan Sekolah Menengah Atas juga\r\ndiajarkan hal yang serupa pada mata pelajaran yang sama, yakni Biologi. Pada\r\nbangku Sekolah Menengah Atas, para siswa cenderung merasa kesulitan dalam\r\nmempelajari kerangka manusia. Kendala umum yang dialami oleh siswa ialah\r\nmenghafalkan nama – nama dari semua jenis tulang yang ada pada kerangka\r\nmanusia karena menggunakan bahasa latin yang sulit untuk diingat. Berdasarkan\r\nmasalah yang ada, dirancang sebuah aplikasi Virtual Reality Anatomi Kerangka\r\nManusia untuk lebih memudahkan para siswa dalam mempelajari tentang Kerangka\r\nManusia.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis\r\nyang digunakan adalah Design and Creation. Penelitian ini menggunakan metode\r\npengumpulan data observasi dan studi literatur. Metode perancangan yang\r\ndigunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan,\r\nmemberikan informasi yang lebih baik daripada layanan sejenis, menyenangkan\r\nsehingga para siswa tidak merasa bosan serta membantu meningkatkan pemahaman\r\npara siswa.\r\nKata Kunci: Pendidikan, Biologi, Kerangka Manusia, Android, Virtual Reality.'),
(135, 'RANCANG BANGUN APLIKASI INTERAKTIF PROSES PERSALINAN NORMAL MENGGUNAKAN VIRTUAL REALITY UNTUK CALON BIDAN ( STUDI KASUS: AKBID SYEKH YUSUF GOWA)', 2017, 'SAINS DAN TEKNOLOGI', 3, 'Dilihat kenyataannya sekarang ini, para mahasiswa calon bidan tersebut terkendala dengan metode pembelajaran pada saat masa perkuliahan yang lebih banyak merujuk ke teori daripada praktek langsung. Akibatnya mahsiswa masih canggung dan belum terbiasa dalam menangani proses persalinan. Sehingga memungkinkan terjadinya malpraktek. Selain itu, metode pembelajaran konvensional dengan kuliah dan demonstrasi oleh dosen kepada mahasiswa menggunakan phantom (alat peraga) dan buku, di rasa belum memberikan pemahaman yang cukup bagi mahasiswa. Perkembangan teknologi yang semakin pesat juga membawa pengaruh dalam dunia pendidikan di Indonesia dalam mempermudah proses belajar mengajar. Penelitian ini bertujuan untuk merancang dan membangun suatu pembelajaran interaktif proses persalinan dengan menggunakan virtual reality sebagai sarana pendukung proses pembelajaran bagi mahasiswa dan dosen , serta untuk menambah value praktikum.\r\nJenis penelitian yang digunakan adalah kualitatif dengan menggunakan Design and Creation serta menggunakan pendekatan penelitian santifik. Penelitian ini menggunakan metode pengumpulan data dengan wawancara, observasi dan studi literatur. Aplikasi ini berjalan pada perangkat mobile berbasis Android.Metode perancangan yang digunakan adalah waterfall dengan teknik pengujian Black Box dan White Box. Berdasarkan hasil uji coba menunjukkan bahwa aplikasi ini dapat berfungsi dengan baik, baik dari segi logika maupun fungsi. Karena itu dapat disimpulkan bahwa aplikasi ini dapat memudahkan proses belajar mengajar.\r\nKata Kunci: Simulasi, Proses Persalinan, Virtual Reality, Android'),
(136, 'ANALISIS DAN PERANCANGAN SISTEM INFORMASI BERBASIS WEB DAN ANDROID PADA KLINIK GIGI LISDA MEDICA DI KABUPATEN BULUKUMBA SULAWESI SELATAN', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatarbelakangi karena pihak klinik masih menggunakan media buku dalam mencatat semua data-data pasien sehingga menyulitkan pada saat penyajian datanya. Penyajian data biasanya membutuhkan waktu yang lama dan bisa menyebabkan data hilang atau rusak karena hanya dicatat dalam sebuah buku. Oleh karena itu, hadirnya perkembangan teknologi Sistem Informasi berbasis Web dan Android diharapkan dapat memberikan solusi dari permasalahan yang ada pada Klinik Gigi sehingga kesalahan-kesalahan seperti yang telah dijelaskan tadi dapat diminimalisir.\r\nPerancangan dalam membangun sistem ini terbagi atas Data Flow Diagram, use case diagram, dan perancangan antarmuka. Aplikasi ini berbasis dan dirancang menggunakan bahasa pemrograman HTML5, CSS3, PHP, Javasript / JQuery, MySqL, Web Browser: chroom, Mozilla Firefox C#(c Sharp). Pembangunan aplikasi ini menggunakan Bootstrap, codeigniter Framework, yang menggunakan pengujian Black Box. Hasil penelitian ini adalah sebuah apliksi web dan Android. Kesimpulan dari penelitian ini yaitu memudahkan pihak klinik dalam mendata dan menyajikan data klinik secara efektif dan efisien. serta memudahkan pasien untuk berkonsultasi via online dengan dokter telah tercapai.\r\nKata kunci: Klinik gigi, Lisda Medica, Sistem Informasi, Android HTML5,CSS3, PHP, Javascript / JQuery,MySql, web browser, Bootstrap,codeigniter.'),
(137, 'RANCANG BANGUN SISTEM MONITORING ACCESS POINT BERBASIS WEB PADA KAMPUS II UIN ALAUDDIN MAKASSAR', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Universitas Islam Negeri (UIN) Alauddin Makassar adalah salah satu pengguna jaringan komputer dengan lebih dari satu gedung yang saling terhubung ke jaringan luar kampus. Infrastruktur jaringan Pustipad menyediakan perangkat jaringan, media transmisi dan layanan akses internet di UIN Alauddin Makassar agar seluruh user dapat terhubung dengan pengguna lainnya di ruang lingkup universitas. Dengan banyaknya perangkat jaringan dan media transmisi yang menghubungkan antar user, network administrator mengalami kesulitan untuk selalu memeriksa keadaan perangkat jaringan yang ada apakah perangkat jaringan tersebut saling terhubung atau tidak. Tersebarnya perangkat disetiap gedung juga membuat proses pengawasan perangkat menjadi sulit. Pengawasan yang rutin dibutuhkan agar dapat mengetahui kondisi perangkat jaringan terutama pada perangkat access point.. Berdasarkan latar belakang tersebut peneliti bertujuan merancang dan membangun sistem Monitoring Access Point berbasis Web pada kampus II UIN Alauddin Makassar sehingga dapat mempermudah network administrator untuk memonitoring perangkat Access Point yang digunakan.\r\nPerancangan dalam membangun sistem ini terbagi atas data flow diagram, perancangan tabel, flowchart, dan perancangan antarmuka. Jenis penelitian yang digunakan adalah penelitian lapangan kualitatif eksperimental, yang bersifat deskriptif. Penelitian ini menggunakan metode pengumpulan data observasi, studi literatur, dan observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah whitebox dan blackbox. Hasil uji coba menunjukkan bahwa aplikasi ini dapat membantu masyarakat dalam proses berkirim pesan yang lebih singkat, cepat, dan mudah, dengan memanfaatkan fitur speech recognition dan text to speech. Kesimpulan yang dapat ditarik berdasarkan hasil uji coba adalah bahwa tujuan penelitian telah berhasil dicapai dan sistem ini dapat mempermudah network administrator untuk mengawasai kinerja perangkat access point.\r\nKata Kunci: Monitoring, Access Point, Web.'),
(138, 'SISTEM PENILAIAN KINERJA DOSEN BERDASARKAN COURSE EVALUATION SURVEY DAN BEBAN KERJA DOSEN BERBASIS WEB', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Kompetensi tenaga pendidik, khususnya dosen, diartikan sebagai seperangkat pengetahuan, keterampilan dan perilaku yang harus dimiliki, dihayati, dikuasai dan diwujudkan oleh dosen dalam melaksanakan tugas profesionalnya. Tugas utama dosen adalah pelaksanaan Tridharma Perguruan Tinggi dengan beban kerja paling sedikit sepadan dengan 12 (dua belas) SKS dan paling banyak 16 (enam belas) SKS pada setiap semester sesuai dengan kualifikasi akademik. Dalam organisasi apapun, kegiatan penilaian kinerja atau unjuk kerja dari setiap karyawan merupakan kegiatan yang umum dilakukan. Demikian pula dalam organisasi pendidikan tinggi baik yang berbentuk akademi, politeknik, institute, sekolah tinggi maupun universitas. Secara umum penilaian kinerja adala proses mengevaluasi kinerja karyawan dengan tujuan untuk meningkatkannya. Pada penelitian ini membuat atau merancang suatu “Sistem Penilaian Kinerja Dosen Berdasarkan Course Evaluation Survey dan Beban Kerja Dosen.\r\nPada penelitian ini menggunakan jenis penelitian kualitatif dengan konsep design and creation, sedang metode pengumpulan data yang digunakan yaitu mengumpulkan, memilah-milah, mengklasifikasikan, dan mencatat yang dihasilkan catatan lapangan serta memberikan kode agar sumber datanya tetap dapat ditelusuri. Analisis yang dilakukan mencakup analisis sistem dan analisis aplikasi. Aplikasi diuji menggunakan black box.\r\nHasil dari pengujian aplikasi ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan keinginan. Dan dapat memberikan kemudahan dan membantu mahasiswa dan dosen dalam proses penilaian CES dan membantu dosen dalam hal BKD.\r\nKata Kunci: CES, BKD, Mahasiswa, Dosen, Kinerja, Web'),
(139, 'RANCANG BANGUN SIMULASI SISTEM PENILAIAN AKREDITASI JURUSAN BERDASARKAN INSTRUMEN PENILAIAN AKREDITASI BAN-PT BERBASIS WEBSITE', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Salah satu kriteria untuk menilai layak atau tidaknya, baik atau buruknya suatu Program Studi di suatu Institusi adalah dengan melihat status akreditasinya. Status akreditasi suatu Perguruan Tinggi merupakan cermin kinerja dari Perguruan Tinggi yang bersangkutan dan menggambarkan mutu, efisiensi, dan relevansi terhadap program studi yang diselenggarakan. Program Studi harus mampu mengatur dirinya sendiri dalam upaya meningkatkan dan menjamin mutu pendidikan secara berkelanjutan, baik yang berkenaan dengan masukan, proses maupun keluaran program akademik dan layanan yang akan diberikan kepada masyarakat selaras dengan bidang pendidikan yang dikelolanya.\r\nPenelitian ini bertujuan untuk memberikan prediksi akreditasi mengenai hal-hal yang menjadi faktor-faktor yang dipertimbangkan ketika akreditasi dilakukan oleh BAN-PT. Batasan masalah pada penelitian ini, yaitu sistem ini merupakan sistem prediksi, bukan rekomendasi. Sistem mengolah data input untuk menghasilkan estimasi nilai akreditasi dan rinciannya. Metode pengembangan sistem yang akan digunakan pada penelitian ini adalah menggunakan waterfall. Metode ini merupakan metode yang paling sering digunakan oleh system analyst pada umumnya.\r\nHasil dari penelitian ini adalah menghasilkan sebuah sistem yang mampu melakukan prediksi nilai akreditasi suatup Program Studi sarjana dan mampu menganalisis hal-hal apa saja yang sebaiknya dipertahankan, ditingkatkan atau dihilangkan demi mendapatkan nilai yang sempurna ketika dilakukan akreditasi oleh BAN-PT, sehingga peluang suatu Program Studi mendapatkan nilai akreditasi yang sempurna bernilai besar.\r\nKata Kunci: Sistem Simulasi Akreditasi, BAN-PT, Program Studi, Kualitas, Efesiensi, Relevansi.'),
(140, 'RANCANG BANGUN SISTEM PENDATAAN ANAK PUTUS SEKOLAH PADA DINAS PENDIDIKAN KOTA MAKASSAR BERBASIS WEB', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Anak putus sekolah adalah murid yang tidak dapat menyelesaikan program belajar sebelum waktunya selesai atau murid yang tidak tamat menyelesaikan program belajarnya. Akibat yang disebabkan anak putus sekolah sangat banyak, diantaranya adalah kenakalan remaja, tawuran, kebut-kebutan di jalan raya, minum–minuman keras dan perkelahian, akibat lainnya juga adalah perasaan minder dan rendah diri karena kurangnnya pengetahuan yang dimiliki. Saat ini di Dinas Pendidikan Kota Makassar belum memiliki data yang akurat mengenai jumlah anak putus sekolah di kota Makassar. Hal ini terjadi karena penanganan masalah pendataan anak putus sekolah sering ditangani oleh beberapa orang yang berbeda dan tidak ada rekapitulasi data yang akurat. Dengan demikian, pihak Dinas Pendidikan Kota Makassar tidak dapat memberikan laporan secara cepat dan akurat yang menyebabkan sulit mengambil kebijakan yang layak kepada anak yang putus sekolah.\r\nOleh karena itu dibangunlah sebuah sistem pendataan anak putus sekolah pada Dinas Pendidikan Kota Makassar berbasis web sehingga membantu pemerintah dalam mengambil kebijakan yang layak kepada anak yang putus sekolah agar memperoleh masa depan yang lebih baik.\r\nKata Kunci : sistem, anak putus sekolah, web'),
(141, 'RANCANG BANGUN SISTEM VIRTUAL TOUR WISATA ALAM RAMMANG-RAMMANG DI DESA SALENRANG KABUPATEN MAROS MENGGUNAKAN PENDEKATAN PANORAMA 360 BERBASIS WEB', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Rammang-rammang adalah salah satu tempat wisata alam yang ada di kabupaten Maros. Meskipun letaknya mudah di temukan, karena sedikitnya informasi mengenai Rammang-rammang dan belum adanya website official untuk mengeksplor objek-objek wisatanya membuat para pengunjung kurang tertarik untuk mengunjungi wisata alam Rammang-rammang ini. Adapula masyarakat yang memiliki minat dan ketertarikan yang tinggi akan wisata alam, tetapi memiliki keterbatasan fasilitas baik kendaraan maupun biaya sehingga tidak dapat langsung ke tempat tersebut. Untuk itu dibutuhkan beberapa solusi untuk menangani semua masalah tersebut, yaitu berupa teknologi yang memungkinkan seseorang untuk bisa merasakan dan memvisualisasikan informasi dalam bentuk panorama 360 . Tujuan dalam penelitian ini adalah untuk merancang Sistem Virtual Tour Wisata Alam Rammang-rammang yang nantinya memudahkan pengunjung mengetahui objek – objek apa saja yang tersedia di Rammang-rammang.\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi literatur. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan, memberikan informasi visual yang lebih baik daripada layanan sejenis, menyenangkan sehingga calon pengunjung tidak merasa bosan serta membantu meningkatkan pemahaman calon pengunjung.\r\nKata Kunci: Rammang-rammang, Web, Virtual Tour.'),
(142, 'RANCANG BANGUN SISTEM PERIZINAN PEMASANGAN REKLAME BERBASIS WEBSITE KABUPATEN GOWA (STUDI KASUS KANTOR PELAYANAN PERIZINAN TERPADU)', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Kantor Pelayanan Perijinan Terpadu (KPPT) Kabupaten Gowa merupakan instansi pemerintah dibawah naungan pemerintah Kabupaten Gowa yang mempunyai tugas dan wewenang untuk melayani masyarakat khususnya dalam pengurusan perijinan. Dalam pembuatan ijin reklame pada Kantor Pelayanan Perijinan Terpadu Kabupaten Gowa masih mengalami kendala diantaranya kesulitan mengurus perizinan pemasangan reklame karna membutuhkan proses yang lama sehingga pelayana masih kurang memadai. Pemohon juga harus mengetahui titik-titik reklame yang sudah terpasang sehingga tidak terjadi kekeliruan untuk menentukan titik reklame yang akan dipasang serta kesulitan dalam pengawasan penempatan titik reklame yang sudah terpasang atau sudah jatuh tempo/harus diturunkan. Untuk mengatasi kendala-kendala yang dialami Kantor Pelayanan Perijinan Terpadu Kabupaten Gowa, maka diperlukan adanya sistem perijinan pemasangan reklame berbasis website.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi design and creation, sedangkan metode pengumpulan data yang digunakan yaitu observasi, wawancara dan teknologi. Adapun metode perancangannya menggunakan Data Flow Diagram (DFD). Analisis yan g dilakukan mencakup analisis system yang sedang berjalan, analisis sistem yang diusulkan. Sistem ini mencakup beberapa konten yaitu beranda, pendaftaran user, perijinan reklame, login. Hasil dari penelitian ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai dengan keinginan. Kesimpulannya dengan membuat sistem pengurusan perijinan ini dapat sangat membantu pihak yang terlibat antara lain pegawai kantor pelayanan perijinan terpadu dan pemohon secara online melalu website, agar dapat mempermudah masyarakat ingin mengurus perijinan pemasangan reklame, agar lebih medah dan cepat.\r\nKata Kunci : Kantor Pelayanan Perijinan Terpadu, Perizinan, Informasi, website.'),
(143, 'RANCANG BANGUN INDEX INFORMASI SPESIALITE OBAT BERDASARKAN INDEX OBAT YANG DITERBITKAN OLEH IKATAN APOTEKER INDONESIA BERBASIS WEB', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Pada penelitian ini dilatarbelakangi dengan banyaknya jumlah obat yang beredar, membuat setiap profesional kesehatan pun harus lebih selektif dalam memberikan obat yang tepat kepada pasien. Namun, karena tebalnya buku ISO (Informasi Spesialite Obat), bisa dibilang ISO ini merupakan kamus bagi orang farmasi dan nama-nama obat yang sangat banyak, terkadang membuat kesulitan para penggunanya dan memakan waktu jika digunakan oleh apoteker dalam mencari obat dan informasi detail dari obat yang sedang melayani pasien. Rumusan masalah dari penelitian ini adalah bagaimana merancang dan membangun sistem index Informasi Spesialite Obat berdasarkan index obat yang diterbitkan oleh Ikatan Apoteker Indonesia berbasis web. Adapun tujuan dari penelitian ini diharapkan dapat menghasilkan rancangan sistem index Informasi Spesialite Obat Indonesia berdasarkan yang diterbitkan oleh Ikatan Apoteker Indonesia, yang dapat membantu mahasiswa farmasi, apoteker dan tenaga kesehatan lainnya dalam pecarian informasi detail obat.\r\nPenelitian ini menggunakan jenis penelitian kualitatif dengan konsep design and creation, sedang metode pengumpulan data yang digunakan yaitu mengumpulkan, memilah-milah, mengklasifikasikan, dan mencatat yang dihasilkan catatan lapangan serta memberikan kode agar sumber datanya tetap dapat ditelusuri. Analisis yang dilakukan mencakup analisis sistem dan analisis aplikasi. Aplikasi diuji menggunakan black box.\r\nDari penelitian ini menghasilkan perancangan dan aplikasi Index Informasi Spesialite Obat berdasarkan Index Obat yang diterbitkan oleh Ikatan Apoteker Indonesia Berbasis Web. Penelitian ini menyimpulkan sistem yang dibangun dapat memberikan kemudahan dan membantu mahasiswa farmasi, apoteker dan tenaga kesehatan lainnya dalam pecarian informasi detail obat.\r\nKata Kunci: ISO, Web, Index, Apoteker, Farmasi.'),
(144, 'PENYELESAIAN MASALAH TRANSPORTASI BIKRITERIA DENGAN METODE LOGIKA FUZZY EVOLUSI (STUDI KASUS PT. JNE CABANG MAKASSAR)', 2017, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatarbelakangi oleh kesulitan kurir menentukan rute terbaik untuk meminimumkan jarak dan waktu dalam pengiriman barang. Berdasarkan latar belakang tersebut peneliti membuat suatu aplikasi yang disebut Penyelesaian Masalah Transportasi Bikriteria dengan Metode Logika Fuzzy Evolusi pada PT. JNE Cabang Makassar.\r\nPengambilan data dilakukan dengan cara dokumentasi. Data yang diambil berupa daftar alamat rumah penerima barang di wilayah Kota Makassar, selanjutnya dilakukan pencarian koordinat masing-masing lokasi dengan bantuan Google. Analisis data dilakukan dengan menggunakan mekanisme algoritma fuzzy evolusi yang diaplikasikan dengan program Matlab. Penentuan probabilitas crossover (pc), probabilitas mutasi (pm), jumlah kromosom dalam 1 generasi dan maksimum generasi memberikan pengaruh yang signifikan terhadap solusi optimal yang bisa didapatkan.\r\nPerancangan dalam membangun sistem ini terbagi atas use case diagram, class diagram, activity diagram, flowchart, dan perancangan antarmuka. Jenis penelitian yang digunakan adalah kualitatif dengan menggunakan Design and Creation. Penelitian ini menggunakan metode pengumpulan data wawancara dan observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah blackbox dan kousioner. Penelitian ini menghasilkan sistem pemecahan rute terbaik dalam bentuk desktop yang mampu membantu setiap kurir dalam meminimumkan jarak dan waktu pengiriman barang.\r\nKata Kunci: Masalah Transportasi Bikriteria, Fuzzy Evolusi, Algoritma Genetika.'),
(145, 'SISTEM PENGENDALIAN PROGRAM APLIKASI PADA LABORATORIUM KOMPUTER JURUSAN TEKNIK INFORMATIKA DAN SISTEM INFORMASI UIN ALAUDDIN MAKASSAR', 2016, 'SAINS DAN TEKNOLOGI', 4, 'Penelitian ini bertujuan untuk membuat Sistem Pengendalian Penggunaan\r\nProgram Aplikasi pada Laboratorium Komputer Jurusan Teknik Informatika dan\r\nSistem Informasi UIN Alauddin makassar. Model penelitian menggunakan\r\nDesign and Creation dengan teknik pengumpulan data melalui wawancara dan\r\nobservasi untuk memperoleh spesifikasi sistem yang dibutuhkan. Arsitektur\r\nsistem pengendalian dirancang berbasis Client-Server. Dimana Client digunakan\r\noleh peserta praktikum melakukan permintaan informasi terkait praktikum ke\r\nServer. Sementara Server melakukan validasi data peserta praktikum dan asisten,\r\nserta mengirim informasi aplikasi yang dapat digunakan ke komputer Client.\r\nLapisan GUI, logik dan lapisan data sistem dimodelkan menggunakan use case,\r\nclass, sequence, activity diagram, Entity Relationship diagram, dan rancangan\r\nantarmuka.\r\nUntuk mendukung sistem operasi yang beragam, rancangan selanjutnya\r\ndiimplementasikan ke dalam platform Java dan database MySQL. Hasil pengujian\r\nmenggunakan metode black-box menunjukkan program Client yang dibuat\r\nberhasil digunakan untuk melakukan koneksi ke Server, melakukan validasi\r\npeserta praktikum, selanjutnya menerima informasi terkait aplikasi praktikum\r\nyang digunakan dan hanya menampilkan aplikasi-aplikasi yang telah ditentukan\r\nuntuk kebutuhan suatu praktikum. Sedangkan program Server dapat digunakan\r\nuntuk mengolah data terkait praktikum, melakukan validasi asisten yang bertugas,\r\ndan mengirim informasi aplikasi ke Client. Sistem pengendalian penggunaan\r\nprogram aplikasi yang telah dibuat dalam penelitian ini diharapkan dapat\r\nmembantu dan mempermudah kinerja asisten dalam mengajarkan praktikum\r\nkepada peserta praktikum di Laboratorium Komputer Jurusan Teknik Informatika\r\ndan Sistem Informasi UIN Alauddin Makassar.\r\nKata Kunci: Sistem Pengendali, Java Socket, Client, Server, Jaringan Komputer.');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(146, 'SISTEM PENCARIAN KUALITAS HADITS BERDASARKAN BIOGRAFI PERAWI', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Sunnah atau hadis diyakini oleh kaum muslimin sebagai sumber pokok kedua ajaran\r\nIslam setelah Al-Qur’an. Ia dipandang sebagai miftah al-Qur’an (kata kunci untuk memahami\r\nAl-Qur’an). Sebab, ia merupakan bayan (eksplanasi) terhadap ayat – ayat yang masih bersifat\r\numum, global, atau yang masih mutlak. Tidaklah berlebihan apabila kemudian Imam al-Auza’I\r\nmengatakan bahwa Al-Qur’an lebih membutuhkan sunah daripada kebutuhan sunah terhadap\r\nAl-Qur’an.\r\nTujuan dari penulisan skripsi ini adalah untuk merancang aplikasi pencarian kualitas\r\nhadits berdasarkan biografi perawi. Dalam melakukan penelitian ini, jenis penelitian yang\r\ndigunakan adalah penelitian kualitatif karena penelitian ini lebih menekankan pada aspek\r\npemahaman secara mendalam terhadap masalah yang diteliti. Hasil dari rancangan sistem pada\r\npenulisan skripsi ini adalah sebuah aplikasi yang berjalan pada sistem operasi Android, dimana\r\npengguna dapat mencari tentang hadist dan kualitasnya, dan jalur sanadnya yang ditampilkan\r\nberurut beserta biografi dan komentar ulama terhadap perawi. Pengujian yang dilakukan\r\nmenggunakan metode pengujian blackbox yang Digunakan untuk menguji fungsi-fungsi\r\nkhusus dari perangkat lunak yang dirancang. Setelah dilakukan pengujian, dapat ditarik\r\nkesimpulan bahwa secara fungsional sistem aplikasi ini sudah dapat menghasilkan output yang\r\ndiharapkan.\r\nAplikasi pencarian kualitas hadits berdasarkan biografi perawi dirancang untuk\r\nmemberikan pengguna informasi tentang hadits dan kualitas hadits. Sehingga pengguna dapat\r\nmengetahui detail hadits dan mempelajari hadits secara mendalam.\r\nKata kunci : Pencarian, Hadist, Kualitas, Perawi, Android.'),
(147, 'Sistem Parkir Otomatis Mengidentifikasi Identitas Pengendara Dengan Biometrik Dan Kendaraan Dengan RFID ', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Keamanan merupakan suatu hal yang sangat krusial dimanapun kita berada.\r\nTidak hanya dilingkungan tempat kita tinggal, di lingkungan kampuspun\r\nkeamanan merupakan suatu hal yang sangat penting, karena keamanan merupakan\r\nsalah satu faktor yang dapat mempengaruhi tingkat kualitas dari sebuah perguruan\r\ntinggi. Untuk memberikan keamanan dan kenyamanan bagi mahasiswa yang\r\nmemarkir kendaraanya diperlukan sistem perparkiran yang dapat memberikan\r\nrasa aman terhadap kendaraanya saat menjalani aktifitas akademik di kampus.\r\nDimana sistem perparkiran ini nantinya dapat mengidentifikasi pengendara\r\ndengan biometrik menggunakan Intel Realsence dan kendaraan dengan RFID\r\nmenggunakan RDM 6300. Mikrokontroller yang digunakan adalah\r\nmikrokontroller Intel Galileo Gen 3 sebagai kontrol utama sistem.\r\nMetode penelitian yang digunakan adalah penelitian eksperimen. Penelitian\r\neksperimen yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sistem kontrol robot yang dapat mengidentifikasi\r\nbiometrik wajah dengan Kamera Intel Realsence dalam mendeteksi pengendara,\r\npembacaan tag RFID dengan RFID Reader untuk mendeteksi kendaraan, serta\r\nkeseluruhan proses pada sistem parkir sampai terbukanya palang parkir ketika\r\ndata pengendara dan kendaraan terdaftar pada sistem.\r\nKata kunci : Parkir, Sistem, Biometrik, Rfid.'),
(148, 'RANCANG BANGUN APLIKASI PENGECEKAN KEAMANAN PRODUK MAKANAN BERDASARKAN ATURAN BADAN POM DENGAN MENGGUNAKAN BARCODE BERBASIS ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Berbagai kasus terkait pelanggaran terhadap peredaran produk makanan boleh dibilang akhir-akhir ini makin marak. Seperti beredarnya produk impor yang tidak memiliki kode registrasi dari Badan POM maupun produk yang kode registrasinya dipalsukan oleh pihak yang tidak bertanggung jawab. Dari berbagai kasus tersebut, dibutuhkan perhatian lebih dari pihak Badan POM, mengingat bahwa konsumsi masyarakat terhadap produk makanan cenderung terus meningkat, seiring dengan perubahan gaya hidup masyarakat termasuk pola konsumsinya. Sementara itu, pengetahuan masyarakat masih belum memadai untuk dapat memilih dan menggunakan produk secara tepat, benar, dan aman. Aplikasi Pengecekan Keamanan Produk Makanan merupakan salah satu alternatif bagi konsumen jika ingin memeriksa produk makanan sebelum dikonsumsi sehingga dapat diketahui produk makanan apa saja yang aman untuk dikonsumsi.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan penulis adalah penelitian kualitatif dengan metode Design and Creation. Metode perancangan yang digunakan adalah metode waterfall. Adapun teknik pengujian sistem yang digunakan pada penelitian ini adalah black box dan white box. Adapun hasil dari pengujian ini berupa data atau informasi mengenai produk makanan. Dari hasil pengujian tersebut, maka dapat disimpulkan bahwa aplikasi ini dapat menjalankan fungsi yang diharapkan. Semoga dengan adanya aplikasi ini, bisa membantu para konsumen untuk memeriksa produk makanan agar dapat diketahui apakah makanan tersebut sudah aman atau tidak untuk dikonsumsi.\r\nKata Kunci : Aplikasi, Makanan, Badan POM, Barcode, Android'),
(150, 'RANCANG BANGUN APLIKASI MONITORING JAMAAH HAJI BERBASIS MOBILE ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Dari tahun ke tahun sering ditemui masalah mengenai jamaah haji yang\r\ntersesat ketika melaksanakan ibadah haji. Selain itu dalam setiap kasus tersebut sering\r\nkali membutuhkan waktu yang cukup lama untuk menemukan kembali jamaah yang\r\ntersesat tersebut. Salah satu solusi yang diusulkan adalah dengan pemanfaatan\r\nteknologi mobile dengan fitur google maps untuk memantau lokasi dari jamaah haji\r\nyang sedang melaksanakan ibadah haji dengan tujuan agar dapat dengan mudah\r\nmenemukan dan mengatasi masalah ketersesatan jamaah haji tersebut. Adapun yang\r\nmenjadi fokus dalam penelitian ini adalah membuat suatu aplikasi untuk\r\nmempermudah seluruh jamaah haji dalam melakukan aktifitas ibadah haji dengan\r\nmenampilkan informasi lokasi di google maps.\r\nPenelitian ini menggunakan metode penelitian kualitatif Design and Creation\r\nserta pengujian yang dilakukan adalah pengujian blackbox. Hasil dari tugas akhir ini\r\nadalah sebuah sistem aplikasi mobile yang akan menampilkan data lokasi jamaah haji\r\nyang sedang melaksanakan ibadah menggunakan google maps. Kelebihan dari sistem\r\nini adalah para jamaah haji dapat mengetahui informasi lokasi dari diri sendiri\r\nsehingga dapat mengurangi potensi tersesatnya jamaah haji ketika sebelum dan\r\nsetelah melaksanakan salah satu rukun haji.\r\nKata Kunci: Ibadah Haji, Angularjs, HTML, CSS, Ionic, Javascript, Notepad\r\n++, Xampp, Apache Cordova, Google Maps'),
(151, 'SISTEM PENCARIAN DAN PENGUMUMAN BARANG HILANG BERBASIS ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Kehilangan adalah hal yang biasa dialami oleh setiap orang, baik itu barang berharga, surat-surat penting, dompet, uang, kendaraan bahkan kehilangan orang pun biasa kita dapati di kehidupan sehari-hari. Dalam Islam ada istilah luqathah yang artinya barang hilang. Kewajiban seseorang mengumumkan barang hilang atau orang hilang ialah wajib. Untuk menyebarkan informasi temuan barang atau orang sebagian besar masyarakat pada zaman nabi dahulu, mereka mengumumankannya di tempat-tempat ramai seperti di depan pintu masjid dan pasar. Kemudian masyarakat pada zaman ini sebagian besar menempelkan kertas informasi di tembok-tembok, papan pengumuman atau koran. Alternatif lain yang digunakan adalah dengan memanfaatkan media sosial seperti facebook dan twitter yang lebih mempermudah penyebaran informasi. Akan tetapi ketiga cara tersebut kurang efektif karena cara pertama sudah tidak dapat dilakukan lagi pada zaman ini dengan jadwal pekerjaan yang sangat padat, kedua belum tentu mendapat perhatian dari pembaca sedangkan cara ketiga informasi yang diberikan akan dengan cepat tertimpa oleh status-status pada media sosial tersebut dan juga tidak adanya batasan mengenai larangan upload gambar yang memicu munculnya pihak-pihak kriminal. Penelitian ini bertujuan untuk membangun sistem yang dapat membantu masyarakat dalam melakukan pencarian dan pengumuman barang hilang atau orang hilang yang sesuai dengan aturan syariat.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah design and creations. Sistem ini berjalan pada perangkat mobile berbasis Android. Dirancang dengan bahasa pemrograman java. Dalam pemodelan sistem ini menggunakan UML dan diuji dengan metode pengujian blackbox.\r\nHasil dari penelitian ini menunjukkan bahwa sistem ini telah membantu masyarakat dalam pencarian dan pengumuman barang hilang atau orang hilang dengan sesuai aturan syariat. Dan juga sistem ini telah berjalan sesuai dengan fungsi yang diharapkan.\r\nKata Kunci : kehilangan, pencarian, pengumuman, luqathah, syariat'),
(152, 'RANCANG BANGUN LENGAN ROBOT PADA KENDARAAN PENGANGKUT SAMPAH BERBASIS ARDUINO', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Kasman Suherman. 2016, Rancang Bangun Lengan Robot Pada Kendaraan Pengangkut Sampah. (Dibimbing oleh Faisal Akib, S.Kom., M.Kom dan Faisal Rahman, ST.,MT.\r\nLengan robot ini adalah salah satu sistem lengan yang dirancang untuk dapat melakukan pengambilan dan mengangkat tempat sampah ke bak kendaraan pengangkut sampah. Proses mengangkat dan mengambil tempat sampah dipicu dengan adanya interaksi menggunakan push button. Sedangkan dalam proses pengangkutan tempat sampah ke bak kendaraan menggunakan tiga buah motor servo sebagai alat penggerak lengan dan jari penjepit. Tempat sampah yang digunakan adalah tempat sampah yang sudah disesuaikan dengan jari penjepit. Mikrokontroler yang digunakan adalah mikrokontroler Arduino Uno sebagai kontrol utama sistem.\r\nJenis penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah lengan robot yang dapat mengambil dan mengangkat tempat sampah ke bak kendaraan pengangkut sampah dengan sistem kerja normal.\r\nKata kunci : Lengan Robot, Jari Penjepit, Motor Servo, Push Button, Tempat Sampah dan Arduino Uno.'),
(153, 'APLIKASI INTERAKTIF MENGGUNAKAN SENSOR PADA SMARTPHONE BERBASIS ANDROID UNTUK PEMBELAJARAN FISIKA', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Salah satu disiplin ilmu yang membahas ilmu pengetahuan alam ialah fisika. Fisika menjadi disiplin ilmu yang sulit dan membosankan bagi sebagian siswa pada umumnya. Ponsel cerdas (smartphone) bisa dimanfaatkan sebagai salah satu media pembelajaran. Oleh karena itu, perlu dirancang sebuah aplikasi mobile interaktif berbasis Android yang menarik bagi siswa dan dapat membantu siswa memahami konsep dalam pembelajaran fisika.\r\nPenelitian ini merupakan jenis penelitian riset eksperimental dengan menggunakan strategi design and creation yaitu selain melakukan penelitian juga melakukan pembuatan sistem yang akan dibangun dengan menggunakan metode perancangan waterfall. Sementara untuk perancangan proses digambarkan dengan menggunakan DFD (Data Flow Diagram). Hasil pengimplementasian dari program ini akan diuji menggunakan metode Black Box untuk memastikan output sesuai dengan yang diharapkan. Pengujian terhadap data sensor juga dilakukan agar data yang dihasilkan teruji akurasinya.\r\nHasil yang diharapkan dari penelitian tugas akhir ini adalah dihasilkannya aplikasi interaktif menggunakan sensor pada smartphone Android untuk membantu siswa memahami konsep fisika. Setelah dilakukan penelitian, didapatkan kesimpulan bahwa dengan pemanfaatan sensor pada smartphone dihasilkan aplikasi mobile yang memudahkan siswa untuk terbiasa menghitung dan melakukan eksperimen fisika.\r\nKata Kunci : Android, Fisika, Sensor pada Android.'),
(154, 'APLIKASI PEMBELAJARAN RAMBU-RAMBU LALU LINTAS SERTA PERATURAN BERKENDARA', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh kurangnya pengetahuan serta disiplin para pengendara terhadap peraturan lalu lintas yang mengakibatkan seringnya terjadi kecelakaan lalu lintas, kemacetan dan permasalahan lainnya yang ada di jalan raya. Adapun rumusan masalah yaitu bagaimana merancang dan membuat aplikasi pembelajaran rambu lalu lintsa serta peraturan berkendara berbasi Android. Tujuan penelitian adalah memberikan pengetahuan kepada para pengendara mengenai rambu yang ada di jalan raya.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian Design and Creation serta perancangan aplikasi menggunakan metode kualitatif. Aplikasi ini berjalan pada perangkat mobile dengan sistem operasi Android dan dirancang menggunakan bahasa pemrograman Java dan DBMS MySQL. Pembangunan aplikasi ini menggunakan software Eclipse dan SQLite Browser. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram, class diagram dan sequence diagram dan diuji menggunakan metode pengujian black box. Hasil dari penelitian ini adalah aplikasi rambu lalu lintas serta aturan berkendara berbasis Android. Berdasarkan hasil pengujian dapat ditarik kesimpulan bahwa aplikasi ini dibuat sebagai sarana untuk pengendara agar mengetahui rambu-rambu lalu lintas yang ada di jalan raya.\r\nKata Kunci: Android, Rambu, Lalu Lintas, Berkendara, Java, UML'),
(155, 'APLIKASI TUTORIAL BERBASIS ANDROID MATAKULIAH ANATOMI TUBUH MANUSIA', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Anatomi tubuh manusia merupakan salah satu mata kuliah jurusan kesehatan yang membahas tentang sistem tubuh manusia. Terkhusus di Universitas Islam Negeri Alauddin Makassar, media pembelajaran yang digunakan masih manual yaitu mengandalkan buku pelajaran. Padahal di era globalisasi ini teknologi sudah sangat meningkat, terlebih pada alat komunikasi yaitu hanphone. Selain digunakan sebagai alat komunikasi handphone juga dapat digunakan sebagai media pembelajaran. Apalagi sekarang sudah ada smartphone atau ponsel cerdas yang memiliki fitur canggih.\r\nPerkembangan smartphone di Indonesia sangat berkembang pesat karena gadget seperti ini telah menjadi kebutuhan primer. Berbagai smartphone di Indonesia banyak beredar khususnya smartphone Android. Android memiliki banyak pengguna karena harganya yang relatif murah dan memiliki fitur yang sangat canggih. Android bersifat open source sehingga bagi pembuat game bisa saja memasukkan ke dalam Android.\r\nAplikasi Tutorial anatomi tubuh manusia berbasis android ini dibangun untuk memudahkan pelajar dalam mempelajari anatomi. Dimana bisa dipelajari dimanapun dan kapanpun karena memanfaatkan teknologi handphone. Aplikasi ini\r\niii\r\nmenampilkan materi tentang ilmu anatomi dasar dan sistem tubuh manusia. Aplikasi ini juga disertai dengan gambar untuk memudahkan setiap penjelasan materi.\r\nProses pembuatan aplikasi ini melalui beberapa tahapan mulai dari perancangan\r\nkonsep kerja aplikasi sampai pada tahap implementasi.\r\nDari hasil pengujian yang dilakukan dengan metode black box, dapat disimpulkan bahwa aplikasi ini dapat berfungsi baik. Serta dapat memudahkan pembelajaran anatomi tubuh manusia bagi pengguna smartphone Android.\r\nKata kunci : Smartphone Android, Aplikasi Tutorial, Matakuliah, Anatomi Tubuh.'),
(156, 'RANCANG BANGUN SISTEM ADMINISTRASI PERSURATAN DIGITAL MOBILE PADA FAKULTAS SAINS DAN TEKNOLOGI UIN ALAUDDIN MAKASSAR', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi oleh kesulitan mahasiswa mengetahui informasi surat yang diajukan melalui birokrasi Fakultas Sains dan Teknologi UIN Alauddin Makassar telah selesai atau tidak. Berdasarkan latar belakang tersebut penelitian membuat suatu aplikasi yang disebut Sistem Administrassi Persuratan Digital Mobile pada Fakultas Sains dan Teknologi UIN Alauddin Makassar, yang bertujuan untuk membantu mahasiswa menyelesaikan surat dan memberikan informasi penyelesaian surat.Perancangan dalam membangun sistem ini terbagi atas use case diagram, class diagram, sequence diagram, activity diagram, Entity Relationship diagram, flowchart, struktur navigasi dan perancangan antarmuka. Jenis penelitian yang digunakan adalah kualitatif dengan menggunakan Design and Creation. Metode pengumpulan data wawancara dan observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah whitebox dengan memasukkan listing coding menggunakan rumus dengan bernilai benar, blackbox dengan pengujian setiap menu-menu dengan memasukkan data bernilai benar dan kousioner dari sejumlah pertanyaan kepada responden. Penelitian ini menghasilkan sistem administrasi persuratan dalam bentuk digital mobile yang mampu memberi informasi penyelesaian surat. Berdasarkan hasil pengujian tersebut dapat disimpulkan bahwa aplikasi ini sudah dapat berfungsi sesuai tujuannya untuk mempercepat penyelesaian surat dan mempermudah mahasiswa mendapatkan informasi penyelesaian surat di Fakultas Sains dan Teknologi UIN Alauddin Makassar dengan login menggunakan akun sendiri dan aplikasi ini hanya dapat digunakan jika ada koneksi internet.\r\nKata Kunci: Surat, Mahasiswa,Android.'),
(157, 'GAME EDUKASI PENGENALAN ALAT MUSIK TRADISIONAL DI INDONESIA BERBASIS ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Indonesia memiliki banyak sekali kebudayaan yang dapat dibanggakan,\r\nsalah satunya yaitu alat musik tradisional. Setiap daerah di Indonesia pasti\r\nmemiliki alat musik tradisional. Salah satu kegunaan alat musik tradisional selain\r\nuntuk menghibur bisa juga digunakan untuk keperluan upacara adat.\r\nSeiring perkembangan zaman, kepedulian pelestarian kebudayaan nasional\r\nkhususnya alat musik tradisional menjadi sangat minim. Sebagai contoh\r\nkurangnya pengenalan dan sosialisasi akan budaya Indonesia sendiri dimasyarakat\r\nmerupakan salah satu faktor penting mengapa minat masyarakat menjadi kurang\r\nterhadap alat musik tradisional.\r\nKemajuan teknologi membawa pengaruh bagi masyarakat, salah satunya\r\nadalah mulai menjamurnya berbagai macam game. Selain membawa dampak\r\nnegatif bagi generasi muda, game juga memiliki banyak dampak positif. Salah\r\nsatunya yaitu menggunakan game edukasi. Selain memanfaatkan perkembangan\r\nteknologi, game edukasi juga menggunakan unsur-unsur dalam game yang dapat\r\nmenarik perhatian kalangan generasi muda.\r\nPada penelitian ini dikembangkan sebuah game edukasi “Pengenalan Alat\r\nMusik Tradisional di Indonesia” pada platform Android yang memberikan\r\ninformasi kepada pengguna mengenai alat musik tradisional apa saja yang ada di\r\nIndonesia. Game edukasi diharapkan dapat membantu dalam pengenalan budaya\r\nyang ada dan dapat dijadikan sebagai untuk memberikan wawasan kepada anakanak.\r\nDari hasil pengujian yang dilakukan dengan metode black box, dapat\r\ndisimpulkan bahwa aplikasi ini dapat berfungsi baik. Dan dapat memberikan\r\npengguna smartphone android game yang edukatif.\r\nKata kunci: Game Edukasi, Alat Musik Tradisional, Smartphone Android'),
(158, 'Aplikasi Pembelajaran Pendidikan Agama Islam Berbasis Android', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Hadist Rasulullah saw. dan Al Qur’an surah At-Tahrim ayat ke 6 tentang\r\nperintah mendidik anak sejak dini. Anak sejak usia dini perlu diperkenalkan tentang\r\najaran-ajaran Islam. Metode edukasi konvensional yang kurang interaktif sehingga aplikasi\r\npembelajaran sangat menarik dikembangkan. Perkembangan teknologi informasi dan\r\nkomunikasi saat ini berpengaruh besar terhadap berbagai aspek kehidupan. Salah satu\r\ncontohnya adalah pemanfaatan teknologi pada proses belajar mengajar. Maka perlu\r\nmerancang dan membangun aplikasi pembelajaran pendidikan agama Islam berbasis\r\nAndroid agar anak lebih tertarik belajar ajaran agama Islam sejak dini.\r\nPenilitian ini melakukan metode pengumpulan data Library research dan\r\nmengutip pendapat-pendapat para ahli dari buku-buku bacaan yang ada kaitannya\r\ndengan pembahasan penelitian ini untuk melakukan analisis sistem yang sedang\r\nberjalan. Perancangan yang diusulkan akan ditampilkan dalam bentuk UML (Unifield\r\nModelling Language) yaitu Use Case Diagram, Class Diagram, Sequence Diagram\r\ndan Flowchart. Pada sistem yang diusulkan akan dilakukan pengujian dengan metode\r\nBlack Box yang mengfokuskan keperluan fungsional dari sistem. Hasilnya, aplikasi\r\npembelajaran pendidikan agama Islam berbasis Android mampu mengenalkan ajaran\r\nagama Islam secara efektif dan efisien terhadap anak usia dini.\r\nKata kunci : Android, Aplikasi Pembelajaran, Pendidikan Agama Islam.'),
(159, 'RANCANG BANGUN APLIKASI PEMBELAJARAN IBADAH HAJI BERBASIS ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Kesibukan dunia di zaman modern ini semakin lama semakin membuat\r\nseseorang terkusus ummat Islam diberbagai kalangan belum mengerti tentang apa yang\r\nharus di lakukan dalam melakukan ibadah haji. Ibadah haji merupakan rukun Islam\r\nkelima setelah syahadat, shalat, zakat, dan puasa dimana hukumnya adalah wajib bagi\r\nyang mampu. Permasalahan yang dihadapi cukup kompleks apabila orang – orang yang\r\ningin menunaikan ibadah haji sesuai dengan syari’at Islam ini tidak memiliki\r\npengetahuan yang cukup atau pengalaman dalam menunaukan ibadah haji.\r\nBerdasarkan hal ini maka perlu dirancang aplikasi untuk smartphone yang dapat\r\nmembantu seseorang dalam dalam menunaikan ibadah haji dan mempelajari ilmu\r\ntentang haji kapan saja dan dimana saja. Adapun tujuan dari penelitian ini adalah\r\ndiharapkan dapat membangaun aplikasi yang dapat berjalan dengan baik di sistem\r\noperasi Android untuk membantu dalam menunaikan ibadah haji.\r\nPenelitian ini menggunakan metode penelitian Library Research dan Field\r\nResearch sedang metode pengumpulan data yang digunakan yaitu wawancara dan studi\r\npustaka. Adapun metode perancangannya menggunakan metode waterfall. Aplikasi ini\r\nmencakup beberapa konten yaitu materi tentang haji, petunjuk berhaji, kegiatan\r\njama’ah, kumpulan do’a-do’a, tempat ziarah dan tentang aplikasi. Hasil dari pengujian\r\naplikasi ini menyimpulkan bahwa fungsi yang diharapkan semuanya berhasil sesuai\r\ndengan keinginan. kesimpulannya bahwa aplikasi “Pembelajaran ibadah haji” ini dapat\r\nmembantu dalam menunaikan ibadah haji dan dapat berjalan dengan baik di\r\nsmartphone bersistem operasi Android.\r\nKata Kunci: Pembelajaran ibadah haji, Materi, Android'),
(160, 'RANCANG BANGUN APLIKASI PENGENALAN DAN SIMULASI PERMAINAN TRADISIONAL NUSANTARA BERBASIS ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Permainan tradisional adalah salah satu kebudayaan milik Indonesia yang harus dilestarikan, sebab permainan tradisional merupakan produk kebudayaan etnis Indonesia yang memiliki manfaat, kandungan dan makna filosofis. Penelitian ini dilatarbelakangi oleh kurangnya media informasi yang membahas permainan tradisional dan sulitnya memperoleh informasi tersebut secara lengkap, cepat dan mudah. Berdasarkan latar belakang tersebut maka dibutuhkan suatu aplikasi sebagai media informasi yang memperkenalkan tentang permainan tradisional. Tujuan dalam penelitian ini adalah merancang dan membangun aplikasi pengenalan dan simulasi permainan tradisional nusantara berbasis Android untuk memudahkan pengguna dalam memperoleh informasi seputar permainan tradisional secara lengkap, cepat dan mudah.\r\nPendekatan atau metode yang digunakan pada penelitian ini adalah penelitian kualitatif dimana strategi yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi dan studi pustaka. yaitu dengan mencari referensi dari buku dan juga dari internet yang berhubungan dengan objek yang diteliti. Metode perancangan yang digunakan adalah waterfall, pemodelannya menggunakan UML, flowchart, dan perancangan antarmuka sedangkan teknik pengujian yang digunakan adalah White Box, Black Box dan kuesioner. Berdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini membantu pengguna dalam memperoleh informasi seputar permainan tradisional secara lengkap, cepat dan mudah dengan menggunakan smartphone berbasis Android. Kesimpulan dari hasil uji coba adalah tujuan penelitian telah berhasil dicapai.\r\nKata Kunci : Aplikasi, Permainan Tradisional, Simulasi, Android.'),
(161, 'APLIKASI PANDUAN DAN MONITORING IBU HAMIL BERBASIS ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Kehamilan menjadi suatu perhatian besar dunia dalam isu kesehatan saat ini.\r\nAngka kematian ibu (AKI) yang masih cukup besar di hampir seluruh negara di dunia\r\nmenjadi kecemasan tersendiri yang menjadikan seluruh negara berusaha untuk\r\nmenurunkan presentasenya di tiap tahun. Kematian ibu hamil secara garis besar\r\ndisebabkan oleh faktor : minimnya pengetahuan ibu hamil tentang penanganan dan\r\nhal apa saja yang seharusnya dilakukan selama masa kehamilan keterlambatan dalam\r\npengambilan keputusan untuk mencari pertolongan, keterlambatan mendapatkan\r\ntransportasi untuk membawa ke fasilitas kesehatan, dan keterlambatan mendapatkan\r\npertolongan dari petugas kesehatan.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah\r\npenelitan design and creatuin dengan menggunakan metode pengambilan data secara\r\nkualitatif. Selain itu, pembuatan sistem yang akan dibangun menggunakan metode\r\nperancangan waterfall. Dalam pemodelannya aplikasi ini menggunakan metode UML\r\nberupa use case diagram, class diagram, activity diagram, dan sequence diagram dan\r\ndiuji menggunakan metode pengujian blackbox.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah aplikasi panduan dan\r\nmonitoring ibu hamil berbasis teknologi digital yang diberi nama Aplikasi Panduan\r\ndan Monitoring Ibu Hamil Berbasis Android. Berdasarkan hubungan Function Point,\r\naplikasi ini mendapatkan skor 9,638 (skala 1-10) yang menunjukkan kelayakan\r\npenggunaan kepada user. Dengan demikian aplikasi ini sangat layak digunakan\r\nkarena seluruh fitur yang disiapkan adalah hal-hal yang memang sangat dibutuhkan\r\nibu hamil dalam aktivitasnya sehari-hari.\r\nKata Kunci: Aplikasi, Kehamilan, Panduan, Monitoring, Ibu Hamil, Java, MySQL'),
(162, 'IMPLEMENTASI APLIKASI PENDAFTARAN ONLINE SEBAGAI SERVICE PADA CLOUD COMPUTING DI KOPERTAIS WILAYAH VIII', 2016, 'SAINS DAN TEKNOLOGI', 1, 'Penerimaan Mahasiswa Baru (PMB) merupakan sebuah rutinitas yang tidak lepas dari sebuah perguruan tinggi. Termasuk perguruan tinggi yang ada dibawah naungan Koordinatoriat Perguruan Tinggi Agama Islam Swasta (KOPERTAIS) Wilayah VIII. Namun, dengan belum tersedianya sebuah sistem yang dapat mendukung dalam melaksanakan proses PMB ini masih jadi kendala tersendiri bagi perguruan tinggi tersebut. Proses PMB yang masih dilakukan secara tradisional tentunya mengakibatkan proses ini menjadi kurang efisien dari segi waktu dan dana. Penelitian ini bertujuan untuk mengimplementasikan sebuah aplikasi pendaftaran mahasiswa online sebagai service dengan memanfaatkan konsep cloud computing. Sehingga aplikasi ini dapat digunakan oleh semua perguruan tinggi yang ada dibawah naungan KOPERTAIS Wilayah VIII. Dengan adanya aplikasi ini, tentunya perguruan tinggi akan sangat terbantu terutama dalam menjalankan proses penerimaan mahasiswa baru.\r\nAdapun jenis penelitian yang digunakan adalah penelitian kualitatif dengan metode design and creation. Dengan menggunakan pendekatan saintifik yaitu pendekatan berdasarkan ilmu pengetahuan dan teknologi. Sedangkan dalam pengumpulan data-data yang dibutuhkan, digunakan metode observasi dan studi literatur. Aplikasi dirancang dengan menggunakan metode waterfall.Sedangkan dalam pengujiannya digunakan tabel uji. Penelitian ini menghasilkan sebuah aplikasi pendaftaran yang terdiri dari 2 bagian yaitu, bagian form pendaftaran dan bagian panel kendali. Dengan adanya aplikasi ini tentunya dapat membantu perguruan tinggi yang ada dibawah naungan KOPERTAIS Wilayah VIII dalam menjalankan proses PMBnya.\r\nKata Kunci : Pendaftaran Online, Service, Cloud Computing'),
(163, 'RANCANG BANGUN SISTEM RESPON LAMPU LALU LINTAS BERDASARKAN KONDISI DARURAT MENGGUNAKAN TEKNOLOGI RFID', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Pada persimpangan jalan baik persimpangan tiga maupun persimpangan empat yang memiliki lampu lalu lintas sering terjadi kepadatan kendaraan. Tentu saja hal tersebut dapat menghambat kinerja kendaraan darurat yang akan melintas dipersimpangan. Untuk mengatasi hal tersebut maka penulis merancang sebuah sistem mikrokontroler respon lampu lalu lintas berdasarkan kondisi darurat mengunakan teknologi RFID.\r\nTujuan penelitian ini yaitu diharapkan dapat menghasilkan suatu rancangan sistem respon lampu lalu lintas berdasarkan kondisi darurat yang memanfaatkan teknologi RFID terhadap kepadatan kendaraan yang berada di persimpangan tiga guna mengatur kelancaran lalu lintas agar kendaraan darurat dapat bekerja secara tepat waktu dan maksimal.\r\nRFID (Radio Frequency Identification) adalah teknologi identifikasi otomatis yang menggunakan gelombang elektromagnetik untuk transmisi dan menerima informasi yang tersimpan dalam tag atau transponder atas permintaan RFID reader.\r\nDalam melakukan penelitian ini, jenis yang digunakan adalah prototype dengan menggunakan papan mikrokontroler Arduino Mega. Dirancang dengan bahasa pemrograman C. Pemodelannya menggunakan flowchart dan diuji dengan metode pengujian white box.\r\nHasil penelitian menunjukkan bahwa sistem respon lampu lalu lintas berdasarkan kondisi darurat dengan menggunakan teknologi RFID dapat melakukan perubahan kondisi pada lampu lalu lintas secara otomatis ketika kendaraan darurat melewati sensor RFID yang terpasang dibadan jalan, sehingga dapat diimplementasikan berdasarkan tujuannya.\r\nKata Kunci : RFID, Arduino Mega, Lampu Lalu Lintas'),
(164, 'SISTEM PAKAR DIAGNOSA PENYAKIT DAN RELASIONALITAS OBAT APOTEK AMOR', 2016, 'SAINS DAN TEKNOLOGI', 4, 'Perkembangan teknologi informasi dan komunikasi saat ini berpengaruh besar\r\nterhadap berbagai aspek kehidupan, bahkan perilaku dan aktivitas manusia kini\r\nbanyak tergantung kepada teknologi informasi dan komunikasi. Salah satu contohnya\r\nadalah pemanfaatan teknologi berbasis sistem pakar.\r\nPerkembangan aplikasi berbasis sistem pakar sangatlah diminati sejak tahun\r\n1950, dengan cakupan area yang cukup luas. Sistem pakar pada organisasi ditujukan\r\nuntuk penambahan value, peningkatan produktivitas serta area manajerial yang dapat\r\nmengambil kesimpulan dengan cepat. Pada penelitian ini dikembangkan sebuah\r\naplikasi “Sistem Pakar Diagnosa Penyakit dan Relasionalitas Obat”.\r\nAplikasi ini dibangun untuk bisa menjadi suatu alternatif dalam mendiagnosa\r\nsuatu jenis penyakit berdasarkan gejala yang dirasakan user, sehingga user\r\nmenemukan solusi atas permasalahan yang dihadapi.\r\nDari hasil pengujian yang dilakukan dengan metode black box, dapat\r\ndisimpulkan bahwa aplikasi ini dapat berfungsi baik. Dan dapat memberikan\r\nkemudahan bagi pengguna dalam mendiagnosa penyakit dan merekomendasikan obat\r\napa yang cocok bagi penderita penyakit.\r\nKata kunci : sistem pakar, diagnosa penyakit, certainty factor'),
(165, 'RANCANG BANGUN APLIKASI SIMULASI PEMBELAJARAN REAKSI KIMIA UNTUK PRAKTIKUM TINGKAT SMU BERDASARKAN KURIKULUM PENDIDIKAN 2013', 2016, 'SAINS DAN TEKNOLOGI', 4, 'Pada praktikum kimia ditingkat Sekolah Menengah Umum (SMU) saat ini masih ditemukan adanya bahan kimia berbahaya dan bahan yang sulit diperoleh serta mahal. Selain itu, banyak alat praktikum yang sudah rusak dan pecah yang belum diadakan kembali. Perkembangan teknologi yang semakin pesat juga membawa pengaruh dalam dunia pendidikan di Indonesia dalam mempermudah proses belajar mengajar. Penelitian ini bertujuan untuk merancang dan membangun suatu aplikasi simulasi pembelajaran reaksi kimia berbasis desktop dan Android sebagai sarana pendukung proses pembelajaran bagi siswa dan guru pada mata pelajaran kimia serta untuk menambah value praktikum.\r\nJenis penelitian yang digunakan adalah kualitatif dengan menggunakan Design and Creation serta menggunakan pendekatan penelitian santifik. Penelitian ini menggunakan metode pengumpulan data dengan wawancara, observasi dan studi literatur. Aplikasi ini berjalan pada perangkat mobile berbasis Android dan berbasis desktop di Windows. Metode perancangan yang digunakan adalah waterfall dengan teknik pengujian Black Box dan White Box. Berdasarkan hasil uji coba menunjukkan bahwa aplikasi ini dapat berfungsi dengan baik, baik dari segi logika maupun fungsi. Karena itu dapat disimpulkan bahwa aplikasi ini dapat memudahkan proses belajar mengajar pada mata pelajaran kimia serta menambah value praktikum.\r\nKata Kunci: Simulasi, Reaksi Kimia, Android'),
(166, 'SISTEM KEAMANAN KENDARAAN BERMOTOR MENGGUNAKAN SMS DENGAN METODE GPS TRACKING BERBASIS ARDUINO', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Kasus pencurian kendaraan bermotor masih seringkali terjadi di sekitar kita, hal\r\nini terjadi karena masih kurangnya sistem keamanan yang terdapat pada kendaraan\r\nbermotor yang hanya menggunakan kunci kontak dan penutup kunci saja, yang dimana\r\nkelemahan sistem keamanan standar seperti ini telah dipahami oleh para pelaku\r\npencurian kendaraan bermotor untuk melakukan aksinya. Kebutuhan akan sistem\r\npengamanan tambahan dirasa sangat perlu, guna menghindari terjadinya pencurian\r\nkendaraan bermotor. Untuk mengatasi itu semua maka dibuatlah sistem keamanan\r\nkendaraan bermotor menggunakan sms dengan metode gps tracking berbasis arduino\r\nuntuk mencegah dan mempermudah mendapakan kembali kendaraan bermotor yang\r\ntelah dicuri.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah\r\npenelitian kuantatif dengan metode eksperimental. Selain itu, pembuatan sistem yang\r\nakan dibangun menggunakan metode perancangan. Adapun tahapan tahapan dalam\r\nsistem ini adalah menggambarkan flowmap yang sedang berjalan kemudian merancang\r\nflowchart dan blok digram untuk gambaran atau alur kerja sistem yang akan dibuat dan\r\ndiuji menggunakan metode pengujian blackbox.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah alat Sistem keamanan\r\nkendaraan bermotor menggunakan sms dengan metode gps tracking berbasis arduino\r\nmega 2560 sebagai input/output data yang akan di proses dan gps tracking untuk\r\nmemberikan informasi lokasi terakhir kendaraan bermotor dan dapat mengontrol jarak\r\njauh dengan menggunakan sms. Dari hasil pengujian yang dilakukan oleh peneliti alat\r\nini berfungsi dengan baik dan mampu mengatasi permasalahan yang selama ini dialami\r\npengguna kendaraan bermotor.\r\nKata Kunci : Kecurian, Kendaraan Bermotor, Mikrokontroler Arduino, Gps\r\nTracking'),
(167, 'ANALISIS DAN PERANCANGAN SIMULASI SISTEM PERINGATAN DINI AIR BAH PADA AIR TERJUN BAH BERBASI MIKROKONTROLER', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Air terjun merupakan salah satu objek wisata yang sering dikunjungi oleh\r\nmasyarakat. Namun masyarakat atau pengunjung tidak sadar bahwa ada bahaya\r\nyang menunggu dibalik keindahan air terjun itu sendiri yaitu air bah. Oleh karena\r\nitu, solusi yang tepat untuk mengurangi dampak buruk terhadap bencana air bah\r\nadalah dibuatnya sebuah sistem peringatan dini air bah berbasis mikrokontroler\r\nyang dapat memberikan informasi secara realtime akan adanya air bah kepada\r\nwisatawan yang sedang berada di sekitar air terjun sehingga wisatawan dapat\r\ndengan segera mengevakuasi diri sebelum air bah tiba. Namun sistem yang dibuat\r\nmasih berupa simulasi pendeteksi dini air bah. Jadi belum dapat diterapkan\r\nlangsung pada air terjun.\r\nMetode penelitian yang digunakan adalah penelitian kuantitatif. Penelitian\r\nkuantitatif yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah simulasi sistem peringatan dini air bah pada air\r\nterjun dengan menggunakan water flowmeter sensor sebagai pembaca kecepatan\r\narus sungai yang akan mendeteksi sedini mungkin ketika air bah muncul dan\r\nmemberikan peringatan berupa bunyi sirine pada air terjun pada saat terdeteksinya\r\nair bah serta memberikan info grafik kecepatan arus sungai pada monitor operator.\r\nKata kunci : Pendeteksi dini Air Bah, water flowmeter Sensor, Arduino Uno\r\ndan air terjun.'),
(168, 'SISTEM MONITORING AIR LAYAK KONSUMSI BERBASIS ARDUINO (STUDI KASUS PDAM PATALASSANG)', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Sistem Monitoring Air Layak Konsumsi Berbasis Arduino dengan Studi Kasus PDAM\r\nPatalassang Kabupaten Gowa adalah alat yang dibuat untuk memberi kemudahan pada karyawan\r\nPDAM (Perusahaan Daerah Air Minum) khususnya pada PDAM Patalassang, untuk mengetahui\r\nnilai pH air serta nilai kadar NTU pada bak penampungan air dengan menggunakan sensor pH\r\nair dan sensor kekeruhan air yang akan ditampilkan pada desktop melalui kabel USB berbentuk\r\ngrafik apabila nilai pH yang terbaca ke sensor pH air adalah pH ? 6,5 dan ? 8,5 maka dapat\r\ndinyatakan air dalam kondisi normal sedangkan jika sensor membaca pH < 6,5 dan pH > 8,5\r\nmaka pH air tidak normal. Tujuan dari penelitian ini adalah membangun suatu system yang dapat\r\nmemudahkan pekerjaan manusia khususnya pada karyawan Perusahaan Daerah Air Minum\r\n(PDAM) Pattallassang Kabupaten Gowa, Sulawesi Selatan.\r\nMetode penelitian yang digunakan, penelitian kuantitatif. Penelitian kuantitatif yang dilakukan\r\nadalah metode penelitian eksperimental. Dengan melakukan eksperimen terhadap variabaelvariabel\r\nkontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan\r\ndibandingkan dengan output tanpa adanya pengontrolan variabel. Dengan menggunakan\r\npengujian white box dan pengujian black box sehingga hasil pengujian menunjukkan bahwa\r\nsistem monitoring air layak konsumsi dapat berfungsi dengan baik, baik dari segi logika maupun\r\nfungsi sehingga dapat diimplementasikan berdasarkan tujuannya.\r\nKata kunci : Air Layak Konsumsi, Sistem Monitoring, Arduino.'),
(169, 'RANCANG BANGUN SISTEM PDAM PRABAYAR BERBASIS MIKROKONTROLER', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Penelitian ini dilatarbelakangi oleh adanya ketidak nyamanan dan ketidak adilan\r\nyang dirasakan petugas PDAM dan pelanggannya, dimana masing-masing pihak merasa\r\ndirugikan. Misalnya masalah pencatatan pemakaian air, para pelanggan merasa sudah\r\nmembayar namun pelayanan airnya belum terpenuhi, begitu juga pihak PDAM yang\r\nmerasa masih banyaknya tunggakan pembayaran dari pelanggan sehingga membuat\r\nterhambatnya penyaluran air. Bagaimana agar dapat mengelola air lebih efektif dan\r\nefisien untuk kelangsungan hidup, begitu juga semakin berkembangnya teknologi saat ini\r\nmenjadi tantangan tersendiri untuk dihadapi dan diselesaikan, sehingga penulis bertujuan\r\nmerancang dan membuat alat sistem prabayar PDAM yang dapat membantu\r\nmempermudah pencatatan pemakaian air. Berdasarkan latar belakang tersebut penulis\r\nmerancang alat yang disebut PDAM prabayar berbasis Mikrokontrole yang dapat\r\nmeningkatkan mutu atau layanan yang diberikan PDAM.\r\nPerancangan dalam membangun rancang bangun sistem ini yakni terdiri diagram\r\nblok, rancangan perangkat keras dan flowchart. Penelitian ini menggunakan kuantitatif\r\ndengan metode eksperimental. Pengumpulan data meliputi observasi dan studi literatur.\r\nPengujian alat menggunakan metode black box dan white box. Hasil uji coba\r\nmenunjukkan alat ini membantu PDAM maupun pelanggan pdam dengan memanfaatkan\r\nalat ini PDAM dapat menghindari kesalahan pencatatan dan penunggakan pelanggan.\r\nDan pelanggan juga dapat membayar tagihan sesuai dengan pemakain air. Kesimpulan\r\nyang ditarik berdasarkan hasil uji coba adalah tujuan penelitian berhasil dicapai.\r\nKata kunci: Mikrokontrol, Pencatatan Air, Sistem Prabayar'),
(170, 'Sistem Pendeteksi Tingkat Kesuburan Tanah untuk Menentukan Tingkat Perbandingan Penggunaan Pupuk Organik dan Anorganik pada Lahan Pertanian Menggunakan Arduino', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Masalah yang melatar belakangi penelitian ini adalah penurunan kualitas lahan\r\npertanian saat ini akibat dari kecenderungan para petani menggunakan pupuk\r\nanorganik secara terus menerus dengan dosis yang tinggi, sehingga ketergantungan\r\nterhadap penggunaan pupuk kimia semakin meningkat yang dapat berpengaruh negatif\r\nterhadap lingkungan dan menurunkan kesuburan tanah, upaya yang dapat di lakukan\r\nadalah dengan menggunakan pupuk organik yang secara perlahan memperbaiki sifat\r\nfisik ,kimia, dan biologi tanah. Penelitian ini bertujuan untuk merancang dan membuat\r\nsistem pendeteksi kesuburan tanah untuk menentukan perbandingan pengunaan pupuk\r\norganik dan anorganik pada lahan pertanian menggunakan Arduino, sehingga para\r\npetani dapat mengetahui tingkat kesuburan lahan pertaniannya tersebut agar dapat\r\nmenentukan jumlah pemberian pupuk organik dan anorganik.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah desain\r\nand creations. Sistem ini berjalan pada perangkat smartphone berbasis Android yang\r\ndirancang dengan menggunakan bahasa pemrograman Arduino dan App Inventor.\r\nPemodelannya menggunakan flowchart dan diuji dengan metode pengujian whitebox,\r\nblackbox dan pengujian kelayakan sistem. Hasil pengujian menunjukkan bahwa sistem\r\nini dapat berfungsi dengan baik, baik dari segi logika maupun fungsi sehingga dapat ditarik\r\nkesimpulan bahwa dalam perancangan sistem ini dengan tujuan untuk menentukan\r\nperbandingan penggunaan pupuk organik dan anorganik pada lahan pertanian sudah\r\ntercapai.\r\nKata kunci : Kesuburan Tanah, Pupuk Organik dan Anorganik, Arduino.'),
(171, 'PEMANFAATAN RASBERRY PI SEBAGAI SERVER PORTABLE', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Masalah yang melatar belakangi penelitian ini adalah bentuk daerah Indonesia merupakan kepulauan dan pegunungan menyebabkan penyebaran internet di beberapa daerah kurang merata. Terdapat sekolah yang tidak dapat mengakses internet sehingga menyulitkan para guru untuk memberikan laporan yang harus dilakukan secara online. Raspberry pi yang bersifat portabale dan berbiaya lebih murah dibandingkan dengan server pada umumnya digunakan untuk membantu menyimpan sementara laporan para guru. Secara berkala raspberry pi dibawa ke tempat yang menyediakan akses internet untuk melakukan sinkronisasi dengan server pusat.\r\nPerancangan dalam membangun sistem ini terbagi atas flowchart dan flowmap. Jenis penelitian ini menggunakan metode penelitian kualitatif simulation, Design and Creation. Metode pengumpulan data adalah observasi dan studi literature. Metode perancangan yang digunakan adalah prototype dan teknik pengujian yang digunakan adalah blackbox yang berfokus pada persyaratan fungsioanal. Hasil dari penelitian ini adalah sebuah web server yang berjalan pada raspberry pi. Adapun kelebihan alat ini yaitu biayanya lebih murah daripada server dan bersifat portable sehingga dapat dipindahkan dari satu tempat ke tempat lainnya. Hasil pengujian menunjukkan bahwa server multimedia yang berjalan pada raspberry pi dapat berfungsi dengan baik dan dapat diimplementasikan berdasarkan tujuannya.\r\nKata Kunci: Server Portable, Web Server, Raspberry Pi'),
(172, 'RANCANG BANGUN TIMBANGAN OTOMATIS PENSORTIR UDANG WINDU (STUDI KASUS DI CV.MUSTIKA TARAKAN)', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Penelitian ini dilatarbelakangi oleh melimpahnya hasil budidaya tambak\r\nudang windu di pulau Tarakan dan hasilnya akan dikirim ke berbagai Negara,\r\nsehingga membutuhkan ketelitian dan keakuratan yang baik dalam hal pensortiran\r\nudang windu yang akan dikirim tersebut, sedangkan perusahaan – perusahaan\r\nudang yang ada saat ini masih menggunakan karyawan untuk mensortir udang\r\nyang akan dikirm tersebut dengan menggunakan pengalaman dan perasaan.\r\nSehingga hasilnya kurang optimal. Maka dari itu perlunya suatu alat yang mampu\r\nmensortir udang windu secara otomatis dan akurat dimana menggunakan acuan\r\nberat atau massa sebagai variabel pensortiran yang akan menghasilkan dua tipe\r\nudang yang berbeda dengan sensor load cell sebagai sensor pembaca berat yang\r\nakan mengirimkan data analog ke mikrokontroler arduino uno sehingga pintu\r\nyang digerakkan oleh motor servo akan terbuka dan menjatuhkan udang ke wadah\r\nyang sesuai dengan berat udang.\r\nMetode penelitian yang digunakan adalah penelitian eksperimen. Penelitian\r\neksperimen yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah timbangan otomatis pensortir udang windu\r\nyang akan penyeleksi udang windu berdasarkan berat yang telah ditentukan.\r\nKata Kunci: Mikrokontroler, Arduino Uno, Timbangan, dan Pensortiran.'),
(173, 'SISTEM PENGATUR LAMPU LALU LINTAS MENGGUNAKAN IMAGE PROCESSING', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Makassar termasuk pada posisi kesembilan kota termacet di Indonesia berdasarkan Castrol’s Magnatec Stop-Start index. Salah satu penyebab terjadinya kemacetan di jalan yaitu pengaturan durasi lampu lalu lintas yang tidak akurat dan tidak menyesuaikan dengan kepadatan kendaraan pada ruas jalan.\r\nImage processing adalah suatu metode yang digunakan untuk memproses atau memanipulasi gambar dalam bentuk dua dimensi dan dapat juga dikatakan segala operasi untuk memperbaiki, menganalisa, atau mengubah suatu gambar.\r\nTujuan penelitian ini yaitu diharapkan dapat menghasilkan suatu rancangan sistem pengatur lampu lalu lintas yang memanfaatkan image processing terhadap kepadatan kendaraan yang dapat mengoptimalkan durasi guna mengatur kelancaran lalu lintas.\r\nDalam melakukan penelitian ini, jenis yang digunakan adalah prototype dengan menggunakan komputer mini Raspberry Pi. Dirancang dengan bahasa pemrograman Python dan sebagai pustaka tambahan menggunakan OpenCV sebagai pengolahan citra digital. Pemodelannya menggunakan flowchart dan diuji dengan metode pengujian white box.\r\nHasil penelitian menunjukkan bahwa sistem pengatur lampu lalu lintas dengan menggunakan image processing dapat mengukur kepadatan tiap ruas jalan pada persimpangan empat jalan dan mengatur durasi lampu lalu lintas tiap ruas jalan, sehingga dapat diimplementasikan berdasarkan tujuannya.\r\nKata Kunci : Macet, Image Processing, Raspberry pi, Lampu Lalu Lintas'),
(174, 'RANCANG BANGUN SISTEM INFORMASI INVENTARIS BARANG PADA HOTEL ALDEN MAKASSAR', 2016, 'SAINS DAN TEKNOLOGI', 1, 'Hotel Alden Makassar merupakan salah satu hotel yang baru saja ikut\r\nmeramaikan bisnis perhotelan di Indonesia yang berkedudukan di Kota Makassar.\r\nDalam sebuah hotel perlu ada kegiatan inventaris sebagai salah satu kegiatan yang\r\nmenangani masalah pengadaan barang dalam mendukung kebutuhan operasional\r\nhotel. Inventaris barang merupakan kegiatan untuk melakukan penghitungan,\r\npencatatan, pendaftaran, dan penilaian terhadap semua barang milik hotel, agar\r\ntidak terjadi pemborosan dalam penggunaan barang. Berdasarkan hal ini, maka\r\nuntuk merancang dan membuat sistem informasi inventaris barang pada hotel\r\nAlden Makassar yang memudahkan dalam administrasi digudang hotel, dan\r\nmembuat laporan penyesuaian perhitunagn akhir bulan.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi\r\ndesign and creation sedang metode pengumpulan data yang digunakan yaitu\r\nobservasi, studi literatur, wawancara. Adapun metode perancangannya\r\nmenggunakan Data Flow Diagram (DFD). Analisis yang dilakukan mencakup\r\nanalisis sistem yang sedang berjalan, dan analisis sistem yang diusulkan. Sistem\r\nini mencakup beberapa konten yaitu login, beranda, data barang, pemesanan\r\nbarang, validasi pemesanan barang, dan laporan. Hasil dari pengujian sistem ini\r\nmenyimpulkan bahwa dengan membuat system informasi inventaris barang ini\r\ndapat membantu pihak-pihak hotel yang terlibat antara lain Store Kepeer, General\r\nManager, Departement-departement, dan Accounting untuk memudahkan dalam\r\nadministrasi barang digudang hotel.\r\n.\r\nKata Kunci : Hotel Alden Makassar, Inventaris Barang, Clien Server');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(175, 'SISTEM KONTROL PENUNJANG TUMBUH BIBIT TANAMAN CENGKEH PADA PUSAT BUDIDAYA CENGKEH DI KAB.LUWU', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Dengan berbagai aktifitas yang padat, terkadang masyarakat tidak mempunyai\r\nwaktu yang cukup untuk menyelesaikan tugas rumah tangga. Sehingga banyak\r\npekerjaan rumah yang tidak bisa dikerjakan. Seperti menyiram tanaman, dan\r\nmelindungi dari sinar matahari serta curah hujan, misalnya bibit tanaman cengkeh.\r\nOleh karena itu dibutuhkan alat yang dapat meringankan pekerjaan rumah. Salah\r\nsatunya adalah sistem kontrol penunjang tumbuh bibit tanaman cengkeh pada pusat\r\nbudidaya cengkeh di Kab.Luwu. Pada perancangan alat ini menggunakan Arduino\r\nMega 2560. Selain itu sistem ini juga menggunakan sensor Soil Hygrometer\r\nDetection Module berfungsi sebagai sensor kelembaban dan PH tanah, kemudian\r\nmenggunakan LDR yang berfungsi sebagai sensor intensitas cahaya, dan sensor FC-\r\n37 berfungsi sebagai sensor rintik hujan.\r\nMetodologi penelitian yang digunakan adalah jenis penelitian kualitatif dan\r\npenelitian eksperimental dengan melakukan eksperimen hubungan sebab akibat\r\nterhadap kondisi satu variabel kontrol (input) dengan kondisi variabel kontrol\r\nlainnya, kemudian menganalisa output yang dihasilkan dengan tanpa pengontrolan\r\nakan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil dari pengujian sistem kontrol ini dapat menunjukkan jumlah\r\nkelembaban dan PH tanah yang dibutuhkan bibit cengkeh dan jumlah intensitas\r\ncahaya yang dibutuhkan serta dapat terlindungi dari curah hujan.\r\nKata kunci : Sistem Kontrol Penunjang Tumbuh Bibit Tanaman, LDR, Soil\r\nHygrometer Detection, FC – 37 module, Arduino Mega.'),
(176, 'ANALISIS DAN PERANCANGAN SISTEM PENGELOLAAN SAMPAH BERBASIS ANDROID MELALUI PARTISIPASI MASYARAKAT DI KECAMATAN RAPPOCINI', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Kota Makassar sebagai salah satu kota besar di Indonesia padat akan penduduk masih memiliki masalah akan pengelolaan kebersihan. Sampah setiap hari dihasilkan dari aktivitas masyarakat. Hal tersebut membuat petugas kebersihan belum maksimal dalam mengangkut sampah termasuk di kecamatan Rappocini sebagai salah satu kecamatan yang ada di kota Makassar. Sistem pengangkutan sampah yang sekarang dilakukan dari rumah ke rumah menyebabkan ada beberapa rumah yang tidak diangkut sampahnya. Maka dari itu untuk memaksimalkan sistem pengelolaan sampah diharapkan partisipasi masyarakat terutama di kecamatan Rappocini melalui sebuah sistem pengelolaan sampah yang dapat melaporkan masalah sampah di lingkungan sekitarnya.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian kualitatif dengan metode field research. Selain itu, pembuatan sistem yang akan dibangun menggunakan metode perancangan waterfall. Aplikasi ini berjalan pada smartphone berbasis Android dan dirancang menggunakan bahasa pemrograman Java dan MySQL. Pembangunan aplikasi ini menggunakan software Android Studio dan JetBrains PhpStrom. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram, class diagram, activity diagram, dan sequence diagram, dan diuji menggunakan metode pengujian blackbox.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah sistem pengelolaan sampah berbasis Android melalui partisipasi masyarakat di kecamatan Rappocini yang diberi nama aplikasi Sampah Ta? dengan sebuah web server. Aplikasi ini telah diuji cobakan kepada masyarakat di kecamatan Rappocini secara langsung dan aplikasi ini direkomendasikan untuk digunakan dalam membantu pengelolaan sampah yang lebih baik dan lebih maksimal.\r\nKata Kunci: Kebersihan, Pengelolaan Sampah, Android, Java, MySQL'),
(177, 'Simulasi Komunikasi Peer to Peer Pengontrolan dan Deteksi Kesalahan Pengiriman Data dengan Metode ARQ (Aoutomatic Repead Request)', 2016, 'SAINS DAN TEKNOLOGI', 4, 'Pengontrolan dan deteksi kesalahan dalam pengiriman data merupakan hal yang sangat penting. Metode automatic repeat request merupakan salah satu metode yang dipergunakan dalam pengontrolan deteksi kesalahan pengiriman data yang berkaitan dengan mekanisme mendeteksi dan memperbaiki kesalahan yang terjadi pada pentransrnisian frame. Pada tugas akhir ini penulis mencoba membuat sebuah program simulasi pengontrolan kesalahan pengiriman frame data dengan metode ARQ dan diharapkan berfungsi dalam membantu proses pembelajaran tentang Komunikasi Data. Simulasi pengontrolan deteksi kesalahan pengiriman data dengan metode ARQ ini memberikan pemahaman yang lebih baik dan mudah untuk dipahami serta dicerna pikiran.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian kualitatif dengan metode Design and Creation. Adapun tahapan tahapan dalam sistem ini adalah menggambarkan flowmap, yang sedang berjalan kemudian merancang use case diagram dan activity diagram untuk gambaran alur kerja sistem yang akan dibuat dan diuji menggunakan metode white box dan black box. Aplikasi simulasi ini dikembangkan dengan menggunakan bahasa pemograman Microsoft Visual Basic 6.0.\r\nHasil dari penelitian ini adalah berupa pengembangan aplikasi untuk simulasi komunikasi peer to peer pengontrolan dan deteksi kesalahan dalam pengiriman data yang berupa frame dengan meteode automatic repead request. Aplikasi ini mensimulasikan tiga metode automatic repead request yaitu stop-N-wait ARQ, go-back-N ARQ, dan Selective-reject ARQ. Dari hasil penelitian pengujian yang dilakukan oleh penelitian aplikasi ini berfungsi dengan baik dan mampu mengatasi permasalahan yang selama ini dialami dosen/guru dan mahasiswa/siswa dalam proses belajar mengajar mengenai dasar-dasar komunikasi data, khususnya fungsi data link.\r\nKata Kunci : Automatic Repeat Request'),
(178, 'RANCANG BANGUN SISTEM INFORMASI DISTRIBUSI BANTUAN SOSIAL BERAS MISKIN (STUDI KASUS KECAMATAN BINAMU KABUPATEN JENEPONTO)', 2016, 'SAINS DAN TEKNOLOGI', 1, 'Beras Miskin (Raskin) merupakan program bantuan sosial pemerintah yang bertujuan menunjang kebutuhan dasar masyarakat yang hidup di daerah dengan tingkat kemiskinan tinggi. Dari banyaknya daerah sasaran raskin, Kecamatan Binamu Kabupaten Jeneponto menjadi salah satu yang mendapat penilaian buruk pemerintah pusat dalam hal penanganan raskin, ini disebabkan administrasi data yang buruk dan angka penggelapan raskin sangat tinggi di daerah ini, untuk itu diperlukan penerapan sistem informasi pada proses administrasi data raskin dengan kemampuan menampilkan data realisasi kepada khalayak ramai. Tujuan daripada penelitian ini adalah bagaimana merancang dan membangun sistem informasi distribusi bantuan raskin yang dapat dipergunakan sebagai instrumen pendukung tercapainya administrasi data yang baik dan mendorong transparansi proses distribusi raskin yang berjalan.\r\nPenelitian ini menggunakan metode kualitatif lapangan dengan strategi desain and creation yaitu selain melakukan penelitian juga melakukan pembuatan sistem menggunakan metode perancangan waterfall. Untuk perancangan proses digambarkan menggunakan DFD (Data Flow Diagram), untuk perancangan database menggunakan ERD (Entity Relationship Diagram), dan uji implementasi dari program menggunakan metode Black box.\r\nHasil yang diharapkan pada penelitian ini adalah hadirnya sebuah website layanan informasi data realisasi raskin yang dapat diakses oleh seluruh masyarakat khususnya Kecamatan Binamu Kabupaten Jeneponto. Adapun kesimpulan yang dapat diperoleh adalah penerapan sistem informasi pada proses distribusi raskin menghadirkan regulasi distribusi raskin yang lebih baik.\r\nKata Kunci : Sistem informasi, website, data realisasi'),
(179, 'SIMULASI ROBOT PENEBAR PAKAN DAN RACUN OTOMATIS PADA TAMBAK DI PULAU TARAKAN', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Penelitian ini dilator belakangi oleh usaha budidaya perikanan semakin tahun\r\nsemakin meningkat. Kualitas dari hasil perikanan tersebut juga diharapkan selalu baik.\r\nAkan tetapi faktor alam serta sumber daya manusia juga sangat mempengaruhi\r\npeningkatan hasil budidaya perikanan. Terutama budidaya tambak yang sangat butuh\r\nperawatan dan pengawasan untuk mendapatkan hasil yang memuaskan. Sehingga\r\ndibutuhkan suatu alat sebagai media bantu kerja untuk meningkatkan efektifitas kerja\r\npara petani tambak dalam mengelola budidaya tambak. Tujuan dalam penelitian ini\r\nadalah merancang dan membangun alat sebagai media bantu kerja dengan\r\nmenggunakan robot kapal yang akan membantu dalam proses penebaran serta\r\nmelakukan peracunan otomatis sehingga dapat meningkatkan efektifitas kerja para\r\npetani tambak.\r\nMetode penelitian pada penelitian ini adalah penelitian eksperimental dimana\r\nstrategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan\r\nmetode pengumpulan data wawancara dan observasi. Metode perancangan yang\r\ndigunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nHasil dari penelitian ini adalah robot penebar pakan dan racun otomatis pada tambak\r\ndi pulau Tarakan yang digunakan untuk membantu petani tambak dalam proses\r\nbudidaya tambak. Kesimpulan dari penelitian ini yaitu sebagai alat bantu untuk petani\r\ntambak serta memberikan kemudahan dalam proses perawatan serta pengelolaan\r\nbudidaya perikanan khususnya budidaya tambak.\r\nKata Kunci: Alat Bantu Kerja , Budidaya Tambak, Robot Kapal, Pakan, Racun'),
(180, 'RANCANG BANGUN APLIKASI E-OFFICE PADA FAKULTAS TEKNIK UNIVERSITAS BOSOWA 45 MAKASSAR', 2016, 'SAINS DAN TEKNOLOGI', 4, 'Manajemen perkantoran merupakan suatu manajemen yang beroperasi dalam kegiatan administrasi yang mencakup pengelolaan informasi yang dibutuhkan bagi keputusan yang efektif dan tepat waktu. Pada kenyataannya pada wilayah Fakultas Teknik Bosowa kegiatan manajemen akademik masih menggunakan sistem administrasi perkantoran manual sehingga pelayanan yang diberikan belum maksimal. Adapun yang menjadi fokus dalam penelitian ini adalah bagaimana penulis dapat membuat suatu aplikasi untuk mempermudah seluruh civitas akademik dalam melakukan aktifitas administrasi perkantoran. Pada proses pembuatan aplikasi web service ini menggunakan beberapa software seperti notepad++ sebagai wadah untuk menampung source code Code Igniter, JavaScript, HTML, CSS, Angular js serta software MySql untuk menampung basis data dari aplikasi tersebut.\r\nPenelitian ini menggunakan metode penelitian kualitatif Design and Creation serta pengujian yang dilakukan adalah pengujian blackbox. Hasil dari tugas akhir ini adalah sebuah sistem aplikasi berbasis web service yang akan mempermudah dalam kegiatan administrasi akademik. Kelebihan dari sistem ini adalah keterbukaan kegiatan adminstrasi perkantoran dan penyajian informasi yang cepat.\r\nKata Kunci: E-Office, Code Igniter, Mobile HTML, CSS, Ionic, Javascript, Notepad ++, Xampp, Apache Cordova, Jeasy UI.'),
(181, 'RANCANG BANGUN APLIKASI PENELUSURAN SKRIPSI', 2016, 'SAINS DAN TEKNOLOGI', 1, 'Penelitian ini dilatar belakangi oleh banyaknya mahasiswa Teknik\r\nInformatika dan Sistem Informasi UIN Alauddin Makassar yang kesulitan saat\r\npengajuan judul. Kurangnya informasi terkait judul skripsi yang akurat dan\r\nkreativitas mahasiswa yang kurang dalam menemukan ide baru menjadi penghambat\r\nmahasiswa tingkat akhir dalam proses pengajuan judul. Akibatnya mahasiswa tidak\r\ndapat menyelesaikan studinya tepat waktu. Berdasarkan latar belakang tersebut,\r\nmaka perlu dibuat sebuah aplikasi pencarian judul di jurusan Teknik Informatika dan\r\nSistem Informasi UIN Alauddin Makassar, yang bertujuan untuk membantu\r\nmahasiswa tingkat akhir dalam menemukan informasi skripsi serta menemukan saran\r\nide dalam pengajuan judul.\r\nMetode penelitian yang digunakan adalah menggunakan metode penelitian\r\nkualitatif. Perancangan aplikasi ini terbagi atas Data Flow Diagram, Entity\r\nRelationship Diagram, Struktur Tabel, flowchart dan perancangan antarmuka.\r\nPembangunan aplikasi ini menggunakan codeigniter sebagai framework php\r\n(backend) dan materialize sebagai framework css (frontend) yang menggunakan\r\npengujian Black Box dan White Box. Hasil tugas akhir, adalah sebuah aplikasi\r\nwebsite yang akan membantu mahasiswa atau dosen menemukan judul skripsi yang\r\nsudah digunakan. Kelebihan aplikasi ini, mahasiswa tidak mengajukan judul secara\r\nmanual melainkan langsung menginput data ke website yang tersedia. Selain itu,\r\nmahasiswa dan dosen dapat secara langsung melakukan penelusuran skripsi dan\r\nmenemukan tugas akhir mahasiswa lainnya dalam waktu relative cepat dan akurat.\r\nKata Kunci : Web, Codeigniter, Materializecss, Algortima Brute Force.'),
(182, 'ROBOT TEMPAT SAMPAH MINI SEBAGAI SARANA PEMBELAJARAN UNTUK MEMBENTUK PERILAKU CINTA KEBERSIHAN PADA ANAK-ANAK', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Sampah merupakan permasalahan yang penting di kota Makassar. Beberapa\r\nprogram pemerintah di lakukan untuk menjaga kebersihan kota Makassar yang\r\nbertujuan membentuk perilaku cinta kebersihan. Untuk mendukung program\r\npemerintah, di rancang sebuah robot tempat sampah mini sebagai sarana\r\npembelajaran untuk membentuk perilaku cinta kebersihan pada anak – anak.\r\nRobot tempat sampah mini adalah salah satu mobile robot yang dirancang untuk\r\ndapat melakukan proses buka tutup otomatis tempat sampah, menghasilkan suara\r\ndari tempat sampah dan dapat membuang isi tempat sampah secara otomatis\r\ndengan cara berjalan mengikuti garis dengan menggunakan sensor TCRT5000L\r\ndengan teknik line following untuk mengikuti garis. Motor DC digunakan sebagai\r\nmotor penggerak roda. Mikrokontroller yang digunakan adalah mikrokontroller\r\nArduino UNO 2560 sebagai kontrol utama sistem.\r\nMetode penelitian yang digunakan adalah penelitian eksperimen. Penelitian\r\neksperimen yang dilakukan adalah metode penelitian eksperimental. Dengan\r\nmelakukan eksperimen terhadap variabael-variabel kontrol (input) untuk\r\nmenganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan\r\ndengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah robot tempat sampah mini yang dapat berfungsi\r\nmembuka penutup secara otomatis, menghasilkan suara ajakan membuang\r\nsampah dan dapat membuang sampah secara otomatis serta berjalan secara\r\notomatis menggunakan teknik line following melewati garis atau jalur sehingga\r\ndapat mengajarkan ke anak – anak dalam membentuk perilaku cinta kebersihan.\r\nKata kunci : Robot Tempat Sampah Mini, Ping, TCRT5000L, dan Arduino\r\nUNO 2560.'),
(183, 'RANCANG BANGUN HELM PENGURAI POLUTAN MENJADI OKSIGEN', 2016, 'SAINS DAN TEKNOLOGI', 2, 'Helm pengurai polutan ini adalah salah satu helm yang dirancang untuk dapat melakukan deteksi polusi atau debu. Proses mendeteksi polusi atau debu menggunakan Sensor MQ-7 dan Sensor Sharp GP2Y1010AU0F. Sedangkan dalam proses penguraian polutan menjadi oksien menggunakan teknologi Filter HEPA (High-efficiency particulate arrestance) dan Karbon Aktif. Blower digunakan untuk menciptakan aliran udara pada helm dengan driver L298N sebagai motor penggerak. Motor servo sebagai alat untuk menutup kaca helm secara otomatis jika terdeteksi udara berpolusi. Mikrokontroler yang digunakan adalah mikrokontroler Arduino NANO sebagai kontrol utama sistem.\r\nJenis penelitian yang digunakan adalah penelitian kuantitatif. Penelitian kuantitatif yang dilakukan adalah metode penelitian eksperimental dengan melakukan eksperimen terhadap variabael-variabel kontrol (input) untuk menganalisis output yang dihasilkan. Output yang dihasilkan akan dibandingkan dengan output tanpa adanya pengontrolan variabel.\r\nHasil penelitian ini adalah sebuah helm yang dapat mengurai polutan menjadi oksigen yang masuk kedalam helm dengan nilai batas ambang normal.\r\nKata kunci : Helm pengurai polutan, MQ-7, Sharp GP2Y1010AU0F, Filter HEPA, Filter Karbon Aktif dan Arduino NANO.'),
(184, 'APLIKASI PELATIHAN BERBICARA DENGAN METODE MATERNAL REFLEKTIF UNTUK PENYANDANG CACAT ANAK TUNARUNGU DAN TUNAWICARA', 2016, 'SAINS DAN TEKNOLOGI', 4, 'menggunakan papan tulis, gambar serta peragaan yang terkesan kurang menarik dan sulit dipahami apalagi hal ini menyangkut tentang anak yang berkebutuhan khusus. Sehingga dibutuhkan suatu aplikasi sebagai media pembelajaran untuk meningkatkan minat siswa dalam mempelajari bahasa SIBI. Tujuan dalam penelitian ini adalah merancang dan membangun aplikasi sebagai media pembelajaran interaktif bahasa SIBI dengan Metode Maternal Reflektif sebagai acuan teknik pengajaranya yang dimana dibagun dengan berbasis Dekstop.\r\nMetode penelitian pada penelitian ini adalah penelitian eksperimental dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data wawancara dan observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil uji coba menunjukkan bahwa aplikasi ini mudah digunakan, memberikan informasi visual yang lebih baik dari pada buku konvensional, menyenangkan sehingga siswa merasa tidak bosan serta membantu meningkatkan pemahaman siswa.\r\nKata Kunci : Media Belajar , Bahasa SIBI, Metode Maternal Reflektif, Aplikasi Dekstop, Eksperimental.'),
(185, 'APLIKASI VALIDASI STRUKTUR KARYA TULIS ILMIAH MENURUT JENIS PENELITIAN SESUAI PEDOMAN PENULISAN KARYA TULIS ILMIAH UNIVERSITAS ISLAM NEGERI ALAUDDIN MAKASSAR', 2016, 'SAINS DAN TEKNOLOGI', 1, 'Metode bimbingan struktur yang digunakan saat ini ialah masi menggunakkan manual dengan cara dosen memeriksa struktur satu persatu, dengan berbagai hal kesibukan yang di miliki oleh seorang dosen tidak semua dosen memeriksa secara rinci apakah struktur bab sudah valid atau belum sesuai pedoman yang diterapkan di kampus Uin Alauddin Makassar. Sehingga di butuhkan aplikasi yang dapat mengecek struktur dari sebuah jenis penelitian. Tujuan dari penelitian ini adalah membangun suatu aplikasi validasi struktur karya tulis ilmiah menurut jenis penelitian sesuai pedoman penulisan karya tulis ilmiah uin alauddin Makassar\r\nMetode penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box.\r\nBerdasarkan hasil ujicoba menunjukkan bahwa aplikasi ini mudah digunakan, memberikan informasi kepada pengguna kesalahan apa saja yang ada pada penelitiannya.\r\nKata kunci: Karya Tulis Ilmiah, Validasi, , Jenis Penelitian.'),
(186, 'RANCANG BANGUN APLIKASI GAME FUN WITH PHYSIC BERBASIS ANDROID', 2016, 'SAINS DAN TEKNOLOGI', 3, 'Ilmu fisika sangat mendukung perkembangan teknologi, industri, komunikasi, termasuk kerekayasaan (engineering), kimia, biologi, kedokteran, dan lain-lain. Ilmu fisika dapat menjawab pertanyaan-pertanyaan mengenai fenomena-fenomena yang menarik. Walaupun demikian sayang sekali kenyataannya minat siswa terhadap pelajaran fisika sangat rendah. Pembelajaran fisika di sekolah memiliki kecenderungan menjadi suatu pembelajaran yang terkesan kaku dan tersistem dengan skenario yang sudah diciptakan oleh guru dalam proses pembelajarannya. Apabila kondisi ini terus berlanjut dapat menimbulkan turunnya minat dan kurangnya penguasaan konsep pada pelajaran fisika. Karena itulah perlu dibangun aplikasi game fun with physic sebagai salah satu sarana edukasi bagi pengguna sehingga dapat memotivasi pengguna untuk terus belajar di bidang fisika.\r\nDalam melakukan penelitian ini, digunakan jenis penelitan kualitatif dengan metode Design and Creation. Selain itu, metode perancangan waterfall digunakan untuk pembuatan sistem. Aplikasi ini berjalan pada perangkat mobile dengan sistem operasi Android. Dirancang menggunakan bahasa pemrograman Java dan C#. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram , activity diagram, dan sequence diagram dan diuji menggunakan metode pengujian whitebox.\r\nHasil dari penelitian ini adalah dihasilkannya sebuah aplikasi game berbasis android diberi nama Fun with Phisic, sebuah aplikasi yang dapat digunakan sebagai sarana untuk edukasi pembelajaran fisika dalam kehidupan sehari-hari.\r\nKata Kunci: Game Edukasi, Fisika, Java, C#'),
(187, 'APLIKASI PENGELOLA KEUANGAN PRIBADI DAN RUMAH TANGGA', 2015, 'SAINS DAN TEKNOLOGI', 3, 'Perilaku konsumtif yang sering terjadi di tengah masyarakat dapat menjadi\r\nmasalah utama dalam pengelolaan keuangan. Seiring berkembangnya teknologi dan\r\ninformasi, saat ini ada berbagai macam aplikasi dalam mengelola dan mengalokasikan\r\nkeuangan yang mampu menjadi referensi bagi masyarakat baik untuk pribadi maupun\r\ndalam rumah tangga, salah satunya aplikasi dengan sistem operasi Android. Adapun\r\nyang menjadi fokus dalam penelitian ini adalah bagaimana penulis dapat membuat\r\nsuatu aplikasi untuk memberikan informasi dan referensi kepada pengguna tentang\r\ncara pengelolaan keuangan yang baik dan benar, baik untuk pribadi maupun rumah\r\ntangga dengan menampilkan informasi keuangan di smartphone dengan Platform\r\nAndroid. Selain itu, pada proses pembuatan aplikasi mobile ini menggunakan beberapa\r\nsoftware seperti brackets sebagai wadah untuk menampung source code HTML, CSS,\r\nangularjs serta software Xampp selaku wadah untuk menampung basis data dari\r\naplikasi tersebut.\r\nPenelitian ini menggunakan metode penelitian kualitatif Design and Creation\r\nserta pengujian yang dilakukan adalah pengujian blackbox. Hasil dari tugas akhir ini\r\nadalah sebuah sistem aplikasi mobile yang akan menampilkan data keuangan baik\r\npemasukan maupun pengeluaran menggunakan persentase. Kelebihan dari sistem ini\r\nadalah user dapat mengetahui informasi kondisi keuangannya sehingga dapat menjadi\r\nreferensi dalam mengelola keuangan.\r\nKata Kunci: Keuangan, Angularjs, HTML, CSS, Ionic, Javascript, Notepad ++,\r\nXampp, Apache Cordova'),
(188, 'GAME PENGENALAN MAKANAN TRADISIONAL KHAS SULAWESI SELATAN BERBASIS ANDROID', 2015, 'SAINS DAN TEKNOLOGI', 3, 'Perkembangan teknologi informasi dan komunikasi saat ini berpengaruh besar terhadap berbagai aspek kehidupan, bahkan perilaku dan aktivitas manusia kini banyak tergantung kepada teknologi informasi dan komunikasi. Salah satu contohnya adalah pemanfaatan teknologi pada proses belajar mengajar.\r\nSeiring perkembangan industri game mobile yang semakin pesat, game sekarang tidak hanya berfungsi sebagai media hiburan semata. Pada penelitian ini dikembangkan sebuah game edukasi “Pengenalan Makanan Tradisional Sulawesi Selatan” pada platform Android yang memberikan informasi kepada pengguna mengenai makanan apa asa saja yang ada di sulawesi selatan.\r\nGame edukatif pengenalan makanan tradisional ini dibangun untuk bisa menjadi suatu alternatif dalam memperkenalkan makanan tradisional, dimana pengguna bisa bermain sambil belajar. Didalam game ini, pengguna diajak untuk mengetahui makanan tradisional apa saja yang ada di sulawesi selatan serta asal daerah atau suku makanan tersebut, sehingga dapat menambah wawasan para penggunanya.\r\nDari hasil pengujian yang dilakukan dengan metode black box, dapat disimpulkan bahwa aplikasi ini dapat berfungsi baik. Dan dapat memberikan pengguna smartphone Android game yang edukatif.\r\nKata kunci : Smartphone Android, Game Edukasi, Makanan Tradisional.'),
(189, 'SISTEM PEMANTAU CURAH HUJAN DAN TINGGI GENANGAN AIR PADA JALAN YANG RAWAN TERGENANG DI KOTA MAKASSAR MELALUI JARINGAN INTERNET PADA APLIKASI ANDROID', 2015, 'SAINS DAN TEKNOLOGI', 3, 'Kondisi jalan di Kota Makassar pada umumnya masih banyak jalan yang\r\nrawan tergenang, hal ini yang mendukung pentingnya informasi curah hujan dan\r\ntinggi genangan yang terjadi pada jalan berbasis Android. Informasi adanya curah\r\nhujan dan genangan air pada jalan melalui aplikasi Android, dapat membantu\r\npengguna aplikasi untuk mengetahui kondisi cuaca dan kondisi genangan pada jalan\r\ndengan praktis, cukup dengan membuka aplikasi ini pada smartphone Android.\r\nPengguna aplikasi dapat melihat kondisi jalan terlebih dahulu ketika jalan tersebut\r\nakan dilewatinya, sehingga pengguna jalan dapat mengetahui apakah jalan tersebut\r\ndapat dilewati atau tidak, karena adanya hujan atau tinggi genangan yang terjadi pada\r\njalan tersebut.\r\nMikrokontroler akan membaca tegangan yang masuk dari sensor, kemudian\r\ntegangan tersebut diubah ke dalam nilai ADC (Analog to Digital Converter). Data\r\ndari nilai ADC inilah yang akan dikirimkan ke server menggunakan jaringan GPRS,\r\nkemudian disimpan ke dalam server sehingga apabila ada permintaan dari pengguna\r\naplikasi (masyarakat), data tersebut akan di tampilkan melalui smartphone Android.\r\nKata kunci : Sistem, Curah Hujan, Tinggi Genangan, Air.'),
(190, 'RANCANG BANGUN APLIKASI MIX AND MATCH HIJAB DENGAN ANDROID FACE DETECTOR API', 2015, 'SAINS DAN TEKNOLOGI', 3, 'Masalah yang melatar belakangi penelitian ini adalah karena menutup aurat merupakan kewajiban bagi tiap wanita mukmin. Berhijab merupakan bagian dari menutup aurat. Seiring perkembangan fashion muslim, hijab muncul dengan beragam jenis dan model. Sehingga muslimah dituntut untuk pandai dalam memilih, memadukan dan mengenakan hijab sesuai bentuk wajahnya. Untuk itu, dibutuhkan suatu aplikasi mobile untuk memudahkan pengguna hijab dalam memilih, memadukan dan mengenakan hijab. Adapun tujuan dari penelitian ini adalah membangun suatu aplikasi mix and match hijab yang dapat mendeteksi wajah dengan Android face detector API. Aplikasi ini berjalan pada smartphone berbasis Android dan dibuat sebagai sarana untuk membantu memudahkan pengguna dalam berhijab.\r\nJenis penelitian yang digunakan dalam penelitian ini adalah desain and creations. Dirancang dengan bahasa pemrograman Java menggunakan software Eclipse dan SQLite Browser. Pemodelannya menggunakan UML yaitu use case diagram, sequence diagram dan class diagram. Diuji dengan metode pengujian blackbox. Hasil dari penelitian ini adalah sebuah aplikasi mix and match hijab yang diberi nama aplikasi My Hijabs. Aplikasi ini dapat mendeteksi wajah dengan Android face detector API dan membantu memudahkan pengguna hijab dalam memilih, memadukan dan megenakan hijab sesuai dengan bentuk wajah.\r\nKata Kunci : Android, Face Detector, Hijab, Mix And Match'),
(191, 'APLIKASI MEDIA PEMBELAJARAN SEMAPHORE MENGGUNAKAN KINECT', 2015, 'SAINS DAN TEKNOLOGI', 4, 'Semaphore merupakan salah satu bentuk bahasa isyarat dalam komunikasi jarak jauh dengan menggunakan bendera, dayung, batang , tangan kosong atau dengan sarung tangan. Dalam pembelajaran Semaphore pada saat ini masih menggunakan media konvensional berupa buku ataupun gerakan manusia yang diperagakan secara langsung. Pada penelitian ini penulis melakukan penelitian yaitu bagaimana merancang aplikasi yang menggunakan teknologi Kinect sebagai metode baru dalam pembelajaran sandi Semaphore yang lebih interaktif. Adapun maksud dari penelitian ini yakni penulis mencoba untuk mempermudah menghapal gerakan sandi Semaphore dengan menggunakan teknologi Kinect. Dalam perkembangan teknologi informasi terdapat salah satu perangkat teknologi yang dikenal dengan nama Kinect yang merupakan perangkat keras yang dapat melacak, menguraikan gerak tubuh dan suara. Pada penelitian ini jenis penelitian yang digunakan penulis yaitu Design and Creation dimana disamping melakukan penlitian tentang judul penulis mengembangkan produk. Dalam penelitian ini kinect sebagai alat yang mendeteksi gerakan Semaphore yang di terjemahkan dalam bentuk huruf yang diperoleh dari titik Skeleton dari sensor Kinect . aplikasi ini dapat menerjemahkan gerakan Semaphore secara real time dengan cara menggerakkan lengan sesuai dengan gerakan Semaphore kemudian sensor Kinect menerjemahkannya tanpa harus diperagakan oleh pengajar, sehingga aplikasi ini cukup membantu dalam pembelajaran semaphore dan dapat diterapkan dalam pembelajaran Semaphore guna mengurangi kesalahan pada saat komunikasi sandi Semphore .\r\nKata Kunci: Tracking Skeleton, Pramuka, Semaphore, Kinect.'),
(192, 'APLIKASI STRATEGI BOARD BASKET BERBASIS ANDROID', 2015, 'SAINS DAN TEKNOLOGI', 3, 'Dewasa ini, ada berbagai macam jenis olahraga dan salah satu jenis olahraga yang\r\ntermasuk paling banyak dimintai yaitu olahraga basket. Basket membutuhkan banyak\r\nstrategi yang dapat diterapkan dalam pertandingan untuk mendapatkan sebuah\r\nkemenangan dengan sportif. Penyampaian strategi yang belum efesien seperti secara\r\nlisan, menggukanan alat bantu seperti coaching board, batu, dan lain-lain.\r\nPermasalahan ini masih dihadapi oleh pelatih-pelatih basket amatir maupun\r\nprofessional di Indonesia dalam hal penerapan strategi di atas lapangan, pergerakan\r\npemain, dan taktik bermain masih manual.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian\r\nkualitatif dengan strategi penelitian Design and Creation, penelitian ini dilakukan\r\ndengan cara observasi yang menghasilkan data deskriptif berupa kata-kata tertulis\r\natau lisan dari orang-orang dan prilaku yang dapat diamati. Pengujiaan yang\r\ndilakukan adalah pengujian blackbox. Hasil dari tugas akhir ini adalah sebuah\r\naplikasi strategi board basket berbasis android yang dapat menampilkan strategi\r\ndalam bentuk animasi dan dapat membantu pelatih dalam membuat dan\r\nmenyampaikan strategi kepada pemain yang sesuai dengan kebutuhan tim. Aplikasi\r\nini berjalan sesuai dengan yang diharapkan, pengujian sistem berjalan dengan baik.\r\nMulai dari menambahkan, mengurangi, Drag and Drop Pin A, Pin B dan bola,\r\nRecord, play and pause animation.\r\nAplikasi ini dibuat menggunakan Unity 3D sebuah game engine yang berbasis crossplatform\r\nseperti Mac, Windows, Wii, iPhone, iPad dan Android. Unity lebih kurang\r\nsama dengan Blender game engine cuma unity lebih ringan dan diintegrasi lebih\r\ndidalam suasana grafik bahasa pemrograman yang dapat diterima Unity adalah Java\r\nScript, dan Cs Script (C#). Hasil dari penelitian ini yaitu aplikasi strategi board\r\nbasket berbasis android, yang dimana strategi yang dibuat sendiri oleh pelatih\r\nsehingga dapat menciptakan strategi yang sesuai kebutuhan tim\r\nKata Kunci : Olahraga, Basket, Strategi, Android'),
(193, 'APLIKASI STEGANOGRAFI PENYEMBUNYI PESAN SUARA TERENKRIPSI BERBASIS ANDROID', 2015, 'SAINS DAN TEKNOLOGI', 3, 'Penelitian ini dilatarbelakangi karena seringnya terjadi kasus penyadapan atau pembajakan data dalam proses pengirimannya. Karena itu dibutuhkan sebuah keamanan untuk mengamankan data teresebut. Ada dua teknik yang digunakan dalam mengamankan data, yaitu kriptografi dan steganografi. Kriptografi adalah teknik mengamankan pesan dengan cara mengacak atau merubah isi pesan dengan algoritma tertentu sedangkan steganografi adalah teknik mengamankan pesan dengan cara menyembunyikan pesan ke dalam media lain. Dengan kedua teknik tersebut akan dibuat aplikasi yang akan mengamankan data, dalam hal ini adalah data yang berupa pesan suara.\r\nAplikasi steganografi penyembunyi pesan suara terenkripsi merupakan aplikasi yang digunakan untuk mengamankan pesan suara singkat, seperti hasil wawancara. Aplikasi ini menggunakan dua teknik untuk mengamankan datanya, untuk kriptografinya menggunakan algoritma serpent dan metode end of file untuk proses steganografinya.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah penelitian penelitan lapangan kualitatif eksperimental. Aplikasi ini berjalan pada perangkat mobile dengan sistem operasi Android dan dirancang menggunakan bahasa pemrograman Java. Pembangunan aplikasi ini menggunakan software Eclipse. Dalam pemodelannya aplikasi ini menggunakan metode UML berupa use case diagram, class diagram dan sequence diagram dan diuji menggunakan metode pengujian black box. Hasil dari penelitian ini adalah aplikasi steganografi penyembunyi pesan suara ternekripsi, Aplikasi ini dibuat sebagai sarana untuk pengamanan pesan suara.\r\nKata Kunci: Android, Steganografi, Kriptografi, Java, UML'),
(194, 'SISTEM NOTIFIKASI KECELAKAAN PADA SEPEDA MOTOR BERBASIS ARDUINO', 2015, 'SAINS DAN TEKNOLOGI', 3, 'Tingkat kecelakaan yang sangat tinggi di Indonesia serta kemudahan mendapatkan kendaraan bermotor, hal ini yang mendukung pentingnya informasi tentang kecelakaan berbasis mikrokontroller Arduino. Informasi tentang dimana lokasi kecelakaan yang dapat diakses melalui Google Maps, dapat membantu kita untuk mengetahui dimana lokasi kecelakaan keluarga ataupun kerabat. Cukup dengan membuka link yang dikirm oleh sepeda motor kepada pengguna melalui Smartphone.\r\nMikrokontroller akan selalu mengecek kemiringan sepeda motor pengguna, dan ketika sepeda motor mendapat kemiringan 55º sampai 90º maka mikrokontroller akan mengambil data dari GPS Shield berupa koordinat lokasi sepeda motor mengalami kecelakaan, kemudian mengirim pesan kepada pengguna berupa link lokasi kecelakaan dengan bantuan GSM Shield.\r\nSetelah SMS sampai kepada pengguna dalam bentuk link, maka pengguna akan diarahkan langsung ke Google Maps untuk melihat dimana lokasi kecelakaan terjadi.\r\nKata kunci : Kecelakaan, Sepeda Motor, Arduino,GPS Shield, GSM Shield, Smartphone, Google Maps.'),
(195, 'RANCANG BANGUN SISTEM INFORMASI PENYEWAAN TEMPAT TINGGAL SEMENTARA BERBASIS WEB ( STUDI KASUS KEL. ROMANG POLONG KEC. SOMBA OPU KAB. GOWA )', 2015, 'SAINS DAN TEKNOLOGI', 1, 'Pondokan merupakan salah satu kebutuhan mahasiswa atau karyawan yang\r\nbekerja maupun menuntut ilmu di kelurahan Romang Polong walaupun sifatnya\r\nsementara banyak yang cenderung dalam mencari dikarenakan kurangnya informasi\r\nmengenai penyewaan tempat tinggal sementara. Berdasarkan hal ini maka untuk\r\nmerancang dan membangun sistem informasi penyewaan tempat tinggal sementara\r\nberbasis website sehingga dapat mempermudah pencarian dan penyewaan agar lebih\r\ncepat dan tepat. Sehingga dapat memberikan apresiasi positif bagi penggunanya\r\nkarena mampu menghargai kemajuan teknologi informasi dan komunikasi.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan strategi\r\ndesign and creation sedang metode pengumpulan data yang digunakan yaitu\r\nobservasi, studi literatur, wawancara. Adapun metode perancangannya menggunakan\r\nData Flow Diagram (DFD). Analisis yang dilakukan mencakup analisis sistem yang\r\nsedang berjalan, analisis sistem yang diusulkan. Sistem ini mencakup beberapa\r\nkonten yaitu beranda, pondokan, cari pondokan, daftarkan pondokan, login. Hasil\r\ndari pengujian sistem ini menyimpulkan bahwa fungsi yang diharapkan semuanya\r\nberhasil sesuai dengan keinginan. Kesimpulannya dengan membuat sistem periklanan\r\nini dapat sangat membantu pihak terlibat antara lain pemilik tempat tinggal mengatur\r\ndengan baik penyewaan tempat tinggalnya secara online melalui website, agar dapat\r\nmempermudah masyarakat yang ingin mencari tempat tinggal agar lebih mudah dan\r\ncepat.\r\nKata Kunci : Romang Polong, Pondokan, Informasi, Website'),
(196, 'RANCANG BANGUN SISTEM KEAMANAN KOMPUTER UNTUK PENGAMANAN LAPTOP YANG HILANG', 2015, 'SAINS DAN TEKNOLOGI', 4, 'Salah satu perkembangan teknologi yang sangat serius dihadapi oleh perusahaan yang bergerak di bidang teknologi yaitu masalah keamanan. Sering terjadi kejahatan di dunia teknologi baik dalam bentuk pencurian data, perusakan fasilitas, dan banyak lagi jenis-jenis kejahatan yang bisa terjadi di bidang teknologi, dan pada saat ini yang sering terjadi yaitu pencurian gadget seperti laptop dan handphone. Tujuan penelitian ini merancang sistem keamanan laptop dengan mengindentifikasi pelaku pencurian laptop dengan menggunakan webcam yang terdapat pada laptop.\r\nMotode penelitian pada penelitian ini adalah penelitian kualitatif yang memusatkan perhatian pada suatu kasus secara intensif dan terperinci mengenai latar belakang keadaan sekarang yang dipermasalahkan. Penelitian ini menggunakan metode pengumpulan data observasi dan dokumentasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah black box.\r\nAnalisis dan perancangan sistem pada aplikasi ini menggunakan analisi kebutuhan software. Kebutuhan perangkat keras sebuah laptop yang memiliki camera webcam. Aplikasi ini memiliki beberapa kondisi tertentu supaya dapat beroperasi dengan maksimal dan pihak kepolisian dapat mengidentifikasi pelaku pencurian.\r\nKata Kunci: Keamanan Komputer, Pengamanan Laptop, Laptop Hilang.'),
(197, 'PERANCANGAN SISTEM KEAMANAN PINTU DAN KONTROL LAMPU RUMAH MENGGUNAKAN RASPBERRY PI', 2015, 'SAINS DAN TEKNOLOGI', 2, 'Seiring dengan perkembangan zaman tindak kejahatan dengan target rumah\r\nsering terjadi, angka kriminalitas pun semakin meningkat. Salah satu dari bentuk\r\nkejahatan tersebut ialah pencurian yang akhir-akhir ini marak terjadi. Disisi lain\r\nperkembangan teknologi terus menerus dikembangkan demi untuk mempermudah\r\nsegala aktifitas manusia, salah satu bidang teknologi yang berkembang itu ialah\r\nteknologi Raspberry Pi.\r\nAdapun penerapan teknologi raspberry pi ini adalah pada keamanan pintu\r\nrumah dan kontrol lampu, dimana perangkat ini dapat mengunci pintu dan\r\nmenongontrol lampu dari jauh serta mendeteksi gerkan manusia. Dalam perancangan\r\nperangkat ini, menggunakan raspberry pi sebagai pengolah data dan kontroler, relay\r\nmodul sebagai sakelar otomatis, selenoid door lock sebagai kunci pintu, webcam\r\nsebagai kamera pengawas dan sensor pir yang mndeteksi gerakan yang dilengkapi\r\nbuzzer.\r\nPenelitian ini menggunakan metode penelitian kualitatif Design and Creation\r\ndan pengujian yang dilakukan adalah pengujian blackbox yang berfokus pada\r\npersyaratan fungsioanal perangkat lunak. Hasil dari penelitain ini adalah sebuah\r\nperangkat keamanan kunci pintu rumah, kontrol lampu, pengawasan sekitar pintu\r\ndengan kamera dan sensor PIR yang akan membunyikan buzzer sebagai alarm.\r\nKelebihan perangkat ini kunci pintu dan lampu rumah dapat diakses dari jauh dan dapat\r\nmelihat situasi pintu pada rumah melalui video langsung.\r\nKata kunci : Raspberry Pi, Relay Modul, Selenoid Door Lock, Webcam, Sensor,\r\nBuzzer'),
(198, 'METODE LEARNING VECTOR QUANTIZATION PADA JARINGAN SYARAF TIRUAN UNTUK MENGIDENTIFIKASI TULISAN TANGAN HURUF LONTARA', 2015, 'SAINS DAN TEKNOLOGI', 4, 'Kurangnya pengetahuan masyarakat tentang aksara lontara sehingga\r\nmenyulitkan masyarakat dalam membaca naskah-naskah penting yang\r\nmenggunakan aksara lontara. Selain itu pembelajaran tentang aksara lontara\r\ndalam muatan lokal dalam dunia pendidikan tidak maksimal. Melalui tugas akhir\r\nini, penulis memberikan solusi dengan merancang sebuah sistem yang akan\r\nmengidentifikasi tulisan tangan huruf lontara bugis makassar. Salah satu\r\npemanfaatan sistem terkomputerisasi ini yaitu dengan menerapkan teori Image\r\nprocessing. Disamping itu juga menerapkan teori jaringan syaraf tiruan dengan\r\nmetode learning vector quantization, dalam hal ini sebagai sistem yang\r\nmelakukan pengelompokan aksara lontara sesuai kelasnya masing-masing.\r\nDengan menerapkan kedua teori ini maka sistem akan melakukan\r\npengidentifikasian tulisan tangan aksara lontara yang mempunyai karakteristik\r\nmenyerupai jaringan syaraf manusia. Data yang digunakan berupa citra yang telah\r\ndiambil menggunakan scanner. Citra diubah menjadi numerik dengan\r\nmenggunakan image processing. Tahapan image processing antara lain proses\r\ncrop citra RGB menjadi 186 x 186 pixel, dan binerisasi citra. Tahap pelatihan\r\njaringan menggunakan data sebanyak 30 citra yang terdiri dari aksara lontara yang\r\nberjumlah 23 karakter ( k , g , G , K , p , b , m , P , t , d , n , R ,\r\nc , j , N , P , y , r , l , w , s , a , h ). Hasil pengujian citra\r\nlatih diperoleh persentase 68,98 %. Hasil identifikasian untuk 3 citra baru\r\ndiperoleh persentase 68,1 %. Citra yang diambil sebaiknya tidak perlu dengan\r\nscanner yang memiliki jumlah pixel yang besar, sehingga citra tidak perlu lagi dicrop\r\n186 X 186 pixel, menggunakan diakritik anak huruf lontara, menggunakan\r\natau menambahkan beberapa fungsi image processing, dan diimplementasikan\r\ndalam bentuk perangkat portable.\r\nKata kunci : Learning Vector Quantization, Jaringan Syaraf Tiruan,\r\nTulisan Tangan, Huruf Lontara.'),
(199, 'IMPLEMENTASI NAVIGATOR KULINER KOTA MAKASSAR DENGAN GPS BERBASIS ANDROID', 2014, 'SAINS DAN TEKNOLOGI', 3, 'Perkembangan teknologi mobile sangatlah pesat, kini penggunaan\r\nperangkat mobile tidak hanya sebatas melakukan panggilan atau menelepon dan\r\nmengirim pesan singkat, akan tetapi, dengan menggunakan perangkat mobile,\r\ndalam hal ini adalah smartphone, maka bisa di dapatkan informasi apa saja yang\r\nkita butuhkan, salah satu informasi yang penting adalah informasi mengenai\r\nkeberadaan kuliner. Terkhusus kota Makassar dengan keberadaan kuliner khas\r\nyang banyak dan kurangnya infrormasi yang tersedia mengenai keberadaan\r\nkuliner tersebut.\r\nTujuan dari penulisan skripsi ini adalah merancang aplikasi navigator\r\nkuliner kota Makassar yang berbasis pada pencarian lokasi, sehingga kita dapat\r\nmemperoleh informasi mengenai keberadaan kuliner di kota Makassar dengan\r\nmenggunakan perangkat mobile smartphone.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah\r\npenelitian eksperimental yaitu melakukan eksperimen terhadap variabel-variabel\r\nkontrol (input) untuk menganalisis output yang dihasilkan.\r\nHasil dari rancangan sistem pada penulisan skripsi ini adalah sebuah\r\naplikasi yang berjalan pada sistem operasi android, dimana dapat memberikan\r\ninformasi kuliner terdekat dengan posisi pengguna dan dapat menampilkannya\r\ndalam peta lengkap menuju lokasi kuliner terdekat tersebut.Aplikasi ini juga dapat\r\nmelakukan panggilan telepon kepada kuliner yang nomor teleponnya telah\r\nterdaftar.Pengujian yang dilakukan yaitu metode pengujian blackbox yang\r\nberfokus pada persyaratan fungsional perangkat lunak.\r\nKata kunci : Navigator, Kuliner ,GPS, android'),
(200, 'APLIKASI PEMBELAJARAN ILMU TAJWID BERBASIS ANDROID', 2014, 'SAINS DAN TEKNOLOGI', 3, 'setiap kaum muslim. Agar bisa membaca dengan tartil sebelumnya harus mengetahui aturan dalam Ilmu Tajwid. Ilmu Tajwid diajarkan hanya sedikit di sekolah. Biasanya hanya diselipkan pada pelajaran Pendidikan Agama Islam. Agar lebih mudah mempelajarinya dibutuhkan teknologi terbaru di bidang mobile agar mudah dalam mengaksesnya yaitu android. Tujuan dari penelitian ini adalah membangun aplikasi pembelajaran ilmu Tajwid berbasis Android. Aplikasi ini diharapkan mampu menjadi alternatif dalam metode pembelajaran Ilmu Tajwid dan menutupi waktu belajar Ilmu Tajwid yang tidak diajarkan di sekolah. Jenis penelitaian pada penelitian ini adalah kualitatif.\r\nHasil dari rancangan sistem pada penulisan skripsi ini adalah sebuah aplikasi yang berjalan pada sistem operasi Android, dimana terdapat beberapa menu yang memberikan pembelajaran Ilmu Tajwid secara betahap. Aplikasi ini juga memiliki menu tes yang dapat digunakan untuk memberi tes kepada pengguna yang sedang belajar Ilmu Tajwid. Pengujian yang dilakukan menggunakan metode pengujian black box yang berfokus pada persyaratan fungsional perangkat lunak. Setelah dilakukan pengujian, dapat ditarik kesimpulan bahwa secara fungsional sistem aplikasi ini sudah dapat menghasilkan output yang diharapkan.\r\nKata kunci : Al-Qur’an, Android, Aplikasi , Ilmu Tajwid, Pembelajaran.'),
(201, 'AUGMENTED REALITY GESTURE ALAT PERAGA BANGUN DATAR DAN BANGUN RUANG MENGGUNAKAN KINECT', 2014, 'SAINS DAN TEKNOLOGI', 4, 'Pada pembelajaran matematika kelas 1 SD, terdapat materi pembelajaran tentang pengenalan bentuk bangun datar dan bangun ruang berdasarkan dimensinya sehingga diperlukan suatu alat peraga atau media yang dapat digunakan sebagai jembatan bagi peserta didik untuk berfikir abstrak, memudahkan dalam menyamakan presepsi antara siswa dan guru pada saat proses pembelajaran. Tujuan dalam penelitian ini adalah merancang sebuah alat peraga dalam pengenalan bentuk bangun datar dan bangun ruang berdasarkan dimensi.\r\nMetodologi penelitian pada penelitian ini adalah penelitian kualitatif dimana strategis yang digunakan adalah Design and Creation. Penelitian ini menggunakan metode pengumpulan data wawancara dan observasi. Metode perancangan yang digunakan adalah waterfall dan teknik pengujian yang digunakan adalah Black Box .\r\nAnalisis dan perancangan sistem pada aplikasi ini menggunakan analisis kebutuhan software, pengambilan gambar sensor kinect, analisis pengenalan objek kerangka dan perancangan aplikasi yang menjelaskan alur program pada pembuatan aplikasi. Aplikasi ini menerapkan teknologi Augmented Reality (AR) dengan menggunakan interaksi tangan (Gesture Based) pada alat peraga agar siswa bisa membedakan bentuk bangun 2D dan 3D dalam pembelajaran pengenalan bentuk bangun dengan metode Games Education sehingga dapat digunakan sebagai media pembelajaran matematika Sekolah Dasar kelas 1 sesuai kurikulum tematik 2013 dalam mengenal bangun datar dan bangun ruang berdasarkan dimensi.\r\nKata Kunci: Augmented Reality, Gesture, Kinect, Alat peraga, kurikulum 2013.'),
(202, 'APLIKASI MEDIA PEMBELAJARAN BIOLOGI BERBASIS ANIMASI KOMPUTER INTERAKTIF UNTUK SEKOLAH MENENGAH UMUM PADA KELAS XII', 2014, 'SAINS DAN TEKNOLOGI', 4, 'Pada dasarnya pembelajaran merupakan proses komunikasi antara guru dan\r\npeserta didik. Proses yang terjadi tidak selamanya berjalan dengan lancar, bahkan\r\nproses komunikasi dapat menimbulkan salah pengertian, ataupun salah konsep.\r\nUntuk itu seorang guru hendaknya menggunakan metode yang tepat sehingga dapat\r\nmendukung proses pembelajaran tersebut.\r\nProses pembelajaran dapat didukung dengan berbagai macam media, salah\r\nsatunya dengan menggunakan media animasi komputer interaktif. Dengan\r\nmenggunakan media animasi yang interaktif maka proses pembelajaran dapat lebih\r\nefektif dan siswa akan lebih tertarik. Animasi yang interaktif merupakan suatu\r\naplikasi yang dapat digunakan dalam menjelaskan materi yang tidak bisa diamati\r\nsecara langsung seperti pada mata pelajaran biologi yang di mana kebanyakan\r\nmaterinya memuat proses-proses biologi yang sangat rumit dan susah dimengerti\r\nkarena prosesnya yang tidak bisa diamati secara langsung.\r\nBiologi merupakan pelajaran yang membahas tentang mahluk hidup. Dimana\r\npada setiap makhluk hidup pasti mengalami banyak proses-proses yang tidak dapat di\r\namati secara langsung.\r\nPenelitian ini merupakan penelitian kuantitatif yang dilakukan dengan metode\r\neksperiment. Animasi interaktif yang dibuat membahas tentang materi pelajaran\r\nbiologi sekolah menengah umum (SMU) pada kelas dua belas (XII) semester ganjil\r\ndan genap. Animasi dibuat menggunakan software 3D Flash Animator. Animasi\r\ndijalankan dengan menggunakan software Macromedia Flash Player.\r\nPengujian sistem dilakukan dengan metode Black Box Testing. Pengujian\r\nanimasi dari aplikasi media pembelajaran biologi ini dilakukan dengan cara mengetes\r\nsemua fungsi tombol animasi apakah sesuai dengan fungsinya.\r\nKata kunci : Media Pembelajaran, Animasi Interaktif, Biologi, SMU.'),
(203, 'PERANCANGAN PENGINGAT RUTINITAS ANAK BERBASIS MIKROKONTROLER', 2014, 'SAINS DAN TEKNOLOGI', 2, 'Pada kenyataanya teknologi informasi saat sekarang ini sudah sangat pesat\r\nperkembanganya. Hal ini dapat dilihat dari banyaknya diciptakan suatu alat yang\r\ndapat meringankan pekerjaan manusia yang tadinya dikerjakan secara manual kini\r\ndikerjakan oleh mesin. Otomatis semua pekerjaan tersebut sebagian besar\r\ndikerjakan oleh mesin yang mengendalikan pekerjaan tersebut. Manusia hanya\r\nbekerja sebagai pemantau apakah alat sudah bekerja dengan baik. Tidak terkecuali\r\nalat yang mampu mengingatkan manusia tentang rutinitas sehari-hari. Sesuai\r\ndengan judul skripsi ini “Perancangan Pengingat Rutinitas Anak berbasis\r\nMikrokontroler”. Adapun tujuan dari alat ini yakni memudahkan para orang tua\r\nuntuk mengajak anak-anak mengerjakan rutinitas atau kebiasaan yang baik.\r\nDalam perancangan alat ini digunakan beberapa rangkaian yaitu rangkaian\r\nmikrokontroler ATMega 8535, rangkaian RTC DS1307, rangkaian keypad,\r\nrangkaian relay. Adapun penelitian yang digunakan pada skripsi ini adalah\r\npenelitian dengan metode kualitatif. Penelitian kualitatif ini menfokuskan apakah\r\ncara kerja alat sesuai dengan hasil yang diharapkan oleh pengguna (user). Adapun\r\ncara kerja dari alat ini yakni nyalakan DVD player portable kemudian LCD akan\r\nmenampilkan tanggal, jam, menit, dan detik secara default pada tampilan awal.\r\nSetelah itu atur rutinitas anak sesuai dengan kebutuhan dengan mengatur jam dan\r\nrutinitas yang di inginkan. Misalnya rutinitas shalat diatur berulang setiap hari.\r\nKata Kunci : Mikrokontroler, Rutinitas, RTC, LCD');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(204, 'PROTOTYPE MONITORING KETINGGIAN AIR PADA WADUK BERBASIS MIKROKONTROLER', 2014, 'SAINS DAN TEKNOLOGI', 2, 'Pengawasan terhadap ketinggian air baik pada waduk ataupun bendungan merupakan pekerjaan yang tidak terlalu berat, namun jika terjadi kelalaian dalam pengawasan akibatnya sangat merugikan karena menyangkut keselamatan warga disekitarnya. Bukan hanya itu, penyampaian informasi mengenai ketinggian air juga sangat minim. Sehingga ketika curah hujan tinggi, warga yang tinggal disekitar waduk/bendungan tidak cukup waktu untuk membenahi barang-barang yang perlu diamankan. Debit air yang tidak terkontrol akibat curah hujan yang ekstrem dapat membuat suatu waduk meluap dikarenakan kurangnya informasi ke pengawas pintu air, hal ini disebabkan sistem pengawasaan pintu air saat ini masih manual. Bukan hanya itu, dalam membuka dan menutup pintu air dibutuhkan juga petugas pintu air yang harus siap siaga di dekat tuas pengontrol pintu air agar ketika debit air sudah tinggi maka petugas dapat segera membuka pintu air. Cara manual ini mempunyai faktor kekurangan yaitu, apabila para penjaga pintu tersebut lalai dalam tugasnya, maka tuas pembuka dan penutup pintu tidak difungsikan dengan baik sehingga dapat menyebabkan air meluap ke lingkungan warga disekitar waduk. Salah satu bidang teknologi yang berkembang itu ialah teknologi mikrokontroler. Adapun penerapan dari teknologi mikrokontoler adalah Prototype Monitoring Ketinggian Air Pada Waduk Berbasis Mikrokontroler. Dalam perancangan alat ini, menggunakan mikrokontroler ATMega 8535 sebagai pengolah data dan sensor ping sebagai input serta LCD grafik, LED, Buzzer dan Motor DC sebagai inputnya. Untuk pemberitahuan dini terjadinya bencana banjir, maka diperlukan pengamatan monitoring level air secara intensif dan efektif, agar hal-hal yang menjadi kekhawatiran warga di sekitar waduk tersebut dapat di tepis karena adanya informasi secara akurat dari monitoring waduk. Kata Kunci :Mikrokontroler, ATmega8535, Motor, Buzzer, Led, LCD Grafik'),
(205, 'RANCANG BANGUN PENGAMAN RUANGAN MENGGUNAKAN PINTU OTOMATIS DENGAN DETEKSI MANUSIA', 2014, 'SAINS DAN TEKNOLOGI', 2, 'Seiring dengan perkembangan zaman tindak kejahatan di lingkungan gedung perkantoran sering terjadi, angka kriminalitas pun semakin meningkat. Salah satu dari bentuk kejahatan tersebut ialah pencurian yang akhir-akhir ini marak terjadi. Disisi lain perkembangan teknologi terus menerus dikembangkan demi untuk mempermudah segala aktifitas manusia, salah satu bidang teknologi yang berkembang itu ialah teknologi mikrokontroler. Adapun penerapan dari teknologi mikrokontoler adalah sistem keamanan ruangan, dimana alat ini mendekteksi adanya pergerakan manusia diruangan tersebut. Dalam perancangan alat ini, menggunakan mikrokontroler ATMega 8535 sebagai pengolah data dan beberapa sensor pendeteksi dari manusia itu sendiri. Penelitian ini menggunakan metode penelitian kualitatif Field Research dan pengujian yang dilakukan adalah pengujian blackbox yang berfokus pada persyaratan fungsioanal perangkat lunak. Hasil dari perancangan dari sistem pada tugas akhir ini adalah sebuah sistem keamanan ruangan yang memiliki dua objek yang menjadi input yang dikelola mikrokontroler yaitu sensor passive infrared (pir) dan sensor laser. Kelebihan dari alat ini adalah output yang dihasilkan berupa motor yang terpasang pada pintu akan menutup secara otomatis dan sirine akan aktif disaat yang sama apabila sensor yang ada bereaksi terhadap pergerakan manusia.\r\nKata Kunci: Mikrokontroler, Atmega 8535, Motor, Sirine, Sensor.'),
(206, 'APLIKASI REKAM TAHAPAN PEMBINAAN NARAPIDANA LAPAS KELAS I MAKASSAR', 2014, 'SAINS DAN TEKNOLOGI', 1, 'Pada masa sekarang ini, pengolahan data dan informasi membutuhkan kecepatan dan keakuratan. Berdasarkan pada ilmu yang penulis tekuni, untuk mendapatkannya haruslah didukung dengan suatu teknologi informasi yang tepat dan berdaya guna serta relevan untuk penerapannya. Kantor Lembaga Pemasyarakatan yang biasa disingkat LAPAS ini turut pula merasakan dampak dari kemajuan teknologi.\r\nDalam hal ini yaitu dalam proses tahapan pembinaan narapidana, dimana dalam proses tahapan ini, membutuhkan ketelitian dalam melakukan penghitungan remisi pada setiap narapidana, maka dari itu dibutuhkan suatu aplikasi yang dapat mendukung proses tahapan pembinaan tersebut agar lebih meningkatkan mutu dari lembaga pemasyarakatan itu sendiri. Dalam penelitian ini, penulis menarik kesimpulan bahwa perlunya dilakukan pembaharuan yang lebih efisien dan efektif dalam melakukan proses tahapan pembinaan.\r\nKata Kunci : Aplikasi, Rekam Tahapan Pembinaan Narapidana'),
(207, 'PEMBUATAN APLIKASI REAL QUICK COUNT BERBASIS WEBSITE', 2014, 'SAINS DAN TEKNOLOGI', 1, 'Pilkada merupakan pesta demokrasi di suatu daerah yang diadakan setiap lima tahun sekali, untuk memilih Kepala Daerah dan Wakil Kepala Daerah. Perhitungan suara membutuhkan waktu yang sangat lama dan tidak efisien karena jumlah suara dan jumlah TPS yang begitu banyak. Pada saat sekarang ini satu jam dari pelaksanaan Pilkada, sudah bisa dilihat hasil sementara pemenang dalam pilkada tersebut. Hasil Sementara tersebut bisa dilihat dengan metode penghitungan real quick count dengan kombinasi teknologi sms gateway. Adapun yang menjadi rumusan masalah dalam penelitian ini adalah bagaimana penulis menghasilkan sebuah sistem yang dapat membantu proses penghitungan suara dengan waktu yang cepat. Selain itu, pada proses pembuatan aplikasi ini menggunakan beberapa software seperti Notepad++ sebagai wadah untuk menampung source code HTML,CSS,PHP,Javascript serta software Xampp selaku wadah untuk menampung basis data dari aplikasi tersebut. Pada penelitian ini proses pengiriman data perolehan suara di tiap-tiap TPS dikirim oleh masing-masing relawan yang telah terdaftar dalam sistem melalui SMS dengan format yang telah ditentukan sebelumnya. Hasil dari tugas akhir ini adalah sebuah aplikasi berbasis website yang akan menampilkan data hasil perhitungan suara dalam bentuk diagram batang dan hanya dapat diakses menggunakan browser.\r\nKata Kunci: Real Quick Count, Pilkada, SMS Gateway.'),
(208, 'Aplikasi Penyedia Informasi Kebutuhan Gizi Orang Dewasa Berbasis Android', 2013, 'SAINS DAN TEKNOLOGI', 3, 'Dalam tubuh yang sehat terdapat jiwa yang sehat, dan untuk mendapatkan\r\ntubuh yang sehat salah satunya dapat dilakukan dengan cara memperhatikan\r\nasupan gizi yang sesuai dengan kebutuhan kalori tubuh. Namun sebagian besar\r\norang tidak mengetahui seberapa besar jumlah kalori yang harus dikonsumsinya\r\ntiap hari, hal inilah yang mengakibatkan munculnya kelebihan bahkan ada pula\r\nkekurangan gizi.\r\nTujuan dari penulisan skripsi ini selain sebagai syarat untuk mencapai\r\ngelar sarjana komputer pada jurusan teknik informatika, juga untuk merancang\r\natau membangun aplikasi penyedia informasi kebutuhan gizi orang dewasa\r\nberbasis android. Dalam melakukan penelitian ini, jenis penelitian yang digunakan\r\nadalah penelitian eksperimental yaitu melakukan eksperimen terhadap variabelvariabel\r\nkontrol (input) untuk menganalisis output yang dihasilkan. Hasil dari\r\nrancangan sistem pada penulisan skripsi ini adalah sebuah aplikasi yang berjalan\r\npada sistem operasi Android, dimana pengguna dapat memperoleh informasi\r\ntentang berat badan ideal, status gizi, jumlah kalori yang perlu dikonsumsi\r\nperharinya, serta beberapa contoh menu makanan. Pengujian yang dilakukan\r\nmenggunakan metode pengujian blackbox yang berfokus pada persyaratan\r\nfungsional perangkat lunak. Setelah dilakukan pengujian, dapat ditarik\r\nkesimpulan bahwa secara fungsional sistem aplikasi ini sudah dapat menghasilkan\r\noutput yang diharapkan.\r\nAplikasi penyedia informasi kebutuhan gizi (Nutrition Care) dirancang\r\nuntuk memberikan informasi kepada pengguna (orang dewasa) tentang gizi dan\r\nkebutuhan kalori, atau keadaan gizi pada tubuh, apakah kurang, lebih, ataupun\r\nnormal. Dan dalam Islam masalah tersebut sangat diperhatikan, hal tersebut\r\nterlihat dari banyaknya ayat yang membahasnya.\r\nKata kunci : informasi kebutuhan gizi, orang dewasa, android'),
(209, 'APLIKASI PENAMPILAN INFORMASI AREA KAMPUS UIN ALAUDDIN MAKASSAR BERBASIS LOCATION BASED SERVICE DENGAN ANDROID', 2013, 'SAINS DAN TEKNOLOGI', 3, 'Perkembangan smartphone memberikan pola baru terhadap kehidupan\r\nmanusia dalam berinteraksi satu sama lain. Hal tersebut memberi dampak positif\r\ndalam pengembangan aplikasi mobile sebagai media informasi. Salah satu aplikasi\r\nyang sangat ideal dalam penyampaian informasi adalah aplikasi Location Based\r\nService. Dengan mengusung lisensi Open Source disertai dukungan dari Google\r\nmaka android merupakan pilihan yang tepat untuk pengembangan aplikasi\r\nLocation Based Service pada mobile smartphone.\r\nPenyampaian informasi dalam dan luar kampus masih belum cukup teratur\r\nsehingga terkadang masyarakat kesulitan dalam mendapatkan informasi yang\r\ndiinginkan. Oleh karena itu perlu dikembangkan sebuah sistem untuk menangani\r\nmasalah tersebut.\r\nImplementasi aplikasi Location Based Service pada UIN Alauddin\r\nMakassar merupakan salah satu sarana untuk mengetahui informasi kegiatan\r\nmaupun area-area pada kampus UIN Alauddin Makassar. Penelitian ini\r\nmerupakan jenis penelitian kualitatif dengan metode pengumpulan data berupa\r\nlibrary research dan field Research.\r\nBerdasarkan hasil implementasi dan pengujian aplikasi ini, maka\r\npenyampaian informasi menjadi lebih terarah dan meluas serta masyarakat dapat\r\nlebih mengenal UIN Alauddin Makassar. Sehingga dapat dikatakan bahwa dengan\r\nadanya aplikasi ini maka masyarakat maupun civitas akademik dapat dengan\r\nmudah untuk memperoleh informasi mengenai UIN Alauddin Makassar, maupun\r\nkegiatan-kegiatan yang berlangsung dalam lingkup kampus.'),
(210, 'PERANCANGAN APLIKASI PEMBELAJARAN MEMBACA\r\nALQUR’AN DENGAN METODE QIRO’AH\r\nBERBASIS ANDROID', 2013, 'SAINS DAN TEKNOLOGI', 3, 'Membaca Al-Qur’an merupakan salah satu kewajiban seorang muslim,\r\nkarena di dalam Al-Qur’an terdapat pedoman untuk setiap umat manusia agar\r\nselalu berjalan di jalan yang diridhoi oleh Allah SWT. Allah SWT telah\r\nmenjanjikan dalam Al-Qur’an bahawa siapa saja yang membaca Al-Qur’an tidak\r\nakan pernah mendapat kerugian akan tetapi sebaliknya, mereka akan mendapat\r\npahala yang sangat berlipat ganda.\r\nTujuan dari penulisan skripsi ini adalah merancang Aplikasi Pembelajaran\r\nmembaca Al-Qur’an melalui suatu alat komunikasi yang disebut smartphone. Alat\r\nkomunikasi ini dapat sangat membantu orang yang ingin belajar membaca Al-\r\nQur’an karena dapat dibawah kemana saja.\r\nDalam melakukan penelitian ini, jenis penelitian yang digunakan adalah\r\npenelitian eksperimental yaitu melakukan eksperimen terhadap variabel-variabel\r\nkontrol (input) untuk menganalisis output yang dihasilkan.\r\nHasil dari rancangan sistem pada penulisan skripsi ini adalah sebuah\r\naplikasi yang berjalan pada sistem operasi Android, dimana terdapat beberapa\r\nmenu yang memberikan pembelajaran cara membaca Al-Qur’an secara bertahap.\r\nAplikasi ini juga memiliki menu tes yang dapat digunakan untuk member tes\r\nkepada pengguna yang sedang belajar membaca Al-Qur’an.\r\nPengujian yang dilakukan menggunakan metode pengujian blackbox yang\r\nberfokus pada persyaratan fungsional perangkat lunak. Setelah dilakukan\r\npengujian, dapat ditarik kesimpulan bahwa secara fungsional sistem aplikasi ini\r\nsudah dapat menghasilkan output yang diharapkan.\r\nKata kunci : membaca, Al-Qur’an, android'),
(211, 'APLIKASI TEKNIK PENCARIAN CERDAS MENU KULINER BERBASIS ANDROID', 2013, 'SAINS DAN TEKNOLOGI', 3, '\r\nManusia sebagai mahluk hidup tidak dapat terlepas dengan kebutuhan\r\nakan makanan. Salah satu aktifitas dalam membuat makanan adalah dengan\r\nmemasak. Beragam makanan diolah dengan berbagai teknik memasak dan\r\nmenggunakan rempah-rempah yang beragam pula. Indonesia sebagai negara yang\r\nkaya akan rempah-rempah sehingga membuat rakyatnya cerdas dalam mengolah\r\nmakanan. Perkembangan teknologi memiliki peran penting dalam penyebaran\r\nresep-resep masakan khas Negara Indonesia, sehingga masakan-masakan dari\r\nNegara Indonesia tersebar sampai ke luar negeri. Berbagai macam resep-resep\r\nmasakan tercipta sehingga membuat masyarakat tidak dapat mengetahui secara\r\ndetail setiap resep masakan yang ada. Sehingga membuat masyarakat mulai\r\nmendokumenkan resep-resep masakan dalam sebuah buku.\r\nAplikasi menu kuliner dibuat agar memudahkan masyarakat dalam\r\nmencari dan mengetahui resep-resep masakan. Sehingga proses masak memasak\r\nkhususnya masyarakat yang baru belajar memasak tidak lagi terhambat karena\r\nkurangnya pengetahuan masyarakat tentang bahan dan cara membuat masakan.\r\nAplikasi ini dapat diakses dengan menggunakan perangkat mobile berbasis\r\nAndroid. Penelitian ini merupakan penelitian kualitatif dengan metode\r\npengumpulan data berupa library research dan field research.\r\nDari hasil penelitian ini diperoleh informasi bahwa aplikasi yang\r\ndirancang dapat membantu masyarakat dalam mengolah bahan pangan menjadi\r\nmasakan. Dikarenakan aplikasi ini disertakan dengan kulkas virtual sebagai\r\ntempat penyimpanan bahan pangan layaknya kulkas sungguhan. Dengan\r\npenggunaan aplikasi ini diharapkan masyarakat dengan cepat dapat mencari dan\r\nmengetahui resep-resep masakan. Untuk pengembangan selanjutnya, diharapkan\r\naplikasi menu kuliner ini ditambahkan dengan fitur-fitur yang belum ada dan\r\ncompatible sehingga dapat berjalan disemua platform sistem operasi mobile.\r\nKata kunci : Aplikasi Kuliner, Resep Masakan, Rempah-rempah, Memasak,\r\nSistem Operasi Android'),
(212, 'SISTEM PENDETEKSI KELAYAKAN AIR MINUM DALAM KEMASAN BERBASIS MIKROKONTROLER', 2013, 'SAINS DAN TEKNOLOGI', 2, 'Perkembangan teknologi mikrokontroler telah membawa era baru dalam dunia\r\nelektronika. Salah satu bentuk penerapannya adalah sistem pendeteksi kelayakan air\r\nminum dalam kemasan, dimana alat ini berfungsi untuk menampilkan kadar TDS\r\npada LCD dan report sehingga dapat mengetahui layak atau tidaknya air itu untuk\r\ndikonsumsi. Dalam perancangan alat ini, menggunakan mikrokontroler\r\nATMega8535, infrared, elektrolisa air dan bahasa pemrograman Visual Basic.\r\nPenelitian ini menggunakan metode penelitian kualitatif dengan pengujian blackbox\r\nyang berfokus pada persyaratan fungsional perangkat lunak.\r\nHasil dari rancangan sistem pada tugas akhir ini adalah sebuah penampil informasi\r\nyang memudahkan masyarakat untuk mengetahui layak atau tidaknya Air Minum\r\nDalam Kemasan (AMDK) itu dikonsumsi, dimana standar TDS (Total Dissolved\r\nSolids) air menurut World Health Organization (WHO) dan Badan Pengawas Obat\r\ndan Makanan (BPOM) adalah 50 ppm. Alat ini juga dapat membantu BPOM dalam\r\nmeneliti AMDK yang layak beredar di pasaran.\r\nDari Pengujian AMDK diketahui bahwa terjadi perbedaan nilai antara AMDK yang\r\ndiletakkan di tempat sejuk dan AMDK yang diletakkan di tempat yang bersuhu tinggi\r\nyaitu sebesar 34,77% serta tempat yang bersuhu rendah yaitu sebesar 32,32%.\r\nDari hasil pengujian sistem secara keseluruhan didapatkan hasil dari beberapa contoh\r\nAMDK seperti merek A yaitu 131,96ppm, merek B yaitu 170,08ppm dan merek C\r\nyaitu 133,91ppm masih berbeda dengan data dari BPOM. Dimana dari data BPOM\r\nuntuk merek A yaitu 139ppm, merek B yaitu 180ppm dan merek C yaitu 144ppm.\r\nPerbedaan tersebut berkisar 8,855 %. Perbedaan yang terjadi pada sistem dikarenakan\r\nfaktor dalam seperti sensor yang digunakan kurang presisi dalam menangkap sinyal\r\nyang dipancarkan oleh infrared serta faktor luar seperti kontaminasi sinar matahari\r\nlangsung, perubahan suhu dan kelembaban pada saat AMDK tersebut diuji. Namun\r\nsecara keseluruhan alat yang dibuat, dapat bekerja dan berfungsi dengan baik, karena\r\nrata-rata perbedaan yang dihasilkan tidak melebihi batas toleransi sebesar 10%.\r\nKata Kunci: Mikrokontroler, Sistem, Air, Air Minum Dalam Kemasan, Atmega 8535.'),
(213, 'SISTEM PERINGATAN DINI UNTUK KEAMANAN RUMAH', 2013, 'SAINS DAN TEKNOLOGI', 2, 'Kemajuan ilmu pengetahuan dan teknologi telah mendorong manusia untuk\r\nberusaha mengatasi segala permasalahan yang timbul di sekitarnya serta\r\nmeringankan pekerjaan yang ada. Salah satu teknologi yang berkembang saat ini\r\nadalah mikrokontroler. Dengan memanfaatkan mikrokontroler ini dapat\r\ndiciptakan suatu alat secerdas komputer tetapi dengan biaya yang relatif lebih\r\nmurah dari pada komputer. Seiring dengan berkembangnya mikrokontroler, maka\r\nsaat ini mikrokontroler banyak diaplikasikan pada instrument – instrument yang\r\nberhubungan dengan kehidupan sehari – hari. Salah satunya digunakan pada\r\nperancangan Sistem Peringatan untuk keamanan rumah. Tugas Akhir ini berjudul\r\n”Sistem Peringatan Dini untuk Keamanan Rumah Berbasis Mikrokontroler Pada\r\nKompleks Perumahan”. Di dalam perancangan alat ini, digunakan beberapa\r\nrangkaian yaitu rangkaian mikrokontroller Atmega8535, Push Button, Sirine dan\r\nLCD. Hasil dari perancangan alat ini yaitu sirine akan berbunyi untuk\r\nmemberikan tanda bahwa ada bahaya yang terjadi pada salah salah satu rumah\r\nyang telah menekan push button yang ada di setiap rumah dan kemudian akan\r\nmenampilkan rumah yang memerlukan bantuan tersebut ke LCD yang ada\r\nterpasang ditengah kompleks dan untuk mematikan sirine yang sedang berbunyi\r\ndengan menekan push button kembali rumah yang sebelumnya menekan atau\r\ndengan menekan push button yang ada pada pos petugas keamanan. Adapun\r\nfungsi dari alat ini adalah dapat membantu penghuni rumah yang sedang panik\r\ndalam memanggil bantuan ke masyarakat dan petugas keamanan sehingga dapat\r\nmemanfaatkan waktu lebih efektif dan efisien.\r\nKata kunci : Sistem Peringatan, Mikrokontroler, ATmega 8535, Push Button,\r\nLCD, Sirine'),
(214, 'SIMULASI PENGATURAN LAMPU LINTAS (TRAFFIC LIGHT) BERBASIS MIKROKONTROLER', 2013, 'SAINS DAN TEKNOLOGI', 2, 'Perkembangan ilmu pengetahuan dan teknologi makin pesat saja dimana\r\ndapat terlihat dari berbagai macam alat yang dibuat secara otomatis dan teratur.\r\nDengan kemajuan teknologi ini pula dapat dijadikan salah satu tolak ukur tingkat\r\nkemajuan suatu bangsa untuk menciptakan sebuah alat. Banyaknya alat yang\r\ndiciptakan dengan berbagai aplikasi yang bertujuan dapat menghemat tenaga,\r\nwaktu, dan uang bagi penggunanya atau khalayak. Skripsi ini berjudul “ Simulasi\r\nPengaturan Lampu Lalu Lintas Traffic Light) Berbasis Mikrokontroler”. Adapun\r\nfungsi dari alat ini adalah untuk mengurai kemacetan atau kepadatan kendaraan\r\nlalu lintas pada persimpangan jalan berdasarkan kepadatan lalu lintas.\r\nDidalam Perancangan alat ini, digunakan beberapa rangkaian yaitu\r\nrangkaian mikrokontroler ATMega 8535, rangkaian sensor, rangkaian lampu led,\r\nRangkaian lcd, modul rangkaian relay dan rangkaian power supply. Pada\r\npenelitian ini dalam perancangan menggunakan metode Prototyping yaitu\r\nmembuat sebuah contoh prototipe untuk menunjukkan kebutuhan dan desain ke\r\npemakai. Pada metode perancangan ini harus ada versi yang dapat dijalankan\r\nsebagai prototipe sebelum sistem dikembangkan bisa berupa contoh sistem lain).\r\nMetode ini harus ada implementasi sistem yang dikembangkan sebelum dibuat\r\nsebuah sistem final.\r\nKata kunci : Simulasi Pengaturan Lampu Lalu Lintas (Traffic Light) Berbasis\r\nMikrokontroler.'),
(215, 'PENERAPAN DIGITAL SIGNAGE BERBASIS RASPBERRY PI SEBAGAI ALTERNATIF MEDIA INFORMASI', 2013, 'SAINS DAN TEKNOLOGI', 2, 'Di era globalisasi, kebutuhan manusia akan teknologi informasi dan\r\nkomunikasi semakin meningkat. Salah satu hasil pengembangan teknologi saat ini\r\nyaitu Raspberry Pi, dimana Raspberry Pi bersifat open source merupakan komputer\r\nmini atau single board computer yang dapat melakukan banyak hal seperti yang\r\ndilakukan komputer pada umunya yaitu mengolah angka, mengolah kata, game dan\r\nyang lainnya. Berdasarkan permasalahan yang telah dikemukakan diatas, maka\r\ntujuan dari penelitian ini adalah untuk membangun sistem digital signage dengan\r\nmenggunakan komputer mini dengan biaya yang terjangkau.Dalam melakukan\r\npenelitian ini, jenis penelitian yang digunakan adalah penelitian kualitatif.\r\nPenelitian kualitatif merupakan suatu penelitian yang dilakukan dengan metode\r\neksperimental. Penelitian ini bertujuan mengimplementasikan digital signage\r\ndengan menggunakan media Raspberry Pi sebagai alternatif media informasi yang\r\nstatis (gambar cetak) dan merupakan media baru untuk penyampaian pesan,\r\ninformasi maupun promosi yang terarah (narrowcast) kepada khalayak secara tepat\r\ndalam waktu yang singkat. Dari hasil penelitian ini diperoleh kesimpulan bahwa\r\nsalah satu fungsi dari digital signage Raspberry Pi adalah Secara visual lebih\r\nmenarik dan dapat menyampaikan informasi secara lebih dinamis dan informatif\r\nKata kunci : Raspberry Pi, komputer mini, open source, single board computer,\r\ndigital signage'),
(216, 'PERANCANGAN TIGA DIMENSI RUMAH TINGGAL BERBASIS WEB', 2013, 'SAINS DAN TEKNOLOGI', 1, 'Website adalah dokumen atau informasi yang saling berhubungan, dengan\r\nkemajuan teknologi dibidang internet, kebanyakan orang memilih membuat sebuah\r\nwebsite sebagai layanan jasa, salah satunya adalah jasa desain rumah tinggal, dalam\r\nlayanan website sekarang ini, kebanyakan website menyediakan layanan rumah\r\ntinggal dalam bentuk yang sama, dimana mereka menampilkan hasil desain yang\r\nsudah dirancang dan mengirim data desain pada alamat yang telah diisi pengguna.\r\nDengan adanya jasa desain rumah tinggal ini, memudahkan pengguna mendapatkan\r\ndesain rumah sesuai dengan keinginannya. Perancangan tiga dimensi rumah tinggal\r\nini, memberikan pelayanan yang memudahkan pengguna dapat melihat langsung\r\nhasil desain rumah tinggal sesuai, dengan data yang diisi oleh user pada halaman\r\nwebsite yang telah disediakan.\r\nDalam melakukan penelitian, jenis penelitian yang digunakan adalah\r\neksperimental. Dengan metode pengumpulan data, library research dengan membaca\r\nbuku yang berkaitan dengan penelitian, mengutip pendapat para ahli, dan\r\nmengumpulkan artikel yang berhubungan dengan penelitian. Pengujian yang\r\ndilakukan pada penelitian ini adalah blackbox. Hasil dari perancangan desain tiga\r\ndimensi rumah tinggal ini dapat berjalan pada lingkungan yang memiliki jaringan\r\ninternet, sehingga memudahkan pengguna mendapatkan desain rumah tinggal dengan\r\ncepat tanpa harus menunggu hasil desain dalam beberapa hari, aplikasi ini\r\nmenyediakan tampilan rumah tinggal dengan berbagi sisi, denah rumah, serta video\r\nbagian interior ruangan.\r\nDapat disimpulkan bahwa aplikasi ini dapat berfungsi dengan baik, dan dapat\r\nmemudahkan pengguna untuk memilih tipe rumah, dan luas bangunan yang telah\r\ntersedia.\r\nKata kunci : Tiga Dimensi, Rumah Tinggal, Internet, Desain, Website.'),
(217, 'Pembuatan Foto Panorama Kampus UIN Alauddin Makassar dengan Metode Image Stitching', 2012, 'SAINS DAN TEKNOLOGI', 1, 'Perkembangan teknologi yang meningkat pesat semakin memudahkan kita untuk memperoleh informasi. Informasi yang jelas tidak hanya berkaitan dengan teks tetapi juga gambar, suara dan video. Informasi yang jelas mengenai suasana dan fasilitas pada sebuah lokasi sering menjadi pertimbangan seseorang untuk berkunjung atau bergabung ke lokasi tersebut. Image stitching merupakan salah satu metode penggabungan gambar untuk membentuk sebuah gambar panorama mengenai sebuah lokasi. Sebuah gambar panorama dapat memberikan informasi yang jelas berupa gambar mengenai suatu lokasi dan fasilitas dalam lokasi tersebut.\r\nPenelitian ini merupakan penelitian kualitatif deskriptif dengan metode pengumpulan data berupa penelitian kepustakaan dan lapangan dengan pengambilan foto di Kampus II UIN Alauddin. Penelitian ini bertujuan membuat foto panorama kampus UIN Alauddin Makassar dengan metode image stitching untuk memberikan informasi yang jelas mengenai suasana dan fasilitas kampus UIN Alauddin Makassar. Dari hasil penelitian ini diperoleh bahwa metode image stitching dapat digunakan untuk membuat panorama Kampus UIN Alauddin Makassar.\r\nPenerapan gambar panorama hasil penjahitan pada situs web UIN Alauddin menggunakan bentuk VR (virtual reality) Panorama sehingga pengguna dapat melihat seperti nyata mengenai suasana dan fasilitas dari Kampus UIN Alauddin. Hasil analisis menunjukkan bahwa sistem yang dirancang dapat membantu pengguna memperoleh informasi berupa gambar panorama mengenai suasana dan fasilitas Kampus UIN Alauddin Makassar.\r\nKata kunci : Image Stitching, Foto Panorama, VR (virtual reality) Panorama, Kampus UIN Alauddin Makassar.'),
(218, 'APLIKASI AUGMENTED REALITY DENGAN METODE MARKER BASEDTRACKING UNTUK MEMVISUALISASIKAN GEDUNG-GEDUNG PADA KAMPUS II UNIVERSITAS ISLAM NEGERI ALAUDDIN SAMATA GOWA', 2012, 'SAINS DAN TEKNOLOGI', 4, 'Manfaat teknologi pada saat ini sudah sangat mempengaruhi kehidupan manusia,\r\ndengan diciptakannya mesin atau alat canggih yang dipergunakan manusia demi tercapainya\r\nkebutuhan manusia. Sejalan dengan perkembangan tersebut, muncullah teknologi realitas\r\ntertambah atau biasa disebut dengan Augmented Reality (AR). Augmented Reality adalah suatu\r\nlingkungan yang memasukkan objek virtual 3D ke dalam lingkungan nyata. Augmented Reality\r\nberkembang sangat pesat sehingga memungkinkan pengembangan aplikasi ini diberbagai\r\nbidang termasuk media periklanan. Saat ini, banyak literature-literatur yang menunjukkan\r\nkemungkinan penggunaan AR di bidang media periklanan sebagai strategi, pemasaran dan\r\npengenalan produk kepada konsumen. Seperti brosur perumahan, apartemen dan produk-produk\r\nlainnya yang akan dipublikasikan.Mengingat Universitas Islam Negeri Alauddin Makassar\r\nmerupakan salah satu perguruan tinggi negeri terbesar di Indonesia Timur yang memiliki\r\nbanyak gedung sebagai tempat aktivitas akademik. UIN Alauddin Makassar yang dulunya\r\naktivitas perkuliahan berada di kampus I dengan menempati gedung lama yang dimana gedung\r\nperkuliaha setiap jurusan se-fakultas terpisah. Kini sebagian besar aktivitas akademik dialihkan\r\nke kampus II UIN Alauddin Samata Gowa, yang dimana memiliki letak bangunan yang baru,\r\ndengan setiap gedungnya ditempati satu fakultas dengan beberapa jurusan yang ada. Dimana\r\nletak gedungnya masih asing bagi mahasiswa baru maupun masyarakat atau tamu Universitas\r\nyang berkunjung ke UIN Alauddin Samata Gowa, sehingga pada penelitian ini, keunggulan AR\r\ndimanfaatkan untuk membantu memvisualisasikan gedung-gedung yang ada di UIN Alauddin\r\nSamata Gowa untuk meningkatkan pemahaman atau memperdengarkan model gedung dan letak\r\ngedung-gedung yang ada di UIN Alauddin Samata Gowa, sehingga memudahkan pengenalan\r\nkampus tampa harus mengelilingi UIN Alauddin Samata Gowa.Metode yang digunakan untuk\r\nmenguji mencapaian tujuan penelitian adalah dengan membuat peta lokasi UIN yang telah\r\ndisisipi marker yang akan menampilkan desain interaktif 3D model setiap gedung didepan\r\nwebcam dan ditampilkan dalam monitor computer.Hasil penelitian ini menunjukkan bahwa\r\npenerapan teknologi Augmented Reality dapat diaplikasikan pada peta lokasi UIN Aluddin\r\nMakassar Samata Gowa dan dapat meningkatkan pemahaman atau memperkenalkan model\r\ngedung dan letak gedung-gedung yang ada di UIN Alauddin Samata Gowa.\r\nKata Kunci : Augmented Reality, Memvisualkan Model 3D Gedung UIN Alauddin Samata\r\nGowa, Peta Lokasi UIN.'),
(219, 'Perancangan Sistem Informasi Geografis (SIG) Berbasis Mobile', 2012, 'SAINS DAN TEKNOLOGI', 3, 'Mobile GIS Potensi Lahan Pertanian adalah sebuah aplikasi Sistem Infromasi\r\nGeografis Berbasis Mobile Android yang berfungsi sebagai aplikasi penampil\r\ninformasi mengenai pertanian yang terdapat di kabupaten Pinrang. Pemilihan sistem\r\noperasi Android sebagai sistem operasi mobile karena bersifat Open Source dan\r\nmempunyai lisensi Apache yang sangat terbuka dan bebas, maka Android menjadi\r\nsistem operasi yang sangat populer bagi berbagai produsen perangkat mobile.\r\nPenelitian ini merupakan jenis penelitian kualitatif dengan metode\r\npengumpulan data berupa library research dan field research, penelitian ini bertujuan\r\nuntuk merancang sebuah aplikasi sistem informasi geografis berbasis mobile potensi\r\nlahan pertanian di kabupaten Pinrang agar memudahkan setiap orang khususnya yang\r\nmenggunakan smarthphone berbasis Android mengakses informasi pertanian\r\nkabupaten Pinrang sekaligus diharapkan mampu memudahkan pemerintah setempat\r\ndalam melakukan penyuluhan kepada masyarakat.\r\nDari hasil penelitian ini diperoleh informasi bahwa aplikasi yang dirancang\r\ndapat membantu setiap pengguna smarthphone berbasis Android mengakses\r\ninformasi pertanian kabuaten Pinrang dan dapat mengembangkan aplikasi tersebut\r\njika ada yang ingin dikembangkan dari setiap konten-konten yang berhubungan\r\ndengan pertanian kabupaten Pinrang.\r\nKata kunci : Sistem informasi Geografis, Kabupaten Pinrang, Berbasis M'),
(220, 'RANCANGAN PENAMPIL INFORMASI RUNNING TEXT BERBASIS MIKROKONTROLER ATMEGA 16', 2012, 'SAINS DAN TEKNOLOGI', 2, 'Perkembangan teknologi mikrokontroler telah membawa era baru dalam dunia\r\nelektronika. Salah satu bentuk penerapannya adalah running text, dimana alat ini\r\nberfungsi untuk menampilkan informasi berupa tulisan berjalan menggunakan lampu\r\nLED yang disusun secara matriks sebagai displaynya. Dalam perancangan alat ini,\r\nmenggunakan mikrokontroler ATMega 16 sebagai pengolah data sekaligus\r\nmenyimpan data-data biner yang diperlukan untuk mengendalikan matriks LED\r\nsebagai output data.\r\nPenelitian ini menggunakan metode penelitian kualitatif yaitu dengan cara melakukan\r\neksperimen terhadap sistem yang akan dibangun.\r\nHasil dari rancangan sistem pada tugas akhir ini adalah sebuah penampil informasi\r\nyang terbagi menjadi tiga bagian penting yang dirangkai menjadi satu rangkaian,\r\nyaitu bagian pertama untuk menampilkan jam digital, bagian kedua untuk\r\nmenampilkan informasi running text, dan bagian ketiga untuk menampilkan nama\r\njurusan yang memberikan informasi. Kelebihan dari sistem ini adalah informasi dapat\r\ndi-update dan dapat melakukan penjadwalan informasi yang akan ditampilkan, selain\r\nitu sistem ini menampilkan informasi jadwal waktu shalat disertai dengan adanya\r\nbunyi buzzer dan semua informasi yang pernah di tampilkan akan tersimpan secara\r\notomatis di database sehingga memungkinkan untuk ditampilkan kembali jika\r\ninformasi tersebut diperlukan.\r\nSelama perancangan alat adapun kendala yang dihadapi yaitu keterbatasan memori\r\nyang tersedia pada mikrokontroler sehingga perencanaan awal untuk menggunakan\r\nbuzzer yang mampu merekam suara adzan sebagai penanda waktu shalat harus\r\ndiganti dengan buzzer alarm standar.\r\nKata Kunci : Mikrokontroler, LED, Running Text, Jam Digital, Buzzer,\r\nDatabase.'),
(221, 'KACAMATA PENDETEKSI BENDA UNTUK TUNA NETRA BERBASIS MIKROKONTROLER ATMEGA8', 2012, 'SAINS DAN TEKNOLOGI', 2, 'Dari hasil penelitian kacamata pendeteksi benda ini, diperoleh tingkat efektifitas rata-rata sensor ping 1 yang mendeteksi benda atau kalangan pada bagian depan sebesar 98,756% dan mampu mendeteksi hingga jarak 1 meter. Jika lebihj jarak tersebut, sensor tetap mendeteksi tetapi tidak akan mengeluarkan out put disebabkan nilai yang tidak akurat. Untuk sensor ping 2 yang mendeteksi benda dan lubang pada bagian bawah, diperoleh tingkat efektifitas rata-rata sebesar 96,99%.'),
(222, 'SISTEM KONTROL PENGUKUR KADAR ALKOHOL PADA CAIRAN BERBASIS MIKROKONTROLER ATMEGA8535', 2012, 'SAINS DAN TEKNOLOGI', 2, 'Alkohol merupakan suatu zat yang apabila di gunakan atau di konsumsi secara\r\nberlebihan dan terus menerus akan membahayakan kondisi tubuh konsumen.\r\nPenggunaan alkohol banyak beredar dipasaran dan sudah dikenal luas terutama\r\ndalam bentuk produk minuman, karena jumlah pemakaian alkohol dalam minuman\r\nsangat banyak maka tidak mengherankan apabila keracunan akut maupun kronis\r\nakibat alkohol sering terjadi. Namun dari segi religi alkohol digolongkan pada\r\nminuman yang memabukkan atau biasa disebut khamar (Haram). Sehingga\r\nseseorang biasanya ragu akan penggunaan alkohol sehingga perlu diuji kadar\r\nalkohol tersebut. Pada umumnya alat yang digunakan untuk mengukur kadar alkohol\r\nbiasanya digunakan pada laboratorium. Namun pengukuran tersebut membutuhkan\r\nwaktu yang cukup lama dan mengakibatkan manusia sulit mendapatkan informasi\r\nmengenai kadar alkohol dengan cepat. Untuk memudahkan manusia dalam\r\nmengukur kadar alkohol dengan tidak dibatasi oleh tenaga ahli dan tempat, maka\r\nakan dibuat sistem kontrol pengukur kadar alkohol pada cairan dengan\r\nmenggunakan mikrokontroler ATMega8535 dengan adanya sistem yang dirancang\r\nini diharapkan dapat memudahkan kinerja manusia untuk mempercepat proses\r\npemeriksaan pengukuran kadar alkohol pada suatu cairan dengan waktu yang relatif\r\nsingkat dan hasil mendekati akurat sehingga dapat mengurangi keraguan masyarakat\r\ndan untuk mengatasi masalah uji laboratorium yang pada dasarnya membutuhkan\r\nwaktu yang cukup lama. Selain itu informasi hasil pengukur kadar alkohol ini juga\r\ndapat dihubungkan ke perangkat lunak yang akan dibuat dengan menggunakan\r\nVisual Basic 6.0.\r\nKata Kunci : Alat ukur, Alkohol, Mikrokontroler ATMega8535, lcd, Komunikasi\r\nSerial, Sensor TGS 822'),
(223, 'PERANGKAT LUNAK TES POTENSI AKADEMIK', 2012, 'SAINS DAN TEKNOLOGI', 4, 'Skripsi ini adalah studi tentang salah satu pemanfaatan teknologi dalam\r\npeningkatan efisiensi dan efektivitas kegiatan manusia, khususnya pemanfaatan\r\nkomputer dalam kegiatan akademik. Tujuan dari penelitian ini adalah untuk\r\nmerancang dan membangun sebuah perangkat Tes Potensi Akademik yang lebih\r\nefektif dan efisien, sehingga yang menjadi pokok permasalahan adalah bagaimana\r\nmerancang dan membangun sebuah perangkat Tes Potensi Akademik (TPA)\r\nyang lebih efektif dan efisien. Masalah ini dibahas dengan menggunakan metode\r\nanalisis data kuantitatif. Berdasarkan hasil survey tentang pelaksanaan Tes Potensi\r\nAkademik, kegiatan Tes Potensi Akademik selama ini dilaksanakan secara\r\nmanual, yaitu dengan mengisi lembaran-lembran soal Tes Potensi Akademik\r\nberupa kertas yang dibagikan oleh pelaksana tes. Pelaksanaannya diadakan dalam\r\nsebuah ruangan yang telah ditentukan serta pengerjaannya sesuai waktu yang\r\nditentukan pula. Berdasarkan hasil pengamatan, peringatan waktu yang dilakukan\r\nsecara manual kurang efektif. Serta penggunaan beberapa orang pengawas dalam\r\nproses tes, selain boros tenaga dan biaya, juga belum dapat dipastikan\r\nvaliditasnya. Dengan merancang dan membangun perangkat lunak Tes Potensi\r\nAkademik, dapat dibuktikan sebagai hasil penelitian bahwa dengan menggunakan\r\nperangkat lunak dalam melaksanakan Tes Potensi Akademik, proses pelaksanaan\r\nTes Potensi Akademik menjadi lebih efektif dan efisien. Sehingga dapat ditarik\r\nkesimpulan bahwa dengan menggunakan perangat lunak atau menerapkan\r\nComputer Based Test (CBT), maka kegiatan Tes Potensi Akademik dinyatakan\r\nmenjadi lebih efektif dan efisien.\r\nKata kunci : Tes Potensi Akademik (TPA), Computer Based Test (CBT),\r\nEfektif dan Efisien.'),
(224, 'PERANCANGAN DAN IMPLEMENTASI SISTEM SEKOLAH TERPADU BERBASIS CLIENT SERVER DI SMAN 9 MAKASSSAR', 2012, 'SAINS DAN TEKNOLOGI', 4, 'Sistem Sekolah Terpadu merupakan aplikasi yang diperuntukkan untuk mengolah data –\r\ndata yang berhubungan dengan sekolah.seperti pengolahan data registrasi ulang siswa, data\r\nabsensi siswa dan data pembayaran siswa. Belum optimalnya data – data ini menyebabkan\r\nsulitnya dalam mencari informasi tentang data siswa dan pembuatan laporan yang belum\r\nmemadai.Oleh karena itu diperlukan suatu aplikasi yang bias mendukung dan memecahkan\r\nmasalah tersebut. Aplikasi ini dibangun dengan menggunakan Apache web server sebagai web\r\nservernya, menggunakan PHP sebagai bahasa pemrograman, dan MySQL dalam pembangunan\r\ndatabase.\r\nPenelitian ini bertujuan untuk merancang Sistem Sekolah Terpadu pada SMAN 9\r\nMakassar berbasis client-server. Jenis penelitian yang digunakan yaitu penelitian kuantitatif,\r\nsementara dalam pengumpulan data menggunakan metode penelitian kepustakaan dan penelitian\r\nlapangan (observasi). Adapun metode pengujian menggunakan Black Box Testing yang berfokus\r\npada kebutuhan fungsional dari perangkat lunak.\r\nDengan adanya Sistem Sekolah Terpadu pada SMAN 9 Makassar Berbasis Client-Server\r\nini maka dapat membantu staf dan pegawai pada SMAN 9 Makassar dalam hal pengelolaan datadata\r\nyang berhubungan dengan sekolah tersebut. Contohnya dalam hal pengelolaan data\r\nAkademik, Keuangan, Perpustakaan, Kepegawaian, Info Guru, Info Siswa dan BK (Badan\r\nKonseling).\r\nKata kunci : sistem sekolah terpadu, client-server, akademik, keuangan, perpustakaan,\r\nkepegawaian, info guru, info siswa, bk (badan konseling).'),
(225, 'APLIKASI PEMBELAJARAN INTERAKTIF UNTUK MATA PELAJARAN TEKNOLOGI INFORMASI DAN KOMUNIKASI PADA SMP NEGERI 3 PALLANGGA', 2012, 'SAINS DAN TEKNOLOGI', 3, 'Ilmu pengetahuan dan teknologi merupakan sesuatu yang tidak dapat\r\ndipisahkan. Perkembangan ilmu pengetahuan selalu beriringan dengan\r\nberkembangnya teknologi. Ilmu pengetahuan adalah hal yang mutlak harus\r\ndituntut oleh manusia, agar manusia tidak merugi dikehidupan dunia dan akhirat.\r\nSebagaimana firman Allah Swt. dalam surah Al Balad ayat 8 – 10 bahwa Allah\r\nSwt. memberikan dua buah mata, lidah dan dua buah bibir dan telah ditunjukkan\r\nkepada manusia dua jalan yaitu jalan kebajikan dan kejahatan. Untuk menjadi\r\nmanusia yang tidak merugi, maka jalan yang harus ditempuh adalah jalan\r\nkebajikan, salah satunya dengan belajar. Proses belajar mengajar merupakan salah\r\nsatu faktor yang menetukan ilmu pengetahuan tersebut dapat tersalurkan dan\r\ndipahami dengan baik oleh manusia khususnya para pelajar yang sedang menuntut\r\nilmu dibangku pendidikan. Saat ini proses belajar mengajar lebih banyak\r\nmenggunakan cara manual, dengan syarat guru dan siswa harus bertatap muka\r\nlangsung guna melaksanakan proses belajar mengajar. Ketika guru tidak dapat\r\nhadir dalam proses pembelajaran, maka penyaluran ilmu pengetahuan akan\r\nterhambat.\r\nUntuk mengatasi hal tersebut, maka dibuatlah sebuah aplikasi\r\npembelajaran yang berbasis e-learning dan m-learning, agar memudahkan para\r\nguru dan siswa saling berinteraksi. Sehingga proses belajar mengajar tidak akan\r\nterhambat oleh faktor ketidakhadiran serta faktor waktu dan tempat. Aplikasi ini\r\ndapat diakses dengan menggunakan komputer atau laptop serta perangkat mobile\r\nberbasis Android. Penelitian ini merupakan penelitian kualitatif dengan metode\r\npengumpulan data berupa library research dan field research.\r\nDari hasil penelitian ini diperoleh informasi bahwa aplikasi yang\r\ndirancang dapat membantu setiap guru dan siswa dalam melaksanakan proses\r\nbelajar mengajar dengan menggunakan komputer atau handphone / tablet berbasis\r\nAndroid untuk mengupload serta mengakses materi-materi pembelajaran\r\nkhususnya mata pelajaran Teknologi Informasi dan Komunikasi. Dengan\r\npenggunaan aplikasi ini diharapkan siswa dengan cepat dapat menyerap dan\r\nmemahami materi pembelajaran, khususnya mata pelajaran Teknologi Informasi\r\ndan Komunikasi. Untuk pengembangan selanjutnya, diharapkan aplikasi mlearning\r\nini ditambahkan dengan fitur-fitur yang belum ada dan dapat berjalan\r\ndisemua platform sistem operasi mobile.\r\nKata kunci : Aplikasi Pembelajaran, E-learning, M-learning, Sistem\r\nOperasi Android'),
(226, 'IMPLEMENTASI NETWORK MONITORING SYSTEM (NMS) SECARA VISUAL PADA INFRASTRUKTUR JARINGAN FISIK BERBASIS WEB STUDI KASUS : UIN ALAUDDIN MAKASSAR', 2012, 'SAINS DAN TEKNOLOGI', 1, 'Network Monitoring System (NMS) menggambarkan sebuah system yang terus menerus memonitor jaringan komputer sehingga jika terjadi gangguan dapat secepatnya melakukan notifikasi kepada seorang network administrator atau system administrator. Aplikasi NMS secara garis besar bekerja berdasarkan dengan 2 buah metode konektivitas. Dua cara yang biasa dilakukan yaitu dengan menggunakan ping dan protocol SNMP.\r\nPenelitian ini bertujuan mengimplementasikan sistem monitoring jaringan untuk memonitor perangkat jaringan yang ada di Universitas Islam Negeri Alauddin. Aplikasi ini dibuat secara visual yang berbasis web sehingga memudahkan administrator dalam mengetahui masalah perangkat jaringan serta melakukan konfigurasi dalam sistem ini.\r\nHasil dari penelitian ini adalah sistem dapat mengetahui perangkat jaringan yang bermasalah dengan melakukan metode ping terhadap semua perangkat jaringan yang ada dan menampilkan hasilnya dalam bentuk visual. Bila dalam proses ping pada perangkat jaringan tidak berhasil, maka sistem mendeteksi bahwa perangkat jaringan tersebut sedang bermasalah.\r\nKata kunci: Network Monitoring System, Ping, Web, PHP'),
(227, 'SISTEM ADMNISTRASI PASCA PELELANGAI BERBASIS WEB PADA UIN ALAUDDIN MAKASSAR', 2012, 'SAINS DAN TEKNOLOGI', 1, 'Dalam era globalisasi saat ini\r\nteknologi terasa sangat pesat, sehingga\r\nperkembangan ilmu pengetahuan dan\r\nmenawarkan banyak sekali kemudahan\r\ndalam meni alankan aktivitasnYa.\r\nDengan perken-rbangan teknologi yang semakin pesat\' sarana dan prasarana\r\ndalam ,yJ*.n administrasi pun harus mengikutinya. Salah satunya dengan media\r\nkomputerisasi yaitu internet-\r\nPembangunan aplikasi berbasis web ini merupakan web dinamis dimana\r\nterdapat interaksi antara user dan administrcttor Sefta menggunakan bagan alir\r\nsistem (systents .flowchart) sebagai model sistem yang dianalisa dan bagan alir\r\nprogram (program Jloutchart) setagai rincian untuk program yang akan dibuat.\r\nUntuk teknik p.ng,,,.jiun sistem digunakan penguiian v\'hite box yaitu pengujian\r\nterlradap cara ker;a prog.um. Penguiian dilatufan dengan memetakan .flov\'chart\r\nprogram ke ltir*grc,it yang\r\n-kemudian dilak\'kan proses penghitungan\r\nKon-rpleksitas siklomuii, v(c) r.urtuk r-nendapatkan nilai yang sama antara v(G)\'\r\njunrlah region dengap.iumlah injependent 1tirh.|ka1ur-1lah ketiganya sama besar\r\nmaka sistem dikatakan sudah benar. Pengujian dilakukan pada setiap rnodul\r\nprogram dan kemr-rdian program diuji secara keseluruhan\' Untuk bahasa\r\npemrograman digr-urakan bahasa p\"*rog.ut]tan web yakni PHP dengan bantuan\r\nMacrontedict Dreamweaver sebagai rcols editornya. Kemudian untuk basis data\r\ndigunakan MySQL sebagai p.t yitTtpunan data, YAMP Psebagai server sefta\r\nMozilla Firefox sebagai u\'eb browser\'\r\npenelitian ini frerupakan penelitian kuantitatif dengan metode pengumpulan\r\ndata berup a library ,nsuarrh Aan field research, penelitian ini bertujuan untuk\r\nmerancang sebuahwebsite pasca pelelangan pada UIN Alauddin Makassar\r\nsebagai media untuk -.rnuduhkun para panitia^ te.nder untuk memanege\r\nadministrasi yang berhunungan dengan pelelairgan. Sehingga dapat memberikan\r\npelayanan yang cepat dan akr\"rrat\'\r\nKat:r kunci : Sistenr Administrusi, Pnscu Pclelangun\' ll/ebsite'),
(228, 'STEGANOGRAFI METODE LEAST SIGNIFICANT BIT PADA CITRA BITMAP DENGAN TEKNIK KOMPRES DATA DAN EKSPANSI WADAH', 2011, 'SAINS DAN TEKNOLOGI', 4, 'Steganografi merupakan ilmu dan seni yang mempelajari teknik dan cara\r\npenyembunyian pesan rahasia ke dalam suatu media sedemikian rupa sehingga pihak\r\nketiga tidak dapat melihat dan menyadari keberadaan pesan rahasia tersebut. Tugas\r\nAkhir ini membahas studi mengenai bagaimana steganografi pada media citra digital.\r\nCitra digital yang digunakan adalah citra berformat BMP (Bitmap). Steganografi pada\r\ncitra BMP. salah satu Metode dalam Steganografi, yaitu LSB (Least Significant Bit).\r\nLSB menambahkan bit data yang akan disembunyikan (pesan) di bit terakhir\r\nyang dimana pada proses penyisipan pesan, metode ini melakukan penyimpanan data\r\ndengan cara mengganti bit-bit yang tidak signifikan (least significant pixel) pada\r\nberkas (file) wadah (Image) dengan bit-bit berkas yang akan disimpan. Salah satu\r\nkelemahan dari metode modifkasi LSB adalah ketidakmampuannya dalam\r\nmenyimpan data dengan ukuran yang besar. Untuk mengatasi hal tersebut maka\r\ndalam makalah ini dikemukakan beberapa teknik untuk memperbesar kemampuan\r\nteknik steganografi metode LSB dalam menyimpan data. Teknik yang pertama yaitu\r\nTeknik kompres data yaitu memperkecil ukuran file yang akan disisipkan, dan yang\r\nkedua Teknik Ekspansi wadah yaitu memperbesar wadah yang akan disisipi pesan.\r\nDan dalam skripsi ini juga akan dilakukan analisis terhadap proses dan hasil dari\r\nmasing-masing metode tersebut. Hasilnya dari percobaan ini adalah Maksimal ukuran\r\nfile yang dapat disembunyikan adalah 850 kb pada Image yang mempunyai pixel\r\n1024 x 768, sehingga besarnya ukuran pesan yang akan disisipkan tergantung dari\r\nbesarnya ukuran Wadah (tempat disisipi File/data). Semakin besar ukuran pixel maka\r\nsemakin besar juga ukuran pesan yang dapat disisipkan.\r\nKata kunci: Steganografi, Metode LSB (Least Significan Bit), Teknik Kompres,\r\nprocess ekspansi wadah (Image).'),
(229, 'ANALISIS DAN PERANCANGAN DIGITAL LIBRARY', 2011, 'SAINS DAN TEKNOLOGI', 1, 'Fakultas Sains dan Teknologi Universitas Islam Negeri Alauddin memiliki\r\nsebuah perpustakaan sebagai pusat kegiatan pengembangan minat baca dan\r\nkebiasaan membaca. Seharusnya perpustakaan tersebut mempunyai tanggung\r\njawab besar terhadap peningkatan dan pengembangan minat dan kegemaran\r\nmembaca, tetapi informasi yang berlimpah di perpustakaan tidak termanfaatkan\r\nsecara maksimal karena beberapa faktor diantaranya adalah kurangnya sumber\r\ndaya manusia yang mengelola perpustakaan tersebut.\r\nDalam pengumpulan data, penulis menggunakan dua metode, yaitu Library\r\nresearch atau penelitian kepustakaan dan Field research atau penelitian lapangan.\r\nAdapun Metode pengujian yang akan digunakan dalam pengujian perangkat lunak\r\nDigital Library ini adalah Black Box.\r\nBerdasarkan hasil penelitian dan pembahasan yang telah diuraikan serta\r\nmelihat implementasi sistem yang dirancang, maka beberapa kesimpulan yang\r\ndiperoleh dalam proses pembangunan perpustakaan digital adalah Pengurangan\r\nbeberapa komponen pada sistem digital library yang umum, tidak mengurangi\r\nsecara signifikan kinerja dari digital library ini, serta dengan adanya fasilitas\r\nDigital Library ini pada Fakultas Sains dan Teknologi UIN Alauddin Makassar\r\nakan memberikan kemudahan kepada mahasiswa untuk mendapatkan bahan\r\nbacaan sesuai dengan kebutuhannya. Mahasiswa tidak perlu lagi datang ke\r\nperpustakaan secara langsung untuk medapatkan bahan bacaan, namun dapat\r\nlangsung mecari bahan bacaan dengan mengakses web tersebut.\r\nKeyword : Digital Library, Digilib, Library, Perpustakaan Digital'),
(230, 'SIMULASI MANASIK HAJI BERBASIS MULTIMEDIA', 2011, 'SAINS DAN TEKNOLOGI', 4, 'Dalam agama Islam terdapat 5 (lima) rukun yang wajib dijalankan dimana\r\nrukun yang ke lima hanya diwajibkan oleh orang yang mampu yaitu “Haji”. Harus\r\njujur diakui, banyak ummat Islam yang belum pernah melaksanakan rukun Islam\r\ntersebut terdapat perasaan betapa praktik ibadah haji itu rumit dan sulit dipahami. Hal\r\nini dapat terjadi karena kurangnya wawasan tentang tata cara (manasik) haji ataukah\r\nhaji sendiri diartikan secara berlebihan sehingga sulit dimengerti. Banyak guru, ustad,\r\nkyai, ulama dan para pembimbing ibadah haji kurang pandai dalam\r\nmenyampaikannya, antara konsepsi (teori) dengan praktik di lapangan.\r\nManasik haji merupakan perkara yang wajib diketahui bagi mereka yang ingin\r\nmenunaikan haji dan demikian pula tentang jenis haji yang akan dilaksanakan. Jika\r\nbelum memahami maka kewajiban mereka untuk mencari tahu atau menanyakannya.\r\nDengan muatan spirit yang begitu tinggi, kemudian banyak orang\r\nmenempatkan haji sebagai puncak pengalaman spiritual seseorang (spirituality\r\nexperience of person). Pada puncak keagungannya, ibadah haji sering dipahami\r\nsecara berlebihan, baik dari rangkaian manasik maupun pengalaman spiritual yang\r\nmenyertainya. Akibatnya, rangkaian manasik haji seperti sulit dipahami oleh orang\r\nyang mempelajarinya.\r\nPenelitian ini bertujuan untuk merancang sebuah metode yakni simulasi\r\nmanasik haji berbasis multimedia yang dapat memberikan penjelasan prosesi manasik\r\nhaji secara interaktif, dari awal pemberangkatan hingga berakhirnya manasik haji.\r\nMetode penelitian yang digunakan adalah penelitian kualitatif yaitu mengetahui\r\nkelayakan program simulasi. Hasil pengujian sistem menunjukkan keberhasilan dari\r\npembuatan simulasi manasik haji dengan elemen multimedia yang interaktif.\r\nKata kunci : simulasi, manasik haji, multimedia');
INSERT INTO `skripsi` (`id`, `judul_skripsi`, `tahun`, `fakultas`, `kategori`, `abstrak_skr`) VALUES
(231, 'SISTEM INFORMASI GEOGRAFIS WISATA BUDAYA DAN SEJARAH KOTA MAKASSAR BERBASIS WEB', 2011, 'SAINS DAN TEKNOLOGI', 1, 'Sistem Informasi Geografis adalah sistem yang berkemampuan dalam\r\nmenjawab baik pertanyaan spasial maupun pertanyaan non-spasial beserta\r\nkombinasinya (queries) dalam rangka memberikan solusi-solusi atas\r\npermasalahan keruangan. Artinya sistem ini memang sengaja dirancang untuk\r\nmendukung berbagai analisis terhadap informasi geografis: teknik-teknik yang\r\ndigunakan untuk meneliti dan mengeksplorasi data dari perspektif keruangan,\r\nuntuk mengembangkan, menguji model-model, dan menyajikan kembali datanya\r\nsedemikian rupa hingga dapat meningkatkan pemahaman dan wawasan.\r\nJenis penelitian yang digunakan adalah metode deskriptif kualiatatif.\r\nDimana hanya mendeskripsikan data apa adanya dan menjelaskan data atau\r\nkejadian dengan kalimat-kalimat penjelasan secara kualitatif. Dalam penelitian\r\nini, pengujian program dilakukan dengan menggunakan metode blackbox yaitu\r\npengujian interface untuk mengetahui fungsi-fungsi yang diharapkan seperti\r\noutput dihasilkan secara benar dari input, serta mencari kelemahan dan\r\nkekurangan sistem, database diakses serta di-update secara benar dan mengujinya\r\napakah akan menjalankan fungsi-fungsi tersebut secara tepat.\r\nAplikasi WebGIS ini dibuat dengan menggunakan aplikasi ArcView, Alov\r\nsebagai frameworknya. Sedangkan bahasa pemrograman yang digunakan adalah\r\nPHP. Sistem Informasi Geografis Wisata Budaya dan Sejarah Kota Makassar\r\nberbasis web ini menampilkan informasi geografis beberapa faktor-faktor\r\npendukung seperti titik koordinat letak wisata budaya dan sejarah kota makassar,\r\njalanan penting yang ada di kota makassar, Kecamatan dan kelurahan yang ada di\r\nkota Makassar. Sistem Informasi Geografis Wisata Budaya dan Sejarah Kota\r\nMakassar ini dirancang berbasis web sehingga dengan mudah dapat diakses oleh\r\npengguna dimana saja melalui media internet.\r\nKata kunci : Sistem Informasi Geografis, Alov, Kota Makassar'),
(232, 'SISTEM INFORMASI GEOGRAFIS BERBASIS WEB SARANA PENDIDIKAN DAN PUSAT KESEHATAN MASYARAKAT KABUPATEN GOWA', 2011, 'SAINS DAN TEKNOLOGI', 1, 'Kemampuan teknologi komputer yang semakin berkembang membuat\r\nkomputer saat ini dapat digunakan untuk berbagai bidang, salah satunya untuk\r\nmembuat sebuah sistem informasi geografis (SIG). SIG adalah suatu sistem yang\r\nmeng-capture mengintegrasikan, memanipulasi, menganalisa, dan menampilkan data\r\nsecara spasial mereferensikan kondisi bumi.\r\nTujuan penelitian ini untuk membangunan sistem informasi geografis berbasis\r\nweb sarana pendidikan dan pusat kesehatan masyarakat , dan memberikan informasi\r\numum tentang sarana pendidikan dan pusat kesehatan masyarakat di Kabupaten\r\nGowa. Pada pembangunan Web SIG ini dimulai dengan pengumpulan data,\r\nkemudian menganalisis data yang telah diperoleh. Setelah itu merancang sistem\r\nkemudian dilanjutkan dengan pembangunan program dengan menggunakan Arcview,\r\ndan Macromedia Dreamweaver MX.\r\nUntuk teknik pengujian sistem digunakan pengujian white box yaitu pengujian\r\nterhadap cara kerja program. Pengujian dilakukan dengan memetakan flowchart\r\nprogram ke flowgraph yang kemudian dilakukan proses penghitungan Kompleksitas\r\nSiklomatis V(G) untuk mendapatkan nilai yang sama antara V(G), jumlah region\r\ndengan jumlah independent path. Jika jumlah ketiganya sama besar maka sistem\r\ndikatakan sudah benar. Pengujian dilakukan pada setiap modul program dan\r\nkemudian program diuji secara keseluruhan. Secara umum Web SIG ini dapat\r\nmembantu masyarakat dan instansi terkait dalam pencarian lokasi sarana pendidikan\r\ndan pusat kesehatan masyarakat di Kabupaten Gowa.\r\nKata Kunci : Sistem Informasi Geografis (SIG), Sarana Pendidikan, dan Pusat\r\nKesehatan Masyarakat.'),
(233, 'APLIKASI INDEK AL QUR’AN MENGUNAKAN J2ME (JAVA 2 MICRO EDITION) PADA PERANGKAT MOBILE', 2010, 'SAINS DAN TEKNOLOGI', 3, 'Aplikasi Indeks Al Quran Menggunakan Java 2 Micro Edition (J2ME) Pada Perangkat Mobile adalah sebuah aplikasi untuk memudahkan mencari satu kata atau istilah di dalam Al Qur’an yang memuat kata-kata penting seperti nama tempat, nama orang, istilah, kata benda, kata sifaf dan tidak termasuk kata penghubung. Aplikasi ini dirancang membantu memudahkan pencarian kata dalam Al Quran yang tersusun berdasarkan abjad. Aplikasi indeks digunakan sebagai dalil atau mencari solusi penyelseaian masalah dengan mudah melalui perangkat mobile. Aplikasi Indeks Al Quran analisis dan perancangannya menggunakan diagram UML (Unifield Modelliing Language), softwarenya Pacestar UML, JDK (Java Devolpment Kit), Neatbeans 6.1.9 dan emulator Wireless Toolkit 2.5.2 dengan bahasaa pemprograman J2ME (Java 2 Micro Edition) dengan basis datanya file text, berdasarkan kata dasar dan hasil pencariannya menampilkan deretan angka surah dan ayat. Pengaplikasian berbasis stand alone yang di implementasikan pada perangkat mobile yang berbasis java symbian. Jenis penelitian yang digunakan adalah ekperiment untuk perancangan dan pembuatan aplikasi dan pengujian aplikasi meggunakan black box untuk mengetahui fungsi yang hilang, kesalahan interface, kesalahan kinerja dan menggunakan pengujian deskriptif kualitati pada beberapa perangkat mobile berbeda baik merek maupun tipenya untuk mengetahui aplikasi bisa berjalan pada beberapa perangkat mobile. Hasil penelitian Aplikasi Indeks Al Quran Menggunakan J2ME (J2ME), bahwa apliaksi ini bisa berjalan di hampir seluruh perangkat mobile yang berbasis java mobile.\r\nKata kunci : Indek Quran, Java 2 Micro Edition (J2ME), JDK, NetBeans, UML, Wireless Toolkit'),
(234, 'PEMODELAN INTERAKTIF GEDUNG REKTORAT UIN ALAUDDIN MAKASSAR', 2010, 'SAINS DAN TEKNOLOGI', 4, 'Sesuai dengan fungsinya sebagai pengolah data menjadi sebuah informasi\r\nyang berguna, teknologi komputer akan sangat baik membantu jika dimanfaatkan\r\ndalam proses pelayanan informasi mengenai bagian ruangruang\r\ninterior gedung\r\nrektorat. Dengan merancang sebuah Interface Pemodelan Interaktif Gedung\r\nRektorat UIN Alaudin Makassar berbasis multimedia diharapkan bisa digunakan\r\nuntuk memenuhi kebutuhan informasi orangorang\r\nyang bersangkutan terhadap\r\nkepentingannya di dalam gedung rektorat UIN Alauddin Makassar.\r\nDalam pembangunan interface ini digunakan bagan alir sistem (systems\r\nflowchart) sebagai model sistem yang dianalisa dan bagan alir program (program\r\nflowchart) sebagai rincian untuk program yang akan dibuat. Untuk teknik pengujian\r\nsistem digunakan pengujian data statistik yaitu pengujian terhadap cara kerja\r\nprogram. Untuk software pembuatan interface ini penulis menggunakan Makromedia\r\nFlash 8 dengan bantuan beberapa software design grafis lainnya seperti photoshop\r\nCS3 dan Corel Draw X3 agar tampilan interface yang di rancang tersebut dapat\r\ntampak lebih menarik para penggunanya.\r\nDengan adanya model interaktif ini akan dapat membantu pelaksanaan\r\npenyajian informasi bagi pengunjung rektorat yang membutuhkan informasi terkait\r\nstruktur gedung rektorat UIN Alauddin Makassar sehingga memudahkan mereka\r\ndalam melaksanankan aktifitas masingmasing.'),
(235, 'SISTEM PENCEGAH FLOODING DATA PADA JARINGAN KOMPUTER', 2010, 'SAINS DAN TEKNOLOGI', 4, 'Perkembangan teknologi jaringan internet di era sekarang ini semakin pesat,\r\nKemudahan dan kepraktisan merupakan alasan dipilihnya internet sebagai salah satu\r\nsarana untuk membantu aktifitas suatu perusahaan, keuntungan yang diberikan juga\r\nsangat banyak, tetapi disamping keuntungan tersebut, internet juga banyak\r\nmenyimpan kekurangan yang sangat mengkhawatirkan bagi para penggunanya.\r\nSalah satunya adalah bidang keamanan. Banyak kasus yang membuktikan bahwa\r\nperusahaan yang terhubung ke internet sering kali mendapatkan gangguan, baik itu\r\ngangguan data maupun gangguan peralatan yang dimilikinya. Kerugian yang\r\ndiakibatkan oleh hal tersebut tidaklah kecil. Untuk mengatasi masalah ini umumnya\r\nperusahaan menempatkan administrator untuk mengontrol penggunaan jaringan,\r\ntetapi administrator tentunya memiliki keterbatasan waktu. Pada saat jam kerja\r\nmisalnya, kadang kala karena terlalu banyaknya aliran data tentunya administrator\r\nakan kesulitan menganalisa data-data yang lewat tersebut. Sedangkan suatu serangan\r\nbisa terjadi kapan saja. Baik pada saat administrator sedang bekerja ataupun tengah\r\nmalam di mana administrator sedang istirahat dalam memantau data-data yang lewat\r\ndalam jaringannya. Salah satu serangan yang biasa terjadi adalah flooding data,\r\nakibat dari serangan flooding ini kinerja sistem akan terhambat dan jaringan tidak\r\nberfungsi seperti yang diharapkan. Oleh karena itu dalam penelitian ini akan\r\nmembahas tentang bagaimana merancang dan membangun sistem yang mampu\r\nmendeteksi data flood sekaligus melakukan blocking pada data yang terbukti flood.\r\nMetode penelitian yang digunakan adalah metode penelitian studi literatur\r\npada buku-buku dan sumber-sumber lain yang tercantum pada daftar pustaka. Jenis\r\npenelitian yang digunakan adalah penelitian eksperimen, dan juga penelitian\r\nkuantitatif. Penelitian kuantitatif dilakukan untuk mengetahui mana data yang\r\ndianggap flood atau tidak dengan cara membandingkan berapa banyak paket yang\r\nterkirim dalam satuan waktu dengan standar maksimum paket yang telah ditentukan\r\nsebagai parameter data flood.\r\nDalam hasil penelitian ini didapatkan bahwa sistem mampu mendeteksi data\r\nflood dan mampu melakukan blocking alamat ip dan port secara otomatis pada\r\nsumber paket yang terbukti mengirimkan data flood. .'),
(236, 'SISTEM PENUNJANG KEPUTUSAN ANGKA KREDIT UNTUK PENENTUAN KENAIKAN PANGKAT DAN JABATAN DOSEN', 2010, 'SAINS DAN TEKNOLOGI', 4, 'Minimnya sosialisasi perhitungan angka kredit menjadi salah satu kendala\r\nbagi dosen ketika ingin mengajukan kenaikan pangkat dan jabatan Akademiknya.\r\nTertundanya kenaikan pangkat dan jabatan akademik seorang dosen, seringkali\r\ndiakibatkan karna terlambatnya arus informasi penetapan keputusan kenaikan\r\npangkat dan jabatan tersebut. Oleh karena itu dibutuhkan suatu sistem informasi\r\nyang akurat, cepat dan cukup untuk membantu menangani masalah tersebut diatas\r\nmaka dibuatlah Sistem Penunjang Keputusan ini. Penelitian ini menggunakan\r\njenis penelitian dekskriptif yaitu penelitian yang menggambarkan bagaimana\r\nkinerja Bagian Kepegawaian UIN Alauddin Makassar dalam memberikan layanan\r\ndan informasi tentang angka kredit kepada dosen yang ingin mengusulkan\r\nkenaikan pangkat dan jabatannya. Agar sistem dapat dikatan berguna maka\r\ndilakukan 2 (dua) teknik pengujian yaitu pengujian white box dan black box.\r\nPengujian White Box adalah pengujian yang bertujuan untuk mendapatkan\r\nukuran kekompleksan logika dari perancangan prosedural program atau dengan\r\nkata lain cara kerja program secara rinci. Sedangkan, Pengujian White Box adalah\r\npengujian yang bertujuan untuk menunjukkan fungsi perangkat lunak tentang cara\r\nberoperasinya. Dari hasil percobaan menggunakan 2 (dua) teknik diatas diperoleh\r\nbahwa dengan adanya sistem penunjang keputusan ini dapat membantu kinerja\r\nBagian Kepegawaian UIN Alauddin Makassar dalam memberikan informasi\r\ntentang angka kredit baik kepada dosen pengusul maupun kepada pimpinan\r\npengambil keputusan.\r\nKata Kunci : Angka Kredi (KUM), Kegiatan Tridharma Perguruan\r\nTinggi, White Box, dan Black Box'),
(237, 'SISTEM INFORMASI GEOGRAFIS ADMINISTRATIF BERBASIS WEB DI KECAMATAN RAPPOCINI MAKASSAR', 2010, 'SAINS DAN TEKNOLOGI', 1, 'Teknologi komputer berkembang dengan pesat dan mampu menangani basis\r\ndata serta mampu menampilkan gambar maupun grafik. Teknologi inilah yang\r\ndigunakan sebagai salah satu alternatif untuk menyajikan sebuah informasi\r\npenampakan bumi yag biasa disebut dengan peta. Sistem yang dapat dikembangkan\r\nuntuk kepentingan pemetaan berbasis komputer yaitu perangkat keras (hardware) dan\r\nperangkat lunak (software). Sistem inilah yang dikenal dengan sistem informasi\r\ngeografis (SIG).\r\nAdapun Sistem Informasi Geografis (SIG) yang dirancang dalam penelitian\r\nini adalah sistem informasi geografis berbasis web sebaran potensi tambang provinsi\r\nSulawesi Selatan yang dijalankan pada web browser. Dan informasi yang ditampilkan\r\nyaitu informasi sebaran potensi tambang di Sulawesi Selatan seperti Batubara, Batu\r\nApung, Batupasir Kuarsa, Besi, Dolomit, Gipsum, Kaolin, Kromit, Mangan, Nikel,\r\nPasir Kuarsa, Seng, Tembaga, Timbal, dan Zeolit.\r\nDalam perancangan aplikasi ini digunakan bagan alir sistem (systems\r\nflowchart) sebagai model sistem yang dianalisa dan bagan alir program (program\r\nflowchart) sebagai rincian untuk program yang akan dibuat. Untuk teknik pengujian\r\nsistem digunakan pengujian white box yaitu pengujian terhadap cara kerja program.\r\nPengujian dilakukan dengan memetakan flowchart program ke flowgraph yang\r\nkemudian dilakukan proses penghitungan Kompleksitas Siklomatis V(G) untuk\r\nmendapatkan nilai yang sama antara V(G), jumlah region dengan jumlah independent\r\npath. Jika jumlah ketiganya sama besar maka sistem dikatakan sudah benar.\r\nPengujian dilakukan pada setiap modul program dan kemudian program diuji secara\r\nkeseluruhan.\r\nDengan adanya rancangan aplikasi Sistem Informasi Geografis berbasis web\r\nini dapat digunakan pada instansi yang bersangkutan sehingga dapat membantu user\r\ndalam mendapatkan informasi sebaran potensi tambang melalui web browser.'),
(238, 'IMPLEMENTASI GAME PETUALANGAN SEBAGAI PENUNJANG PEMBELAJARAN INTERAKTIF BAHASA JEPANG', 2019, 'SAINS DAN TEKNOLOGI', 3, 'Pengetahuan akan bahasa Jepang mampu menghubungkan umat muslim dengan salah satu raksasa teknologi dunia, agar kita sebagai umat mampu membangun hubungan sosial, ekonomi, politik, dan budaya yang baik. Namun saat ini media untuk belajar Bahasa jepang sangat terbatas pada jenjang pendidikan tinggi saja, padahal untuk menguasai Bahasa asing sejak dini diperlukan waktu yang cukup panjang. Mengangkat fenomena ini maka dibutuhkan suatu pendekatan yang dapat meningkatkan minat dan pengetahuan belajar Bahasa jepang sejak awal.\r\nTujuan dari penelitian ini adalah memberi kemudahan, serta stimulus kepada masyarakat untuk mempelajari Bahasa Jepang dengan metode yang menyenangkan yaitu Game.\r\nJenis penelitian yang digunakan pada penelitian ini adalah penelitian kualitatif. Metode pengumpulan data yang diguakan pada penelitian ini berupa observasi, studi literature, dan wawancara. Metode perancangan aplikasi yang digunakan adalah metode waterfall dan teknik pengujian sistem yang digunakan adalah metode Black-box Testing.\r\nHasil dari penelitian ini adalah berupa sebuah aplikasi permainan edukasi Bahasa Jepang berbasis android. Kesimpulan dari penelitian ini bahwa dengan menggunakan permainan maka akan lebih mudah bagi umat muslim untuk mempelajari Bahasa Jepang, juga akan menumbuhkan minat belajar Bahasa jepang kepada umat muslim.\r\nKata Kunci: Game, Petualangan, Bahasa Jepang, Edukasi.'),
(244, 'RANCANG BANGUN SISTEM PENGELOLAAN MANAJEMEN DATA JURUSAN TEKNIK INFORMATIKA DAN JURUSAN SISTEM INFORMASI UIN ALAUDDIN MAKASSAR BERBASIS WEB MENGGUNAKAN FRAMEWORK CODEIGNITER', 2019, 'SAINS DAN TEKNOLOGI', 1, 'Jurusan Teknik Informatika dan Jurusan Sistem Informasi merupakan dua dari sembilan jurusan yang berada di Fakultas Sains dan Teknologi Universitas Islam Negeri Alauddin Makassar. Kedua jurusan tersebut membutuhkan suatu sistem yang dapat mempercepat pekerjaan lembaga secara terstruktur dan berkesinambungan. Karena selama ini data-data dijurusan masih tidak teratur dengan baik, tidak tersusun rapi, penyimpanan tidak terpusat, informasi-informasi masih sulit untuk didapatkan sehingga membuat kinerja dijurusan menjadi lambat dan pelayanan menjadi tidak maksimal.Untuk itu dibutuhkan teknologi informasi manajemen pengelolaan data jurusan berbasis web.\r\nTujuan dari Penelitian ini adalah untuk membangun sebuah sistem pengelolaan manajemen data jurusan agar dapat meningkatkan mutu pelayanan jurusan secara maksimal. Jenis penelitian yang digunakan penulis adalah deskriptif kualitatif dengan menggunakan metode pengumpulan data yaitu observasi dan wawancara. Adapun tools yang digunakan untuk merancang sistem manajemen data jurusan ini menggunakan Data Flow Diagram dan Entity Relationship Diagram. Sedangkan bahasa pemrograman yang dipakai menggunakan PHP dan MySQL serta pengujian aplikasi ini menggunakan metode Black-box.\r\nDari penelitian ini menghasilkan perancangan dan aplikasi sistem manajemen pengelolaan data jurusan Teknik Informatika dan Jurusan Sistem Informasi. Penelitian ini menyimpulkan sistem yang dibangun dapat memudahkan staff jurusan dalam mengelola data jurusan Teknik Informatika dan jurusan Sistem Informasi di Universitas Islam Negeri Alauddin Makassar.\r\nKata kunci: Manajemen, Data, Jurusan, DFD, ERD, Black-box');
